UPDATE `quest_template` SET `RequestItemsText` = 'We at the Darkmoon Faire do much walking. We walk from one faire site to another... in fact, you''ll never see us sitting down on the job! So it is no surprise that we wear out quite a lot of boots! We need boots that are both durable and stylish, and embossed leather boots fit that bill rather well.$B$BYou! You''re a leatherworker; make me embossed leather boots and I''ll give you a Darkmoon Faire ticket for the work.' WHERE `entry` = 7881;
UPDATE `quest_template` SET `RequestItemsText` = 'Our Faire workers do more than sweep trash and hammer spikes! They also help guard the carnival as it travels, and to that end they are always needing good sturdy armor jerkins.$B$BIf you make some tough leather armor and bring it to me, then I''ll make sure it gets to the right people. I''ll also get you some Darkmoon Faire tickets as trade.' WHERE `entry` = 7882;
UPDATE `quest_template` SET `RequestItemsText` = 'Yebb Nebblegear is looking to add more talent to his show, and he''s searching far and wide for the world''s largest gnome. Do you know any gnomes of considerable size?$B$BWell before he finds the gnome, he wants to have its costume ready. I think a barbaric harness would be a good foundation for the costume; can you make some harnesses and bring them to me? Do that, and I''ll have a stack of Darkmoon Faire tickets for you...' WHERE `entry` = 7883;
UPDATE `quest_template` SET `RequestItemsText` = 'Yebb is working on other attractions for his zoo, including wet, swampy abodes for a boy raised by crocolisks, and perhaps for a murloc. We will need nice, water-tight leggings so we won''t get waterlogged during prop-ups and tear-downs. For that job, I think turtlescale leggings will do the trick.$B$B$N, can you make those leggings? If you do, then a fat stack of Darkmoon Faire tickets will be your reward...' WHERE `entry` = 7884;
UPDATE `quest_template` SET `RequestItemsText` = 'You might not realize this, but running a traveling carnival is costly! Everything wears down so fast it''s a wonder we can turn a profit.$B$BBecause of all those hidden costs, we''re always looking for ways to maintain our equipment as cheaply as possible. Our tents, for instance, tear regularly but I''ve found that leather armor kits make great patches. Can you find and bring me some armor kits? That''ll save us a bundle! Do that, and I have a fistful of Darkmoon Faire tickets for you...' WHERE `entry` = 7885;
UPDATE `quest_template` SET `RequestItemsText` = 'It takes a lot of work to be the strongest woman alive! My weight set is getting too light and if I''m to stay fit then I''ll need more weights!$B$BDo you think you could bring me some weight stones? If you do, then I''ll give you a Darkmoon Faire ticket.' WHERE `entry` = 7889;
UPDATE `quest_template` SET `RequestItemsText` = 'To help with my workout, I like to fit a staff between heavy grinding stones, then lift the staff over my head. It isn''t easy, but being the strongest woman in the world, like I am, can''t be earned sitting down!$B$BCan you help me? I need more grinding stones - bring me some and I''ll trade Darkmoon Faire tickets for them.' WHERE `entry` = 7890;
UPDATE `quest_template` SET `RequestItemsText` = 'I''m working on a new costume, for when I have my own booth as the strongest woman alive! Right now I''m looking for some bracers I can wear. They can''t cover much because people want to see my muscles, but I still want to flash a little color, you know?$B$BHow about green iron bracers, $N? Can you make me green iron bracers? If you can, then I have a whole bunch of Darkmoon Faire tickets for you.' WHERE `entry` = 7891;
