UPDATE `quest_template` SET `OfferRewardText`='The old footlocker creaks open. . . .' WHERE `entry`=67;
UPDATE `quest_template` SET `OfferRewardText`='Stalvan? Sure sounds familiar.' WHERE `entry`=69;
UPDATE `quest_template` SET `OfferRewardText`='Yes, I have the results right here.  They are... unsettling, to say the least$B$BOur initial suspicion that the bugs are being controlled by an outside force, we believe, is correct.  If this is the case, then we are dealing with not only a very powerful unknown force, but also a malignant one.  These bugs have been changed to be pure ravagers.  I''ve never seen anything quite like it.' WHERE `entry`=110;
UPDATE `quest_template` SET `OfferRewardText`='Thank you for delivering the report, Junior Surveyor $n; here is your pay for your diligent service to the Gadgetzan Water Company.$B$BWhile I am usually not thrilled about handing out our valuable information carte blanche to those who would otherwise pay good coin for it, I''ve known Pestlezugg for a number of years now.  If he recommends letting everyone know about it, then so be it.  Give me a moment and I''ll make you a copy.' WHERE `entry`=113;
UPDATE `quest_template` SET `OfferRewardText`='Ah, Ghost Hair Thread is what you need, is it? I''m afraid I have none in stock, but I can make some for you...if you can supply the ghost hair.' WHERE `entry`=148;
UPDATE `quest_template` SET `OfferRewardText`='A thousand thanks, $N. You warm an old man''s heart with your foolish-...I mean...with your kindness!$b$bHere you are, friend. Take this as a token of my gratitude.' WHERE `entry`=159;
UPDATE `quest_template` SET `OfferRewardText`='This report... we night elves know of the terror mentioned here.  Fizzledowser was wise to send this, and you, to me.$B$BThese creatures will consume the Tanaris desert rapidly; they are nothing short of one of the greatest menaces we all will ever face.  Familiarize yourself with this name, $n: silithid.  The insects mentioned here are the silithid, and they are the tools of one of the greatest threats that both the Horde and Alliance face.$B$BIf only we were smart enough to see that before.' WHERE `entry`=162;
UPDATE `quest_template` SET `OfferRewardText`='Nicely done, $n.  You are ready to move on.' WHERE `entry`=185;
UPDATE `quest_template` SET `OfferRewardText`='I am impressed, $c.  You are progressing quite well.' WHERE `entry`=186;
UPDATE `quest_template` SET `OfferRewardText`='Most impressive.  I believe you are almost ready.' WHERE `entry`=187;
UPDATE `quest_template` SET `OfferRewardText`='Most impressive, I do say!  You are a true Master Tiger Hunter, $N!' WHERE `entry`=188;
UPDATE `quest_template` SET `OfferRewardText`='Perfectly executed, $N!' WHERE `entry`=191;
UPDATE `quest_template` SET `OfferRewardText`='Now that''s how you get a trophy or two over the ol'' hearth!  Nice killing, $N!' WHERE `entry`=195;
UPDATE `quest_template` SET `OfferRewardText`='You''ve done it!  Araj... the lich is finally defeated!$B$BYou''ve done a tremendous service to the Alliance on this day, $N.  Your bravery and perseverance are a testament to what it means to be a true hero.  Please - accept this as a token for all to see and know that you have delivered the Alliance a victory for the ages!' WHERE `entry`=211;
UPDATE `quest_template` SET `OfferRewardText`='You have served the Kingdom well, $C. Thank you for assisting Corporal Keeshan with his escape from those dreaded Blackrock Orcs. You shall be rewarded for your brave acts this day.' WHERE `entry`=219;
UPDATE `quest_template` SET `OfferRewardText`='Oh good. You thinned out that pack quite a bit, and without those wolves nipping out our heels, we can bind our minds to dealing with Morbent Fel.$B$BHere, take some of these Flash Bundles. They make them in town, and a lot have been donated to Sven to help with his cause.' WHERE `entry`=226;
UPDATE `quest_template` SET `OfferRewardText`='Ah, Zinge needs a kit, does she?  It saddens me that Zinge does not choose to grace myself with her sweet presence.$B$BVery well, let me procure a kit for you.' WHERE `entry`=232;
UPDATE `quest_template` SET `OfferRewardText`='$N, you have slain all three beasts that comprise the Ashenvale Hunt. You have brought me adequate proof of their demise; there is no question of your strength and tenacity. The blood of a hunter streaks through your veins, and you should be commended!$B$BPlease, accept this bauble as a sign of congratulations on your mighty deeds done in Ashenvale for the Horde today. May your ancestors watch over you!' WHERE `entry`=247;
UPDATE `quest_template` SET `OfferRewardText`='What? Success?$B$BTake it from me, $Nama, you don''t let it get to your head. I mean, any unshaven boy with a bow could have killed such... small specimens. And I hope you don''t enjoy killing the buzzards so much, yes? We wouldn''t want them to become extinct.$B$BWell, err... Never let it be said that Daryl the Bold would not hold to his word.' WHERE `entry`=257;
UPDATE `quest_template` SET `OfferRewardText`='You seem a bit worse for wear. No doubt the boars gave you some trouble, hm? No worries, I will be discreet about your struggle, I can imagine how hard it must be for you without the accusations of wagging tongues.$B$BOh! You managed to kill the boars? I... well, that is... that is to say, I''m not surprised! Any child could have--bet?$B$BWhat bet?' WHERE `entry`=258;
UPDATE `quest_template` SET `OfferRewardText`='Well now. it looks like yet another druid has successfully completed the Trial of the Lake! Well done. my young friend - well done.$B$BAs I''ve said, my name is Tajarri. It is my duty and my privilege to serve as a warden for Moonglade, and specifically this shrine. Keeper Remulos guides the Cenarion Circle in preservation of nature and balance, and his shrine serves as a lasting tribute to such. By using the bauble here, it serves as a nod to the importance of this place within the Circle.' WHERE `entry`=29;
UPDATE `quest_template` SET `OfferRewardText`='By reducing the Gnolls'' number, you have tended to the health of the Wetlands. Although my faith in your people has been taxed in the past, $R, it may yet be restored.' WHERE `entry`=276;
UPDATE `quest_template` SET `OfferRewardText`='Your skill in combat, $N, can not be doubted. Your resolve may yet see us through to the end of Morbent Fel!' WHERE `entry`=323;
UPDATE `quest_template` SET `OfferRewardText`='Oh, yes I can check that for you. Let''s see...last week it was...$B$B...why, it was Private Merle scheduled with Thorsen. They had the same patrol times all of last week.' WHERE `entry`=330;
UPDATE `quest_template` SET `OfferRewardText`='It pains me to find out it was Merle who betrayed us. He has always been a brave soldier, and I had thought his heart was true. But it is a great relief to have found him out - with a spy like him among us...we would not last long against Colonel Kurzen.' WHERE `entry`=331;
UPDATE `quest_template` SET `OfferRewardText`='That''s the one! Thank you, $N. May the Light shine brightly upon both your body and spirit!' WHERE `entry`=346;
UPDATE `quest_template` SET `OfferRewardText`='Master says give gift to $N. Zggi wants to keep nice gift but Zggi knows better than to betray Master.' WHERE `entry`=397;
UPDATE `quest_template` SET `OfferRewardText`='This barrel of ale is guarded by Jarven Thunderbrew.  As long as he''s in the basement, no barrels may be disturbed.' WHERE `entry`=403;
UPDATE `quest_template` SET `OfferRewardText`='By the Light!  Finally some food!  Sweet, sweet pumpkin. . . .' WHERE `entry`=407;
UPDATE `quest_template` SET `OfferRewardText`='You grab one of the candles and place it in your pack.' WHERE `entry`=431;
UPDATE `quest_template` SET `OfferRewardText`='You fought like a true disciple of the Dark Lady, $N. With the council dead, perhaps we can gain control of this town once and for all and drive Arugal from Shadowfang Keep. I salute you!' WHERE `entry`=452;
UPDATE `quest_template` SET `OfferRewardText`='The roots and ferns speak well of you, small one. Although I have many names, I answer to only a few. But you may call me Rethiel.$B$BAnd you must harken...for these lands weep from festered wounds, and I would charge you to heal them.' WHERE `entry`=463;
UPDATE `quest_template` SET `OfferRewardText`='Hello $N. You''re here about the task I have, eh? It''s good to see a young $R like yourself whose blood burns at the prospect of adventure!' WHERE `entry`=467;
UPDATE `quest_template` SET `OfferRewardText`='Ah, a drink at last.  I''m sure it''s no Rhapsody Malt but I''ll take anything to whet the old whistle at this point.' WHERE `entry`=492;
UPDATE `quest_template` SET `OfferRewardText`='Very good. Here is your reward.$B$BAnd when you were hunting those Warmongers, how did Alterac city look? It''s in bad shape I would guess. Ogres are not known for their cleanliness.$B$BThankfully, your efforts will help keep them away from Southshore.' WHERE `entry`=504;
UPDATE `quest_template` SET `OfferRewardText`='Ah, you found them! Now let''s get this lightforge iron hammered into something useful, eh?' WHERE `entry`=526;
UPDATE `quest_template` SET `OfferRewardText`='Ah yes, I remember Milton. A bookworm, no doubt. Bless him.$B$BAnd he''s right. The Ruins of Alterac still hold stores of knowledge in danger of being lost!$B$BOgres now dwell in Alterac, and they don''t care much for higher learning.' WHERE `entry`=538;
UPDATE `quest_template` SET `OfferRewardText`='Very good. Those ruins should now be safe enough to search, if one is careful.$B$BThank you, $N.' WHERE `entry`=545;
UPDATE `quest_template` SET `OfferRewardText`='WOW! You got Lady Jaina''s autograph for me! Thank you very much! And wow... she wrote a personal message on here - to me! I knew she''d be totally cool, and maybe someday I''ll thank her myself... when I become a hero of the Alliance!$B$BYou''re the best, $N. Thank you for being so nice to me.' WHERE `entry`=558;
UPDATE `quest_template` SET `OfferRewardText`='With the naga put down in Southshore, I''ll be a shoe-in to be reassigned. I''ll get to see Stormwind again... get away from this Light-forsaken port.' WHERE `entry`=562;
UPDATE `quest_template` SET `OfferRewardText`='Ain''t that great news! Should-a gone and found me a regular ol'' war hero from day one to take care of them beasts. You''d-a made your pappy proud, $N.' WHERE `entry`=564;
UPDATE `quest_template` SET `OfferRewardText`='Shiver me timbers!  Ye found the Cap''n''s grog!$b$bI owe ye big time, friend.$b$bSeems like a storm is a brewin'' outside.  Maybe I''ll just keep warm with one o'' these here bottles while we wait for it to pass....' WHERE `entry`=580;
UPDATE `quest_template` SET `OfferRewardText`='You place the Soul Gem upon his forehead. He shudders as his soul is sucked in, leaving his body, a mindless husk, behind.' WHERE `entry`=593;
UPDATE `quest_template` SET `OfferRewardText`='My dagger? What are you, some sort of comedian?$B$BWhat? Do you just want me to repeat the story of how I''ve gone from the best knife fighter in Booty Bay to the laughing stock of piratedom!$B$BI lost a knife fight to one of the Bloodsail Buccaneers--bunch of right bastards they are!--and he took my blade as spoils.$B$BIt''s not as though I can get by as a knife fighter with insults and a sharp tongue alone...' WHERE `entry`=603;
UPDATE `quest_template` SET `OfferRewardText`='Aha!  These will do nicely, $N.  Yes, quite nicely!$B$BHere is your cut, and...it was a pleasure doing business with you.' WHERE `entry`=605;
UPDATE `quest_template` SET `OfferRewardText`='Hello hello, $N. Captain told me you''re going after Negolash, eh?' WHERE `entry`=615;
UPDATE `quest_template` SET `OfferRewardText`='Hello. Do you have business with me?' WHERE `entry`=620;
UPDATE `quest_template` SET `OfferRewardText`='You find a musty scroll.' WHERE `entry`=625;
UPDATE `quest_template` SET `OfferRewardText`='You open the chest to discover....' WHERE `entry`=626;
UPDATE `quest_template` SET `OfferRewardText`='You search the tiny, dwarven corpse. Engraved into the helmet you can clearly read: Ebenezer Rustlocke.' WHERE `entry`=631;
UPDATE `quest_template` SET `OfferRewardText`='The Lady told me of your coming, $C. You are welcome in my abode for you, like I, serve a higher cause.' WHERE `entry`=653;
UPDATE `quest_template` SET `OfferRewardText`='So, the two troublemakers are all right after all? Haha, I''m glad to hear it. I thank you for bringing me news of their whereabouts and status--it pleases me greatly that they are still alive; the two of them are irreplaceable as friends and traveling companions.$B$BBut... it''s more important I thank you properly for your help. Here. Take this along with my group''s thanks.$B$BWith any luck, we''ll figure out what the Forsaken are up to, and put an end to it.' WHERE `entry`=661;
UPDATE `quest_template` SET `OfferRewardText`='The granite seems but a small token compared to a great dwarf''s life. But no dwarf shall last on this planet for eternity.$B$BLet us just hope that the memorial stands as a reminder to those who will trod the great Azeroth of the future. Lest we not forget it is for them that brave soldiers such as Sully Balloo so valiantly gave their lives.' WHERE `entry`=700;
UPDATE `quest_template` SET `OfferRewardText`='Ha! <cough cough>$B$BAh knew you''d find me amulet, $N.$B$B<weeze> Well done indeed, $N. <cough>' WHERE `entry`=722;
UPDATE `quest_template` SET `OfferRewardText`='Hollee. is that you? I need some help chiseling this stone. Hand me my stone brush, I think I see something.$b$bHey, you''re not Hollee! Don''t suppose you''ve seen my stone brush?$b$bNever mind that now! I promised the League I''d send the mysterious fossil I found. Where did Hollee go?$b$bSo much work to be done! Now where is that mysterious fossil... and my brush... and Hollee...$b$bAnd who are you... ''tis no matter, so long as you''re here to help.$b$bLet me know when you''re ready to start looking.' WHERE `entry`=729;
UPDATE `quest_template` SET `OfferRewardText`='This skeleton must be the unfortunate remains of Agmond. His body is broken and battered, and his bones picked clean.' WHERE `entry`=738;
UPDATE `quest_template` SET `OfferRewardText`='This is sobering news, $N. But Agmond had a strong arm and a fierce hammer-swing, and his skull was as thick as they come! Although he was killed by those cursed troggs I''m sure he took a lot of them down with him.' WHERE `entry`=739;
UPDATE `quest_template` SET `OfferRewardText`='You have done well, $N. You seem well prepared to travel onward. Let the wind always be at your back.' WHERE `entry`=743;
UPDATE `quest_template` SET `OfferRewardText`='The $R of Narache thank you, $N. You show much promise.' WHERE `entry`=747;
UPDATE `quest_template` SET `OfferRewardText`='I don''t think there could be too much misinterpreting or ignoring of that signal, hm? The Venture Co. will know not to take the tauren lightly, or to be so arrogant as to believe we would allow them to steal the natural resources around us without protest.' WHERE `entry`=764;
UPDATE `quest_template` SET `OfferRewardText`='Ah, thank you, $N. Using the items you brought me, I will be able to create the remedy I need to stop the spread of the infection and, eventually, cure it completely. I owe you my life in thanks.$b$bBut I''ll never forget that screeching call when Mazzranache came upon me, the blaze of color as its beak descended...$b$bBe wary on your travels.' WHERE `entry`=766;
UPDATE `quest_template` SET `OfferRewardText`='I see you have learned to gather from our sacred land, $N. It will take but a moment for me to brew the Water of the Seers.' WHERE `entry`=771;
UPDATE `quest_template` SET `OfferRewardText`='You have shown great diligence in your yearning to pass the Rites of the Earthmother, $N.$b$bWe, the Ancestral Spirits, represent the mighty tauren who gave their lives bravely to found and protect our great city of Thunder Bluff. I hereby pass the duty of that protection over to you.$b$bYou have passed the Rite of Wisdom, young $C. Enter Thunder Bluff with pride.' WHERE `entry`=773;
UPDATE `quest_template` SET `OfferRewardText`='As you place the Runestones into the matching recesses, a violent rumbling shakes the earth as the Seal is broken.' WHERE `entry`=779;
UPDATE `quest_template` SET `OfferRewardText`='With Tho''grun dead, his corpse picked clean by the desert winds and scavenging buzzards, the ogres will be put into disarray. Though a small victory, this will lead to a much larger one$B$BThe Sign of the Earth is now in our possession, and we can open the black drakes'' prison in Lethlor.  We shall free them from endless imprisonment, albeit to their doom!' WHERE `entry`=782;
UPDATE `quest_template` SET `OfferRewardText`='Ah, good.  Another volunteer.  We''re getting a lot of you these days.$B$BI hope it''s enough.$B$BThe human lands are threatened from without, and so many of our forces have been marshaled abroad.  This, in turn, leaves room for corrupt and lawless groups to thrive within our borders.$B$BIt is a many-fronted battle we wage, $N.  Gird yourself for a long campaign.' WHERE `entry`=783;
UPDATE `quest_template` SET `OfferRewardText`='As you place the Runestones into the matching recesses, a violent rumbling shakes the earth as the Seal is broken.' WHERE `entry`=795;
UPDATE `quest_template` SET `OfferRewardText`='Skorn Whitecloud is a wise tauren. He has hunted for years and years, and although his body is old, his spirit burns fiercely. We are honored to have him with us.$b$bIf Skorn sent you to me, then you too must have the $C''s spirit. And to have gathered these claws shows your burgeoning skills.$b$bPerhaps you are ready to walk the path.' WHERE `entry`=861;
UPDATE `quest_template` SET `OfferRewardText`='My brother sent you, did he? Then you must have proven yourself to him. If you have earned the respect of Jorn, then you have my respect as well.$B$BAre you ready to tread farther down the hunter''s path?' WHERE `entry`=874;
UPDATE `quest_template` SET `OfferRewardText`='Yes, yes... filled with joy because finally <snort> the Bristleback know my tribe''s pain, $R. That is how I should feel, but that <snort> is not the case.$B$BYou aid your people and they honor you. Mangletooth aids his people, and what do they do? They turn their backs on him. They forget him and leave him to rot in cage!$B$BI aid them even from locked behind bars and they send no one to save me!' WHERE `entry`=878;
UPDATE `quest_template` SET `OfferRewardText`='Is your task finished? Ponder the life of the Scytheclaw as you do it. There are important lessons within every creature''s lifespawn. $B$BSome of the others believe I have been too heavy handed in my lesson. I know that you are simply following my orders, but I want you to consider the life of the creatures you are slaughtering. $B$BThough they are at times a nuisance, they only become threatening when we seek their slaughter. This days defilement will cause us more trouble than it will solve problems...' WHERE `entry`=905;
UPDATE `quest_template` SET `OfferRewardText`='These stones are infused with magical energy, but purposefully flawed. They are very unstable and once removed from the table they will consume themselves quickly.' WHERE `entry`=926;
UPDATE `quest_template` SET `OfferRewardText`='My sister was where?? Therylune doesn''t mind getting herself dirty, but still! That''s a long way to wander, and the Master''s Glaive is an unwholesome place...$B$BWell thank you, $N. It was very nice of you to let me know she''s all right.' WHERE `entry`=945;
UPDATE `quest_template` SET `OfferRewardText`='I knew you would be up to the task, $N.$B$BI sense great deeds before you, and that you will right many of the wrongs that plague our lands. Bear my blessings, $N, as well as this gift.' WHERE `entry`=981;
UPDATE `quest_template` SET `OfferRewardText`='Wash the blood from your garments, $N, and do not mourn what you had to do. Instead, give thanks. You have lessened the threat to our people here in Auberdine, even if Darkshore is still in jeopardy from the effects of fel moss.' WHERE `entry`=985;
UPDATE `quest_template` SET `OfferRewardText`='What''s this?  You were ambushed by some sort of bad mojo creepy-crawly?  Oh, this does not bode well for the Gadgetzan Water Company, no indeed...$B$BI guess I should have told you about the reports coming in on some crazy bug-creatures that appear to be sucking up all the water in the desert.  At first, I thought it was just a crock.  We have enough trouble with the nomads as is; I thought it was just more of their shenanigans.  Well, now we know at least!' WHERE `entry`=992;
UPDATE `quest_template` SET `OfferRewardText`='Very well done, $N.  Your actions in the Zoram Strand against the naga are commendable.$B$BI know your feat was not easily accomplished, for the strength and guile of the naga is well known to the night elves.  We know this, for we share a history with them.$B$BIt is a history I care not to repeat.' WHERE `entry`=1008;
UPDATE `quest_template` SET `OfferRewardText`='Ah, you have the hair!  Now I will mix a cure for the child, and pray my concoction works.$B$BAnd... Forsaken are at Bathran''s Haunt?  Very troubling to hear, that is.  Very troubling indeed...' WHERE `entry`=1010;
UPDATE `quest_template` SET `OfferRewardText`='I felt the anguish of the Dor''danil Barrows lessen, and knew you had completed your task.$B$BIt was grim work you did, $N, for the spirits you destroyed were merely victims of the Forsaken''s evil. But with their destruction, let us hope the other maddened spirits find peace.' WHERE `entry`=1012;
UPDATE `quest_template` SET `OfferRewardText`='What makes you think I wish to be pestered by the likes of you, $C? Wait - let me stop the important duties I attend to on a daily basis so I can help you locate a doodad somewhere. By all means, the welfare of Darnassus - nay, all of Teldrassil - should come second to the acquisition of a bauble for your collection.$B$BThe fools in Moonglade waste my time with their call for assistance, and now I must endure this?' WHERE `entry`=1015;
UPDATE `quest_template` SET `OfferRewardText`='This is from Orendil?$B$BHis skill with herbs and healing is great.  This cure gives me hope, when before I had little...' WHERE `entry`=1020;
UPDATE `quest_template` SET `OfferRewardText`='The Tome of Mel''Thandris works in strange ways. The events it records, the events it shows... No one truly understands why it does what it does.$B$BNonetheless, it is clear that what Priestess Starsong received--this Scythe of Elune--bears further investigation.' WHERE `entry`=1022;
UPDATE `quest_template` SET `OfferRewardText`='Avast ye, scallywag. I hears that ye be the type for a bit o'' the skullduggery. Well, if yer no friend of Booty Bay, then ye might have a special place with the Bloodsail Buccaneers.$B$BArrrrr...' WHERE `entry`=1036;
UPDATE `quest_template` SET `OfferRewardText`='Yes? Now, it doesn''t look to me like you''re the sort with goods that need shipping, so either you''re looking for a job with my caravan--and there''s no jobs to be had now--or you''re probably talking to the wrong goblin.$B$BSo which one is it?' WHERE `entry`=1040;
UPDATE `quest_template` SET `OfferRewardText`='This is perfect, $N. Thank you greatly.$B$BPerhaps one day in the future I''ll be able to help you as you have helped me.' WHERE `entry`=1078;
UPDATE `quest_template` SET `OfferRewardText`='You found the port? Well done, $N! I am sure the goblins were quite surprised from your delivery! Let us hope that toxin finds its way to their headquarters.$B$BYou have served your people well, and I advise you to ignore any guilt you might harbor for poisoning the Venture Company. They are deserving of far worse.$B$BAnd if there is one mote of wisdom the Forsaken might teach its allies, it is this:$B$BDo not shy from dark paths... if those paths lead to victory.' WHERE `entry`=1086;
UPDATE `quest_template` SET `OfferRewardText`='Ahhh, den yur ready...$B$BI''ll put me items in the brazier den, and you c''n talk wit'' da spirit too.$B$BAn'' dontchu worry none ''bout seein'' into da spirit world wit'' da sapta... ol'' Tiev know a trick or two ''bout how da sapta magic works.$B$BCome now, head down wit'' me to the shrine and let''s speak to da spirits together, brotha.' WHERE `entry`=1103;
UPDATE `quest_template` SET `OfferRewardText`='I am Rabine Saturna, and on behalf of Keeper Remulos and all of the denizens of this sacred glade I bid you welcome.$B$BI appreciate your interest and eagerness to assist the Cenarion Circle. The tauren have shown an incredible propensity to the tenets of Cenarius, and by their proxy the Horde is welcomed within the safety of this glade. The preservation of Azeroth is a common goal we both share.$B$BYou are among friends here, $N.' WHERE `entry`=1123;
UPDATE `quest_template` SET `OfferRewardText`='So, $N, you have come. Now, are you prepared to journey through distant lands?$B$BIf so, young $C, then listen on...' WHERE `entry`=1130;
UPDATE `quest_template` SET `OfferRewardText`='Wow, these fine crab chunks are what I need.  Thanks $N!  I found this while I was fishing a while ago, and I have no use for it.  Maybe you can do something with it.  It sure don''t make any good crab dishes.$B$BI told you all about crabs, right?' WHERE `entry`=1138;
UPDATE `quest_template` SET `OfferRewardText`='Them''s some real nice groupers, $N!  Thanks for helping me out!$B$BYou''re at least as good of a fisherman as my cousin, Graun Blump.  She also has a beard and she smells kinda funny, but that don''t do nothing to stop her fishing.  I reckon you have what it takes to use a Blump Family Fishing Pole.' WHERE `entry`=1141;
UPDATE `quest_template` SET `OfferRewardText`='Ah, it''s good to see you again, $N! The strangest things have been happening around here, I''m glad you showed up!$B$BIt was very strange, $N. Everything seemed normal--well, as normal as things get around here--and then suddenly there was a blinding flash of light from the upper room of the tower. Then came the screams. The cries split the air, and lightning struck the ground from time to time. What''s going on?' WHERE `entry`=1167;
UPDATE `quest_template` SET `OfferRewardText`='Why you tell me ''bout dragons? Me no like dragons. Me like it here. No dragons here.' WHERE `entry`=1170;
UPDATE `quest_template` SET `OfferRewardText`='I''m appreciative of your efforts, $c. The warchief will enjoy hearing how tenacious you have been in your duties.$B$BOh, of course I will mention your name to him. He speaks to me often and values my opinions greatly.$B$BGo now, I have much to do. And if you speak to Korran soon, and he has news of these creatures, then return to me--I would think they are a threat that must be taken seriously.' WHERE `entry`=1184;
UPDATE `quest_template` SET `OfferRewardText`='Mr. Ignatz was just here with the bogbean leaves, and he told me you helped him out of some real trouble.$B$BThank you, $N. I will ask my uncle to treat you to a feast the next time you visit the Blue Recluse in Stormwind.' WHERE `entry`=1222;
UPDATE `quest_template` SET `OfferRewardText`='I''m sorry, a letter for me? Well, I''ll be... not often you get a delivery that''s not a crate or barrel when all you do is work. Let''s see what this is about.$B$B<Elling looks up at you while he opens the letter.>$B$BYou look a little tense, you okay, $N?' WHERE `entry`=1242;
UPDATE `quest_template` SET `OfferRewardText`='Welcome, welcome, welcome, $N. Good of you to join us. Perhaps an ale today? Or some mutton?$B$BName your pleasure and I''ll see to it that you''re taken care of. My name is Mikhail, and I look forward to serving you.$B$BHmm? What''s that? Trias? Keep your voice down, my friend. This isn''t something for the whole tavern to hear about.' WHERE `entry`=1248;
UPDATE `quest_template` SET `OfferRewardText`='Caught him, huh? Good for you. I''m surprised that was Slim.$B$BI''ll be honest, I never thought I''d miss the excitement of some of the more devious underground activities. I guess old habits die hard. Don''t mention that to Elling--he''d probably try and get me to come back to Stormwind if he heard I missed the action.$B$BI''m glad I could at least be of a little service to you while you were in Menethil. If you need anything else, just ask.' WHERE `entry`=1249;
UPDATE `quest_template` SET `OfferRewardText`='THE KING?! I mean... the king? The real king? Are you joking? You didn''t mention you were looking for the king''s kidnappers. I didn''t even hear he was missing--that would explain his son being crowned some.$B$BI''ll send word to Elling right away. He''ll want to know you''re on the trail.$B$BI would never have guessed Jahn would sell out Stormwind for some lousy coin. Even a rogue''s got to have honor when it comes to some things.$B$BThe key now is to find this Hendel. And I think I can help with that.' WHERE `entry`=1250;
UPDATE `quest_template` SET `OfferRewardText`='A pleasure to meet you, $N. I am Commander Samaul. I''m in charge of Miss Proudmoore''s forces here in Theramore.$B$BAlthough I''m quite busy, if you have any questions, please feel free to speak up. I might have to keep it short, but there''s no reason for me to be rude if you need my help.$B$BIf you plan on traveling out of the city, I''d suggest you be careful. Besides ogres, orcs and murlocs, the southern part of the swamp is filled with black dragons.' WHERE `entry`=1264;
UPDATE `quest_template` SET `OfferRewardText`='Stinky was here with the herbs I ask of him, and he told me you helped him out of a bind. Good work! A friend of Stinky''s is a friend of mine!$B$BHe asked me to give you this if I ever saw you, right before he walked back south toward the marsh.' WHERE `entry`=1270;
UPDATE `quest_template` SET `OfferRewardText`='My nephew said you aided him with his research in Dustwallow, and that you helped his associate out of a tight spot. Well, we Sterns stick together and we don''t ignore our friends!$B$BSo wash your hands, $N, because we''re about to throw a party in your honor!' WHERE `entry`=1271;
UPDATE `quest_template` SET `OfferRewardText`='Hmph. It is good that Reethe will no longer be lurking around the swamp, but it is a shame that humans are built so frail that he could not recover from a little arrow wound.$b$bIt seems that this thread of the mystery has led nowhere, and we must look elsewhere.' WHERE `entry`=1273;
UPDATE `quest_template` SET `OfferRewardText`='Missing? That would be Tesoran''s kind way of saying traitor.$B$BNo doubt he''s one of those fools so blindly loyal to Admiral Daelin that he turned traitor. Isn''t that a delicious irony? The deserters accuse us of betraying the Alliance.' WHERE `entry`=1285;
UPDATE `quest_template` SET `OfferRewardText`='By now, the centaur must know your name. I''m sure they know it, and respect it, and fear it. And just as they know you, they know the banner under which you ride.$B$BThe banner of the Horde.' WHERE `entry`=1366;
UPDATE `quest_template` SET `OfferRewardText`='The earth speaks to me. And it says you have killed many Magram. This is good.$B$BIf you are a friend of the Gelkis, then listen. I have more tasks for you.' WHERE `entry`=1368;
UPDATE `quest_template` SET `OfferRewardText`='Khan Shaka is dead!  I will place his head on a pike, and keep it with me so Shaka can see the strength of the Magram!' WHERE `entry`=1375;
UPDATE `quest_template` SET `OfferRewardText`='Khan Hratha is dead!  Now the Magram are the strongest of the centaur!  We will crush the others, and rule Desolace!$B$BWe will remember, you, $N, and you will be spared our hooves when all others are trampled.' WHERE `entry`=1381;
UPDATE `quest_template` SET `OfferRewardText`='Your name is whispered among the Gelkis. You have much Magram blood on your hands. This is good.$B$BMaybe it is also good if we speak. Speak of what you can do for the Gelkis, and what we can do for you.' WHERE `entry`=1382;
UPDATE `quest_template` SET `OfferRewardText`='Many Gelkis fall to you. I like that. Maybe you can do more things I like. Maybe you and the Magram can be friends.' WHERE `entry`=1385;
UPDATE `quest_template` SET `OfferRewardText`='The Kolkar fear you now! I hope you laughed when you killed them. It is better to laugh when you kill, so the enemy can see he is weak.' WHERE `entry`=1386;
UPDATE `quest_template` SET `OfferRewardText`='I knew old Faustin would come up with something good! You were a tremendous help, no doubt.$B$BNow let''s get down to business, shall we?' WHERE `entry`=1388;
UPDATE `quest_template` SET `OfferRewardText`='You have gained the weapon of the dreaded Noboru?  Is he then dead?$B$BThis is a joyous day for the Harborage.  Noboru and his gang were a terror to us, wandering the swamps and killing any Draenei who crossed his path.  He was a direct threat to our survival, and we did not have the strength to face him.$B$BWe are fortunate to have a friend in you, $N.' WHERE `entry`=1392;
UPDATE `quest_template` SET `OfferRewardText`='The sounds of animals are now faint, more distant. Thank you, $N. Now let''s hope they don''t return!' WHERE `entry`=1396;
UPDATE `quest_template` SET `OfferRewardText`='Thank Elune someone has finally come to help. Please, $C, I need your help. My brother Tyranis and I were captured and brought here by the Burning Blade. I think they mean to sacrifice me to their demon masters!$B$BI knew coming to Desolace was a mistake, but Tyranis has recently begun craving knowledge of all things arcane--even against the wishes of our people. He decided to make this trek even after hearing tales of this land''s demon infestation.$B$BI fear the worst for him.' WHERE `entry`=1438;
UPDATE `quest_template` SET `OfferRewardText`='What do you want, laddy? Can''t you see I''ve got problems to take care of here? Who has time to stand around yapping with some $R chatterbox?$B$BThere are trolls coming out of the woodwork! Make it snappy.' WHERE `entry`=1449;
UPDATE `quest_template` SET `OfferRewardText`='You notice the chest does not seem to have any water damage.$B$BThe second thing you notice is that the top has been forced open, and whatever magical traps were set to safeguard it have long been triggered--this much is obvious from the burn marks around its edges.' WHERE `entry`=1454;
UPDATE `quest_template` SET `OfferRewardText`='Again, you have done well, $N. It has been quite some time since I have seen a young $c with as much potential as you. Be assured that I will continue to watch your progress, and prepare and assist you in your future trials.$B$BFor now, let me show you the summoning spell for your newly dominated succubus.' WHERE `entry`=1474;
UPDATE `quest_template` SET `OfferRewardText`='Andromath sent you? Very good. I have an important task for you...' WHERE `entry`=1477;
UPDATE `quest_template` SET `OfferRewardText`='Hmmm, Searn sent you to me, did he?$B$BWell then, Searn could always be trusted, so that must mean you''re ready to take part of the next sapta--the sapta of fire.$B$BI see it in your eyes already, the burning, the desire. You''ve tasted power, and now you''re ready for more of it. Patience, $N. Remember what earth taught you. Power and destruction will come easily, but you must still know when to stay your hand.' WHERE `entry`=1522;
UPDATE `quest_template` SET `OfferRewardText`='The wind approaches you quickly from the horizon; the earth is steady beneath your feet; and your spirit is already warmed by fire--I would say it is time for you to learn about the purity of water.$B$BYour path has led you this far, and your spirit will give you the strength to carry on even further. But the first step is yours to take.' WHERE `entry`=1529;
UPDATE `quest_template` SET `OfferRewardText`='For the time being. I shall give you what you need to focus your spells and to call upon the spirits of air. Take this totem, and when you are ready, train with me some more.' WHERE `entry`=1531;
UPDATE `quest_template` SET `OfferRewardText`='Hello, $N. I''m assuming by all that armor and weapon of yours, you''re either here to try and take my land, or the Church finally sent someone to help protect me while my Jordan''s gone.$B$B Well, let me introduce myself: I''m Daphne Stilwell. It''s a pleasure.$B$BNow, you''re not too late... I''ve only killed a half dozen of the scum since last sun up. They''ve been a little slow getting ''round the bend up there, but they probably saw you coming, which means they''ll probably be here any minute.' WHERE `entry`=1650;
UPDATE `quest_template` SET `OfferRewardText`='So, we meet again, $N, and you are in high spirits, I see.$B$BThe Stilwell home will be safe for another day, and from your story I see that there was no shortage of danger to be found. Well done.$B$BDaphne and Jordan have helped the Church greatly, and having you protect their property--and their very lives--was the least we could do for them.$B$BFor your valor, you will be rewarded.' WHERE `entry`=1652;
UPDATE `quest_template` SET `OfferRewardText`='Who''s that?$B$BBurlguard, is that you?$B$BYou''ll have to step a little closer. My eyes aren''t what they used to be.$B$BWalking up like that, I thought you were a gnoll!' WHERE `entry`=1666;
UPDATE `quest_template` SET `OfferRewardText`='You did better than I expected, $N, but as well as I''d hoped. Now, you can learn to command your subjugated voidwalker, an ally you will find valuable in the trials that are sure to stand before you.$B$BI have nothing more to teach you at the present, but I am far from done with you, $N.' WHERE `entry`=1689;
UPDATE `quest_template` SET `OfferRewardText`='Here''s your armor, $N. Furen''s process worked brilliantly! Perfectly! Marvelously, truly!$B$BYou could run this armor over with a siege engine and it would spring right back into shape!' WHERE `entry`=1709;
UPDATE `quest_template` SET `OfferRewardText`='Tome of Cabal? Hmm...sounds familiar. I have never seen it here before, though--and believe me, I remember every book I read. $B$BHmm... Ah, yes!$B$BI have seen reference to it in library cataloging books.' WHERE `entry`=1758;
UPDATE `quest_template` SET `OfferRewardText`='Here''s your armor, $N. This will stand up to the strongest assaults or my name isn''t Furen Longbeard!$B$BAnd I have to thank you. I learned a lot while working with the materials$Byou brought me. I think I''ll have another breakthrough one day!$B$BI''m going to send what I learned to other$Bblacksmiths of the Alliance.$B$BI''ll tell them you were a big help, and maybe they''ll want to return the favor.' WHERE `entry`=1782;
UPDATE `quest_template` SET `OfferRewardText`='Thank you, $Gbrother:sister;.$B$BSeeing you wield the Symbol of Life, may I assume Duthorian or Gazin sent you?$B$BI fell to the Defias spell casters while Gazin and I tried to get their plans from them: I was able to hold on long enough to allow Gazin to escape, but in the end, their magics overwhelmed me.$B$BBut you were able to bring me back: the ability to use the Symbol doesn''t come to just anyone, $N. It bodes well for you that you were able to empower it with your own faith.' WHERE `entry`=1786;
UPDATE `quest_template` SET `OfferRewardText`='$N? Ah, of course. Our latest prodigy. The real thing can not live up to the legend, I am afraid. $B$BNo matter, you have come here to learn, not to hear me make jokes to myself.' WHERE `entry`=1798;
UPDATE `quest_template` SET `OfferRewardText`='Map making! Pictures, estimations of reality. I have no use for such things.$b$bIn books, narrative, description! That is where truth lies. I would trade all the maps in this store for one book on the rise of necromancy, or a tale of the Dark Lady''s triumph.' WHERE `entry`=1801;
UPDATE `quest_template` SET `OfferRewardText`='Well done! The Tome of the Cabal and three pristine--slightly scratched, I suppose--rods of channeling.$B$BThis will be interesting. It''s been some time since a young $C took on a felhunter to make his own.' WHERE `entry`=1805;
UPDATE `quest_template` SET `OfferRewardText`='Very well done!  I will study these creatures and, with diligence and luck, determine how they slipped into our world.$B$BYour value to the society of mages grows, $N.' WHERE `entry`=1920;
UPDATE `quest_template` SET `OfferRewardText`='I feared that Morganth had hidden the book elsewhere, or that he had found a way to open it and read its contents.$B$BIt is good to see that he did not, and that the seals we placed on Ur''s Treatise on Shadow Magic still hold.' WHERE `entry`=1938;
UPDATE `quest_template` SET `OfferRewardText`='Nice specimens, these. I''ll get right to work!' WHERE `entry`=1940;
UPDATE `quest_template` SET `OfferRewardText`='Ah, very good. I trust the satyrs of Xavian gave you little trouble?$B$BThank you, $N. I will study this sample of Xavian water immediately.' WHERE `entry`=1944;
UPDATE `quest_template` SET `OfferRewardText`='Ah, this hair will weave into a fine robe, $N. It is a pity the laughing sisters had to die to part with it, though I do doubt they would ever give it willingly.$B$BA pity, but only a small one.' WHERE `entry`=1945;
UPDATE `quest_template` SET `OfferRewardText`='Here is your nether-lace, $N.  It is both comfortable and durable, and holds the magic of the laughing sisters'' hair.$B$BEnjoy, and if you find it amenable, please mention so to Deino.  She is a $C on whose good side I wish to stay...' WHERE `entry`=1946;
UPDATE `quest_template` SET `OfferRewardText`='Quiet! I''m in a delicate juncture and mustn''t be disturbed!$B$BOne moment...' WHERE `entry`=1947;
UPDATE `quest_template` SET `OfferRewardText`='Ah, yes.  You are here for an orb or a staff, $N?  Very well.  I will aid you in its construction.$B$BBut be forewarned--the process is a perilous one and could mean your death.$B$BOr my death.  Definitely someone''s death... $B$BBut let''s hope it''s someone else''s death, eh?' WHERE `entry`=1953;
UPDATE `quest_template` SET `OfferRewardText`='Oh, that''s a nice one!  No, I don''t mean it''s "nice" like cool juice is nice on a hot day.$B$BIn fact, it''s very NOT nice now that I think about it.  Not the juice.  The orb!$B$BFocus, $N!  We''ll need you focused if we''re ever to finish our task!' WHERE `entry`=1954;
UPDATE `quest_template` SET `OfferRewardText`='You did it?  Well done!$B$BI was chatting with some of my colleagues and when your name came up they said, "You know that $N sure works well under stress!"$B$BBut when I told them I sent you to Uldaman against the obsidian sentinel, they said I was crazy!  They said, "Tabetha, you''re crazy!  There''s no way $N could take on that sentinel!"$B$BAnd I said, "We''ll see," and then they said "Yeah, we''ll see..."$B$BWell we sure showed them, didn''t we!' WHERE `entry`=1956;
UPDATE `quest_template` SET `OfferRewardText`='You did it!  I never doubted you for a second!  Ok, maybe for just a second, or two... but basically I didn''t have much doubt.$B$BHonest.' WHERE `entry`=1957;
UPDATE `quest_template` SET `OfferRewardText`='Very good, $N.  The creatures within these containment coffers will be studied by our finest minds, and the reason behind their presence in the Undercity will be determined.$B$BIf their appearance is caused by a rift in the natural flow of magic, then we must determine if the rift was random.  If it was not random, but instead an attack by some magical force, then we must prepare for future, more serious disturbances.' WHERE `entry`=1960;
UPDATE `quest_template` SET `OfferRewardText`='Avast ye scurvy sea dog! Ye did it! Soon me first mate be back in workin'' order and them beasties won''t know what hit em!$B$BHrm, have ye seen me first mate?' WHERE `entry`=2098;
UPDATE `quest_template` SET `OfferRewardText`='You have done Auberdine a great service, $N, but your task is not yet complete.' WHERE `entry`=2138;
UPDATE `quest_template` SET `OfferRewardText`='You''re all right in my book; I don''t care what everyone else has been saying... I kid, I kid!  Seriously, thank you my friend.$B$BNow, the necklace you have is one of my finest creations, but it is missing three gems that help bind magic power to it.  I crafted it for a paladin some time ago.  He was on a self-appointed quest to clear out the "evil taint" present at an excavation site in the Badlands called Uldaman.$B$BWell... that paladin died in Uldaman, and that was just the beginning of my woes.' WHERE `entry`=2199;
UPDATE `quest_template` SET `OfferRewardText`='Yep, those indeed are the three gems.  Good job!  Unfortunately, your work isn''t quite over just yet.$B$BNo, I''m not trying to pull a fast one here, silly $C.  This is about making magic jewelry - Talvash del Kissel quality-level jewelry!  You need a strong power source to give it some oomph.  Well, that necklace has no more oomph to give.' WHERE `entry`=2201;
UPDATE `quest_template` SET `OfferRewardText`='Well I''ll be - I sure am glad to see you and this power source in one piece.  It will take me a moment to magically fuse the power source with the necklace now that the gems have been reunited with it.  Once it is done, however, the necklace will be yours!$B$BYou''re excited, aren''t you?  All tingly with anticipation?  Now where did I put that spell focus at...' WHERE `entry`=2204;
UPDATE `quest_template` SET `OfferRewardText`='So ye think yer a right scoundrel? Destined to be one o'' Blackbeard''s chosen few - an officer o'' the Hidden Circle?$B$BOnly a good fer nothin'' scallywag would think so highly o'' hisself.$B$BThat''s exactly what we be lookin'' fer! Welcome aboard, $N!' WHERE `entry`=2218;
UPDATE `quest_template` SET `OfferRewardText`='What do you have there... oh my.  You found this where?$B$BNo, really?$B$BYou spoke to whom about what?$B$BNO, REALLY?!$B$BMy fine $C, you may have just made the archaeological find of the year!  By the Gods who am I kidding, the find of the century!  If these discs are what I think them to be, then this could be the very key we have been looking for!  This may well prove outright once and for all the legitimacy of the Dwarves'' enchanted creation!' WHERE `entry`=2279;
UPDATE `quest_template` SET `OfferRewardText`='Mmmm salvage!  I can smell the necklace from here.  Now let''s look at that beauty...$B$BHey, what do you think you''re trying to do here?  This necklace is missing the gems!  You think we wouldn''t notice?  Even Malton could see that the gems are gone.$B$BWell, maybe you didn''t steal them... but this necklace is worthless without those gems!  Your job isn''t done here yet, not by a long shot!' WHERE `entry`=2283;
UPDATE `quest_template` SET `OfferRewardText`='Very well done, $C.  Now the fruits of our redirection will pay themselves out handsomely.  I''m finished with the necklace itself, and I am confident I can duplicate the construction process consistently.$B$BBut first, I will use a specially prepared incantation to quickly analyze those gems before you take them and the necklace back to Orgrimmar.  This will take just a brief moment to do.' WHERE `entry`=2339;
UPDATE `quest_template` SET `OfferRewardText`='At last - a broom worthy of a Garrett.  You''re bloody well worth every silver I spent on you, I say!$B$BDo you hear me, foul bats?  I now wield the Garrett family weapon of choice!  Tremble, bats, tremble!!' WHERE `entry`=2342;
UPDATE `quest_template` SET `OfferRewardText`='' WHERE `entry`=2358;
UPDATE `quest_template` SET `OfferRewardText`='That''s great, you found some!  Thanks a lot, $N.  You''re the most dependable $r I''ve met!$B$BI can''t wait to try these on some devices I''ve been tinkering with.  I bet that, under the right circumstances, devices powered with these stones will keep going, and going, and going...' WHERE `entry`=2418;
UPDATE `quest_template` SET `OfferRewardText`='As yes, a voucher from the Explorers'' League... and quite the valuable one, might I add.$B$BThe Explorers'' League lends me the authority to offer you a choice in your compensation directly from their vault.  You are to receive this item, and you may choose between five superior healing potions or five greater mana potions as your reward.' WHERE `entry`=2439;
UPDATE `quest_template` SET `OfferRewardText`='Ah, well done $N.  These should last me for a little while at least.  Here is your pay, as promised.$B$BIf you''re interested, I have some more reagents I could use.  These, however, are only found in the depths of the Uldaman excavation.  They will not be easy to get, but I will make it worth your while if you are interested in helping me again.$B$BPerhaps something more than some shiny coins, yes?' WHERE `entry`=2500;
UPDATE `quest_template` SET `OfferRewardText`='Simply amazing. I had doubted that you could find another sphere, yet here it is, pulsating in my hands.$B$BWell done, $N!$B$BShould you find anymore--and I believe this to be an impossibility--return them to me and I shall reward you again.' WHERE `entry`=2522;
UPDATE `quest_template` SET `OfferRewardText`='This is wondrous, $N! My offering to you is a taste of the inner workings of the redstone basilisk.$B$BShould the compound be to your liking, more can always be made... for a price.' WHERE `entry`=2601;
UPDATE `quest_template` SET `OfferRewardText`='Yes, yes, give me a moment and more of the compound will be ready for your consumption, $N.$B$BTake it... and $N, do not attempt to consume these experimental concoctions in rapid succession. The results could be disastrous.' WHERE `entry`=2602;
UPDATE `quest_template` SET `OfferRewardText`='Most excellent! I shall get to work immediately. Perhaps a cure for many of the ailments of the world is to be found!$B$BAh yes, your reward - of course, should you require more of the gum, return to me and another task you shall be given.' WHERE `entry`=2603;
UPDATE `quest_template` SET `OfferRewardText`='Marin''s a good guy, don''t get me wrong -- just a little... eccentric, I''d say.$B$BAnd of course he needs my help, yet again.' WHERE `entry`=2606;
UPDATE `quest_template` SET `OfferRewardText`='Well now, you have one--amazing!$B$BI hope you always remember the good you have done today.' WHERE `entry`=2747;
UPDATE `quest_template` SET `OfferRewardText`='Very good, $N. I will be sending this egg to Darnassus where I hope it will soon hatch!$B$BPlease accept this as a symbol of my gratitude.' WHERE `entry`=2748;
UPDATE `quest_template` SET `OfferRewardText`='So, you have found an ordinary egg, $N? Please give it to me... And we can only hope for the best.$B$BI don''t have much, but please accept this reward. If you ever find yourself in Feralas again, know that I am always here to take the eggs you find there.' WHERE `entry`=2749;
UPDATE `quest_template` SET `OfferRewardText`='I am afraid I have bad news for you, $N. This egg is too far gone. I can take it from you so that it may be disposed of properly.$B$BPlease don''t be discouraged; we cannot save them all. If you find yourself in Feralas again, please try again. Bring another egg for the Super Egg-O-Matic!' WHERE `entry`=2750;
UPDATE `quest_template` SET `OfferRewardText`='The bloodline will fade but perhaps the legend of Omosh will continue!$B$BYou have proven that you are a blacksmith, $N. For the blacksmith the reward is the satisfaction of seeing their weapons and armors coated in the blood of their enemies!$B$BMay the breastplates you create for the generations ahead be drenched in the blood of your enemies!' WHERE `entry`=2751;
UPDATE `quest_template` SET `OfferRewardText`='Very good, $N! Listen and learn.$B$BBlacksmithing never comes from here! <Hank points to his hammer.>$B$BBlacksmithing never comes from here! <Hank points to the anvil.>$B$BBlacksmithing only comes from here! <Hank points to his heart.>$B$BAnd now you know the origin of blacksmithing.' WHERE `entry`=2758;
UPDATE `quest_template` SET `OfferRewardText`='One can barely keep their eyes from leaving its splendor, $N. Aye, citrine is a glorious gem.$B$BPay attention and learn what such a discovery may teach us!' WHERE `entry`=2763;
UPDATE `quest_template` SET `OfferRewardText`='Wow, you got the scale!  Thanks, $N.  I can''t wait to get to work on this thing!$B$BSo you saw Gahz''rilla?  Was he as big as they say??' WHERE `entry`=2770;
UPDATE `quest_template` SET `OfferRewardText`='Did you stop and examine the texture of these hides?  Properly treated, these hides could very well be stronger than iron.  Not many people know about these hides, and that in combination with the vast treating solutions I know will allow me to potentially make items with a true mark of quality... thanks to you, of course!$B$BAnd now, please choose from what I am able to offer you for your service!' WHERE `entry`=2821;
UPDATE `quest_template` SET `OfferRewardText`='I knew you could do it, $N! Sovik on the other hand, he had his doubts.$B$B<Nogg clears his throat.>$B$BNow that we have the blueprints in our possession, it is only a matter of time before we figure out all of the gnomish innovations that went into the creation of the rig and make them goblin innovations for our new shredder models.' WHERE `entry`=2841;
UPDATE `quest_template` SET `OfferRewardText`='What? You say dis bell will work when Shay runs off? Well, how ''bout that!$B$BSince you did so much fer me, here ya go, $N. ' WHERE `entry`=2845;
UPDATE `quest_template` SET `OfferRewardText`='This Nightscape equipment you have supplied fills the order perfectly, $N. I expect no less from a leatherworker of your caliber.$B$BYou have definitely earned this pattern. I give it to you freely, and hope you will profit from it accordingly.' WHERE `entry`=2850;
UPDATE `quest_template` SET `OfferRewardText`='Oh, great!  You got them!$B$BThanks, $N.  You''re a real lifesaver!' WHERE `entry`=2865;
UPDATE `quest_template` SET `OfferRewardText`='Yes, yes, these scales are more than satisfactory.  Actually, I think I will send these down to Pratt for him to take a look at.  Maybe he can craft something useful out of them.$B$BAs for you, I have another mission I want to send you on.  But first, here is your bounty for the scales.  Your continued service to the General and Feathermoon Stronghold at large is a blessing in the face of adversity.' WHERE `entry`=2869;
UPDATE `quest_template` SET `OfferRewardText`='Well played, $N! Lord Shalzaru''s demise will throw the naga into disarray for some time, if not permanently.  The threat they pose is now under more of our control than it has ever been, and we have you to thank for it.$B$BHere is more bounty money from the stronghold treasury - you''ve earned every copper.  You and yours are welcome in Feathermoon Stronghold anytime, my friend.$B$BOne more thing before you depart, $N... if you could...' WHERE `entry`=2870;
UPDATE `quest_template` SET `OfferRewardText`='Interesting... this came from the Ruins of Solarsal, you say?  Well, Latro''s right that I need to look at this.  At first glance, it seems non-indigenous to the ruins.  Then again, this isn''t of naga design... not something as alien as this.$B$BIt is going to take some time to research this item.  Once my research on it is done, maybe I will make use of your talents, should you be around.$B$BHere, take one of these extra items we have; I hope you''ll find some use for it!' WHERE `entry`=2871;
UPDATE `quest_template` SET `OfferRewardText`='Now that''s what I am talking about! See - these necklaces prove that you''re willing to get your hands dirty. We Wildhammers value that in those we associate with.$B$BYou keep this up, and you''ll be in our good graces yet.' WHERE `entry`=2881;
UPDATE `quest_template` SET `OfferRewardText`='You got them!  Now I can begin my new experiments!$B$BI can''t thank you enough, $N!  Your bravery has advanced gnomish research by a leap and a bound!' WHERE `entry`=2924;
UPDATE `quest_template` SET `OfferRewardText`='You did it!  You found the prismatic punch card and recovered the lost data!  Vitally, critically, immeasurably important data that we could not live another moment without!$B$BYour service to the gnomes will be long remembered, $N.' WHERE `entry`=2930;
UPDATE `quest_template` SET `OfferRewardText`='I have been reading since you left, $N. This stone you have found is called the Morrow Stone. While I am not entirely sure what its purpose is yet, you can be sure that it is something of great significance to be hidden away inside the Equinex Monolith the way it was.$B$BI will continue my studies, and I hope I will be able to count on you in the future, $N. Thank you for all your help.' WHERE `entry`=2942;
UPDATE `quest_template` SET `OfferRewardText`='You place the ring inside the Sparklematic 5200 and deposit a silver coin into the slot.$B$BPainful grinding noises emanate from the machine as it begins to jerk around violently.  One can only guess what is happening with the ring inside the machine...$B$BThe machine suddenly stops, trumpeting its cessation with a simple "Ding!"  The item receptacle opens up to reveal a small box that is neatly wrapped with a red bow.  It would appear that the Sparklematic 5200 also gift wraps!' WHERE `entry`=2945;
UPDATE `quest_template` SET `OfferRewardText`='A ring, you say?  Let''s see... yep, I made that ring by golly.$B$BBefore Gnomeregan went up, I had a small shop there.  Perhaps it''s one I left behind when I ran for the hills; it''s a simple design, and I made several like it.  Maybe it''s from someone who didn''t make it out.$B$BDark Iron dwarves had this?  Well, that puts a new layer of conspiracy on the nine different layers already floating about.  Maybe the authorities would like to know; it''s wasted on the likes of me.$B$BNow, back to the ring...' WHERE `entry`=2947;
UPDATE `quest_template` SET `OfferRewardText`='Ah, exactly what I needed!  Someday, when I find myself out of this hole that I am unjustly in, I will make for you, for EVERYONE the finest trinkets in all of Azeroth!  Until then, thanks for being a sport about the reagents.  I''d normally charge ten times what I have charged you for a ring of this quality...$B$BSpeaking of rings, here''s your new one!' WHERE `entry`=2948;
UPDATE `quest_template` SET `OfferRewardText`='A ring from Gnomeregan?  Let''s see... not mine, but interesting.$B$BThe Gnomeregan thing - couldn''t have happened to a nicer bunch of numbskulls.  For years they''re a joke, and now almost overnight they''re making better rigs than us?$B$BDark Iron dwarves had the ring?  That''s even more interesting!  You know, maybe the gnomes stole their crazy golem plans and modified them.  Those Dark Irons, they''d definitely want some major payback.  It''s certainly worth investigating.$B$BYou know, about that ring...' WHERE `entry`=2949;
UPDATE `quest_template` SET `OfferRewardText`='You insert the grime-encrusted item and three silver coins into the Sparklematic 5200. The machine surges to life in a frenzied attempt to purge the grime from the unknown item. Loud, violent churning sounds beat from the heart of the machine. The metal frame of the beast creaks and groans as it lurches from side to side...' WHERE `entry`=2951;
UPDATE `quest_template` SET `OfferRewardText`='As quickly as it started, the Sparklematic 5200 comes to an abrupt halt. A simple "ding" is heard from the machine, and the mouth of the machine spirals upward. Inside the Sparklematic 5200 is a small box wrapped in a little bow. The machine would appear to wrap an object up after eliminating its grime-encrusted status. Even if the machine didn''t work, at least the item is now wrapped in a pretty box.$B$BWell, there is one way to find out if it cleaned the item or not...' WHERE `entry`=2952;
UPDATE `quest_template` SET `OfferRewardText`='The Sparklematic 5200 comes to life, lurching to and fro. Inside, the helpless grime that has encrusted the object placed within it is being pulverized by the machine''s gnomish cleaning agent.$B$BThe Sparklematic 5200 comes to a halt, heralded by a familiar "ding!" The item receptacle of the machine spirals open, revealing a neatly wrapped box.' WHERE `entry`=2953;
UPDATE `quest_template` SET `OfferRewardText`='You were missing some discs?  Interestingly enough, it seems that the discs of Norgannon are only parts of the complete set - like keys on a key ring, if you will.$B$BIf we can find the Plates of Uldum, then we could actually access the Uldum complex itself.  I don''t know whether to be excited by that prospect, or be terrified.$B$BWe may need to risk everything to ensure that those secrets the earth keeps which would destroy us all remain just that - secrets.' WHERE `entry`=2967;
UPDATE `quest_template` SET `OfferRewardText`='Thank Elune, $N! You are a great blessing to us and to the darters you saved. Jer''kai and I would never have been able to help the dragons ourselves--your intervention in the Grimtotem''s affairs will be remembered.$B$BSpeak to Jer''kai now... I have to prepare for our retribution. Just because the faerie dragons are free, it doesn''t mean they will remain so. Jer''kai and I will now go on the offensive.' WHERE `entry`=2969;
UPDATE `quest_template` SET `OfferRewardText`='Kindal was right about you, $N--you do have a knack for this. You are a more seasoned adventurer than the both of us, and for that we thank you.$B$BThe Grimtotem clan is much more hostile than most tauren... I wonder if their own kind frowns upon their actions. I wouldn''t be surprised. As you are probably aware, many races on Azeroth have ties to less kindly counterparts.$B$BBut that is a discussion for another day.' WHERE `entry`=2970;
UPDATE `quest_template` SET `OfferRewardText`='That''s an amazing story, $N. It pleases us that you''ve not only helped dragonkind, but also one of our own priestess. Jer''kai was right to send you to me. I will make sure she has her ring returned to her--I have scouts heading the direction of Feralas soon. This will be one more thing for them to investigate while on their mission.$B$BThank you again, and please, make yourself at home while you''re here.' WHERE `entry`=2972;
UPDATE `quest_template` SET `OfferRewardText`='You were missing some discs?  Interestingly enough, it seems that the discs of Norgannon are only parts of the complete set - like keys on a key ring, if you will.$B$BIf we can find the Plates of Uldum, then we could actually access the Uldum complex itself!  Imagine actually exploring the place where the Creators worked without having to bring a huge shovel!$B$BNot that there''s anything wrong with shovels... or digging...' WHERE `entry`=2977;
UPDATE `quest_template` SET `OfferRewardText`='Hmmm, Narm sent you to me, did he?$bbWell then, Narm could always be trusted, so that must mean you''re ready to take part of the next sapta--the sapta of fire.$b$bI see it in your eyes already, the burning, the desire. You''ve tasted power, and now you''re ready for more of it. Patience, $n. Remember what earth taught you. Power and destruction will come easily, but you must still know when to stay your hand.' WHERE `entry`=2984;
UPDATE `quest_template` SET `OfferRewardText`='Ah, the medallion of Nekrum.  It is rumored to have given the troll an unnatural long life, but at a cost.  I hope to discover a way to reap the medallion''s power while avoiding its... unpleasant side effects.$B$BYou have done me a service, $N.  I shall now uphold my end of our bargain.' WHERE `entry`=2991;
UPDATE `quest_template` SET `OfferRewardText`='As you experience what Shadowglen has to teach you, come see me--I will be able to help you understand more about your role as a $C and what you are capable of.$B$BThese are dangerous times, $N, do not take for granted the skill of your pets--there are things in this world more dangerous than you can imagine. Go with Elune and return to me again.' WHERE `entry`=3117;
UPDATE `quest_template` SET `OfferRewardText`='Greetings, young one.  You are here to walk the hunter''s path?$B$BVery good.  Let us begin.' WHERE `entry`=3261;
UPDATE `quest_template` SET `OfferRewardText`='I will return you to Sanath''s camp now.$B$BDo not mind his bad manners--he is rude to everyone save for the master. Perhaps he shall learn his lesson one day.' WHERE `entry`=3421;
UPDATE `quest_template` SET `OfferRewardText`='What can I do for you, $N? Kinda busy at the moment preparing my ship for a long trip. I just came over to see some of the tank pilots--I need some wendigo manes to line my cockpit and they usually have extra.$B$BI can give you a minute if you''re brief... one of the boys just took off to Steelgrill''s Depot to see if the pilots down there have extra manes for me.' WHERE `entry`=3450;
UPDATE `quest_template` SET `OfferRewardText`='Here''s my standard issue flare gun, and be patient after you fire off the gun--there are only a couple charges in one of these, and it might take me a minute to get to you depending on how far out to sea I am. Just look out to sea after you fire off the flare.' WHERE `entry`=3451;
UPDATE `quest_template` SET `OfferRewardText`='You truly disgust me, $r. A grown man drooling over a pile of junk? Pitiful! Take your reward and get out of my sight.' WHERE `entry`=3501;
UPDATE `quest_template` SET `OfferRewardText`='There was a time when I could ask whatever I wished from those who sought out my master.  But now, you need only ask and I will send you to him.$b$bIt is upsetting to me, but I do not question his orders.  I can only take enjoyment in making fun of the ridiculous clothes you wear or the pathetic look on your face.  Even that bores me...$b$bEven this rambling bores me!  Do you wish to see my master or not?' WHERE `entry`=3503;
UPDATE `quest_template` SET `OfferRewardText`='You have done well, $N.  Perhaps now it is time to reveal more...$B$BThere is an ancient prophecy among the trolls, where the dead god Hakkar, the Soulflayer, will one day return to this earth.  Some say the coming of Hakkar will bring joy and glory to trollkind, while others believe his resurrection marks the end of all things.$B$BI do not believe this myth, but I do know the essence of Hakkar holds great power, and this power should be kept from those who would abuse it...' WHERE `entry`=3520;
UPDATE `quest_template` SET `OfferRewardText`='Since you''re a practitioner of Goblin engineering and are in good standing, I am able to renew a lapsed membership card for the fee of two gold pieces. Once this fee is paid, you will be reissued a new membership card. This will allow access to Goblin engineering schemata from appropriate trainers.$B$BThis card will last for two weeks of activity, at the end of which your membership fees will become due again! If you want to access schemata, you''ll need to bring your dues out of arrears.' WHERE `entry`=3644;
UPDATE `quest_template` SET `OfferRewardText`='Since you''re a practitioner of Gnomish engineering and are in good standing, I am able to renew a lapsed membership card for the fee of two gold pieces. Once this fee is paid, you will be reissued a new membership card. This will allow access to Gnomish engineering schemata from appropriate trainers.$B$BThis card will last for two weeks of activity, at the end of which your membership fees will become due again! If you want to access schemata, you''ll need to bring your dues out of arrears.' WHERE `entry`=3645;
UPDATE `quest_template` SET `OfferRewardText`='Since you''re a practitioner of Goblin engineering and are in good standing, I am able to renew a lapsed membership card for the fee of two gold pieces. Once this fee is paid, you will be reissued a new membership card. This will allow access to Goblin engineering schemata from appropriate trainers.$B$BThis card will last for two weeks of activity, at the end of which your membership fees will become due again! If you want to access schemata, you''ll need to bring your dues out of arrears.' WHERE `entry`=3646;
UPDATE `quest_template` SET `OfferRewardText`='Since you''re a practitioner of Gnomish engineering and are in good standing, I am able to renew a lapsed membership card for the fee of two gold pieces. Once this fee is paid, you will be reissued a new membership card. This will allow access to Gnomish engineering schemata from appropriate trainers.$B$BThis card will last for two weeks of activity, at the end of which your membership fees will become due again! If you want to access schemata, you''ll need to bring your dues out of arrears.' WHERE `entry`=3647;
UPDATE `quest_template` SET `OfferRewardText`='Greetings, $C; I am glad you are interested in assisting our research. There is much to do, and I would be doing you a disservice if I informed you that the work this entails is not dangerous. Hopefully this will not scare you off... but from the looks of you, I take it that danger is something that you have dealt with before.' WHERE `entry`=3762;
UPDATE `quest_template` SET `OfferRewardText`='Well now, $c... since you were informed that I was leading this research myself, you obviously came as quickly as you could.$B$BNow that you are here, be sure to pay attention the first time I tell you the details; I have no desire to repeat myself.' WHERE `entry`=3763;
UPDATE `quest_template` SET `OfferRewardText`='Greetings, $C; I am glad you are interested in assisting our research. There is much to do, and I would be doing you a disservice if I informed you that the work this entails is not dangerous. Hopefully this will not scare you off... but from the looks of you, I take it that danger is something that you have dealt with before.' WHERE `entry`=3784;
UPDATE `quest_template` SET `OfferRewardText`='Well now, $C... since you were informed that I was leading this research myself, you obviously came as quickly as you could.$B$BNow that you are here, be sure to pay attention the first time I tell you the details; I have no desire to repeat myself.' WHERE `entry`=3789;
UPDATE `quest_template` SET `OfferRewardText`='Well now, $C... since you were informed that I was leading this research myself, you obviously came as quickly as you could.$B$BNow that you are here, be sure to pay attention the first time I tell you the details; I have no desire to repeat myself.' WHERE `entry`=3790;
UPDATE `quest_template` SET `OfferRewardText`='Gah, these morrowgrain make me feel... weird.  What in the name of Elune is Staghelm up to with these things?$B$BAnyway, thank you again for your help.  Here''s a little something... you know, for the effort.  My research on morrowgrain is going to take a while, and I no doubt am going to need more.  While I''m at it, I suppose I could take the time to see if morrowgrain have some pertinent alchemical uses.  Still, I feel uncomfortable even being around them.' WHERE `entry`=3791;
UPDATE `quest_template` SET `OfferRewardText`='Excellent - this morrowgrain will no doubt please the Arch Druid.  I must admit though... just being near them makes me feel a little uncomfortable.  I can only imagine how difficult it is for the Arch Druid to tolerate them in such large numbers!$B$BThis is for you, $N.  The Cenarion Circle thanks you for your continued support.' WHERE `entry`=3803;
UPDATE `quest_template` SET `OfferRewardText`='Excellent - this morrowgrain will no doubt help when the time comes.  We know that the night elves are conducting similar research into these herbs, though it isn''t clear to what end they will use them for if they discover anything.  The Arch Druid thinks that the need for morrowgrain will remain until we''ve figured out the mysteries behind this herb.$B$BThis is for you, $N.  The Cenarion Circle thanks you for your continued support.' WHERE `entry`=3804;
UPDATE `quest_template` SET `OfferRewardText`='Just look at it, soldier. Disgusting! When the remaining Firegut ogres see this fat mug stuck on a pike sitting at the top of their mountain, mass hysteria will ensue!$B$B<Oralius cackles wildly.>' WHERE `entry`=3824;
UPDATE `quest_template` SET `OfferRewardText`='Ah, a sprite darter egg, and one near maturation, if I''m not mistaken. Remarkable you''ve found one, let alone in this good a condition. They''re rarely seen in Feralas these days. I understand there were various poachers in the area trying to capture and kill them for many reasons. Too bad really... such beautiful creatures when they reach adulthood.$B$BHow did you come across such a find?' WHERE `entry`=3841;
UPDATE `quest_template` SET `OfferRewardText`='Excellent, these should do the trick.  And now, if you''ll permit me...$B$BTHANKS FOR DIGGING ALL OF THESE BONES OUT OF THE GROUND FOR US AND NOT HURTING THE NATIVE BEASTS IN ANY WAY.$B$BWhether you really did or didn''t, I don''t want to know.  Let''s keep it that way, shall we?  Here - maybe this will keep your lips shut on the whole thing.  Anything to get out of here alive, I say!' WHERE `entry`=3882;
UPDATE `quest_template` SET `OfferRewardText`='Well look at this - my journal!  I thought it was lost, much like almost everything else we brought into Un''Goro.  I thank you kindly for returning this to me!' WHERE `entry`=3884;
UPDATE `quest_template` SET `OfferRewardText`='Wonderful! I will have these sent by courier to the Undercity at once!$B$BAs for you - here is payment, as promised. Keep the change, you filthy beast!' WHERE `entry`=3911;
UPDATE `quest_template` SET `OfferRewardText`='Oh, what''s this? A samophlange, you say? What''s a samophlange??$B$BAh... but look at the way it moves when you handle it. And there''s the sound of intricate gears inside. Oh my! I want to fix it and see what it does, don''t you??' WHERE `entry`=3921;
UPDATE `quest_template` SET `OfferRewardText`='What''s this? Why, it''s a samophlange! Where did you get this thing? Have you been poking around the Venture Company holdings in the Barrens?$B$BYou must be very brave, or very stupid.' WHERE `entry`=3923;
UPDATE `quest_template` SET `OfferRewardText`='You got the manual! I can''t wait to read it and find out how to fix the Samophlange! I spoke with Sputtervalve in Ratchet--he wanted to thank you for your help, and wanted to reward your efforts.$B$BI want to thank you too, and if I ever get this thing fixed I''ll let you know...' WHERE `entry`=3924;
UPDATE `quest_template` SET `OfferRewardText`='So, you pulled a fast one on ol'' Miblon, eh?' WHERE `entry`=4041;
UPDATE `quest_template` SET `OfferRewardText`='The spectral chalice floats in the air, slowing rising and falling... as if to the beat of a dying heart.' WHERE `entry`=4083;
UPDATE `quest_template` SET `OfferRewardText`='This blood amber will be used to find a means of defeating the corruption present in Felwood. You''ve proven to me that you''re willing to do whatever it takes for the Cenarion Circle. I trust you now, friend.$B$BIt might seem odd that killing the elementals proved yourself to me, but the end of saving countless sentient beings must justify the means we take. You and I can now focus on the preservation of life through the salves I can make.$B$B$N, the time has come to cleanse Felwood.' WHERE `entry`=4101;
UPDATE `quest_template` SET `OfferRewardText`='This blood amber will be used to find a means of defeating the corruption present in Felwood.  You''ve proven to me that you''re willing to do whatever it takes for the Cenarion Circle.  I trust you now, friend.$B$BIt might seem odd that killing the elementals proved yourself to me, but the end of saving countless sentient beings must justify the means we take.  You and I can now focus on the preservation of life through the salves I can make.$B$B$N, the time has come to cleanse Felwood.' WHERE `entry`=4102;
UPDATE `quest_template` SET `OfferRewardText`='You apply 3 Cenarion Plant Salves to the Whipper Root. It immediately begins to shed its corrupted form, blossoming into a vibrant and healthy plant.' WHERE `entry`=4117;
UPDATE `quest_template` SET `OfferRewardText`='Interesting... I believe that this is Raschal''s knife.  You say you found it at the bottom of the water, along with his boat?  Well, just the knife''s discovery might not be enough to connect this to Raschal''s disappearance; we do, however, have an unconventional option available to us to try and learn more.$B$BHave you ever heard of psychometry?' WHERE `entry`=4127;
UPDATE `quest_template` SET `OfferRewardText`='Thank you, $N.$B$BWhile psychometry isn''t an exact art by any stretch of the imagination, I''ve used it in times past to give insight into situations that others have chalked up to lost causes.  I think using it on the knife you''ve uncovered will give us a glimpse into what happened to Raschal.$B$BIt will only take a moment to do, but it isn''t what I''d call a caster-friendly task.  Bear with me on this.' WHERE `entry`=4129;
UPDATE `quest_template` SET `OfferRewardText`='I hope they didn''t give you too much trouble, $N. I try to steer clear of them -- they''re wild!$B$BI tried jumping over one... I was attacked! Plants just shouldn''t be acting that way!' WHERE `entry`=4141;
UPDATE `quest_template` SET `OfferRewardText`='It could have been worse, I suppose...$B$B<Magistrate Solomon looks you over.>$B$BIt appears as if the fate of Lakeshire rests squarely on your shoulders.$B$B<You notice Magistrate Solomon blinking rapidly. He appears to be crying.>' WHERE `entry`=4186;
UPDATE `quest_template` SET `OfferRewardText`='Oh, you''ve done it!  I can now make my potion and use it on Rocknot.  Finally, he will fall victim to my charms!$B$BThank you, $N.  You are a champion of love!' WHERE `entry`=4201;
UPDATE `quest_template` SET `OfferRewardText`='Yes, s, $N. Felwood has been through much hardship. Thank you for what you have done.$B$BOne day, we may be able to reclaim Felwood from the corruption; every kind deed helps.' WHERE `entry`=4261;
UPDATE `quest_template` SET `OfferRewardText`='We night elves know of the terror outlined in this report.  Shandris was wise to send this, and you, to me.$B$BThese creatures will consume Feralas rapidly; they are nothing short of one of the greatest menaces we all will ever face.  The insects you and the courier encountered are known as the silithid.  They are mere tools of one of the greatest threats that both the Horde and Alliance will ever face.$B$BI pray we will have the resolve to defeat them before they destroy us.' WHERE `entry`=4267;
UPDATE `quest_template` SET `OfferRewardText`='<Marshal Windsor snatches the two tablets from your hands.>$B$BWe need to get out of here!' WHERE `entry`=4282;
UPDATE `quest_template` SET `OfferRewardText`='I know the stories are true, $N.' WHERE `entry`=4285;
UPDATE `quest_template` SET `OfferRewardText`='<Oralius starts rummaging through the mountainous pile of fanny packs.>$B$BOH WONDERFUL!$B$B<Oralius sticks his large nose into the pile and takes a whiff.>$B$BDELICIOUS! Look at all these goodies!$B$BTake one for yourself, $N. There''s plenty to go around.' WHERE `entry`=4286;
UPDATE `quest_template` SET `OfferRewardText`='Un''Goro is such a strange place, $N. When you enter the crater, it''s as if you are in a completely different world...' WHERE `entry`=4287;
UPDATE `quest_template` SET `OfferRewardText`='There are many hidden areas of the crater along the sides. Try exploring the winding paths if you can''t think of anywhere else to look, $N.' WHERE `entry`=4288;
UPDATE `quest_template` SET `OfferRewardText`='Ah, excellent. These samples will do nicely. I thank you for your help.$B$BOnce we''ve gathered all the samples of slimes, we''ll be able to determine more. I am beginning to suspect that Lady Sylvanas'' hunch was not only correct, but more insightful than even she could have predicted. These samples are very interesting. Just seeing how they''ve reacted with my compounds... hmm, yes, we''ll definitely need to investigate further.' WHERE `entry`=4293;
UPDATE `quest_template` SET `OfferRewardText`='Truly amazing, $N. This Un''Goro Crater is holding many more secrets than I expected. I wonder what else we will discover as we test further.$B$BSimply amazing... look at the purity of these samples. Hmm, I wonder what it could mean. They seem to be elemental in nature, but... something more. They remind me of... of the Old Gods. We''ve found traces of them throughout Azeroth, and now I wonder if these creatures aren''t related to them somehow.$B$BWe shall have to test further.' WHERE `entry`=4294;
UPDATE `quest_template` SET `OfferRewardText`='These''ll do nicely, and if I''m not mistaken, your little egg''s just about ready to hatch. How does it feel? You know, you about to be a father? Haha, didn''t think ya''d have to deal with such responsibility, now did ya?' WHERE `entry`=4297;
UPDATE `quest_template` SET `OfferRewardText`='Arranging the crystals on the table, you carefully align the colors. As you push the last one into place, a burst of light fuses the crystals together.$B$BThe resulting combination is now yours.' WHERE `entry`=4381;
UPDATE `quest_template` SET `OfferRewardText`='Arranging the crystals on the table, you carefully align the colors. As you push the last one into place, a burst of light fuses the crystals together.$B$BThe resulting combination is now yours.' WHERE `entry`=4382;
