UPDATE `quest_template` SET `OfferRewardText`='So you have put together a deck of Storms. Your gesture of returning it to us will create a tie between you and the Darkmoon that will not soon be forgotten. Allow me to present you with one of the greater Darkmoon cards as a small token of our appreciation.' WHERE `entry`=10939;
