UPDATE `quest_template` SET `OfferRewardText`='Thank you, $N. Now, we must pray that we can undo the damage that has been done...' WHERE `entry`=4441;
UPDATE `quest_template` SET `OfferRewardText`='With the blessed water, I was able to break the link between the flute and the ancient spirit. I do believe though, that if you were to use this flute in a sacred spot, you may be able to summon the ancient spirits.$B$BPerhaps you might try the ruins in the southern part of Irontree Woods. Many corrupted treants inhabited this area at one time, and it is possible that they may still reside there, even in spirit form.' WHERE `entry`=4442;
