UPDATE `quest_template` SET `OfferRewardText`='Yes, I gathered that Gracina sent you to me. Your experience in fighting these beasties is priceless; no one to my knowledge has ever dealt with their kind before. As for Gracina''s idea that Un''Goro Crater is their heart... perhaps it is. Un''Goro is a mysterious and dangerous jungle to the west of here. Perhaps it is also one step closer to figuring out what the silithid are all about.' WHERE `entry`=4493;
UPDATE `quest_template` SET `OfferRewardText`='Fantastic, $N!  We''ve won quite the victory here today.  It will take some time for us to fully understand what we have here; we''ll put it to good use though, don''t you worry about that.$B$BAs for the silithid, I genuinely doubt that this was the full extent of their presence.  This is much too clean of a resolution, I''m sorry to say.' WHERE `entry`=4507;
UPDATE `quest_template` SET `OfferRewardText`='Amazing results, $N! You got close enough to take a sample of the corrupted things, and managed to look no worse for wear! Thank you. Oh, these samples will be perfect. I can''t wait to start testing on them.$B$BIf I''m right, I could be one of the Explorers'' Leagues greatest scientists!$B$BThat''ll prove to all the dwarves that it wasn''t a mistake to allow us gnomes into Ironforge  after the Gnomeregan incident.' WHERE `entry`=4512;
UPDATE `quest_template` SET `OfferRewardText`='You''ve found it? $N, you are a treasure unto yourself. Your dedication and aid has been magnificent and I could not possibly thank you enough.$B$BPlease, take this for your troubles. I have some work to do, but I''m sure, if you come back at a later time, I''ll have need of your services again.$B$BThank you. Thank you so much.' WHERE `entry`=4513;
UPDATE `quest_template` SET `OfferRewardText`='This contraption stands out amongst the gnomes holding out against the madness outside the room. A small plaque on the device reads "The Sparklematic 5200", followed by some text:$B$B"Grime and residue ruining your sparklies? The Sparklematic 5200 puts the shine back in shine-tastic! Insert the item you wish to clean and deposit three silver coins in the coin slot. Give the Sparklematic 5200 a moment for operation, and voila! Your valuables will emerge clean and shiny!"' WHERE `entry`=4602;
UPDATE `quest_template` SET `OfferRewardText`='The Sparklematic 5200 comes to life, lurching to and fro. Inside, the helpless grime that has encrusted the object placed within it is being pulverized by the machine''s gnomish cleaning agent.$B$BThe Sparklematic 5200 comes to a halt, heralded by a familiar "ding!" The item receptacle of the machine spirals open, revealing a neatly wrapped box.' WHERE `entry`=4604;
UPDATE `quest_template` SET `OfferRewardText`='As quickly as it started, the Sparklematic 5200 comes to an abrupt halt. A simple "ding" is heard from the machine, and the mouth of the machine spirals upward. Inside the Sparklematic 5200 is a small box wrapped in a little bow. The machine would appear to wrap an object up after eliminating its grime-encrusted status. Even if the machine didn''t work, at least the item is now wrapped in a pretty box.$B$BWell, there is one way to find out if it cleaned the item or not...' WHERE `entry`=4605;
UPDATE `quest_template` SET `OfferRewardText`='As quickly as it started, the Sparklematic 5200 comes to an abrupt halt. A simple "ding" is heard from the machine, and the mouth of the machine spirals upward. Inside the Sparklematic 5200 is a small box wrapped in a little bow. The machine would appear to wrap an object up after eliminating its grime-encrusted status. Even if the machine didn''t work, at least the item is now wrapped in a pretty box.$B$BWell, there is one way to find out if it cleaned the item or not...' WHERE `entry`=4606;
UPDATE `quest_template` SET `OfferRewardText`='Avast ye... Admiral $N!  Yer a pirate of pirates, lass!$B$BIt warms the cackles of me heart to give ye this hat.  Ye will ne''er find one like it anywheres, and all that gazes upon ye will see that yer an Admiral of the Bloodsail Navy!' WHERE `entry`=4621;
UPDATE `quest_template` SET `OfferRewardText`='Another discovery for us to research - well done $N!  These remains will be properly studied once they get to Darnassus.  Please accept this small honorarium in exchange for the remains you have provided for our study.' WHERE `entry`=4722;
UPDATE `quest_template` SET `OfferRewardText`='The bones you have are from gentle sea mammals that are known to inhabit the waters surrounding the base of Teldrassil.  They had never been known to violently beach themselves like the threshers had been known to.  Why would these creatures do this, I wonder?  Well, perhaps the study of their remains will bear the fruits of knowledge that we seek.$B$BAgain, thank you for your aid.  Please accept this honorarium from the Temple of the Moon.' WHERE `entry`=4730;
UPDATE `quest_template` SET `OfferRewardText`='I have heard of the kinds of carriages found on the back of that turtle.  Those I do believe are naga carriages, used both in battle and in transportation of their supplies on to land.  The markings on the box you found are of the naga; perhaps the creature you discovered was killed as it was heading further south... to Ashenvale maybe?$B$BI will be sure to send this box to Darnassus with the rest of your discoveries.  This is for you - thank you again for your assistance.' WHERE `entry`=4731;
UPDATE `quest_template` SET `OfferRewardText`='You''ve found even more beached creatures, $N?  Sea turtles were commonly found frolicking along the base of Nordrassil before it was destroyed.  With the birth of Teldrassil, however, these creatures have been seen in ever decreasing numbers.  Some, as we have discovered, end their lives here for some unknown reason.$B$BYour aid will perhaps unlock the mystery before us.  Please accept this in exchange for the remains you have provided for our study.' WHERE `entry`=4732;
UPDATE `quest_template` SET `OfferRewardText`='Well met, $c.  Your scouting of the furbolg situation comes at a fortuitous time for us in Auberdine.  For some time we have dealt with not only forest dwellers who are now openly hostile to our presence, but also the outright corruption of the forest itself.  Hopefully you might be able to lend Auberdine aid during these troubling times.' WHERE `entry`=4761;
UPDATE `quest_template` SET `OfferRewardText`='Good, you''ve returned, $N. And where is the thread?$B$BAh, I understand. That is acceptable. The goblin and his brother have not failed us yet--I suppose it is understandable that he did not have it prepared right then. So be it... we have other things we can attend to in the meantime.$B$BAre you prepared for the next step?' WHERE `entry`=4782;
UPDATE `quest_template` SET `OfferRewardText`='Mmmmmmmmm! I love their strawberry ice cream! If there''s one thing Tigule and Foror know to do, it''s make ice cream!$B$BThank you very much $N - this is the best treat ever!' WHERE `entry`=4822;
UPDATE `quest_template` SET `OfferRewardText`='What a load! I mean, look at all those eggs! These should bring in a right few gold.$B$BAs promised, here''s your own little critter. Don''t get bitten!' WHERE `entry`=4862;
UPDATE `quest_template` SET `OfferRewardText`='Do not hesitate; tell me why you have come.$B$BOh, yes? Hmm. Well.$B$BThank you for bringing this straight to me; it is always best to go right to the top... But... Yes. The druids of the Cenarion Circle have known of the Wildkin for some time. That they are pets of Elune, and were chosen to guard the most sacred of places.$B$BSo while this isn''t news, I definitely compliment you on your effort. Here, take this -- it is something that seems suitable for such a deed.' WHERE `entry`=4902;
UPDATE `quest_template` SET `OfferRewardText`='Ah, the spirit of a felhound. Well done, $N.$B$BWhen I have both the spirit and the cleansed orb, I will merge the two for you, but not until then.' WHERE `entry`=4962;
UPDATE `quest_template` SET `OfferRewardText`='Ah, the spirit of an infernal. Well done, $N.$B$BWhen I have both the spirit and the cleansed orb, I will merge the two for you, but not until then.' WHERE `entry`=4963;
UPDATE `quest_template` SET `OfferRewardText`='Ah, you do seek something more... substantial. That I can help you if you truly are prepared.$B$BIt''s a welcome change to see one of our kind seeking more power in forms other than just knowledge.$B$BSo, do you feel you''re ready, $N?' WHERE `entry`=4965;
UPDATE `quest_template` SET `OfferRewardText`='Ah, you do seek something more... substantial. I can help you if you truly are prepared.$B$BIt''s a welcome change to see one of our kind seeking more power in forms other than just knowledge.$B$BSo, do you feel you''re ready, $N?' WHERE `entry`=4969;
UPDATE `quest_template` SET `OfferRewardText`='Time feels easier to mend now, thank you $N.  While you might not understand fully the consequences of a fractured timeline, I appreciate that you understand the urgency of countering what I suspect more and more to be a Scourge-driven malfeasance.$B$BI see no harm in rewarding you for your assistance, mortal.  Your greatest feats are to come, and the awarding of a bauble will certainly not alter your future destiny.  Your continued aid, however, is something that I and the dragonflight could use...' WHERE `entry`=4971;
UPDATE `quest_template` SET `OfferRewardText`='These are exactly what I need, $N.  Thank you.$B$BAllow me to suitably reward you with this.  You may not understand what you would need with such a device.  You might not even know quite what it really is.  Alas, I cannot tell you when you will find it most useful; just know that at some point in the future, you may find this item to have extreme utility and function when consumed.  Whether or not you choose to hold on to it until then... this, my friend, is up to you.' WHERE `entry`=4972;
UPDATE `quest_template` SET `OfferRewardText`='You have dealt a crippling blow to the forces of Blackrock, $N. With their Warchief slain, the Blackrock legion is once again thrown into the maw of chaos.$B$BIn honor of your heroics, the people of Kalimdor shall be rewarded!' WHERE `entry`=4974;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $N. This will do nicely.$B$BThe only thing left for you to do is to decide on which demon you want me to imprison within the cleansed orb. Do that, and you will have a magnificent new item to wield.' WHERE `entry`=4976;
UPDATE `quest_template` SET `OfferRewardText`='You''ve done it! Once Lexlort has these plans, he''ll forget all about the nasty things he wanted to do to me.$B$B$N, you''re my hero!' WHERE `entry`=4982;
UPDATE `quest_template` SET `OfferRewardText`='I... I sense that the souls of those wolves you have put down now have rest.  They - and I - thank you for a merciful release.$B$BThe wolves are not alone in their suffering within this damnable place, $N.  Please, I have need of you once more.' WHERE `entry`=4984;
UPDATE `quest_template` SET `OfferRewardText`='"I know that the grizzlies have been put down, their torment at an end.  I... I have one more thing for you.  I wrote it down on... on this branch, sensing that my time in this realm had come to an end.$B$BIndeed... I am at that end.  Thank you again friend... the creatures of this accursed land may rest... and now shall I."$B$BWith that, a heavy sigh is uttered by the druid, followed by what sounds like a death rattle.  His body lies motionless on the cottage floor.' WHERE `entry`=4985;
UPDATE `quest_template` SET `OfferRewardText`='This... this is quite strange.  This druid - this tauren druid no less - entrusted you with a great deal of valuable information on the extent of the Scourge''s plague.  I am surprised a tauren would give a $r such information, and freely at that if what you say is true.  We will make good use of this, I promise you.  Perhaps the tauren have not fallen as far from Cenarius as Fandral would believe...$B$BErm, anyway, please - accept this as a token of thanks from the Cenarion Circle.' WHERE `entry`=4986;
UPDATE `quest_template` SET `OfferRewardText`='A package in the barn that you might have otherwise overlooked now stands out amongst the decay and ruin.  Perhaps this is the one that the ghost of Janice Felstone was clamoring about...' WHERE `entry`=5021;
UPDATE `quest_template` SET `OfferRewardText`='A package for an Emma Felstone, you say?  Last known address was Stormwind, four years ago?  Well let me see here...$B$BAccording to what we know, there was an Emma Felstone in the city about four years ago.  Well, I should say possibly - this census I refer to is from five years ago, and I don''t have a report of her vacating the city.  This doesn''t mean that she is still here though.$B$BWait a second... this package couldn''t be for Ol'' Emma, could it?' WHERE `entry`=5022;
UPDATE `quest_template` SET `OfferRewardText`='My name is indeed Emma Felstone - you''re the first person in years to call me that.  Who... who are you?$B$BYou say you knew... my sister?!  Is she still alive?  Who am I kidding, of course she isn''t.  When the plague broke out in Lordaeron, I had come to expect the worst.  So many of my family died... or worse.  Here I am now, crazy Ol'' Emma, all alone.  What are you, a grave-robber or something?  Looking for your next target?$B$BWhat... you have a package for me from my sister?' WHERE `entry`=5048;
UPDATE `quest_template` SET `OfferRewardText`='You give the half-charm back to the apparition.  She looks at it, then at you expectantly.$B$B"Honey, where did you put your half of the charm?  We can''t be together unless we have both halves.  Honey... can you see me?"' WHERE `entry`=5050;
UPDATE `quest_template` SET `OfferRewardText`='You hand the reassembled good luck charm to Janice Felstone''s ghost.  As soon as she grasps it, you observe an almost immediate change in her.  Her ethereal form shimmers, and she looks upon you with clear yet sad eyes.$B$B"You''ve freed me... I no longer will need this charm.  Please, take it and perhaps it will give you the solace it has given me."' WHERE `entry`=5051;
UPDATE `quest_template` SET `OfferRewardText`='Using the key found on the skeleton of the former Mrs. Dalson, you unlock the door to the outhouse.  A bloodthirsty ghoul leaps from the outhouse, having been trapped inside for who knows how long.$B$BIt is clear by the bloodcurdling scream of the ghoul at your presence that the former Farmer Dalson is now beyond saving.' WHERE `entry`=5059;
UPDATE `quest_template` SET `OfferRewardText`='The key taken from Farmer Dalson''s ghoulish remains fits the lock perfectly.  The doors of the cabinet swing open, revealing several items that remain intact and appear quite valuable.' WHERE `entry`=5060;
UPDATE `quest_template` SET `OfferRewardText`='Welcome to the Plaguelands, hero.  This is one of the most dangerous frontiers in Azeroth, especially with the looming threat of the Scourge to our north and northeast.  I am glad to hear that the clarion call of duty and service to the greater good did not fall on deaf ears with you!$B$BIf you are ready to get your hands dirty, then there is plenty for willing and able heroes to do here on the edge of the Plaguelands.' WHERE `entry`=5066;
UPDATE `quest_template` SET `OfferRewardText`='Welcome to the Plaguelands, hero.  This is one of the most dangerous frontiers in Azeroth, especially with the looming threat of the Scourge to our north and northeast.  I am glad to hear that the clarion call of duty and service to the greater good did not fall on deaf ears with you!$B$BIf you are ready to get your hands dirty, then there is plenty for willing and able heroes to do here on the edge of the Plaguelands.' WHERE `entry`=5091;
UPDATE `quest_template` SET `OfferRewardText`='Mission accomplished, $N!  Well played, well played.$B$BAllow me to reward your work thus far with some coin from the Stormwind coffers.  I''d recommend spending it on materiel that will aid you in your next mission... one that will take you into the ruins of Andorhal itself.$B$BBe ready!  Be vigilant!' WHERE `entry`=5092;
UPDATE `quest_template` SET `OfferRewardText`='Welcome to the Plaguelands, hero. This is one of the most dangerous frontiers in Azeroth, with the looming threat of the Scourge to our east, and then even further still eastward from there. I am glad to hear that the call of duty and service to the Horde did not fall on deaf ears with you!$B$BIf you are ready to get your hands dirty, then there is plenty for willing and able heroes to do here on the edge of the Plaguelands.' WHERE `entry`=5095;
UPDATE `quest_template` SET `OfferRewardText`='Finely executed, $N. Your attack on the Scarlet Crusade will buy us time. I have sent one of my best scouts out to watch over the camp and make sure that the Crusade forces that come to reinforce the position will take the bait.$B$BWith the pressure on us lessened, we should now finally be able to risk a mission into Andorhal itself, and an important one at that. I''d very much like it if you''d perform this one as well, based on your success to date.' WHERE `entry`=5096;
UPDATE `quest_template` SET `OfferRewardText`='You found it!  You found my doll!  Oh, thank you!' WHERE `entry`=5149;
UPDATE `quest_template` SET `OfferRewardText`='You saw Pamela?  How is she?  Is she alive??  Oh, no!  Poor Pamela!  She was so young, and such a happy child...$B$BShe doesn''t know what happened to her father, does she?  My brother, Joseph?$B$BNo... she couldn''t understand what happened to Joseph.  And even if she could, I don''t have the heart to tell her...' WHERE `entry`=5152;
UPDATE `quest_template` SET `OfferRewardText`='What is this?  A wedding ring?  Let me see...$B$BAh!  This ring was once on the hand of a great man, but there is much tragedy in that man''s past.$B$BAre you here to help him?  It''s far too late for him now... but perhaps we can help him in the past!' WHERE `entry`=5153;
UPDATE `quest_template` SET `OfferRewardText`='Well done, you found it!$B$BDid you read it?  Is Joseph Redpath mentioned?  If he is, then perhaps we can save him!$B$BAh.  The Annals of Darrowshire tell a very unsettling tale.  It says that during the battle, Joseph Redpath was corrupted and joined the ranks of the Scourge!  He then betrayed the defenders of Darrowshire.$B$BThat is an ill fate.  If we can, we should try to change that fate, don''t you think?' WHERE `entry`=5154;
UPDATE `quest_template` SET `OfferRewardText`='You found them!  Well done, $N!  These relics hold a power I do not fully understand, a power you will one day harness.$B$BThey also bring dark memories to my mind, memories of death and treachery, and of the last night of Darrowshire...' WHERE `entry`=5181;
UPDATE `quest_template` SET `OfferRewardText`='You found them!  Wonderful!$B$BAlthough I don''t fully understand how they can help us, I feel their power and I know in my bones that they are linked to my home village of Darrowshire.' WHERE `entry`=5206;
UPDATE `quest_template` SET `OfferRewardText`='What is this book?  The Annals of Darrowshire?  That was my home before the war... my home before the battle that destroyed it!  Why did you bring me this book?$B$BBut look here!  At the end there are pages that tell tales of the days beyond the battle!  Here is a passage about me!  And one about my brother Joseph!  Is this book true?$B$BWe must discover the truth!' WHERE `entry`=5210;
UPDATE `quest_template` SET `OfferRewardText`='It is good to hear you found the tortured souls of my brethren and freed them.  My heart will weep less, knowing at least some of the defenders of Darrowshire no longer wallow in the vile subservience of the Scourge.' WHERE `entry`=5211;
UPDATE `quest_template` SET `OfferRewardText`='The key taken from Cauldron Lord Bilemaw is a perfect fit in unlocking the access panel.  A foul stench emanates from the opened panel as an unknown mix of concentrated substances swirl inside the cauldron.$B$BThere is a small spigot that the bottle fits well enough under, allowing you to draw a sample for High Priestess MacDonnell back at Chillwind Point.' WHERE `entry`=5216;
UPDATE `quest_template` SET `OfferRewardText`='Well done $N - it should take Alchemist Arbington no time at all to analyze this and devise a counter agent to introduce into the cauldron.  If we are able to pump out enough of it into the air, we might be able to weaken all the Scourge present here.$B$BThis will no doubt be an ongoing ordeal; we will need to continually hit these cauldrons and introduce our reagents into their mix.  Still, if we can keep it up, we will have a huge advantage over Scourge when the time comes for battle!' WHERE `entry`=5217;
UPDATE `quest_template` SET `OfferRewardText`='The macabre key found on the cauldron lord easily slides into a keyhole and then disappears, allowing you permanent access to it.  Crude, viscous ichors pulsate through twisted tubes within the cauldrons underpinnings.$B$BThere is a small spigot that the bottle fits well enough under, allowing you to draw a sample for High Priestess MacDonnell back at Chillwind Point.' WHERE `entry`=5219;
UPDATE `quest_template` SET `OfferRewardText`='Ah, there is plenty in here for study.  Well done, $N!$B$BFor now, the next step is in our hands.  We''ll need to produce a list of reagents that, when combined with what is already in the cauldron, will act as its counter.$B$BThe only way we will be able to introduce this is by placing the reagents into the cauldron directly.  Alchemist Arbington will have more information on that, so be sure to speak with him at your earliest convenience.' WHERE `entry`=5220;
UPDATE `quest_template` SET `OfferRewardText`='The cauldron lord''s key unlocks the access panel to this cauldron and then disappears, much like the other keys have for the previous two cauldrons you''ve dealt of.  A putrid smelling substance churns violently beneath the platform of the cauldron.$B$BThere is a small spigot that the bottle fits well enough under, allowing you to draw a sample for High Priestess MacDonnell back at Chillwind Point.' WHERE `entry`=5222;
UPDATE `quest_template` SET `OfferRewardText`='Another finely executed mission, $N!  This makes three cauldrons available to us to turn against the Scourge.  If Kel''Thuzad''s necromantic dominance over these lands wasn''t as strong as it currently is, I''d dare say you''d shut them down completely!$B$BAlchemist Arbington will have a report on what this cauldron - as well as the other cauldrons subverted - will require to deliver our counter agent to the plague.  With that, the time has come to bring the last cauldron of the west under our influence!' WHERE `entry`=5223;
UPDATE `quest_template` SET `OfferRewardText`='Cauldron Lord Soulwrath''s key disintegrates as it touches the lock on the access panel at the base of the cauldron''s platform.  A slight clanking noise is heard within, and the access panel swings open to reveal more viscous toxins within the cauldron''s framework.$B$BThere is a small spigot that the bottle fits well enough under, allowing you to draw a sample for High Priestess MacDonnell back at Chillwind Point.' WHERE `entry`=5225;
UPDATE `quest_template` SET `OfferRewardText`='Congratulations $N, you''ve unlocked the last cauldron for us!  Alchemist Arbington will soon know what this cauldron requires as far as reagents needed for the mix.$B$BAs for you, I am sure that Commander Valorfist will want to thank you personally for the assistance you''ve given us.  Without you, our struggle against the Scourge would have been nearly insurmountable.  Thank you, hero!' WHERE `entry`=5226;
UPDATE `quest_template` SET `OfferRewardText`='The key taken from Cauldron Lord Bilemaw is a perfect fit in unlocking the access panel, though it disappears after you use it.  Still, you think you can open the panel now without a key.  A foul stench emanates from the opened panel as an unknown mix of concentrated substances swirl inside the cauldron.
\

\
There is a small spigot that the bottle fits well enough under, allowing you to draw a sample for Shadow Priestess Vandis back at the Bulwark. ' WHERE `entry`=5229;
UPDATE `quest_template` SET `OfferRewardText`='$N, your successful re-engineering of the cauldrons is a tremendous victory for us!$B$B<The commander clears his throat and begins to bellow loudly.>$B$BLet all within my presence hear: for service to the Kingdom of Stormwind and to the Alliance above and beyond the call of duty - in the face of overwhelming odds and incredible danger, might I add - I give $N this, and I extend upon $g him : her; our undying gratitude as a true hero of the Alliance.  Cheers, I say!' WHERE `entry`=5237;
UPDATE `quest_template` SET `OfferRewardText`='You''ve seen Pamela?  She''s alive?$B$BShe''s dead?  No!  Oh, Pamela!  Why does your spirit still suffer in this world.  Why are you perished, while fortune keeps me alive?  In an instant I would switch places with you and wander dead Darrowshire, a ghost and alone!$B$BAh, but this news cannot change fate.  Thank you, $N.  Now my duty, my duty to revenge, burns hot as ever.  ' WHERE `entry`=5241;
UPDATE `quest_template` SET `OfferRewardText`='A student of Daryn Lightwind? Nice to meet you, $N.' WHERE `entry`=5250;
UPDATE `quest_template` SET `OfferRewardText`='That''s true.  I''m looking for someone to hunt me some wolves!  Are you that person?' WHERE `entry`=5261;
UPDATE `quest_template` SET `OfferRewardText`='This be it, $N. After this, there ain''t no way to turn back. It''s not too late to become a toy maker, er, weaponsmith.$B$BI trust ye''ll make the right decision.' WHERE `entry`=5283;
UPDATE `quest_template` SET `OfferRewardText`='May you bash in many a brain, $N!' WHERE `entry`=5305;
UPDATE `quest_template` SET `OfferRewardText`='Knowledge is power!' WHERE `entry`=5306;
UPDATE `quest_template` SET `OfferRewardText`='It should be obvious that a sword is always the best choice.' WHERE `entry`=5307;
UPDATE `quest_template` SET `OfferRewardText`='Congratulations, $N - I am pleased to award you with an Argent Dawn valor token!$B$BThe tokens serve two purposes.  One - they can be used to further your standing within the Argent Dawn; to do so may avail you options and rewards that are reserved for our honored and revered allies.  Two - they can be given to our quartermasters, along with coin, as payment for some of the Dawn''s more prized items.$B$BWhatever you decide, know that you are earning your commission.  Well done!' WHERE `entry`=5402;
UPDATE `quest_template` SET `OfferRewardText`='Congratulations, $N - I am pleased to award you with an Argent Dawn valor token!
\

\
To acquire a valor token in such a manner indicates that you are a true hero in the cause of good. We value all effort brought to bear against the Scourge, but to take down one of their leaders is to truly deliver onto them a crushing defeat!
\

\
For the Dawn, my g$sister:brother;!' WHERE `entry`=5404;
UPDATE `quest_template` SET `OfferRewardText`='Congratulations, $N - I am pleased to award you with an Argent Dawn valor token!
\

\
To acquire a valor token in such a manner indicates that you are a true hero in the cause of good. We value all effort brought to bear against the Scourge, but to take down one of their leaders is to truly deliver onto them a crushing defeat!
\

