For the Dawn, my g$sister:brother;!' WHERE `entry`=5406;
UPDATE `quest_template` SET `OfferRewardText`='Congratulations, $N - I am pleased to award you with an Argent Dawn valor token!
\

\
The tokens serve two purposes. One - they can be used to further your standing within the Argent Dawn; to do so may avail you options and rewards that are reserved for our honored and revered allies. Two - they can be given to our quartermasters, along with coin, as payment for some of the Dawn''s more prized items.
\

\
Whatever you decide, know that you are earning your commission. Well done!' WHERE `entry`=5408;
UPDATE `quest_template` SET `OfferRewardText`='Good. good. Maybe they''ll think twice before slacking next time! Thanks for the help!' WHERE `entry`=5441;
UPDATE `quest_template` SET `OfferRewardText`='Ah, goodie!  My bones!$B$BI can''t wait till the chaps at home see my face on the front cover of Goblin''preneur.  I''ll be the richest goblin in the world... and my physical education teacher said I would never amount to anything.' WHERE `entry`=5501;
UPDATE `quest_template` SET `OfferRewardText`='Outstanding - your tribute to the Dawn is duly noted, $N. With this accomplished, I am delighted to make our mantles available to you for purchase. So long as you maintain your current status with us, these mantles will be purchasable from any authorized quartermaster of the Argent Dawn.$B$BFor the Dawn, my brother!' WHERE `entry`=5504;
UPDATE `quest_template` SET `OfferRewardText`='Outstanding - your tribute to the Dawn is duly noted, $N. With this accomplished, I am delighted to make our mantles available to you for purchase. So long as you maintain your current status with us, these mantles will be purchasable from any authorized quartermaster of the Argent Dawn.$B$BFor the Dawn, my brother!' WHERE `entry`=5507;
UPDATE `quest_template` SET `OfferRewardText`='Congratulations, $N - I am pleased to award you with an Argent Dawn valor token!
\

\
