UPDATE `quest_template` SET `OfferRewardText`='Congratulations, $N - I am pleased to award you with an Argent Dawn valor token!$B$BEach valor token handed out to worthy recipients is a sign of the tide turning against the Scourge.  With more and more heroes fighting the Scourge in their own lands, the Argent Dawn will assuredly be at the forefront when the time comes to wage war on the ultimate evil of the Scourge.  I hope that the valor you''ve shown what it took to acquiring your token will carry the day then as well!' WHERE `entry`=5509;
UPDATE `quest_template` SET `OfferRewardText`='Congratulations, $N - I am pleased to award you with an Argent Dawn valor token!$B$BThe tokens serve two purposes.  One - they can be used to further your standing within the Argent Dawn; to do so may avail you options and rewards that are reserved for our honored and revered allies.  Two - they can be given to our quartermasters, along with coin, as payment for some of the Dawn''s more prized items.$B$BWhatever you decide, know that you are earning your commission.  Well done!' WHERE `entry`=5510;
UPDATE `quest_template` SET `OfferRewardText`='Outstanding - your tribute to the Dawn is duly noted, $N. With this accomplished, I am delighted to make our mantles available to you for purchase. So long as you maintain your current status with us, these mantles will be purchasable from any authorized quartermaster of the Argent Dawn.$B$BFor the Dawn, my brother!' WHERE `entry`=5513;
UPDATE `quest_template` SET `OfferRewardText`='Most impressive, $N - the Chromatic Mantle of the Dawn is now yours!$B$BAs long as you maintain Exalted status with the Argent Dawn, you will be able to purchase additional Chromatic Mantles. They will be made available to you immediately from any of the Dawn''s quartermasters.' WHERE `entry`=5517;
UPDATE `quest_template` SET `OfferRewardText`='Yeah, this will do the trick.  Just a slip here, and tuck here... heh - this is going to work out just fine!  <A broad smile beams from the chained goblin''s face.>$B$BHere you go, you''re all set.  Remember- this isn''t the most securely fashioned item in the world.  You''ll have ten minutes of use before it falls apart, and then you''re not going to fool anybody!  Try using it just before you approach him, and remember... it only will make him think that YOU are an ally - not your group mates!' WHERE `entry`=5518;
UPDATE `quest_template` SET `OfferRewardText`='Here ya go $N - put this thing on, and you''ll have ten minutes to do whatever.  Good luck!$B$BOh, and if you happen to find a key to get me out of here, BY ALL MEANS LET ME KNOW!!!' WHERE `entry`=5519;
