UPDATE `quest_template` SET `OfferRewardText`='You - ranked number one. Everyone else - ranked number two or lower. Oh, thank you for freeing me!$B$BI knew my life was destined for more than just being an appetizer to some ogre!' WHERE `entry`=5525;
UPDATE `quest_template` SET `OfferRewardText`='This''ll work, $N!  My turn now - I will imbue these with a suitable temper that will allow them to survive the intense forging process they will eventually go through.$B$BThe next step will be to get an appropriate mold for the key.  I know a goblin blacksmith in Tanaris that has in the past made molds for similarly macabre items.  He works for whom goblins usually work for - the highest bidder.' WHERE `entry`=5537;
UPDATE `quest_template` SET `OfferRewardText`='You are a shining example of decency, $r! It has been long since I have felt the blood of heroes pump through my veins. Your acts of bravery are uplifting!' WHERE `entry`=5543;
UPDATE `quest_template` SET `OfferRewardText`='Oh, so Branstock sent ya, did he? Good, good! He''s right, it is ''bout time you started taking a much larger step into the Light. It''ll build character and make ya stronger... an'' that''s what you''ll need more than anything: strength of body... strength of will.' WHERE `entry`=5626;
