UPDATE `quest_template` SET `OfferRewardText`='"And so it begins. Father Cenarius. And so it begins."$B$BDendrite makes a quick, invisible gesture in the air above him. A slight aura of power falls over him.$B$B"The first perspective of nature you must adapt to is that of the bear. I will put you on the path to understanding this aspect of druidic life, but it is you that must embrace it and propagate it - now and forever!"' WHERE `entry`=5921;
UPDATE `quest_template` SET `OfferRewardText`='"And so it begins. Father Cenarius. And so it begins."$B$BDendrite makes a quick, invisible gesture in the air above him. A slight aura of power falls over him.$B$B"The first perspective of nature you must adapt to is that of the bear. I will put you on the path to understanding this aspect of druidic life, but it is you that must embrace it and propagate it - now and forever!"' WHERE `entry`=5922;
UPDATE `quest_template` SET `OfferRewardText`='I am glad you found your way here today. young $C. The time has come for you to take a large step into a much larger world.$B$BInside each of Cenarius'' children is the call to serve nature. Animals and plants are our friends as well as our charges. We choose to devote our lives as preservers of balance for their sakes as well as our own. Your first step into this world will be to learn of the ways of the bear, and to learn strength of body and heart.$B$BReady yourself!' WHERE `entry`=5923;
UPDATE `quest_template` SET `OfferRewardText`='I am glad you found your way here today. young $C. The time has come for you to take a large step into a much larger world.$B$BInside each of Cenarius'' children is the call to serve nature. Animals and plants are our friends as well as our charges. We choose to devote our lives as preservers of balance for their sakes as well as our own. Your first step into this world will be to learn of the ways of the bear, and to learn strength of body and heart.$B$BReady yourself!' WHERE `entry`=5926;
UPDATE `quest_template` SET `OfferRewardText`='Dendrite makes another invisible gesture in the air above him as you approach. Another aura of power comes over him. and he smiles ever so slightly.$B$B"I sense wisdom in you, young one, that was not present when we first met. You gaze upon me with strength and knowing intent, though this intent is yet not focused. You will now learn to focus your strength and adopt the nature of the bear into your work."' WHERE `entry`=5929;
