UPDATE `quest_template` SET `OfferRewardText`='Ah yes, there they are.  Together they weave a powerful spell, one that will raise the spirits of Darrowshire.$B$BWith that spell, and with a little luck, we can save Joseph Redpath!' WHERE `entry`=5941;
UPDATE `quest_template` SET `OfferRewardText`='Great, you got him!  And I hope you taught his gang a lesson too!' WHERE `entry`=6021;
UPDATE `quest_template` SET `OfferRewardText`='Very resourceful, Gregor is. He''s been dealing with the Steamwheedle Cartel for some time now, and has become an expert on the "art" of goblin negotiations. Though it''s true that the goblins'' primary loyalties lie with those who have the largest coin purses, they also know and respect the value of diplomacy. If anything, it provides them with repeat customers...$B$BAt any rate, the Argent Dawn acknowledges you for your effort. Please have this, with our thanks.' WHERE `entry`=6028;
UPDATE `quest_template` SET `OfferRewardText`='Resourceful for a human, Gregor is.  He''s been dealing with the Steamwheedle Cartel for some time now, and has become an expert on the "art" of goblin negotiations.  Though it''s true that the goblins'' primary loyalties lie with those who have the largest coin purses, they also know and respect the value of diplomacy.  If anything, it provides them with repeat customers...$B$BAt any rate, the Argent Dawn acknowledges you for your effort.  Please have this, with our thanks.' WHERE `entry`=6029;
UPDATE `quest_template` SET `OfferRewardText`='Ah, you brought the cloth.  Such fine material it is!$B$BThank you, $N.  You are a true friend.  Please accept this in exchange.' WHERE `entry`=6031;
UPDATE `quest_template` SET `OfferRewardText`='' WHERE `entry`=6089;
UPDATE `quest_template` SET `OfferRewardText`='A fledgling $C. I see. Yes. I can bestow you with the skills you need to train and guide your pet. Not only will you be able to teach your pet new abilities, you will now be able to feed your pet, as well as revive it, should it fall in battle.$B$BRemember, $N, always respect the balance and live in awe of nature around you. Now, go forth. We shall speak again, at a later date.' WHERE `entry`=6103;
UPDATE `quest_template` SET `OfferRewardText`='By Elune, this water is disgusting! No wonder the deer are sick.$B$BSomething is polluting the water, and in turn corrupting Darkshore''s entire water table. Sick deer have been seen all over area, and not just by the river. While this water is most likely a primary source of the sickness spreading, there''s something else at work here.$B$BThis water, believe it or not, will help us formulate a cure. While I research this water, I have need of some items to formulate a cure...' WHERE `entry`=6122;
UPDATE `quest_template` SET `OfferRewardText`='This is good, $N, so much so that it should be enough to make some ample doses of the salve - at least enough to start to make a difference.$B$BMaking a cure for poisons can be quite difficult at times because each one often requires a very specific antidote to counteract it. Imagine being able to cure a poison at will without having to worry about the exact ingredients of what the antidote must be!$B$BNow, let me get to work on this!' WHERE `entry`=6123;
UPDATE `quest_template` SET `OfferRewardText`='Perfect mon, this is just what the witch doctor told me to do for my headache. He says, ""Mai''Lahii - go fish. It''ll make you feel better""$B$BWell, I feel better already, thanks mon!' WHERE `entry`=6142;
UPDATE `quest_template` SET `OfferRewardText`='As sweet as it is hearing the news that the naga have been vanquished, my heart still feels empty. For the rest of my life I will be dedicated to having them all killed.$B$BHere mon, your reward as I promised. It''s small in comparison to the gratification of knowing the naga fried for their hated act upon my crew.' WHERE `entry`=6143;
UPDATE `quest_template` SET `OfferRewardText`='I wonder... did it beg for mercy? Could it know what mercy is?$B$B<Nathanos spits.>$B$BI will hang this beast''s head upon my wall.$B$BYou have earned a spot amongst one of my champions, $N.$B$B<Nathanos salutes.>' WHERE `entry`=6163;
UPDATE `quest_template` SET `OfferRewardText`='There it is!  And oh my!  I forgot how full it was!$B$BThis is a glorious day, $N!  Stupendous!  Insanely good, I say!' WHERE `entry`=6164;
UPDATE `quest_template` SET `OfferRewardText`='<Mathias nods.>$B$BI had faith that Wrynn would send me men and women of honor - the most dedicated soldiers of the Alliance.' WHERE `entry`=6183;
UPDATE `quest_template` SET `OfferRewardText`='Rutger. Fredo. Turyen. All... dead...$B$B<Flint clutches the insignias tightly.>$B$BWhere were they? Did you discover any more information about this monster, the Blightcaller?' WHERE `entry`=6185;
UPDATE `quest_template` SET `OfferRewardText`='Ah, a new bundle of hides. I will get to work on these immediately!$B$BThank you, brother. You have done me a great service. Here are some coins to pay for your time and travel costs.' WHERE `entry`=6362;
UPDATE `quest_template` SET `OfferRewardText`='You have to get this meat to Orgrimmar? That is no problem. For a small fee, my wind rider can take you there.' WHERE `entry`=6365;
UPDATE `quest_template` SET `OfferRewardText`='Oh, wonderful! Those are fine cuts! These are from Zargh, are they? That orc sure knows his way into a lady''s heart...$B$BOh, I can''t wait to cook it. But not too much! Meat is best served rare, don''t you think?' WHERE `entry`=6384;
UPDATE `quest_template` SET `OfferRewardText`='Hah! I guess she liked it! Nothing brings red to a lady''s cheeks like a big, juicy steak!$B$BThank you, $N. You''ve done me a great service. Here is some money for your trouble, and don''t be surprised if I invite you to my wedding!' WHERE `entry`=6386;
UPDATE `quest_template` SET `OfferRewardText`='Haha! Thank you, $N! You''ve done it! My father''s spirit can now rest and I can live in peace.$B$BThank you again. If there is anything I can do for you, please, just ask.' WHERE `entry`=6389;
UPDATE `quest_template` SET `OfferRewardText`='You have done a good deed today, $N. Although our struggle against the Scourge continues, let us hope that Marla and Samuel will find peace together in their final resting place.' WHERE `entry`=6395;
UPDATE `quest_template` SET `OfferRewardText`='This amulet will grant you the access that you seek. The lair of Onyxia can be found in Dustwallow Marsh. As long as you hold the amulet, her wards cannot prevent you from entering.$B$BThe Blue Flight wishes you luck, $N.' WHERE `entry`=6502;
UPDATE `quest_template` SET `OfferRewardText`='Kaya is alive! $N, I have you to thank for rescuing her.' WHERE `entry`=6523;
UPDATE `quest_template` SET `OfferRewardText`='Kelris has eluded the Argent Dawn for some time.$B$BFor some time they considered him dead or missing.$B$BBy ending his reign you have spared the lives of many innocent people, $N.$B$BEarthmother be praised! To sacrifice another to a servant of an Old God for personal gain is beyond disgusting!$B$BYou have done a great thing this day. Kelris was a creature of evil and sought to bring the world back to a time of chaos by worshipping such creatures as the Old Gods. Thank you, $N.' WHERE `entry`=6561;
UPDATE `quest_template` SET `OfferRewardText`='<Myranda holds the note, pauses, then smiles.>$B$BHow is he? Rexxar, I mean. Oh, come now, do not look so confused. The letter was left intentionally blank. It carried with it the intentions and thoughts of its creator. Judging from its contents, it is no wonder Rexxar left it as such. Imagine if you were captured or slain and this information discovered!$B$BOh, nevermind! Myranda will help you, $R. I owe the Warchief a favor or two.$B$B<Myranda smiles.>' WHERE `entry`=6568;
UPDATE `quest_template` SET `OfferRewardText`='''Course, you must be a friend of Lumak''s.$B$BFishin''? I can tell you all ''bout fishin''.' WHERE `entry`=6608;
UPDATE `quest_template` SET `OfferRewardText`='' WHERE `entry`=6722;
UPDATE `quest_template` SET `OfferRewardText`='Yes $C, thank you for coming. I apologize about the misunderstanding... the air is thick with mistrust between the Arch Druid here and Keeper Remulos in Moonglade. Each suspect the other of chicanery, and the fact that strange corruptions of Teldrassil continue unabated are still an issue here. It does little to quell mistrust.$B$BRegardless, our duty to the Cenarion Circle remains... even if those who lead it may disagree with one another.' WHERE `entry`=6761;
UPDATE `quest_template` SET `OfferRewardText`='I am Rabine Saturna, and on behalf of Keeper Remulos and all of the denizens of this sacred glade I bid you welcome.$B$BI appreciate your interest and eagerness to assist the Cenarion Circle. I also know that Arch Druid of Darnassus expressed his displeasure to you in your lending us aid. Rest assured that it is for the greater good, and that you will be safe from any ill-conceived repercussions you may be the target of.$B$BYou are among friends here, $N.' WHERE `entry`=6762;
UPDATE `quest_template` SET `OfferRewardText`='You have the hands!  You defeated the fire captains!  I would not have thought it possible, had I not known you and what you are capable of.$B$B$N, your exploits are without number, but word of this last feat will send waves among the Waterlords.  Your name may one day be legend to us.$B$BSpeak with me again, $N.  I may have yet another task...' WHERE `entry`=6824;
UPDATE `quest_template` SET `OfferRewardText`='You''re quite the helper to ol'' Greatfather Winter there, $N.  Have a great Feast of Winter Veil.$B$BHere''s a little something... you know, for the effort.' WHERE `entry`=6962;
UPDATE `quest_template` SET `OfferRewardText`='Y-y-you can h-h-hear me!  Thank the b-b-bottom line!$B$BI''m not really a s-s-snowman - my n-n-name is Sacks, and I w-w-work for the Orgrimmar b-b-branch of Smokywood Pastures... I g-g-got sent out here to look for a m-m-missing package, when I was attacked by a c-c-creature I have never seen b-b-before!$B$BSo v-v-very cold...' WHERE `entry`=6963;
UPDATE `quest_template` SET `OfferRewardText`='The Feast of Winter Veil, you say?  Alas, in times past it held a more substantial meaning to us tauren.  Nowadays, it seems as though others have turned the legend of this season of renewal into something that helps to sell candies and presents.$B$BIt''s no surprise that Furmund is bitter about that sort of change.  He and other tauren like him cling to our past like a banner of war.  While I think a little celebration is always good, it is important to remember the origins of the Feast.' WHERE `entry`=6964;
UPDATE `quest_template` SET `OfferRewardText`='You found it!  You''ve saved Smokywood Pasture''s Feast of Winter Veil!$B$BPoor Sacks... we''ll be sure to send a team out there and figure out a way to unfreeze him.  Hopefully, he''ll be back in time for the day of the Feast; he''ll need to make up missed time working though.  Still, this wouldn''t even be possible if it weren''t for you!' WHERE `entry`=6983;
UPDATE `quest_template` SET `OfferRewardText`='Ho ho hello, adventurer!$B$BThe goblins told me that you have earned a special gift this holiday season, and I am pleased to give it to you.  Here you go - have a wondrous Feast of Winter Veil this and every season in the future.' WHERE `entry`=6984;
UPDATE `quest_template` SET `OfferRewardText`='I can only hope that those charged with collecting ram hides are as determined as you, $N.$B$BAt this rate, we will have the stables full in a matter of hours!' WHERE `entry`=7001;
UPDATE `quest_template` SET `OfferRewardText`='<The brave nods at you in clear approval of your handling of the torch>$b$bLet these vrykul feel the heat of the land. Let them know the fear they would instill in others!' WHERE `entry`=11258;
UPDATE `quest_template` SET `OfferRewardText`='Splendifimous!  Not only am I glad to see that you''ve returned with the residue, but also with all your major appendages intact!  That is, well, there was never any danger in using the Ultra-Shrinker, now was there!$B$BI do appreciate your effort on my behalf, $N.  Truly, you are a friend to goblins everywhere.  Accept this as a token of my appreciation!' WHERE `entry`=7003;
UPDATE `quest_template` SET `OfferRewardText`='Ho ho hello. I am Greatfather Winter, and I - courtesy of the fine folks of Smokywood Pastures... "Fresh from our farm to your plate, it''s Smokywood Pastures wholesome goodness" - would like to wish you a fantastic Feast of Winter Veil.$B$BIf you''ve been good this year, maybe you will receive treats from Smokywood Pastures as your treat for the Feast of Winter Veil. Huzzah.' WHERE `entry`=7022;
UPDATE `quest_template` SET `OfferRewardText`='Ho ho hello.  I am Greatfather Winter, and I - courtesy of the fine folks of Smokywood Pastures... "Fresh from our farm to your plate, it''s Smokywood Pastures wholesome goodness" - would like to wish you a fantastic Feast of Winter Veil.$B$BIf you''ve been good this year, maybe you will receive treats from Smokywood Pastures as your treat for the Feast of Winter Veil.  Huzzah.' WHERE `entry`=7023;
UPDATE `quest_template` SET `OfferRewardText`='You''re quite the helper to ol'' Greatfather Winter there, $N.  Have a great Feast of Winter Veil.$B$BHere''s a little something... you know, for the effort.' WHERE `entry`=7025;
UPDATE `quest_template` SET `OfferRewardText`='Y-y-you can h-h-hear me! Thank the b-b-bottom line!$b$bI''m not really a s-s-snowman - my n-n-name is Sacks, and I w-w-work for the Ironforge b-b-branch of Smokywood Pastures... I g-g-got sent out here to look for a m-m-missing package, when I was attacked by a c-c-creature I have never seen b-b-before!$b$bSo v-v-very cold...' WHERE `entry`=7042;
UPDATE `quest_template` SET `OfferRewardText`='You found it!  You''ve saved Smokywood Pasture''s Feast of Winter Veil!$B$BPoor Sacks... we''ll be sure to send a team out there and figure out a way to unfreeze him.  Hopefully, he''ll be back in time for the day of the Feast; he''ll need to make up missed time working though.  Still, this wouldn''t even be possible if it weren''t for you!' WHERE `entry`=7043;
UPDATE `quest_template` SET `OfferRewardText`='The legends and lore surrounding the Winter Veil are ones that have faded from the forefront of public though over the years.  Yes, I know that the goblins are helping to revive the season for their own ends, the fact that our people reflect upon it at least in some form does good to keep such lore alive.$B$BYour desire to go beyond the material and learn about our past is an admirable trait, young $c.  I salute your wisdom.' WHERE `entry`=7061;
UPDATE `quest_template` SET `OfferRewardText`='The Feast of Winter Veil, you say?  Alas, in times past it held a more substantial meaning to us dwarves.  Nowadays, it seems as though others have turned the legend of Greatfather Winter into something that helps to sell candies and presents.$B$BIt''s no surprise that Goli is bitter about that sort of change.  He and other dwarves like him cling to our past like a banner of war.  While I think a little celebration is always good, it is important to remember the origins of the Feast.' WHERE `entry`=7062;
UPDATE `quest_template` SET `OfferRewardText`='The legends and lore surrounding the Winter Veil are ones that have faded from the forefront of public thought over the years.  While I recognize that the goblins are helping to revive the season for their own ends, the fact that the citizenry thinks about it at least in some form does good to keep such lore alive.$B$BYour desire to go beyond the material and learn about our past is an admirable trait, young $c.  I salute your erudite nature.' WHERE `entry`=7063;
UPDATE `quest_template` SET `OfferRewardText`='This is most wonderful news, $N! Thank you!$B$BAlthough it concerns me that you were not able to bring back Zaetar''s remains, who am I to question the will of Cenarius'' first born. Perhaps now the will of the centaur will break and their thirst for blood will lesson--we can only hope.$B$BIf successful in our mission, I was given these items to reward any who aided us. You may choose one as a token of thanks.' WHERE `entry`=7065;
UPDATE `quest_template` SET `OfferRewardText`='So my brother has finally found peace? I am proud to have lived to see this day. In all his arrogance and anger, I truly thought he was lost to us, but this... this symbol of his sacrifice only proves that he is not lost--he has only been reborn. He takes his place in nature as was his duty.$B$BThank you, $N. By bringing this to me, you have secured a small amount of hope that I thought I had once lost. This seed will be important to the people of this war-torn land some day... I can sense it.' WHERE `entry`=7066;
UPDATE `quest_template` SET `OfferRewardText`='Well done! Graveyards are vital to our control of Alterac Valley. When you capture one, you help ensure the Alliance''s sovereignty here.$B$BGo now, $N. Reenter the battle, and if you see a graveyard under the Horde''s control... you know what to do!' WHERE `entry`=7081;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $N! With each graveyard under our control, the spirits of our enemies will wander more lost and aimless.' WHERE `entry`=7082;
UPDATE `quest_template` SET `OfferRewardText`='I heard of your mission''s success! That pleases me...$B$BOur troops can now charge forward with impunity, and show the Alliance that Alterac Valley is no place for them!' WHERE `entry`=7101;
UPDATE `quest_template` SET `OfferRewardText`='I received a field report stating you helped secure an enemy banner. Well done, $N! With their ranged troops out of position we can move the line of battle forward!' WHERE `entry`=7102;
UPDATE `quest_template` SET `OfferRewardText`='It''s good to see fresh troops here, $N, but with a little luck you''ll get into some action and won''t be fresh for long!$B$BSpeak with me again. I have tasks I must discuss with you....' WHERE `entry`=7121;
UPDATE `quest_template` SET `OfferRewardText`='You did it! Well done, $N!$B$BWhen we control a mine and have troops stationed there, it''s much easier to gather minerals and supplies from it.' WHERE `entry`=7122;
