UPDATE `quest_template` SET `OfferRewardText`='You retrieved the web!  Well done, $N!  Lethtendris, like many elves of her ilk, are blind to the dangers the abuse of magic can cause to our world.  They believe they are masters of magic; they do not realize that they are slaves to their own addiction.  Her death saddens me, but it was necessary.$B$BThank you, $N.  I will have the energies within the web released safely over a wide area, and then I''ll destroy it to prevent future magical exploits.' WHERE `entry`=7488;
