UPDATE `quest_template` SET `OfferRewardText`='Scrumdillyriffic!  These cores will keep me working for some time.  Add to that the benefit of there now being fewer elementals along the coast, and I might no longer cry myself to sleep at the prospect of having set up shop in perhaps the worst place imaginable!$B$BThank you, $N, for your efforts on my behalf.  While it certainly straps me financially to do this, allow me to show you some gratitude you may understand and appreciate... loot!' WHERE `entry`=7721;
UPDATE `quest_template` SET `OfferRewardText`='I hope you kicked his teeth in too, $N. Ragnaros knows, he deserved it.$B$BNow we can get down to business.' WHERE `entry`=7722;
UPDATE `quest_template` SET `OfferRewardText`='Ye''re a good lad, ye are. I got ye a lil'' present fer yer troubles.' WHERE `entry`=7723;
UPDATE `quest_template` SET `OfferRewardText`='<Hansel sneezes.>$B$BI think I''m gettin'' a cold. Damn this frigid climate!' WHERE `entry`=7724;
UPDATE `quest_template` SET `OfferRewardText`='Inconceivably fantastical, $N!  You''ve come through for me again, and for that I thank you.$B$BThank you!$B$BWhile you may find this coin to be a little less than you''re accustomed to, rest assured your great deeds on the field of goblindom are echoing through the halls of power in the Steamwheedle Cartel.  Should you need something else to do, then by all means talk to me!' WHERE `entry`=7725;
UPDATE `quest_template` SET `OfferRewardText`='Top notch, $N, top notch!  While the coin I give you might not be the most you''ll ever receive for such work, rest assured my comrades in the Steamwheedle Cartel will hear about your efforts!$B$BIf you are looking for anything else to do, then let me know.  I can always use more elemental cores and such.' WHERE `entry`=7726;
UPDATE `quest_template` SET `OfferRewardText`='Oh me achin'' feets.$B$BI figured since ye didn''t have a luffa...' WHERE `entry`=7727;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $C.  Though the extensiveness of the Zukk''ash presence will not be thwarted with anything less than a full-scale invasion, you have bought us some time so we can devise a proper strategy.$B$BI will be sure to have these carapaces analyzed; we''ll need to learn everything about them before we deal with what has unfortunately turned into a much larger issue than we had anticipated.' WHERE `entry`=7730;
UPDATE `quest_template` SET `OfferRewardText`='Impressive, $C... most impressive!  If Stinglasher is indeed one of their strongest creatures, the study of the beast will prove to be quite valuable in time.  It''s now my charge to make sure we defend ourselves long enough to take advantage of it.$B$BPlease accept this coin bounty as a token of the entire camp''s thanks, $N.  Well done.' WHERE `entry`=7731;
UPDATE `quest_template` SET `OfferRewardText`='Ah, I''ve been expecting this.  These creatures you faced... they are an ancient threat that the Horde continues to choose to ignore.  Hadoken was wise to bring this - and you - to me.$B$BThe Zukk''ash are nothing more than creatures called the silithid.  Some would think that they are a mindless nuisance, but let me assure you - they are a far, far worse threat than anything the Alliance could muster.$B$BIf you''re willing and strong enough, I could use your aid in bringing this threat to light.' WHERE `entry`=7732;
UPDATE `quest_template` SET `OfferRewardText`='Excellent, excellent!  These are going to work out incredibly well - I can already tell that they''re going to be much harder when properly cured.$B$BThanks again for your help $N.  Here - please take one of my latest creations.' WHERE `entry`=7733;
