UPDATE `quest_template` SET `OfferRewardText`='I wish I coulda been there to see the look on their faces, mon. Are they packing up their bags? Leavin'' town?$B$BYou done good, $N. Real good. Otho reward you with the big mojo.' WHERE `entry`=7843;
