UPDATE `quest_template` SET `OfferRewardText`='My dearest brother, how I will miss you...$B$BThank you for your assistance, $N. You are truly a hero in my eyes.' WHERE `entry`=7849;
UPDATE `quest_template` SET `OfferRewardText`='Ah, you brought the jerkins.  Splendid.  What animal''s skin did you use to make these, may I ask?  The stitch-work is very well done, and the texture of the leather has a rugged style to it.  I can tell you are a craftsman of skill!$B$BThank you, $N, and here are your tickets.' WHERE `entry`=7882;
UPDATE `quest_template` SET `OfferRewardText`='Great, you made them!  These will do nicely... I just hope I won''t be the one to clean the crocolisk cage when the time comes.  Those beasts can be rather beastly, don''t you think?$B$BHere are your tickets, $N.  Enjoy them, and enjoy your stay at the Darkmoon Faire!' WHERE `entry`=7884;
UPDATE `quest_template` SET `OfferRewardText`='Welcome to the Darkmoon Faire!  This voucher is good for FIVE, yes, FIVE prize tickets!$B$BWhen you accumulate prize tickets, you''ll want to speak to me about redeeming them for valuable prizes.  The more tickets you get, the more prizes you can win.  Huzzah!' WHERE `entry`=7926;
UPDATE `quest_template` SET `OfferRewardText`='So you have put together a deck of Portals. Your gesture of returning it to us will create a tie between you and the Darkmoon that will not soon be forgotten. Allow me to present you with one of the greater darkmoon cards as a small token of our appreciation.' WHERE `entry`=7927;
UPDATE `quest_template` SET `OfferRewardText`='So you have put together a deck of Elementals. Your gesture of returning it to us will create a tie between you and the Darkmoon that will not soon be forgotten. Allow me to present you with one of the greater darkmoon cards as a small token of our appreciation.' WHERE `entry`=7929;
UPDATE `quest_template` SET `OfferRewardText`='Yes, $g my son : my daughter;, that is ominous-looking, and you obviously had the right of it.$B$BThank you for bringing this scroll to me. I am very keen to study its implications. If I were to hazard a guess, I would say that these vrykul have a way to transcend death; at least those that are worthy.$B$BBy defeating the Winterskorn thane, you proved him unworthy. The Light only knows what he would have become, and what terror he might have rained down upon us, had you not slain him.' WHERE `entry`=11249;
UPDATE `quest_template` SET `OfferRewardText`='You do much to honor us.  Your hands drip with the blood of Hakkar''s minions.  You are a friend to the tribe.$B$BWear these bracers.  They are the freethinker''s armguards.  This is what I mean about real power.' WHERE `entry`=8053;
UPDATE `quest_template` SET `OfferRewardText`='Your honor is assured in the tribe.  You claim many deaths in Zul''Gurub.  Enemies fall before your convictions.  Enemies fall before your power.$B$BThis is the freethinker''s belt.  It is a symbol of honor.  It is powerful mojo.  It is now yours.' WHERE `entry`=8054;
UPDATE `quest_template` SET `OfferRewardText`='You have done what few ever could.  You have brought the minions of Hakkar to their knees.  You have shown them what a freethinker can do.  You have shown us how a heretic could be revered in the tribe.  You have more than real power.  You ARE real power.$B$BTake the breastplate, freethinker.  Crush those who oppose you.' WHERE `entry`=8055;
UPDATE `quest_template` SET `OfferRewardText`='It seems ya got a bit of the Zandalar augur in ya.  We know about the deeds you''ve been doin'' in Zul''Gurub on our behalf mon.  These Paragons of Power will go a long way to helpin'' out the Zandalar tribe - a tribe, I might add, ya can call upon as friends.  Take these bracers, $N; ya earned them and then some!' WHERE `entry`=8056;
UPDATE `quest_template` SET `OfferRewardText`='You have wrought much vengeance today.  You have taken on the visage of the vindicator.  You have brought the Blood God''s minions to their knees.$B$BTake this.  It will fuel your vengeance for the future.  You are a friend to the Zandalar now.' WHERE `entry`=8058;
UPDATE `quest_template` SET `OfferRewardText`='Impressive... could you feel the mojo flowing through them?  The Paragons of Power were used as currency of sorts back when the Gurubashi Empire ruled these lands.  Now we Zandalar will use the latent mojo inside of them to fight the second rise of the Blood God Hakkar!$B$BYou''ve done well today - consider yourself to have a friend in the Zandalar.  For that, here are the illusionist''s wraps I promised!' WHERE `entry`=8060;
UPDATE `quest_template` SET `OfferRewardText`='I sensed your arrival moments before, $N, but none too easily.  What revealed yourself to me were the Paragons of Power you brought.  I can feel the power without needing to see the trinkets; their latent mojo - raw magic, if you will - will continue to fuel our efforts of vanquishing the diabolic schemes of the Blood God Hakkar.$B$BYou are to be commended - and rewarded - for your success.  You are honored amongst the tribe, and you are worthy to wear the predator''s belt.' WHERE `entry`=8066;
UPDATE `quest_template` SET `OfferRewardText`='Success!  You shall be honored in the tribe from here on!  Zul''Gurub has certainly tasted the might of the Zandalar today, thanks to you $N.$B$BWith the tribe''s blessing, take the Zandalar illusionist''s mantle.  May it serve you well.' WHERE `entry`=8068;
UPDATE `quest_template` SET `OfferRewardText`='Success!  These will go a long way to building up our power against the rise of Hakkar.  With your help, we''ve taken a significant step in ensuring that the Blood God will not destroy us all.$B$BYou''ve earned honor with the tribe today, $N.  Take this - the confessor''s bindings - as a symbol of our thanks.' WHERE `entry`=8070;
UPDATE `quest_template` SET `OfferRewardText`='I can smell the scent of vanquished evil on ya, $N.  It''s a sweet smell mon... one I think you know quite well.$B$BI know it''s no small feat to have brought me the Paragons of Power required for the belt.  Your deeds have not only honored the tribe, but also honored yourself amongst my tribe.  Here ya are - take the augur''s belt and don it as your own!' WHERE `entry`=8074;
UPDATE `quest_template` SET `OfferRewardText`='I know what ya had to go through to bring me the Paragons of Power, $N.  It wasn''t easy, mon - defeatin'' the evil that seeps out of Zul''Gurub like a foul ooze - but now that it is all said and done, I can easily say that you''ll be revered amongst the Zandalar for ages to come!$B$BHere - take the augur''s hauberk and wear it with pride!' WHERE `entry`=8075;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $N.  The Paragons of Power from Zul''Gurub should act as a reminder of wasted power.  The Gurubashi were strong at their height, but they allowed themselves to be consumed by it.  A demoniac knows that the game they play is much similar, but the power unleashed is often the very thing needed for survival.$B$BUse this mantle as an honored ally of the Zandalar... it will serve you well.' WHERE `entry`=8076;
UPDATE `quest_template` SET `OfferRewardText`='Impressive - your victory in Zul''Gurub has assured us - nay, the world - that Hakkar will not prevail.  The time may come when you face the Blood God directly... and should this come to pass know that your reverence is assured amongst the Zandalar tribe.$B$BOh, and this simple robe should help out too I think.$B$B<Al''tabim winks knowingly at you.>' WHERE `entry`=8077;
UPDATE `quest_template` SET `OfferRewardText`='The way of the vindicator is now known to you.  You have brought honor to the tribe.  You have brought honor to yourself.  You have brought pain to our enemies.$B$BThe vindicator''s belt is yours.  You are surely becoming one with the way of the vindicator.' WHERE `entry`=8078;
UPDATE `quest_template` SET `OfferRewardText`='You are to be revered for your deeds.  The tribe rewards its heroes.  Zul''Gurub has tasted Zandalar vengeance like never before.$B$BYour deeds will herald the deeds of others to come.  They will look upon you as a sign of real power.  They will look upon you as vengeance personified!' WHERE `entry`=8079;
UPDATE `quest_template` SET `OfferRewardText`='A pleasure to meet you, $g sir : ma''am;! I look forward to working with you.$B$BSpeaking of which, we have a great deal to do.' WHERE `entry`=11248;
UPDATE `quest_template` SET `OfferRewardText`='It is no longer my purpose to hunt, but to teach the $C.  That is what fate has handed to me.$B$BCraft with me a $C''s charm -- a collection of trophies from fallen prey that will remind you of your past trials and triumphs.  In the end I will keep the charm, but reward you with something else.' WHERE `entry`=8151;
UPDATE `quest_template` SET `OfferRewardText`='You must possess keen sight and great patience to have obtained these. Well done.' WHERE `entry`=8153;
UPDATE `quest_template` SET `OfferRewardText`='Very good, $g sir : ma''am;. That couldn''t have been done without your help.$B$BI''m sure that the captain will be pleased with my report on the matter once we''re done here.' WHERE `entry`=11247;
UPDATE `quest_template` SET `OfferRewardText`='Well, $g sir : ma''am;, I have to say that you went about that particular business with a bit of zeal.$B$B<The sergeant looks at you warily.>$B$BAnyway, if you don''t mind, I''ll be taking my machete back now. It looks dull and we wouldn''t want you to accidentally slip and carve me up, too.' WHERE `entry`=11246;
UPDATE `quest_template` SET `OfferRewardText`='Excellent targeting, $g sir : ma''am;! I''ll have to remember to buy a round for the cannoneers back at the keep.' WHERE `entry`=11245;
UPDATE `quest_template` SET `OfferRewardText`='Apothecary Hanes is alive? You burned the Alliance supplies to the ground? He must''ve gotten a real kick out of that.$b$bAt any rate, the Royal Apothecary Society is in your debt, $n. We thank you from the bottom of our black, black hearts.' WHERE `entry`=11241;
UPDATE `quest_template` SET `OfferRewardText`='Wow, that horn is cold!$B$BOnce again you''ve saved Westguard Keep from certain doom. What a curious $g man : woman; you are, $N. If only there were more of you.$B$BWell, this certainly calls for a reward. Which do you prefer?' WHERE `entry`=11238;
UPDATE `quest_template` SET `OfferRewardText`='<The captain breathes a sigh of relief.>$B$BWell, that should take some of the pressure off of us.$B$B$N, time and again you have proven yourself invaluable to Westguard Keep and the Alliance at large. Pick something from the treasury, $g boy : girl;! It''s the least we can do!' WHERE `entry`=11236;
UPDATE `quest_template` SET `OfferRewardText`='It was about time. The Alliance has been a thorn in our side for a long time now.$b$bThere''s no time to celebrate, however. Look to the west, it appears we have visitors.' WHERE `entry`=11234;
UPDATE `quest_template` SET `OfferRewardText`='<A''dal''s thoughts intermingle with your own.>$B$BThe sphere... Strange. Did you know that he lived? Yes. It is here - in the sphere itself. Maimed for certain. He calls to a higher power now. No, not Illidan.$B$BHigher.$B$BKil''jaeden the Deceiver comes...$B$BNot here...$B$B<A''dal points your mind elsewhere.>$B$BAzeroth. Unknown.$B$BRest. Your brothers and sisters will retake Tempest Keep now.$B$B<A''dal hums a song of battle.>$B$B' WHERE `entry`=11007;
UPDATE `quest_template` SET `OfferRewardText`='Excellent - this set of coins will make a fine addition to our growing collection... one that we will use in the tribe''s defense against the rise of the Blood God. You''ve earned this Honor Token, $N, as well as the thanks of the tribe!' WHERE `entry`=8195;
UPDATE `quest_template` SET `OfferRewardText`='This marks undisputable victory for our forces. Anselm will be most glad to hear about this.' WHERE `entry`=11233;
UPDATE `quest_template` SET `OfferRewardText`='You gained the heads!  You have halted the plundering of our gods'' power, and weakened Hakkar!$B$BYour actions are truly heroic, $N.  May the heads of these troll thralls plead to you for mercy long after their blood chills.' WHERE `entry`=8201;
UPDATE `quest_template` SET `OfferRewardText`='*Whir* $B$B Identification of Keefer''s Angelfish complete. $B$B Your Reward is now available. $B$B *click-click* *Bzzzz*' WHERE `entry`=8221;
UPDATE `quest_template` SET `OfferRewardText`='Great job, $N!  Thanks a lot!  I''m going to make paint from this blood and turn all kinds of cheap junk into glowing treasure!$B$BHere are your tickets, and thanks again!' WHERE `entry`=8222;
UPDATE `quest_template` SET `OfferRewardText`='Thanks again, $N.  Here are your tickets!' WHERE `entry`=8223;
UPDATE `quest_template` SET `OfferRewardText`='*Whir* $B$B Identification of Dezian Queenfish complete. $B$B Your Reward is now available. $B$B *click-click* *Bzzzz*' WHERE `entry`=8224;
UPDATE `quest_template` SET `OfferRewardText`='Are you sure this is the path you seek to take, $N? This is not a decision you ought to take lightly.$B$BThis ring is imbued with a droplet from the Well of Eternity. It will grow in power as you prove yourself to the Scale of the Sands.' WHERE `entry`=10460;
UPDATE `quest_template` SET `OfferRewardText`='*Whir* Identification of Brownell''s Racer complete. Your Reward is now available. *click* *click* *Bzzzz*' WHERE `entry`=8225;
UPDATE `quest_template` SET `OfferRewardText`='Why, you found my favorite measuring tape! I love this tape! I measured some of the biggest fish I ever caught with it...$B$BBut, I lost this tape in Zul''Gurub... you''ve been to Zul''Gurub? Did you see the fabled Gahz''ranka?$B$BWell... do you want to catch him?' WHERE `entry`=8227;
UPDATE `quest_template` SET `OfferRewardText`='I see you have Lord Ravenholdt''s bag. Why didn''t you say so, boy?' WHERE `entry`=8234;
UPDATE `quest_template` SET `OfferRewardText`='The key! I thought it lost forever. Please, take an enchanted garment from my stores -- they are reserved for rogues of exceptional skill and loyalty. It should be known that $N is not to be trifled with!$B$B<Jorach opens the bag and is bathed by a golden glow from within. His eyes widen and he stares...>' WHERE `entry`=8236;
UPDATE `quest_template` SET `OfferRewardText`='Excellent - this set of coins will make a fine addition to our growing collection... one that we will use in the tribe''s defense against the rise of the Blood God. You''ve earned this Honor Token, $N, as well as the thanks of the tribe!' WHERE `entry`=8238;
UPDATE `quest_template` SET `OfferRewardText`='Excellent - this set of coins will make a fine addition to our growing collection... one that we will use in the tribe''s defense against the rise of the Blood God. You''ve earned this Honor Token, $N, as well as the thanks of the tribe!' WHERE `entry`=8239;
UPDATE `quest_template` SET `OfferRewardText`='Excellent. I will signal our ground troops to make their move.' WHERE `entry`=11232;
UPDATE `quest_template` SET `OfferRewardText`='Let me know when you''re ready to barter!' WHERE `entry`=8243;
UPDATE `quest_template` SET `OfferRewardText`='<Sanath sneers at you.>$B$BArch$C Xylem awaits your arrival.' WHERE `entry`=8250;
UPDATE `quest_template` SET `OfferRewardText`='This is a superb specimen of coral, $N.  Your skills are unquestionably precise and deadly.$B$BDo not think your efforts have gone unnoticed.  Perhaps you are worthy of a true test of your skill...' WHERE `entry`=8252;
UPDATE `quest_template` SET `OfferRewardText`='Incredible.  The shard has grown as it absorbed the drake''s energy over the long years.$B$BThere is no more I can ask of you now.  My full ability to forge the arcane has returned with this shard.  My first creation is yours, $N, and you have but to choose...' WHERE `entry`=8253;
UPDATE `quest_template` SET `OfferRewardText`='Nice work paring those mongrels down to size. My men will be able to clean up the rest.' WHERE `entry`=11230;
UPDATE `quest_template` SET `OfferRewardText`='I hope you''re ready to fight, $n. The Queen''s fleet needs you!' WHERE `entry`=11229;
UPDATE `quest_template` SET `OfferRewardText`='Yes! These are the parts to the book!  Let''s get started then, $N.$B$BSwap every third word with words from the second chapter... then swap every other word with words from the first chapter...  Wait, did I get that backwards?' WHERE `entry`=8279;
UPDATE `quest_template` SET `OfferRewardText`='I see you''re familiar with my old organization.  You must be with Cenarion Hold.  $B$BYou seek information to use against them?  Come closer, perhaps we can be of mutual assistance.' WHERE `entry`=8285;
UPDATE `quest_template` SET `OfferRewardText`='It is as it should be - the great one has risen. My watch comes to an end... ' WHERE `entry`=8286;
UPDATE `quest_template` SET `OfferRewardText`='Did you hunt down some crows, $gboy:girl;? Good $gboy:girl;, good $gboy:girl;!$b$bAh, these hounds remind me of my days raising purebreds in Tirisfal... those were good times!' WHERE `entry`=11227;
UPDATE `quest_template` SET `OfferRewardText`='Wow, you got them all!  You''re awesome!$B$BThank you for trick-or-treating for me.  Here, take these pumpkin treats - I think you''ll like them a lot!$B$BHappy Hallow''s End, $N!' WHERE `entry`=8311;
UPDATE `quest_template` SET `OfferRewardText`='Wow, you got them all!  You''re awesome!$B$BThank you for trick-or-treating for me.  Here, take these pumpkin treats - I think you''ll like them a lot!$B$BHappy Hallow''s End, $N!' WHERE `entry`=8312;
UPDATE `quest_template` SET `OfferRewardText`='Let''s have a look at that...$B$BThis seems simple enough.  They have their own names for some of the herbs, but those are simple enough to figure out.  Here, let me show you!  ' WHERE `entry`=8313;
UPDATE `quest_template` SET `OfferRewardText`='You''ve done it!  Vyral is killed!  This can only mean doom for the Twilight Hammer''s operations in Silithus. There may be more of them scurrying about, but the blow you dealt to the cult today is one from which they will not easily recover.' WHERE `entry`=8321;
UPDATE `quest_template` SET `OfferRewardText`='You have successfully completed your first task; for that, you are to be congratulated. Such success gives me faith that you will turn out better than those young blood elves who fail to heed the lessons of their masters. Continued success will be rewarded - not only with knowledge, but also with tangible rewards as well.$B$BYour work here, however, is not finished. There is much more to learn, my young friend...' WHERE `entry`=8325;
UPDATE `quest_template` SET `OfferRewardText`='The tower and surrounding areas should now be relatively secure, though only for the time being.  You have done well in providing us with a buffer of security, but we will need to reassert control over the entire isle if we are to survive here in the long run.  This will involve tackling much greater threats than errant mana wyrms and lynxes.$B$BTake this, $N - you will no doubt make good use of it for the tasks to come.' WHERE `entry`=8326;
UPDATE `quest_template` SET `OfferRewardText`='Magistrix Erona told me you''d be along quick enough, $N. The Falthrien Academy to our west - the huge floating building with the ornate spires - is in bad shape. You''re going to be leading the effort to recapture it from one of the Wretched - a $R who has forever succumbed to their basest cravings.$B$BI hope you''re ready to work. This is not only going to be a lesson about danger, but also of what happens when you forsake the realities of who you are.' WHERE `entry`=8327;
UPDATE `quest_template` SET `OfferRewardText`='Ah, $N - I believe you''re one of the new mages here on the isle, yes? Well, you''ve come to the right place. If arcane mastery is what you seek, then I can provide such knowledge - as long as you have the wherewithal to handle training costs and the capacity to focus on the lessons I''ll be teaching.$B$BLet''s get started!' WHERE `entry`=8328;
UPDATE `quest_template` SET `OfferRewardText`='Ah, very good. I''ve been working on the medallion - now with these last ingredients, I''ll be done in just a few moments...$B$BThere we are. Here is the medallion, $N.$B$BYou''ll need to wear this when you activate one of the Twilight''s Hammer''s wind stones. Put this on, along with the rest of the twilight trappings, and the Abyssal Council will see you as one of their cultist underlings.' WHERE `entry`=8332;
UPDATE `quest_template` SET `OfferRewardText`='Felendren''s head... you are to be commended, $N.  You''ve succeeded where others, like Felendren, have utterly failed.  Perhaps you are truly ready to be a contributing member of $R society.$B$BYour success here means that you are capable of surviving the greater threats that lurk in Eversong... and believe me, there are plenty to face.' WHERE `entry`=8335;
UPDATE `quest_template` SET `OfferRewardText`='Splendid - these will do nicely.  I''ve been doing quite a bit of thinking on the current malaise Sunstrider Isle suffers under.  One possible course of action I had pondered was to collect these arcane slivers from the beasts on the isle.  In doing so, they could be experimented on; this would provide a potential source of culpability.$B$BAnyway, I will tend to the research.  Allow me to place this incantation on you.  I believe you''ll make good use of it!' WHERE `entry`=8336;
UPDATE `quest_template` SET `OfferRewardText`='This is... most interesting.  And when I say interesting, I mean more disturbing than anything else.$B$BOur efforts to reassert control over the isle in the time following the destruction of the Sunwell have been a challenge.  I suspect that whatever foul source is corrupting the isle is at the heart of it all; this sliver may be of some aid in uncovering what''s really going on.$B$BYou were wise to bring this to me, $N. Take this as compensation for your diligence.  Thank you.' WHERE `entry`=8338;
UPDATE `quest_template` SET `OfferRewardText`='Ah, I see your convictions are strong. Not many will face that council of fiends!$B$BHere''s your ring, $N. May your will, and your fortune, stand firm.' WHERE `entry`=8342;
UPDATE `quest_template` SET `OfferRewardText`='What Huum says is true. I believe I know how to summon a lord of the Abyssal Council! Listen on, and I will explain...' WHERE `entry`=8343;
UPDATE `quest_template` SET `OfferRewardText`='Well done!  Yes, this should be enough essence to get started on my research.  I have a strong feeling that this tainted essence will be just the thing... the window, as I mentioned.$B$BFollowing the orders of your masters is highly recommended as a young $C.  As I promised you, here is the reward for obeying instructions and completing them in a competent manner - the knowledge to summon and bind your own imp.$B$BUse it well, $N' WHERE `entry`=8344;
UPDATE `quest_template` SET `OfferRewardText`='Ah, $N - thank you for sharing your experience at the Shrine of Dath''Remar. First off, you should be commended for your sense of duty and respect - it will serve you well not only here, but in all of Azeroth as well.$B$BAs for the odd sensation, it is no doubt a contributing part of the taint that has befallen Sunstrider Isle. We shall keep an eye on it; thank you for alerting us to it!' WHERE `entry`=8345;
UPDATE `quest_template` SET `OfferRewardText`='I knew you were a tough $C the minute I saw you walk into Cenarion Hold. Keep it up!' WHERE `entry`=8348;
UPDATE `quest_template` SET `OfferRewardText`='Good to see you again, $C! So you had a medallion made? Good -- you''ll need that for your next quest...' WHERE `entry`=8349;
UPDATE `quest_template` SET `OfferRewardText`='Yes, that''s right, $N. I have a very tough task ahead...' WHERE `entry`=8351;
UPDATE `quest_template` SET `OfferRewardText`='You... you did it! You did it, $N! Here! Take this. It''s the biggest chest we had lying around and I filled it with some of the best stuff we found.' WHERE `entry`=8352;
UPDATE `quest_template` SET `OfferRewardText`='Too funny!  Well done, $N! Here''s your treat.$B$BHappy Hallow''s End!' WHERE `entry`=8353;
UPDATE `quest_template` SET `OfferRewardText`='Too funny!  Well done, $N! Here''s your treat.$B$BHappy Hallow''s End!' WHERE `entry`=8354;
UPDATE `quest_template` SET `OfferRewardText`='You are truly mighty, haha! Well done, and thanks for being such a good sport. Here''s your candy.$B$BHappy Hallow''s End, $N!' WHERE `entry`=8356;
UPDATE `quest_template` SET `OfferRewardText`='You''re quite the dancing machine, $N!$B$BHere''s your treat for being such a good sport. Happy Hallow''s End, and give my best to your sick little friend! I hope they get better soon.' WHERE `entry`=8357;
UPDATE `quest_template` SET `OfferRewardText`='You are truly mighty, haha! Well done, and thanks for being such a good sport. Here''s your candy.$B$BHappy Hallow''s End, $N!' WHERE `entry`=8359;
UPDATE `quest_template` SET `OfferRewardText`='Hah! You did it, $N! The Twilight''s Hammer will soon be crushed!' WHERE `entry`=8361;
UPDATE `quest_template` SET `OfferRewardText`='I knew you''d come through, $N! Here''s your reward.' WHERE `entry`=8364;
UPDATE `quest_template` SET `OfferRewardText`='War comes, $N, and with it comes untold horrors. You have done all that could be asked of you and for that you should be rewarded.$B$BShould this... this prophecy ever come to pass...$B$B<Geologist Larksbane turns pale.>$B$BThe future of us all could be at an end.$B$BThese armaments will prove invaluable to your campaign in this desert.' WHERE `entry`=8381;
UPDATE `quest_template` SET `OfferRewardText`='Cannons are holding us back? I''ll show them cannons.' WHERE `entry`=11221;
UPDATE `quest_template` SET `OfferRewardText`='Very well, $C! Let''s see what you''re made of.' WHERE `entry`=8415;
UPDATE `quest_template` SET `OfferRewardText`='Wow! You are too kind. Especially for a $C!$B$B<Impsy holds the felcloth to his face.>$B$BOh how I love the feel of it, the way it burns your skin and weaves evil thoughts through the mind...' WHERE `entry`=8420;
UPDATE `quest_template` SET `OfferRewardText`='You continue to prove your competence, $n. Hopefully this toxin will be enough to boost our plague to the levels that we need to.$b$bAt the very least it should help weaken the recipient and make them more susceptible to infection.' WHERE `entry`=11168;
UPDATE `quest_template` SET `OfferRewardText`='It''s good that you''re back in one piece. The danger of becoming infected from handling these containers is not non-existent. I suppose I should''ve warned you about that earlier.' WHERE `entry`=11167;
UPDATE `quest_template` SET `OfferRewardText`='This will make a fine meal for the men.$b$b<The chef leans in closer to whisper in your ear.>$b$bHere, deary, take some for yourself. You look like you could use some more meat on your bones!' WHERE `entry`=11155;
UPDATE `quest_template` SET `OfferRewardText`='Take his ring, $N. It has served its purpose for Malfurion. It shall now serve a new purpose for you...' WHERE `entry`=8447;
UPDATE `quest_template` SET `OfferRewardText`='Ah... I have heard the word on the wind about those not of our tribe who seek to ally themselves with the Timbermaw furbolgs. I welcome you, but you must be warned that my tribe reacts poorly to strangers.$B$BThese are trying times, and we can only trust those who choose to fight the corruption of the land alongside of us... and have proven themselves to us accordingly.  Those who have not done so will be met with open hostility should they enter the Hold.' WHERE `entry`=8462;
UPDATE `quest_template` SET `OfferRewardText`='Excellent work, $N.' WHERE `entry`=8463;
UPDATE `quest_template` SET `OfferRewardText`='Greetings, $C - I stand guard here as both a speaker for the Timbermaw here in Winterspring and as a defender of the tribe.$B$BOur Winterfall brethren here in this frigid land have fallen under the same corruptive sway as the furbolg of Felwood. If you''ve come here offering the Timbermaw furbolgs aid, then we are ready to accept such an offer.' WHERE `entry`=8465;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $N!  I will make sure that your deeds are known amongst my kind.$B$BRemember to bring any of the feathers you find to me.  I will continue to accept them as long as necessary.' WHERE `entry`=8467;
UPDATE `quest_template` SET `OfferRewardText`='That scoundrel, Thaelis, finally met his fate.  Good job, $N.  Things should be quiet with the Wretched for a while.' WHERE `entry`=8468;
UPDATE `quest_template` SET `OfferRewardText`='You''ve done well, $N.  With our arcane sanctums not operating at full capacity, these power cores will go a long way in supplementing our needs.' WHERE `entry`=8472;
UPDATE `quest_template` SET `OfferRewardText`='So, it is done. Curse these times that have driven us to desperate measures... and curse our enemy, the Scourge!$B$BLearn this, $N. Our lands must be protected, no matter what the cost. We shall prevail!' WHERE `entry`=8473;
UPDATE `quest_template` SET `OfferRewardText`='This... this pendant.  I gave it to Old Whitebark after his people helped us rebuild our village.I guess this means he''s...<clears her throat as she regains her composure.>I appreciate you bringing this to me, $N.  There is something I''d like to ask of you.' WHERE `entry`=8474;
UPDATE `quest_template` SET `OfferRewardText`='There''s truth to the rumors! This hammer is light and strong at once; I shall manage to complete several of my unfinished projects.  And of course, I''ll let you have first pick. ' WHERE `entry`=8477;
UPDATE `quest_template` SET `OfferRewardText`='Ya, $Gdad:mon;.  Zul''Marosh had this comin''.  He burn down Ven''jashi''s village.  I kill many Amani before they put me in this cage.  I hide something in the sand, my gift for you now.$B$BAh... ah, the poison... it spread now, mon.  Time to rest...' WHERE `entry`=8479;
UPDATE `quest_template` SET `OfferRewardText`='You''ve... you''ve saved us!  Your defeat of the demon Xandivious has ensured the safety of Timbermaw Hold for years to come.  You are truly a hero amongst our kind.$B$BPlease, accept this with our blessing.  Though the healing process will be slow amongst the furbolgs - and the conflict will still go on - you have given the Winterfall something they never had before this day.$B$BThey have a chance at survival.' WHERE `entry`=8481;
UPDATE `quest_template` SET `OfferRewardText`='Indeed, this is a most fortuitous turn of events.  Were a lasting peace to be made with these creatures, this would certainly give us an advantage in the affairs of Kalimdor... one that the Night Elves cannot support on their own.  I will notify the other leaders of the Alliance of this immediately, and further diplomats will be dispatched!$B$BAs for you, $N... you have shown courage in both diplomacy and in action.  I thank you, as does the whole of the Alliance.' WHERE `entry`=8484;
UPDATE `quest_template` SET `OfferRewardText`='Excellent.  The defenses should hold off the Scourge a bit longer.  Thank you for lending us a hand, $N.' WHERE `entry`=8490;
UPDATE `quest_template` SET `OfferRewardText`='These will do perfectly, $N. Take this piece of armor as a reward. I''ll be able to make more with the pelts you brought me.' WHERE `entry`=8491;
UPDATE `quest_template` SET `OfferRewardText`='You did it, lad! We''ll get those copper bars onto the pile and put them to good use making the war materiel right away. It''s the efforts of people like you that make me proud to serve the Alliance. Good work, soldier!$B$BAnd if you should happen to come across more copper bars, make sure that they find their way to me.' WHERE `entry`=8492;
UPDATE `quest_template` SET `OfferRewardText`='Excellent work, $N. Your part in the attack on Hive''Ashi has been noted.' WHERE `entry`=8501;
UPDATE `quest_template` SET `OfferRewardText`='Excellent work, $N. Without their workers, the silithid will have a hard time repairing any damage inflicted to their hive''s structure.' WHERE `entry`=8502;
UPDATE `quest_template` SET `OfferRewardText`='' WHERE `entry`=8504;
UPDATE `quest_template` SET `OfferRewardText`='' WHERE `entry`=8506;
UPDATE `quest_template` SET `OfferRewardText`='Very well, $N  I''ve prepared a set of tasks that should make optimal use of your skills.$B$BWith the continued efforts of you and people like you, our enemy will soon be vanquished once and for all!$B$BShould you require a new mission briefing, return to Captain Blackanvil.' WHERE `entry`=8507;
UPDATE `quest_template` SET `OfferRewardText`='' WHERE `entry`=8510;
UPDATE `quest_template` SET `OfferRewardText`='Golly, that sure is a lot of medium leather that you''ve brought round, sir! I''m gonna make sure that all of that gets put to proper use, yes indeed. With your help we''ll have filled our estimation for medium leather in no time!$B$BThanks, $N!' WHERE `entry`=8514;
UPDATE `quest_template` SET `OfferRewardText`='You did it again! That is simply amazing how you go out there, collect all of this stuff, and then bring it back here and hand it over. I tell ya, when they find out how much you''ve been helping out around here you''re not going to be able to walk down the street without people asking you for your autograph!$B$BThanks again for your very generous donation of thick leather, $N.' WHERE `entry`=8516;
UPDATE `quest_template` SET `OfferRewardText`='You are to be commended, $N. While there are those that would take advantage of the economics of our war footing to line their pockets in a fervor of greed, you have proven time and again that your devotion to the Alliance, and indeed to all of Azeroth, comes first.$B$BBlessings of Elune be with you always!' WHERE `entry`=8518;
UPDATE `quest_template` SET `OfferRewardText`='You are such a selfless person. Thank you very much for your contribution to the war effort. It''s people like you that are going to make the difference between success and failure at Ahn''Qiraj. I just hope that all of this will be enough.$B$BThanks again, $N.' WHERE `entry`=8521;
UPDATE `quest_template` SET `OfferRewardText`='' WHERE `entry`=8527;
UPDATE `quest_template` SET `OfferRewardText`='Your efforts are greatly appreciated, $N. I''ll read these scouting reports right away, feel free to go over your next assignment.' WHERE `entry`=8534;
UPDATE `quest_template` SET `OfferRewardText`='Good job, $N. Here''s your next assignment.' WHERE `entry`=8535;
UPDATE `quest_template` SET `OfferRewardText`='Good job, $N. Here''s your next assignment.' WHERE `entry`=8537;
UPDATE `quest_template` SET `OfferRewardText`='You have achieved a great accomplishment for our cause today, $N. You''ve vanquished some of our most powerful enemies. For that I greatly commend you.' WHERE `entry`=8538;
UPDATE `quest_template` SET `OfferRewardText`='Excellent work, $N. You''re a worthy ally.' WHERE `entry`=8539;
UPDATE `quest_template` SET `OfferRewardText`='This be a good start for you an me, $C. That be another twenty mithril bars that I can be puttin'' on the stacks an checkin'' off of the list. It all gonna be put to good use makin'' the war materiel.$B$BBe makin'' sure that you check back in with me ''cuz you know it be lookin'' like we gonna need even more of those mithril bars.' WHERE `entry`=8545;
UPDATE `quest_template` SET `OfferRewardText`='Ugh, what''s that smell? Ack, it''s you! Well, I guess I did send you on a smelly job!$B$BThank you, $c. Don''t worry, I''ll get this stuff back to Petrov as soon as we get out of here.$B$B<Feknut yells out loud to the explorers.>$B$BYou hear that guys? Lets get the hell out of here!!!' WHERE `entry`=11154;
UPDATE `quest_template` SET `OfferRewardText`='You are indeed a special hero, $N. We welcome you to the world of Azeroth, and offer you one of these unique gifts!' WHERE `entry`=8547;
UPDATE `quest_template` SET `OfferRewardText`='$N - your name has passed my ears as one seeking out a master in the ways of the $C.  You look capable enough, but I seek more than just looks from my students.  You must be ready to delve where others fear to look to gain your power.  I will teach you, but I will not tolerate failure.$B$BThere will be monetary costs associated with your training, but you should be more concerned with the cost your mind is willing to make.  If you are ready, we shall begin.' WHERE `entry`=8563;
UPDATE `quest_template` SET `OfferRewardText`='Welcome, $N - I am Matron Arena. I offer my services to those who seek to learn the ways of the $C. Such a path is often misconstrued as a path of pacifism; for we blood elves, this couldn''t be further from the truth. While we do mend both bone and spirit, we also act as a fist of vengeance for those who would transgress against us.$B$BI will train you, but all I ask is that you cover any training costs that may come up, and that you learn with an open mind. If you agree to this, we may begin.' WHERE `entry`=8564;
UPDATE `quest_template` SET `OfferRewardText`='' WHERE `entry`=8579;
UPDATE `quest_template` SET `OfferRewardText`='This no joke, $C? You bring Pele''keiki firebloom that fast? Pele''keiki count them up right now, mon! You makin'' Pele''keiki so happy, he be tellin'' everyone, $N best firebloom collector ever! Pele''keiki can''t wait for war to start. Now we really light up the sky over Silithus, right, bruddah?!' WHERE `entry`=8581;
UPDATE `quest_template` SET `OfferRewardText`='Excellent and precise work, $N. Your diligence is to be commended, as is your celerity. I will personally see to it that none of these purple lotus go to waste.$B$BThank you again, and should you come by more purple lotus do not hesitate to bring them to me with utmost haste.' WHERE `entry`=8583;
UPDATE `quest_template` SET `OfferRewardText`='You da mon, mon! Thank you so much for the heavy leather. Every little bit gets us that much closer. I''ll just get these onto a pile so that the other leatherworkers can get to work on them.$B$BThanks again, $N, and if you come across more stacks of heavy leather, you know where you can find me.' WHERE `entry`=8589;
UPDATE `quest_template` SET `OfferRewardText`='Excellent! This will help fuel the flames of war for days to come.' WHERE `entry`=236;
UPDATE `quest_template` SET `OfferRewardText`='You did it, $N, I knew that you would! Once again, thank you on behalf of the entire Horde. Your efforts have been noted and are greatly appreciated. And if you find yourself with more thick leather that you''d like to donate, bring them to me here.$B$BLok''tar Ogar, $C!' WHERE `entry`=8591;
UPDATE `quest_template` SET `OfferRewardText`='You continue to serve us well, $n. Our pact remains in place.' WHERE `entry`=8595;
UPDATE `quest_template` SET `OfferRewardText`='<Narain''s face glows a bright red.>$B$BBooknap my... book, will they!? I''ll teach them what it means to mess with a psychic gnome!' WHERE `entry`=8598;
UPDATE `quest_template` SET `OfferRewardText`='Practice, practice, practice. A well honed knife and the skill to use it will get you far in this world, $N. Looks like the edges on these skins are better than the last. Did you buy a new knife?$B$BIn any case, we thank you for your efforts. Your donation has been noted, and will be put to good use I can assure you. Should you find yourself in the possession of more rugged leather, be sure to come back and speak with me, as I will probably need it.' WHERE `entry`=8601;
UPDATE `quest_template` SET `OfferRewardText`='You are an honorable $C, $N! I will see to it that these bandages get into the right hands. You have my thanks, and that of the Horde.$B$BGo in peace, and return to me again should you find yourself with excess wool bandaging. We can use all of the help that we can get here.' WHERE `entry`=8605;
UPDATE `quest_template` SET `OfferRewardText`='' WHERE `entry`=8612;
UPDATE `quest_template` SET `OfferRewardText`='' WHERE `entry`=8616;
UPDATE `quest_template` SET `OfferRewardText`='Fantastic! I can''t believe you went through the hassle! Are you some kind of machine? If it were me, I would have probably just let the world implode.$B$BI tip my turban to you, sir. And no good deed should go unrewarded.' WHERE `entry`=8620;
