UPDATE `quest_template` SET `OfferRewardText`='Oh, my Smokywood supplies! Splendid! I''ll need these to feed all the people in town for the celebration!$B$BThank you, $N. Please take this as payment, and don''t forget to drink and dance with the revelers outside!' WHERE `entry`=8860;
UPDATE `quest_template` SET `OfferRewardText`='Oh, very good! These supplies will help feed all our people, here to celebrate the new year!$B$BI thank you, $N. You are in my debt. Please, take these coins... and heed my advice - drink heartily from the kegs outside, and join our revelers in a dance of celebration!' WHERE `entry`=8861;
UPDATE `quest_template` SET `OfferRewardText`='Very well then - I accept these coins of ancestry. Please take Elune''s candle with my blessing. Also, please enjoy these complimentary fireworks.$B$BMay your Lunar Festival be joyous and filled with merriment, $N.$B$BAnd if you choose to face Omen and his minions, you will find Elune''s candle quite useful...' WHERE `entry`=8862;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $N.$B$BNow that you''re in the spirit of things, why don''t you take this invitation to the festival in Moonglade.$B$BIt''s quite an enjoyable celebration, if you have the time to spare.  We share food, drink, stories and of course... more fireworks!$B$BOpen the invitation while standing inside the circle of greater moonlight and you''ll be transported to Moonglade.' WHERE `entry`=8867;
UPDATE `quest_template` SET `OfferRewardText`='Welcome, $N.  Are you here to join in the festivities?' WHERE `entry`=8871;
UPDATE `quest_template` SET `OfferRewardText`='$N, welcome to Nighthaven, host of the Lunar Festival!  Although our village is normally remote and sequestered from the peoples of Azeroth, during this time of celebration we open our arms and hearts to all.$B$BEnjoy your visit, $n, and speak with me or my sister again when ready.' WHERE `entry`=8883;
UPDATE `quest_template` SET `OfferRewardText`='A job well done. by the smell of it, I''d say you returned all that I asked for, and possibly more. I''m sure we can find some use for these, in a stew, or somesuch.$B$BAlas, it does not appear that your efforts have done the trick; the murlocs are not in retreat. This calls for more direct action! ' WHERE `entry`=8884;
UPDATE `quest_template` SET `OfferRewardText`='At last! Though the Grimscale did not route. as hoped, it was entertaining to watch them panic in confusion when you laid low their so-called chieftain. You have my thanks, and the gratitude of the sin''dorei of Silvermoon City!$B$BPlease, take one of these in thanks for the service that you have rendered. ' WHERE `entry`=8885;
UPDATE `quest_template` SET `OfferRewardText`='Oh you sweet, sweet $C! I had no idea that those disgusting Grimscale murlocs had also pirated away with my navigation rudders! Without them, I would have no chance of navigating the seas again once we retake the anchorage and repair the ship.$B$BThank you very much! Here, take this coin as a sign of my appreciation.' WHERE `entry`=8887;
UPDATE `quest_template` SET `OfferRewardText`='No! I was too late. It is all my fault.$B$BMy investigation into purifying alternative magical sources got out of hand before I could put a stop to it. If only I had gone myself... or that they had listened to me, and heeded my warnings!$B$BI have blood on my hands, $C. I thank you, though, for putting to rest the tortured souls of my former apprentices. It is some small consolation that they will not linger in that state where a Blood Elf is better off dead.' WHERE `entry`=8890;
UPDATE `quest_template` SET `OfferRewardText`='You place the hippogryph egg into the machine. A series of beeps follows along with some strange mechanical sounds.$B$BIt appears that the Eggometer has weighed, measured, and packaged your egg. Now that''s speedy service!' WHERE `entry`=8893;
UPDATE `quest_template` SET `OfferRewardText`='Well, I suppose that will have to do, now won''t it? Thanks for the help, $C. I can only hope to get this mess completely cleaned up before the Magister returns to Duskwither Spire.$B$BTake this pocket change; it''s not much but it''s all that I have at the moment. Feel free to dispatch a few more of the beasties on your way out, if you''d be so kind.' WHERE `entry`=8894;
UPDATE `quest_template` SET `OfferRewardText`='Thank you, $N.  I''ve been expecting this letter.' WHERE `entry`=8895;
UPDATE `quest_template` SET `OfferRewardText`='Oh, isn''t that sweet! This is the first time he''s ever sent me something. Do you suppose he''s getting serious?$B$BColara Heldric? I suppose it has a ring to it. Oh, but I''m getting ahead of myself. Thank you.' WHERE `entry`=8897;
UPDATE `quest_template` SET `OfferRewardText`='Tormek? Oh yes, I do remember him. He had quite a nice beard and smile underneath.$B$BAh, I can''t believe he remembered me!' WHERE `entry`=8898;
UPDATE `quest_template` SET `OfferRewardText`='I''ve never received something like this before. How lovely!' WHERE `entry`=8899;
UPDATE `quest_template` SET `OfferRewardText`='You wouldn''t expect an orc to be so eloquent. Of course, we never really had a chance to know them before now. Thank you for bringing this to me.' WHERE `entry`=8900;
UPDATE `quest_template` SET `OfferRewardText`='What kind words Temma writes for me. But, as much as his words move me, I cannot consider the love of a tauren. In thoughts, body and mind we are too different.$B$BIt is good I do not have to receive these thoughts of his in person. I could not bear to break his heart.' WHERE `entry`=8901;
UPDATE `quest_template` SET `OfferRewardText`='This brings back memories from a lifetime ago, $N. Elenia Tor. That was going to be my name, you know. We would have a beautiful ceremony out on the shores of the lake. When he retired, we''d find a farm to retire to.$B$BSimple dreams, then.$B$BBut if he saw me now, I doubt he''d even see Elenia in me. Only cold flesh and a dead heart...' WHERE `entry`=8902;
UPDATE `quest_template` SET `OfferRewardText`='So it is true. This is unbelievable. How could this have happened? Let me think for a moment. There must be a reason behind this.' WHERE `entry`=8903;
UPDATE `quest_template` SET `OfferRewardText`='Yes, these will do great!$B$BBy tapping into the otherworldly energies contained within these substances we''ll be able to reach out to those whose souls haven''t quite left this world yet!' WHERE `entry`=8924;
UPDATE `quest_template` SET `OfferRewardText`='Deliana had you contact me? I''ll do my best to help you, but first I must ask a great favor of you.' WHERE `entry`=8929;
UPDATE `quest_template` SET `OfferRewardText`='Mokvar had you contact me? I''ll do my best to help you, but first I must ask a great favor of you.' WHERE `entry`=8930;
