UPDATE `quest_template` SET `OfferRewardText`='That locket... you found her! I can rest in peace at long last.$B$BI shall now answer any questions you might have, $N. But make haste, my time in this world is not long.' WHERE `entry`=8946;
UPDATE `quest_template` SET `OfferRewardText`='Excellent. I shall transmute these into something more suitable to our needs.' WHERE `entry`=8947;
