UPDATE `quest_template` SET `OfferRewardText`='I am so glad that you can see me. Finally someone to talk to!$B$BWill you help us, $N? Help to undo the wrong that we perpetrated and put things to right? If it''s true that you already have the Top Piece of Lord Valthalak''s Amulet, then I think I can point you in the right direction to acquire the other two parts, reunite them and put an end to all of this.$B$BOh, by the way, hello, my name is Bodley. Nice to meet you!' WHERE `entry`=8960;
UPDATE `quest_template` SET `OfferRewardText`='I''m impressed, $C, but there''s no time to lose. I will give you your next task, because you will still need to acquire a few more important components before we can proceed.$B$BSpeak to me again when you feel that you are ready for the challenge that lies ahead.' WHERE `entry`=8961;
UPDATE `quest_template` SET `OfferRewardText`='A job well done, $N. I will imbue the essence of the remains into the brazier.$B$BNow all that is left is to go to the lower portion of Blackrock Spire, to the chamber where War Master Voone resides in Tazz''Alaor, and use the brazier to summon forth the corrupted spirit of my former cohort, Mor Grayhoof. He cannot rest until the amulet piece is taken from him.' WHERE `entry`=8962;
UPDATE `quest_template` SET `OfferRewardText`='A job well done, $N. I will imbue the essence of the relic into the brazier.$B$BNow all that is left is to go to the Shrine of Eldretharr in the east wing of Dire Maul, and use the brazier to summon forth the spirit of my former cohort, Isalien. Her spirit has been corrupted by her possession of the piece of Valthalak''s amulet, and the portion of his soul within it.' WHERE `entry`=8963;
UPDATE `quest_template` SET `OfferRewardText`='A job well done, $N. I will imbue the essence of the sword into the brazier.$B$BNow all that is left is to get into The Crimson Throne inside The Scarlet Bastion at Stratholme, and use the brazier to summon forth the remains of my former cohorts, Jarien and Sothos. Their souls have been twisted further by their possession of Valthalak''s amulet piece and his spirit within.' WHERE `entry`=8964;
UPDATE `quest_template` SET `OfferRewardText`='A job well done, $N. I will imbue the essence of the ashes into the brazier.$B$BNow all that is left is to get into Scholomance, to Ras Frostwhisper''s chamber, and use the brazier to summon forth the spirit of my former cohort, Kormok. The amulet piece, and Valthalak''s spirit within, has corrupted him even further, and he will not rest until you forcibly take it from him.' WHERE `entry`=8965;
UPDATE `quest_template` SET `OfferRewardText`='You have done a great thing, $N. One spirit rests in peace, but there is still much work to be done before we can put all of this behind us.$B$BUnfortunately, I do not know the location of the one who died with the right piece of the amulet in their possession. But do not fear; in life I was a dabbler in the art of divination, so I have another task for you, which is going to enable us to ferret out the final piece.' WHERE `entry`=8966;
UPDATE `quest_template` SET `OfferRewardText`='Thank you, $N, for putting Isalien''s spirit to rest. Now, perhaps, she will find peace with her goddess. But, there is still a great deal of work ahead of us if we are to get out of this fine pickle we find ourselves in.$B$BUnfortunately, I do not know the location of the one who died with the right piece of the amulet in their possession. But do not fear; in life I was a dabbler in the art of divination, so I have another task for you, which is going to enable us to ferret out the final piece.' WHERE `entry`=8967;
UPDATE `quest_template` SET `OfferRewardText`='I suppose it''s for the best that the souls of those two have finally been put to rest, even if I didn''t like them while they were alive. In any case, we have what we were after, and that is definitely a good thing!$B$BUnfortunately, I do not know the location of the one who died with the right piece of the amulet in their possession. But do not fear; in life I was a dabbler in the art of divination, so I have another task for you, which is going to enable us to ferret out the final piece.' WHERE `entry`=8968;
UPDATE `quest_template` SET `OfferRewardText`='Good work, $N! Kormok wasn''t all that bad for an ogre, at least not while he was still alive, so I hope he gets the rest that he deserves. But, there is more work ahead of us.$B$BUnfortunately, I do not know the location of the one who died with the right piece of the amulet in their possession. But do not fear; in life I was a dabbler in the art of divination, so I have another task for you, which is going to enable us to ferret out the final piece.' WHERE `entry`=8969;
UPDATE `quest_template` SET `OfferRewardText`='To be honest, $N, I''m surprised you made it back in one piece. Then again, I guess Alcaz Island is the least of your worries right now.$B$BOk, give me a moment here... divination isn''t something that you can just snap your fingers and expect accurate answers from.' WHERE `entry`=8970;
UPDATE `quest_template` SET `OfferRewardText`='Excellent! You''ve done well, $N. I''m not sure I trust the goblin''s craftsmanship, but I''m left with no other choice.' WHERE `entry`=8977;
UPDATE `quest_template` SET `OfferRewardText`='You''ve returned with the device! I''m impressed by your dedication, $N. Excellent work.' WHERE `entry`=8978;
UPDATE `quest_template` SET `OfferRewardText`='Another one of Fenstad''s obsessions, I see. Does he think that the Royal Apothecary Society has nothing better to do than to perform his little investigations?$B$BVery well, I will humor him once again.' WHERE `entry`=8979;
UPDATE `quest_template` SET `OfferRewardText`='Ah yes, I just recently received stock of the perfume and cologne. I don''t know how long I can keep it on the shelves - seems like no one can get enough of it.$B$BIf you ask me, I don''t see what the big deal is.' WHERE `entry`=8982;
UPDATE `quest_template` SET `OfferRewardText`='I''m afraid I sold my entire supply of perfume and cologne to Norman, the innkeeper. If you''d like some, you should speak with him - assuming he has any left.$B$BYou shouldn''t waste any time, though. I think you''ll find the cologne  irresistible.' WHERE `entry`=8983;
UPDATE `quest_template` SET `OfferRewardText`='Yes, I made those fragrances. Wonderful smell, isn''t it? Irresistible.$B$BOnce the warriors of Alliance and Horde alike are smitten with these feelings of love, they will be powerless to stop the rise of the Shadow Council.$B$BThey will be weakened, unprepared. As they worry for their loved ones, they will lose their edge.$B$BThe solution was so simple. Why did it take me so long to come upon it? The weakness of all is through the heart. And there is nothing you can do to stop the inevitable.' WHERE `entry`=8984;
