UPDATE `quest_template` SET `OfferRewardText`='A job well done, $N. I will imbue the essence of the ashes into the brazier.$B$BNow all that is left is to get into Scholomance, to Ras Frostwhisper''s chamber, and use the brazier to summon forth the spirit of my former cohort, Kormok. The amulet piece, and Valthalak''s spirit within, has corrupted him even further, and he will not rest until you forcibly take it from him.$B$BOh, by the way, I had some leftover bloodkelp from your trip to Alcaz Isle, so I made it into some potions for you. Take your pick!' WHERE `entry`=8988;
UPDATE `quest_template` SET `OfferRewardText`='Thank you for helping Mor Grayhoof, $N. Another spirit rests in peace, and we now have the reassembled amulet! But we still have the hardest test ahead of us.$B$BIn order for the brazier to be attuned to calling forth Lord Valthalak, there are a few more items that need to be gathered and brought back to me here.' WHERE `entry`=8989;
UPDATE `quest_template` SET `OfferRewardText`='Thank you, $N, for putting Isalien''s spirit to rest. Now, perhaps, she will find peace with her goddess. And, we have the reassembled amulet, as well! But we still have the hardest test ahead of us.$B$BIn order for the brazier to be attuned to calling forth Lord Valthalak, there are a few more items that need to be gathered and brought back to me here.' WHERE `entry`=8990;
UPDATE `quest_template` SET `OfferRewardText`='I suppose it''s for the best that the souls of those two have finally been put to rest, even if I didn''t like them while they were alive. In any case, we have what we were after, and now the amulet is reassembled! But we still have the hardest test ahead of us.$B$BIn order for the brazier to be attuned to calling forth Lord Valthalak, there are a few more items that need to be gathered and brought back to me here.' WHERE `entry`=8991;
UPDATE `quest_template` SET `OfferRewardText`='That''s it then. I''ll extract the metal from the bracers and imbue the brazier with these final components. Then it will be ready for you to summon Lord Valthalak, and finally return his spirit amulet to him.$B$BYou''ve come quite a distance, $N, don''t falter now that the end is in sight!' WHERE `entry`=8994;
UPDATE `quest_template` SET `OfferRewardText`='How fortunate for you that I know you''re not part of the original group that stole this from me.$B$BI''ll take back what is mine now, mortal! Give the amulet to me!' WHERE `entry`=8995;
UPDATE `quest_template` SET `OfferRewardText`='He really said all of that? Wow, I can''t believe he''s going to call off the spectral assassins and stalkers, even if he did hint at causing my living companions further harm in the future.$B$BThis is a great day, $N! You''ve accomplished what few ever could, and absolved us, at least in part, of some of our past sins.$B$BThank you! As a sign of appreciation, I''d like to give you this. You can use it to summon forth spirits at the same haunted locations that you already have, and a few others, too.' WHERE `entry`=8996;
UPDATE `quest_template` SET `OfferRewardText`='I am very happy to see you return to me safely, $N. You look well, if not a bit worse for the wear.$B$BCome, tell me of all that has transpired.' WHERE `entry`=8997;
UPDATE `quest_template` SET `OfferRewardText`='I am pleased to see that you have survived, $N. You look well, if not a bit more seasoned.$B$BCome, tell me of all that has transpired.' WHERE `entry`=8998;
