UPDATE `quest_template` SET `OfferRewardText`='I understand Aristan''s concerns, but I really think he''s overreacting. Let young men and women do what they will. I think Aristan has forgotten what it means to be young and in love.$B$BBut it would be better not to tell him that. We''ll humor him.' WHERE `entry`=9024;
UPDATE `quest_template` SET `OfferRewardText`='Oh yes, I just got the perfume and cologne in stock recently. It''s been selling so well, I don''t know how long I can keep it on the shelves.$B$BIf you ask me, it''s kind of boring. Everyone smelling the same? It smells great, but still.' WHERE `entry`=9026;
UPDATE `quest_template` SET `OfferRewardText`='Yes, of course. Those fragrances are the hottest items this season. You must be the fifth or sixth person this hour to inquire about them.$B$BI''m afraid my supplies are all sold out. If you''d like some, you should speak with Allison, the innkeeper of The Gilded Rose.$B$BYou shouldn''t waste any time, though. I think you''ll find the perfume will be irresistible.' WHERE `entry`=9027;
UPDATE `quest_template` SET `OfferRewardText`='Yes, I made those fragrances. Wonderful smell, isn''t it? Irresistible.$B$BOnce the warriors of Alliance and Horde alike are smitten with these feelings of love, they will be powerless to stop the rise of the Shadow Council.$B$BThey will be weakened, unprepared. As they worry for their loved ones, they will lose their edge.$B$BThe solution was so simple. Why did it take me so long to come upon it? The weakness of all is through the heart. And there is nothing you can do to stop the inevitable.' WHERE `entry`=9028;
UPDATE `quest_template` SET `OfferRewardText`='Thank you, $N.  You are brave and wise.$B$BTell me, how did the devilsaur react to the toxin?' WHERE `entry`=9051;
UPDATE `quest_template` SET `OfferRewardText`='The book is completely soaked. Instructor Antheol''s not going to like this at all.$B$BHere, take this money. I have an idea.' WHERE `entry`=9062;
UPDATE `quest_template` SET `OfferRewardText`='You say those two incompetent fools bribed you to lie to me? You''ve done very well in coming to me, $N.' WHERE `entry`=9064;
UPDATE `quest_template` SET `OfferRewardText`='Excellent job, $N. Don''t worry, they''re not stuck in that form permanently.  Their apprenticeship, however, won''t be restored until they earn it back.' WHERE `entry`=9066;
UPDATE `quest_template` SET `OfferRewardText`='You''re quite the energetic young $gman:woman;, aren''t you?$B$BThis all looks very adequate. You certainly deserve compensation for gathering up all of this for me, and something a little extra I think.$B$BOh, I almost forgot, here''s an invitation to the party. And, $c, next time that you drop in make sure to dress up in something a little more... festive.' WHERE `entry`=9067;
UPDATE `quest_template` SET `OfferRewardText`='You defeated him after all!  Undoubtedly my men softened him up for you.$B$BI jest, $C.  You''ve done well.  You''ll make a name for yourself if you keep your nose clean.' WHERE `entry`=9076;
UPDATE `quest_template` SET `OfferRewardText`='Look around you. Things aren''t exactly in order.$B$BWe have a severe malfunction at the West Sanctum. Let us do our best to prevent matters from getting worse.' WHERE `entry`=9119;
UPDATE `quest_template` SET `OfferRewardText`='You will feel a slight tingle, $N. That sensation means it''s working. Once complete, you will be able to enter Naxxramas by stepping upon the rune portal in Plaguewood.' WHERE `entry`=9121;
UPDATE `quest_template` SET `OfferRewardText`='Lymel wants you to head up to Silvermoon City and bring back her goods. huh? Sure. I can get you there quickly... for a small fee, of course.' WHERE `entry`=9130;
UPDATE `quest_template` SET `OfferRewardText`='What''s this? Has Lymel''s rotting brain finally slid out of her head? She wants all of this!?$B$BDid you bring anyone with you to help take it back?' WHERE `entry`=9133;
UPDATE `quest_template` SET `OfferRewardText`='Back down to Tranquillien in the Ghostlands, then? Sure, I can get you there fast!' WHERE `entry`=9134;
UPDATE `quest_template` SET `OfferRewardText`='Well, I guess if he said that the rest of it will be coming quickly overland, then I''ll take him at his word.  He''s certainly never failed to provide the goods in the short time that we''ve been working together.$B$BThank you, $N, you''re a credit to the sin''dorei!  Here take this coin... it''s done nothing but jingle around in my pocket all day.' WHERE `entry`=9135;
UPDATE `quest_template` SET `OfferRewardText`='Outstanding! But, there''s much to be done before the Scourge menace is completely driven from mighty Quel''Thalas!$B$BHere, take this coin... it''s not much, but you''ve earned it.' WHERE `entry`=9138;
UPDATE `quest_template` SET `OfferRewardText`='Your success at Goldenmist Village takes us another step closer to taking our land back. Don''t fool yourself though, $c; this fight is far from over.$B$BHere, you''ve more than earned this. You may need it when you go up against Windrunner Village.' WHERE `entry`=9139;
UPDATE `quest_template` SET `OfferRewardText`='You''ve done it, $N. You''ve broken the Scourge hold on the three villages! Now we can focus our forces with greater ease against the Scourge on the Dead Scar and south at Deatholme.$B$BHere, take your choice of any one of these. I trust that you''re not going anywhere? We can really use your continued assistance!' WHERE `entry`=9140;
UPDATE `quest_template` SET `OfferRewardText`='Good to hear that Lethvalin made it to safety. and that he was smart enough to ask you for help instead of just waiting there.$B$BI hope that Ranger Salissa made it safely to Farstrider Enclave.' WHERE `entry`=9145;
UPDATE `quest_template` SET `OfferRewardText`='That''s dire news indeed -- I completely overestimated Tomathren''s ability to lead. I''ll see to it that a group is dispatched to safely bring him and Valanna back in.$B$BUnfortunately, we never heard from Ranger Salissa, so I fear the worst in her case.$B$BYou''ve done the Farstriders a great service this day, $c. Please take one of these as a small token of our appreciation.' WHERE `entry`=9146;
UPDATE `quest_template` SET `OfferRewardText`='Finally!  We''ve waited for a response from the regent lord for weeks! Let me see here...$B$B<Vandril begins to read the letter.>$B$BWhat''s this? A dark presence? He senses a dark presence in the Ghostlands?! No kidding; I could have told him that!$B$BThis is what we''ve been waiting for?' WHERE `entry`=9148;
UPDATE `quest_template` SET `OfferRewardText`='Not bad, $N. Keep it up, we could use a few more people like you around here.' WHERE `entry`=9155;
UPDATE `quest_template` SET `OfferRewardText`='You''ve done well, $N. It''s important that the plague doesn''t spread to the healthy wildlife in Eversong. I have more work for you if you''re looking for something to do.' WHERE `entry`=9158;
UPDATE `quest_template` SET `OfferRewardText`='You''ve taken your task seriously and thus I''d like to present you with suitable rewards. We need more allies with your courage and determination, $N.' WHERE `entry`=9159;
UPDATE `quest_template` SET `OfferRewardText`='Troubling! These plans show the night elf forces at An''daroth, which we already knew, but also at An''owyn, a more remote ley-line nexus to the southeast.$B$BThere is a third nexus to the east, which is not mentioned, named An''telas. I have a very bad feeling about all of this, $c.' WHERE `entry`=9163;
UPDATE `quest_template` SET `OfferRewardText`='Excellent job, $N. Without your help those prisoners would''ve lost their minds and souls to the Scourge.' WHERE `entry`=9164;
UPDATE `quest_template` SET `OfferRewardText`='It was just horrible! Night elves! They conjured their moon crystal here for some nefarious plot, but I snuck away and gathered a larger group of our scouts and casters from the nearby Sanctum of the Sun. We killed most of them and the rest of the group is hunting down the remnants!I''m glad that you''re here now; I was only left a couple of scouts for protection! It''s not safe out here!Give me a moment and I''ll read through these plans to see what the night elves are up to. ' WHERE `entry`=9166;
UPDATE `quest_template` SET `OfferRewardText`='Today you''ve dealt a deadly blow to the Scourge''s grasp in the region.$B$BWith the vile traitor gone, it shall not be long before we''ve reclaimed our lands and our greatness is restored once again.' WHERE `entry`=9167;
UPDATE `quest_template` SET `OfferRewardText`='Dar''Khan''s armies will soon fall. The Scourge shall not stand a chance against the combined might of the sin''dorei and the Forsaken.' WHERE `entry`=9170;
UPDATE `quest_template` SET `OfferRewardText`='Very well. these will have to do. No, don''t describe them crawling around, I don''t want to know! I''ll work my magic upon these legs and they''ll turn out quite tasty. A little spice here, a pinch of herb there, and then of course some arcane ingredients, and voila, a meal fit for a queen... or in this case, a dame.$B$BYour service has been adequate, $c. Here, take this recipe and some samples.' WHERE `entry`=9171;
UPDATE `quest_template` SET `OfferRewardText`='This book... it can''t be!  It''s Dar''Khan''s very own handwriting.  There must be information here that will reveal a weakness in our opponent.$B$BYou''ve done well in coming to us, $N.  The Farstriders have shown great wisdom in leaving this matter in our hands.  This armor should help you further our cause. ' WHERE `entry`=9172;
UPDATE `quest_template` SET `OfferRewardText`='You''ve avenged our deaths and broken Aquantion''s grasp on our souls. We may finally rest.' WHERE `entry`=9174;
UPDATE `quest_template` SET `OfferRewardText`='You say that you found it on one of the Scourge at Windrunner Spire and that there''s an inscription on it? Let me see!Here, take this coin for a job well done. ' WHERE `entry`=9175;
UPDATE `quest_template` SET `OfferRewardText`='The rumors were true!  The stone of light and the stone of flame do exist!  We shall use their power to create weapons against Dar''Khan.$B$BUse them when the time is right and the energies of the Sunwell, trapped within these objects, will vanquish him with the very power he sought to steal from us!' WHERE `entry`=9176;
UPDATE `quest_template` SET `OfferRewardText`='More armor for the troops! Fantastic, $N!' WHERE `entry`=9179;
UPDATE `quest_template` SET `OfferRewardText`='These should go well with the dense weightstones we''re stockpiling.' WHERE `entry`=9181;
UPDATE `quest_template` SET `OfferRewardText`='I still can''t believe Metz expects our troops to wear this low-quality garbage to protect against the freezing attacks of the Scourge.' WHERE `entry`=9183;
UPDATE `quest_template` SET `OfferRewardText`='Blessed bootstraps! Are those what I think they are? The troops have been complaining non-stop about the lack of storage space for all that is required while in the field. One of them even drew me a diagram - such a pansy...$B$BThese will definitely help alleviate some of the whining.' WHERE `entry`=9191;
UPDATE `quest_template` SET `OfferRewardText`='You shouldn''t have! No really, you shouldn''t have. I don''t know what Metz is thinking, but nobody is going to be wearing these robes into Naxxramas.$B$B<Packmaster Stonebruiser sighs.>$B$BBah, another pile of junk I''ll have to get transferred to the front lines and another berating I''ll have to take from Chambers.' WHERE `entry`=9194;
UPDATE `quest_template` SET `OfferRewardText`='Why are you smiling? What''s so funny? Listen, $Gmister:missy;, a gnomish battle chicken is a very important unit and not to be taken lightly - EVER. We send these in to areas that might be heavily plagued or infested and they clean up any plagued insects or carrion maggots that might still be fluttering about. Everybody knows that robots are immune to the plague.$B$BI bet you don''t feel so smart now, do you? Big dummy...' WHERE `entry`=9197;
UPDATE `quest_template` SET `OfferRewardText`='Thorium tubes? Gee, thanks.$B$B<Packmaster Stonebruiser throws the stack of thorium tubes into a large pile of assorted junk.>' WHERE `entry`=9198;
UPDATE `quest_template` SET `OfferRewardText`='<Packmaster Stonebruiser pops open one of the greater arcane protection potions and take a swig.>$B$BWOOT! These pack a kick, baby! A kick I say!' WHERE `entry`=9201;
UPDATE `quest_template` SET `OfferRewardText`='Do you know what the troops on the front lines call these? Priests in a bottle...$B$B<Packmaster Stonebruiser sings.>$B$B"I''m your priest in a bott-le baby... you gotta drink me the right way..."$B$BWhat''s the matter sonny? It''s a very popular song around these parts.' WHERE `entry`=9202;
UPDATE `quest_template` SET `OfferRewardText`='No comment.$B$B<Packmaster Stonebruiser glares at you.>$B$BI said no comment! Now get out of my sight!' WHERE `entry`=9203;
UPDATE `quest_template` SET `OfferRewardText`='My apprentice was unable to take care of this herself?  I shall have a word with her when she returns then, gnolls or not.  Speaking of which, why didn''t she return with you?<The magister sighs.>That one is a handful, and is going to be quite a challenge to properly train.  Thank you, for bringing these samples to me.  We are hoping that we can uncover some special property from them that will help in the fight against the Scourge.Please take this coin as a token of my appreciation. ' WHERE `entry`=9207;
UPDATE `quest_template` SET `OfferRewardText`='You''re quite the hero, $c, to get her out of there alive.  I suppose we''ll have to mount an offensive to clear out those catacombs too.  As if we didn''t have enough trouble with the living trolls!$B$BYou''ve done a great thing today, I should reward you.  Take your pick from any of these.' WHERE `entry`=9212;
UPDATE `quest_template` SET `OfferRewardText`='I''ll immediately send a few rangers out to survey the damage that you wreaked upon the Shadowpine trolls. I''ve no doubt that we''ll be able to mop up after your offensive and launch an attack on the Scourge soon if these weapons are any indication of your success.$B$BHere, I want you to take this coin in payment. It''s burning a hole in my pouch anyway.' WHERE `entry`=9214;
UPDATE `quest_template` SET `OfferRewardText`='Take this, $N.  You''ll feel the difference immediately!$B$BFeel free to bring more spinal dust; I can use as much of it as you can provide.  Side effects?  You might start feeling your joints acting up a bit.  Nothing permanent, I assure you!' WHERE `entry`=9218;
UPDATE `quest_template` SET `OfferRewardText`='The Scourge has felt our wrath, $N. It won''t be long before their cursed citadel lies in ruins.$B$BWith their numbers weakened, it is time to launch an attack on more strategic targets.' WHERE `entry`=9220;
UPDATE `quest_template` SET `OfferRewardText`='Here is your order, $N. Delivered as promised!' WHERE `entry`=9234;
UPDATE `quest_template` SET `OfferRewardText`='Here is your order, $N. Delivered as promised!' WHERE `entry`=9235;
UPDATE `quest_template` SET `OfferRewardText`='Here is your order, $N. Delivered as promised!' WHERE `entry`=9236;
UPDATE `quest_template` SET `OfferRewardText`='Here is your order, $N. Delivered as promised!' WHERE `entry`=9237;
UPDATE `quest_template` SET `OfferRewardText`='Now that''s one face I was not expecting to see so soon.$B$BThis is quite the good news. $N, in more ways than you can imagine.' WHERE `entry`=9238;
UPDATE `quest_template` SET `OfferRewardText`='Here is your order, $N. Delivered as promised!' WHERE `entry`=9239;
