UPDATE `quest_template` SET `OfferRewardText`='Here is your order, $N. Delivered as promised!' WHERE `entry`=9241;
UPDATE `quest_template` SET `OfferRewardText`='Here is your order, $N. Delivered as promised!' WHERE `entry`=9242;
UPDATE `quest_template` SET `OfferRewardText`='Here is your order, $N. Delivered as promised!' WHERE `entry`=9243;
UPDATE `quest_template` SET `OfferRewardText`='There is a being within... a being not of this world.' WHERE `entry`=9251;
UPDATE `quest_template` SET `OfferRewardText`='You must''ve been sent by someone at Fairbreeze Village. I knew it would just be a matter of time until help arrived.' WHERE `entry`=9253;
UPDATE `quest_template` SET `OfferRewardText`='These notes... are shocking. If they''re correct it means the damage to the land on the Dead Scar is irreversible.$B$BI''ll notify the grand magister right away. More reason for our race to escape this world and find our true fate in Outland.' WHERE `entry`=9255;
UPDATE `quest_template` SET `OfferRewardText`='Keep it coming, $N. Us goblins don''t forget that easily!' WHERE `entry`=9268;
UPDATE `quest_template` SET `OfferRewardText`='Ah, excellent! I knew that a $r-delivery system would make for the most efficient application of the poison. With any luck the Shadowpine trolls will get fat on it before keeling over. That should get them off of the backs of the Farstriders, and me back to Tranquillien.$B$BIt has been a pleasure working with you, $c!' WHERE `entry`=9275;
UPDATE `quest_template` SET `OfferRewardText`='Unbelievable! You really should talk to the captain about joining up as a Farstrider.$B$BAlright, $N, you''ve given us the breathing room that we need to continue building up our forces here. Actually, by your account there aren''t many of those trolls left at all! Maybe now we can join with Tranquillien and attack Deatholme?$B$BI think you''ve earned a little something. Take your pick.' WHERE `entry`=9277;
UPDATE `quest_template` SET `OfferRewardText`='$N. by my eternal soul, it is good to see you! I don''t know why the Exodar crashed. Only those of us that were in this part of the ship remain.$B$BThere''s not much time if we''re to save everyone that we can!' WHERE `entry`=9279;
UPDATE `quest_template` SET `OfferRewardText`='Thanks for giving me a hand, $N. I was dreading the thought of venturing into the woods this close to Deatholme.' WHERE `entry`=9281;
UPDATE `quest_template` SET `OfferRewardText`='Kaendris sent you? I might have a task for you, $c.' WHERE `entry`=9282;
UPDATE `quest_template` SET `OfferRewardText`='The Light be praised! You''ve done what only a true heroine could have done, $N! The draenei you saved owes their continued life to your selflessness!$B$BPlease, take this supply pouch. You look like you can use it more than I.' WHERE `entry`=9283;
UPDATE `quest_template` SET `OfferRewardText`='I''m glad that you have come to me. For quite some time now I have been responsible for the training of our young $cs, a responsibility that I intend to continue on this new world. I''ve had my eye upon you for a while now and it would be my honor to help train you in the ways of the $c.$BShall we begin?' WHERE `entry`=9288;
UPDATE `quest_template` SET `OfferRewardText`='I am pleased that you have come seeking my knowledge. We have much to do if your magical skills are to be honed. For over a hundred years I have taught the arcane, frost and fire magics, and I can feel them just as strongly on this world.  Would you like me to impart some of what I know to you?' WHERE `entry`=9290;
UPDATE `quest_template` SET `OfferRewardText`='It gives me great hope for our future that you come seeking my wisdom. While I have my hands full here with our injured, I am not so busy that I cannot spare a moment to aid you in your first steps as a $C.  To walk in the Light is the highest of callings, and one that I am certain you are more than ready to undertake! Speak with me again when you feel that you are ready to begin your training.' WHERE `entry`=9291;
UPDATE `quest_template` SET `OfferRewardText`='These will do. Thank you, $C!$B$BWhile you were out, I managed to gather some equipment together to make an analysis of the samples.  This should only take a moment.' WHERE `entry`=9293;
UPDATE `quest_template` SET `OfferRewardText`='From what you describe, the neutralizing agent worked! I just wish that I knew how long it will last; we really need to remove that power crystal from the lake entirely.$B$BThank you, $N! I will tell Tedon to try the neutralizing agent on one of the captured beasts at once.' WHERE `entry`=9294;
UPDATE `quest_template` SET `OfferRewardText`='With many of the owlkin now inoculated. we can focus on getting out of here and not have to worry about wiping out the owlkin population in the area.$B$BHere. choose from these. You''ve done good work. and you deserve to be rewarded!' WHERE `entry`=9303;
UPDATE `quest_template` SET `OfferRewardText`='Let me take a look at those.$B$BYes, I think that these will do nicely; good job, $N. The emitter is rather complex so it may take some time to finish the repairs. I''ll let you know when it''s ready.$B$BIn the meantime, you might see if Vindicator Aldar has anything he could use you for.' WHERE `entry`=9305;
UPDATE `quest_template` SET `OfferRewardText`='Help... blood elves! They... ambushed... me. Don''t have... long.' WHERE `entry`=9309;
UPDATE `quest_template` SET `OfferRewardText`='I thank you for dealing with the blood elf surveyor. Surely she was their leader. Rest assured, we will deal with whatever remnant of them is still nearby.$B$BPlease, take one of these weapons as a sign of my gratitude.' WHERE `entry`=9311;
UPDATE `quest_template` SET `OfferRewardText`='I got it. I got it! I think I managed to fix the emitter! Here, I''ll just activate this last crystal and that should do it.$B$BTake a look at the emitter, $N. It looks like it''s beginning to work... someone is appearing!' WHERE `entry`=9312;
UPDATE `quest_template` SET `OfferRewardText`='Ah, good to see you again! I''m glad that we were both able to get our emitters fixed or we might never have found one another. And don''t worry, we''ll see to it that Ammen Vale gets help and supplies.$B$BSpeaking of assistance, now that you''re here, go around and introduce yourself to the others. I know that there''s plenty to do.' WHERE `entry`=9313;
UPDATE `quest_template` SET `OfferRewardText`='Oh, you must be one of the survivors we''ve been hearing about!$B$BI''m glad that you came. Don''t worry, we will send someone to see to Aeun''s injured leg.$B$BI''m most interested in hearing all about your harrowing story of survival. You''re a brave one to have made it all the way here.' WHERE `entry`=9314;
UPDATE `quest_template` SET `OfferRewardText`='I apologize for the shoddy intelligence, $c.  Had I known of this Anok''suten ahead of time, I surely would have told you.$B$BWe''re spread too thin and things are slipping through the cracks!' WHERE `entry`=9315;
UPDATE `quest_template` SET `OfferRewardText`='What''s this? Unless I''m mistaken, this flame has been taken from the heart of Orgrimmar itself! The fierce hearts of the orcs and trolls are reflected in its searing heat. What a fine addition to our collection--how brave you are, stealing into the enemy''s lair to retrieve the sacred flame!' WHERE `entry`=9324;
UPDATE `quest_template` SET `OfferRewardText`='Unless I miss my guess, this fire has been taken from the cliffs of Thunder Bluff! How it sings with the power of the spirits! You are quite the thief, $N. Take this as just payment for your skill. Now, if only we had the flames of all three cities...' WHERE `entry`=9325;
UPDATE `quest_template` SET `OfferRewardText`='Hm... what a strange fire! It is subdued, nearly smoldering, but the heat is intense. And you received this from the Undercity, you say? Fascinating. With the flames of all three cities, who knows what we could accomplish?' WHERE `entry`=9326;
UPDATE `quest_template` SET `OfferRewardText`='Now that''s one face I was not expecting to see so soon.$B$BThis is quite the good news, $N, in more ways than you can imagine. ' WHERE `entry`=9328;
UPDATE `quest_template` SET `OfferRewardText`='And this brightly-burning fire... you say it came from Stormwind? Remarkable! That must have been quite an adventure! I''ll pay you for this, of course. If you find anything else like this, be sure to speak with me again.' WHERE `entry`=9330;
UPDATE `quest_template` SET `OfferRewardText`='This hearty flame must be from the halls of Ironforge; it''s as stalwart as the dwarves themselves. A fine catch, $N. If I had the fires of the other cities... ah, but never mind. Here is your payment.' WHERE `entry`=9331;
UPDATE `quest_template` SET `OfferRewardText`='This fire aches of ancient sorrow, $N. You pulled this from the roots of Teldrassil, you say? Fascinating! Here is a reward for your skill. Return to me should you find anything else like this; I may have a use for it.' WHERE `entry`=9332;
UPDATE `quest_template` SET `OfferRewardText`='Good job, $N. That should teach the rock flayers to stay far away from us.' WHERE `entry`=9340;
UPDATE `quest_template` SET `OfferRewardText`='These should do the job. I''m going to prepare the salve and finish my splint before making my way back to Thrallmar. Why do I have the feeling that I know what Far Seer Regulkut will say when she sees me?$B$B<Grelag sighs half-heartedly.>$B$BThank you for your help, $N. I have some of the spineleaf left over. You''re welcome to take it with you. Who can tell when it will prove useful?' WHERE `entry`=9345;
UPDATE `quest_template` SET `OfferRewardText`='In order to have great cuisine, you need to have great ingredients.  And these eggs look great!$B$BI''ve just finished cleaning off my frying pan, so you''re more than welcome to join me for a meal!' WHERE `entry`=9349;
UPDATE `quest_template` SET `OfferRewardText`='Ravager Eggs.  Bam!$B$BHellboar Bacon. Bam!$B$BBuzzard Wings. Bam!  Bam!$B$BWhat a great meal.  You''ve really got to try it.  ' WHERE `entry`=9356;
UPDATE `quest_template` SET `OfferRewardText`='You''re here to help? Excellent!$B$BThe battle against the Amani trolls has taken its toll on us and capable fighters such as yourself are always welcome.' WHERE `entry`=9359;
UPDATE `quest_template` SET `OfferRewardText`='The information you''ve brought is of vital importance, $N.  Now that we know of the trolls'' plans we can prepare for an attack.$B$BWe won''t be caught with our guard down.' WHERE `entry`=9363;
UPDATE `quest_template` SET `OfferRewardText`='Excellent! It seems we''ve appointed dutiful Flamekeepers this year if the bonfires are as well-kept as you claim. Thank you for inspecting them for me; here, take this as a small token of my esteem.' WHERE `entry`=9367;
UPDATE `quest_template` SET `OfferRewardText`='Regrettable that those creatures had to die so that we might live - indiscriminate killing is not the draenei way. However, the blood you gathered will replenish our healing crystals, so their deaths will not be in vain.' WHERE `entry`=9369;
UPDATE `quest_template` SET `OfferRewardText`='Oh, thank goodness you''ve come. We have much to do.' WHERE `entry`=9371;
UPDATE `quest_template` SET `OfferRewardText`='Thank you for bringing this to me, $c. I was wondering why I hadn''t heard from the Expedition in so long. I wonder how long ago this message was dispatched and what befell its carrier.$B$BHere''s a bit of coin for your trouble.' WHERE `entry`=9373;
UPDATE `quest_template` SET `OfferRewardText`='Ahhh, so they do still burn. I am glad; it would not do for those fires to burn out before their time. You have done well, $N. Take this with my blessing.' WHERE `entry`=9388;
UPDATE `quest_template` SET `OfferRewardText`='So you''ve returned, and you''ve seen to the emerald flames of the continent. What do you think, mm? A rare and wonderful sight, to be certain. I am aware, however, that tangible rewards are better appreciated... so please, take this for your trouble.' WHERE `entry`=9389;
UPDATE `quest_template` SET `OfferRewardText`='I''ve heard your name whispered from the shadows, $N. It''s said that you''re looking for someone experienced to show you the ropes - someone like me. I can do that, but it''ll cost you a small cut of your take every time I''ve got something to teach you. So yes, I will train you in what it means to be a rogue.$B$BBut remember, if you ever get caught stealing something, this conversation never took place. Now get out there and show me what you''re made of!' WHERE `entry`=9392;
UPDATE `quest_template` SET `OfferRewardText`='$N, are your eyes keen as a hawk''s, your motions as fluid as a monkey''s, or your speed that of a cheetah? Mine are, and yours can be too with the proper training. The way of the hunter is one of mastery over the beasts of the world, an unparalleled precision in marksmanship, and the knowledge of how to survive in situations where others would perish.$B$BIf these are the things that you seek to learn, then I will train you - for a small fee, of course. Shall we begin?' WHERE `entry`=9393;
UPDATE `quest_template` SET `OfferRewardText`='Ah, good of Magistrix Dawnstrider to finally respond to my simple requests.  I should take up the matter of her attitude with the regent lord in Silvermoon. She''s quite rude!$B$BNothing for you to concern yourself with though. Now that you''re here, maybe I''ll finally be able to get those party supplies that I''ve been waiting for? ' WHERE `entry`=9395;
UPDATE `quest_template` SET `OfferRewardText`='You''ve done well, $N.  It is always unfortunate to have to resort to taking a life, even when it''s that of a dangerous beast such as the rock flayer.$B$BYou have my thanks for carrying out this grim task.' WHERE `entry`=9398;
UPDATE `quest_template` SET `OfferRewardText`='Oh, well done...  I told you to jump in a pond, and you did.  I can only imagine what you''d do if one of your good friends asked it of you.$B$BIf you want a reward for your efforts, it is this: never lift a finger without first knowing what''s in it for you.  The $C''s mind is his greatest weapon.  Remember that and try to use yours a bit more.' WHERE `entry`=9402;
UPDATE `quest_template` SET `OfferRewardText`='Let''s see what you''ve brought me...$B$B<He holds the phial up to the light and examines it closely.>$B$BYes, this will do. Well done, $N. ' WHERE `entry`=9403;
UPDATE `quest_template` SET `OfferRewardText`='Our Expedition made it safely through the Portal and set up a new base called Thrallmar. Yet as you can see. the Burning Legion moved in and cut us off from our brothers. Clearly, the demons hope to retake the Dark Portal and prevent us from gathering reinforcements from Azeroth.' WHERE `entry`=9407;
UPDATE `quest_template` SET `OfferRewardText`='It''s good that you''re here, but there''s no time to waste making small talk. You need instructions, and then you need to get out there.$B$BListen up.' WHERE `entry`=9416;
UPDATE `quest_template` SET `OfferRewardText`='I am Firmanvaar and you are wise to seek me out. It is my calling to provide instruction to $C, especially those who are just beginning to learn.$B$BShamanism is only now being relearned amongst the $R, $N. You are brave to follow its path as it is not popular amongst your kind.$B$BI will be here when you feel you are ready for further training.' WHERE `entry`=9421;
UPDATE `quest_template` SET `OfferRewardText`='My, my! Another of my brothers arrives to pitch in. Good! There is much to be done in support of our new Forsaken friends, $C. Ask around to see who you can help out.$B$BI know that you will support them to your utmost ability!' WHERE `entry`=9425;
UPDATE `quest_template` SET `OfferRewardText`='Yes, I feel the fel presence in the pools weakening.$B$BYou''ve done well, $N.' WHERE `entry`=9426;
UPDATE `quest_template` SET `OfferRewardText`='The ambassador sent word ahead, so I''ve been expecting you.$B$BThe ambassador simply wants you to do as much as you can to help out around here. She said something about making sure to cement our relationship with the rest of the Horde.$B$BAsk around - there are others in need of help further back in the Post. And I hear that there''s another Horde outpost called Zoram''gar Outpost on the coast all the way to the west.' WHERE `entry`=9428;
UPDATE `quest_template` SET `OfferRewardText`='Always good to see a semi-familiar face. You must be $N. Emissary Valustraa sent me word to expect you.$B$BThe people of Ashenvale need our assistance, $C. Speak with the citizens of Astranaar to see how you can help.' WHERE `entry`=9432;
UPDATE `quest_template` SET `OfferRewardText`='It means very much to us that you come to aid us in our time of need.  We''ll not easily forget you nor he who sends you.$B$BYou have our thanks.' WHERE `entry`=9441;
UPDATE `quest_template` SET `OfferRewardText`='It is done then. I thank you for showing your compassion. Once corrupted by whatever Cersei was feeding them, there is nothing else that could be done.$B$BThey are now at peace and hopefully my studies of the others will bear fruit so that they can be rehabilitated.' WHERE `entry`=9448;
UPDATE `quest_template` SET `OfferRewardText`='You are bold to seek my wisdom after what your people have done to these islands, stranger! Still, there is much to be said for your bravery, so I will impart to you some knowledge.$B$BThe earth beneath your feet forms the foundation for all things. The sky, the waters, even great fire - all rest upon its shoulders. While those others often form chaotic tempests, the earth abides. It grants strength and fortitude to the core of your being.' WHERE `entry`=9449;
UPDATE `quest_template` SET `OfferRewardText`='You have done well. By thinning out the restless spirits you have helped to heal the imbalance between the elements, which your people inadvertently caused.$B$BThroughout your journey as a $C you must keep this in mind when calling upon our power. The balance must be preserved.' WHERE `entry`=9450;
UPDATE `quest_template` SET `OfferRewardText`='You have done well, $N.  In helping to restore the balance of the elements at the grove, you have also created a balance between the earth element of this world and the $R.  Perhaps this will help to bring understanding to those amongst us who do not approve of our ways?$B$BI will create for you a totem through which you will be able to call on the power of earth to do your bidding.  And with time, more of the mysteries of earth will be revealed to you.$B$BNow, take your totem, $C.' WHERE `entry`=9451;
UPDATE `quest_template` SET `OfferRewardText`='I hope the murlocs didn''t cause too much trouble, $N. I owe you a great debt of gratitude for all that you''ve done.$B$BPerhaps I could teach you how to fish? I''ll even supply the fishing pole and a bauble.' WHERE `entry`=9452;
UPDATE `quest_template` SET `OfferRewardText`='Poor Diktynna... That murloc gave her quite a scare.$B$B<Acteon sighs.>$B$BHopefully she will recover from the injuries soon...$B$BSo I presume you''re looking for work. Well there''s plenty of that to be found at Azure Watch!' WHERE `entry`=9453;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $N, well done!$B$BHere, I cooked up some tenderloins while you were gone. Maybe you''d like the recipe, too?' WHERE `entry`=9454;
UPDATE `quest_template` SET `OfferRewardText`='Hello, $N, I have been expecting you. I trust this day finds you well?' WHERE `entry`=9461;
UPDATE `quest_template` SET `OfferRewardText`='I trust that the burning I see behind your eyes is from a desire to grow and understand?  Good!$B$BTuluun has sent you here because he sees your potential to both learn and help with a problem that the crash of your Exodar has caused.$B$BWe shall see.' WHERE `entry`=9464;
UPDATE `quest_template` SET `OfferRewardText`='See how its fire never goes out?  That is the work of Hauteur.  It is a symbol of his arrogance.  Flame is meant to consume that which it burns and then itself die, to be reborn anew another time.$B$BI would help you douse the torch, but it must stay lit for you to deal with Hauteur.  We will let it burn a little while longer.' WHERE `entry`=9465;
UPDATE `quest_template` SET `OfferRewardText`='You''re a brave $C, $N. That savage beast took many of my best hunters'' lives.$B$BTake this reward, you''ve earned it.' WHERE `entry`=9466;
UPDATE `quest_template` SET `OfferRewardText`='It is a valuable lesson that you learn here today.  It is the story of endings and new beginnings.$B$BWhen first we spoke I told you that fire was not just destruction, but also a renewing force of the elements.  Through your actions you have both destroyed and saved Hauteur, for he shall be reborn from his ashes.' WHERE `entry`=9467;
UPDATE `quest_template` SET `OfferRewardText`='<Ambassador Rualeth nods as you give your report.>$B$BYou have done well. The culling of the silvermane will not go unnoticed by the Wildhammer. When I meet with their leaders, I am certain that your deeds will reflect well upon the Alliance. Please accept this coin as a small token of my thanks, $N.' WHERE `entry`=9471;
UPDATE `quest_template` SET `OfferRewardText`='Excellent!  That little backstabber won''t be running off with anyone''s husband any time soon.$B$BHere''s a little something for your troubles.  I trust we can keep this incident between us, $N.' WHERE `entry`=9472;
UPDATE `quest_template` SET `OfferRewardText`='<Handing the eggs to the ambassador, you describe the findings at Featherbeard''s Hovel and Shadra''Alor.>$B$BThe Witherbark killed Featherbeard?$B$B<Rualeth''s face contorts in horror at your description of the dwarf''s death and the implications for Rualeth''s mission.>$B$BI understand why he felt he had to go in search of the eggs, but I wish he''d thought to bring others along. His death will no doubt enrage Falstad Wildhammer, triggering retaliation against the trolls, and delaying my audience indefinitely.' WHERE `entry`=9475;
UPDATE `quest_template` SET `OfferRewardText`='Withstanding the numerous claws and bites from the dragonhawk is a sign of your tenacity. Do you have the strength to learn more? ' WHERE `entry`=9484;
UPDATE `quest_template` SET `OfferRewardText`='So you see $N, there is nothing left for me to teach you at this time. You already understand what it is to befriend those you once hunted. You need only to choose one of nature''s allies with traits that match your own. ' WHERE `entry`=9485;
UPDATE `quest_template` SET `OfferRewardText`='You have shown both strength and tenacity. There remains the final test until you can tame without the use of magic. ' WHERE `entry`=9486;
UPDATE `quest_template` SET `OfferRewardText`='Such a waste, using magic to construct beings of physical strength. I always thought that''s why we allied with the lesser races, after all.$B$BYou were good to destroy them so we can use what remains for a more suitable purpose.' WHERE `entry`=9487;
UPDATE `quest_template` SET `OfferRewardText`='You really don''t need to know the intricacies of crafting a magical robe, $N, you just need to know what to bring me.$B$BAnd let me be honest, you brought enough for several robes.  The profit I''ll make should more than cover the costs to make your robe, and even enough to buy myself something nice.  Looks like the thanks belong to you!' WHERE `entry`=9488;
UPDATE `quest_template` SET `OfferRewardText`='Already the rangers speak of your blessings with awe and respect. Now you can see how the Light serves us, allowing us to help others, but only after we have helped ourselves.' WHERE `entry`=9489;
UPDATE `quest_template` SET `OfferRewardText`='Well done! I can''t hope to replicate the feats of Grand Warlock Nethekurse, nor should I aspire to, but we would be fools to ignore the power of the fel embers.$B$BHowever, there are those who would forbid the type of research I''m about to embark upon, and for that reason, I must keep my efforts secret. Please do not speak of this to anyone, $N.' WHERE `entry`=9494;
UPDATE `quest_template` SET `OfferRewardText`='You have done well, $N. In his prime, Kargath Bladefist was a fine warrior, a hero and example to his people.$B$BHis death is a blow to us all, but especially to Warchief Thrall. Whatever happened to him in his final days, we should not forget the orc Kargath once was, nor the lessons to be learned from his downfall.$B$BFor your service to the Horde, $N, you are to be rewarded with your choice from among these weapons.' WHERE `entry`=9495;
UPDATE `quest_template` SET `OfferRewardText`='Welcome to Falcon Watch, $Gbrother:sister;. Many other blood elves haven''t been fortunate enough to make it this far.$B$BIt''s a terrible shame; our work in Outland has just begun.' WHERE `entry`=9499;
UPDATE `quest_template` SET `OfferRewardText`='We meet again. I have been watching your progress from afar, $C, and I am pleased.$B$BThe time has come for you to commune with the element of water, to learn its mysteries and give yourself over to the water so that you might in turn learn to master it.' WHERE `entry`=9500;
UPDATE `quest_template` SET `OfferRewardText`='Do not fear, $N. While you are here we will speak using our minds.$B$BI am grateful to Farseer Nobundo for sending you to me. There is a great disturbance that is polluting the waters on and around Bloodmyst Isle. Not even the blind would fail to notice the effect this is having on its creatures and the environment.$B$BYou and I will work together to stop this corruption before it spreads further. ' WHERE `entry`=9501;
UPDATE `quest_template` SET `OfferRewardText`='We meet again. I have been watching your progress from afar, $C, and I am pleased.$B$BThe time has come for you to commune with the element of water, to learn its mysteries and give yourself over to the water so that you might in turn learn to master it.' WHERE `entry`=9502;
UPDATE `quest_template` SET `OfferRewardText`='Thank you, $c. These should be enough so that I can examine this corruption. Then we will have a better idea of how to proceed. ' WHERE `entry`=9503;
UPDATE `quest_template` SET `OfferRewardText`='Water parts easily, yet put enough of it together and it will create an unstoppable force. It washes away earth and fire, and easily pushes air out of the way.$B$BWe are that unstoppable force, $N, not those that have poisoned Bloodmyst Isle! ' WHERE `entry`=9504;
UPDATE `quest_template` SET `OfferRewardText`='You''re a resourceful one! With our navigation gear, we can figure out just how far we''ve veered off course.$B$BBut wait, what''s this? There''s something rolled up in the map. Let me see...$B$BThese are orders from Mogul Razdunk of the Venture Company. According to these plans, they''re here to strip-mine the island of the crystal wreckage, then hijack our ships once they''re finished.$B$BBy Bronzebeard''s bushy brow! This is why they forced us to land? How could they know of our plans?$B$BI smell a traitor...' WHERE `entry`=9506;
UPDATE `quest_template` SET `OfferRewardText`='It is done then!  The crisis is averted and you have put in motion the restoration of the water on Bloodmyst Isle.  Over time, the water, in conjunction with the other elements, will heal itself.$B$BIt is unfortunate that the blood elves cannot see that by contaminating their surroundings they''re killing themselves off as well! ' WHERE `entry`=9508;
UPDATE `quest_template` SET `OfferRewardText`='You have comported yourself with wisdom beyond your years, $N.  I can sense that the water element is pleased with your actions.  It will be my great honor to take the pure water that you bear and combine its essence into your new water totem.$B$BRemember well the lessons of water as you go forward and you will gain an even greater understanding and mastery of the element.' WHERE `entry`=9509;
UPDATE `quest_template` SET `OfferRewardText`='Bless yer heart. stranger. This''ll go a long ways in liftin'' the morale o'' the crew.' WHERE `entry`=9512;
UPDATE `quest_template` SET `OfferRewardText`='With Warlord Sriss''tiz dead, the possibility of a naga invasion is now only a distant memory. We are safe, for the time being...$N$NI must admit, I was wrong to think badly of you, $N. You have shown that you are nothing like the filth that was Archimonde. Accept this as a gift from the night elves.' WHERE `entry`=9515;
UPDATE `quest_template` SET `OfferRewardText`='You have my respect and thanks, $C. Perhaps we''ll be able to create a new home here without having to worry about the Burning Legion yet again.' WHERE `entry`=9516;
UPDATE `quest_template` SET `OfferRewardText`='Thank you for delivering this report, $C. From what Sentinel Luciel writes, it seems our worst fears have come to pass. With each advance we make, the Horde appears more determined to do as much damage as possible.$B$BWe can''t afford to back down; the fate of our ancestral lands hangs in the balance. With more people like you on the frontlines, I''m certain we could triumph. Will you join our fight?' WHERE `entry`=9521;
UPDATE `quest_template` SET `OfferRewardText`='Never again will the Burning Legion threaten us here! You have delivered us from a fight we very likely would have lost, $C.$B$BI give you thanks and the deepest gratitude of the Hand of Argus. It honors me to have you at our side.' WHERE `entry`=9522;
UPDATE `quest_template` SET `OfferRewardText`='I thank you, $N. I must admit I didn''t expect a rescue party to be on its way.$B$BI will round up the remaining prisoners and lead them back to Honor Hold.' WHERE `entry`=9524;
UPDATE `quest_template` SET `OfferRewardText`='You''ve brightened my day, $C. When I die, I will make sure it''s in the battlefield... covered in the blood of my opponents and taking them down with me.' WHERE `entry`=9525;
UPDATE `quest_template` SET `OfferRewardText`='Good. Though it may take a great deal of your years for the seedlings to grow into ancients, in the fullness of time they will aid us in our fight against the demons at Felfire Hill.$B$BGo in peace, little $Gbrother:sister;.' WHERE `entry`=9526;
UPDATE `quest_template` SET `OfferRewardText`='Thank you, $N. Their spirits will be at peace now.' WHERE `entry`=9527;
UPDATE `quest_template` SET `OfferRewardText`='<Tears of joy stream down Cowlen''s face.>$B$BHow can I ever repay you for this, $N? Please, take this heirloom. It symbolizes a sacred bond of friendship, trust and love amongst night elves. You are a $Gbrother:sister; to me - from this day until the end of time...' WHERE `entry`=9528;
UPDATE `quest_template` SET `OfferRewardText`='I must warn you, what I ask of you next will be dangerous. I won''t think less of you if you decide not to help me out, $N.' WHERE `entry`=9530;
UPDATE `quest_template` SET `OfferRewardText`='According to the plans, the traitor and the leader of the goblins, Geezle, are to meet at a cove on the western island. I need you to be at that meeting, $N.$B$BRemember the tree and leaves? You''re going to wear them! It''s a perfect disguise.$B$BGo to the cove and look for a naga flag. If the flag is there, it means a meeting is planned. Use the disguise kit when you see the flag and wait. Eventually the traitor will show up. Let the meeting finish then return to me with the identity of the scoundrel.' WHERE `entry`=9531;
UPDATE `quest_template` SET `OfferRewardText`='That''s better! There''s nothing quite like ridding our world of a demon. And they make for worthy opponents as well, unlike the weak races of the Alliance.' WHERE `entry`=9534;
UPDATE `quest_template` SET `OfferRewardText`='Never again will the Burning Legion make slaves of the orcs, or any other race of the Horde!$B$BBravely fought, $C! You have the true heart of the Horde beating inside of you! You give us much honor!' WHERE `entry`=9536;
UPDATE `quest_template` SET `OfferRewardText`='Incredible! This was all part of their master plan!$B$BThis information must reach the king and your own leaders. The implications are staggering.' WHERE `entry`=9537;
UPDATE `quest_template` SET `OfferRewardText`='The totem has various primal markings. You see owls, bears, wolves and stags carved into the surface.$B$BYou note a strange collection of symbols that makes your mouth form the word A-K-I-D-A.' WHERE `entry`=9538;
UPDATE `quest_template` SET `OfferRewardText`='The totem has various primal markings. You see owls, bears, wolves and stags carved into the surface of the totem.$B$BYou note a strange collection of symbols that makes your mouth form the word C-O-O.' WHERE `entry`=9539;
UPDATE `quest_template` SET `OfferRewardText`='The totem has various primal markings. You see owls, bears, wolves and stags carved into the surface of the totem.$B$BYou note a strange collection of symbols that makes your mouth form the word T-I-K-T-I.' WHERE `entry`=9540;
UPDATE `quest_template` SET `OfferRewardText`='I hope the vision you witnessed helped you gain some perspective on Sedai''s death.  The relic showed you a likely series of events leading up to the present.  The truth may have been different, we''ll never know for sure.$B$BWould you act differently knowing what you know now?$B$BWho can say whether our conflict with the orcs will continue?  What''s important is to remain open to the possibilities.' WHERE `entry`=9545;
UPDATE `quest_template` SET `OfferRewardText`='This is fantastic! The theft of my equipment has given me more insight into the nature of these murlocs than I could have possibly gained in weeks of observations!$B$BI know what I''m going to say in my report already.$B$B''When faced with the products of a technologically superior culture, the Blacksilt displayed none of the curiosity characteristic of emerging cultures in humanoid species.''$B$BIt''s brilliant! The gentlemen in Ironforge are going to love it! I can''t thank you enough, $N.' WHERE `entry`=9548;
UPDATE `quest_template` SET `OfferRewardText`='Astounding, simply astounding! These are perfect, $N. I can already see them under the glass in the museum in Ironforge. The text for the display is virtually writing itself in my head!$B$BYour help has been invaluable in getting my studies back on track. How do you spell your name? I''ll make sure it appears in my report as co-author.$B$BOne of the chaps on the ship gave me this ''treasure map'' to cover a gambling debt, but mythology isn''t my area of study. Superstitious lot, sailors. ' WHERE `entry`=9549;
UPDATE `quest_template` SET `OfferRewardText`='Examining the book carefully, you conclude that it must be a journal. Its pages are filled with an elegant script differing from that of the map. The text of many of the pages is obscured by drawings and writing in the mapmaker''s hand.$B$BIt''s nearly impossible to make out the text beneath the mapmaker''s tales of drunken carousing during shore leave. ' WHERE `entry`=9550;
UPDATE `quest_template` SET `OfferRewardText`='It was whispered to me on the winds that you would be coming, $C.$B$BFarseer Nobundo thinks very highly of you, and from what I have heard of your travels, so do I.' WHERE `entry`=9552;
UPDATE `quest_template` SET `OfferRewardText`='I have been awaiting your arrival, $C. You come seeking wisdom, and something else I sense.$B$BVery well, let us begin.' WHERE `entry`=9553;
UPDATE `quest_template` SET `OfferRewardText`='I am proud of you, $N.  You have persevered where others falter, and in the process you''ve gained a greater understanding of the elements and yourself.  Remember their lessons as you go through life and you will be the wiser for it.$B$BNow, hand me the whorl from Susurrus so that I may imbue it into your air totem.  As with the other totems, it will serve as both a focus and a reminder of the connection that you have forged with the elements. ' WHERE `entry`=9554;
UPDATE `quest_template` SET `OfferRewardText`='Greetings. It is always heartening to meet a $R who is open to the way of shamanism. There are so few.$B$BYou have learned not to judge the flame for its outward appearance, just as you should not judge mine.$B$BYou are here because you are ready to create your fire totem.' WHERE `entry`=9555;
UPDATE `quest_template` SET `OfferRewardText`='Hmm... this is most intriguing. Yes, I should be able to make out what the original author wrote in the pages of this book.$B$BI should have everything I need for the process. This should only take a moment.' WHERE `entry`=9557;
UPDATE `quest_template` SET `OfferRewardText`='For centuries, we lived in relative peace with the creatures of the land. Several months ago, Kurz began to see dark omens. The peace that we enjoyed for so long was to be lost. The extent of the catastrophe could not be known!$B$BSo it would be that the gods would shatter our land - turning both friend and foe against us. But there was something else... Amidst the chaos, a hero would rise: A hero not of Stillpine blood. The Promised One would deliver us from devastation.$B$BThat prophesied hero was you.' WHERE `entry`=9559;
UPDATE `quest_template` SET `OfferRewardText`='Not only is the prophecy true, this armor is also amazing! Surely it is armor fit for a champion! And I will sell it to you at discounted prices, furless one.$B$BI jest... The first piece is complimentary.' WHERE `entry`=9560;
UPDATE `quest_template` SET `OfferRewardText`='Grasses and shrubs cover an unnatural bulge in the earth.$B$BA few minutes spent digging reveals an old box, almost certainly the one mentioned in Nolkai''s journal.' WHERE `entry`=9561;
UPDATE `quest_template` SET `OfferRewardText`='<Gurf spits on the clump of fur and tries to affix it to the hairless patch on his backside.>$B$BThis will have to do for now! Hopefully one of the $C will be able to repair the damage.' WHERE `entry`=9564;
UPDATE `quest_template` SET `OfferRewardText`='These blood crystals that you saw; my scouts have seen many more to the north.$B$BI thank you for aid but now ask that you leave me to confer with the elders. I will call for you once I have spoken with the other elders of the village.' WHERE `entry`=9566;
UPDATE `quest_template` SET `OfferRewardText`='Without their leader, and with the recovery of the corrupted crystals underway, we can safely keep the satyr in check. Light knows how many more of these wretched creatures are out there.$B$BHarbinger Mikolaas and I are grateful for the help you''ve provided in dealing with the satyr before they could become a larger threat. Your work stands as a reminder that vigilance is the key to victory against the Legion and its minions.' WHERE `entry`=9569;
UPDATE `quest_template` SET `OfferRewardText`='The Promised One has emerged victorious!$B$BThe prophecy is nearly complete. Now about that hide...' WHERE `entry`=9570;
UPDATE `quest_template` SET `OfferRewardText`='This is the strongest armor I''ve ever made! Make good use of it, $N.' WHERE `entry`=9571;
UPDATE `quest_template` SET `OfferRewardText`='Do you know what I hate worse than being wrong? Losing gold on a bet that you couldn''t pull it off, sweetheart.$B$BOutstanding!  With those three dead their forces should be in disarray.  And with their artillery up there silenced we''ll have an easier time getting close enough to take the citadel!$B$BI have a feeling there''s more to this than meets the eye, though - so I''m going to have something else for you to do.  Here, take one of these from the armory.' WHERE `entry`=9575;
UPDATE `quest_template` SET `OfferRewardText`='This is most curious, $C. I don''t believe we''ve ever seen the murlocs wearing any kind of adornment before.$B$BGiven the corrupting influence that the crystal shards are known to have, the murloc that wore this pendant must have believed it granted him power over his fellows. I wouldn''t be surprised if he had rapidly outgrown his fellow murlocs and gained in strength.' WHERE `entry`=9576;
UPDATE `quest_template` SET `OfferRewardText`='<You tell Morae of your findings in the wreckage of the Cryo-Core.>$B$BSo... he''s...$B$BI guess I knew on some level, but just wouldn''t let myself believe it. It''s not the news I was hoping for, but you have my deepest thanks for finding Galaen.' WHERE `entry`=9579;
UPDATE `quest_template` SET `OfferRewardText`='<Ruada nods solemnly.>$B$BThen it is done.$B$BYou are ready for your next lesson, $N, but I will not be the one to teach it to you. ' WHERE `entry`=9582;
UPDATE `quest_template` SET `OfferRewardText`='<Harbinger Mikolaas examines the crystal shard.>$B$BThis shard is much different from the initial sample.$B$B<Harbinger Mikolaas holds the crystal up to catch the light.>$B$BDo you see how it pulsates like that? That''s worrisome. I''ll make a note in my report of the alterations the blood elves appear to have made to this crystal. Thank you again for your help, $N.' WHERE `entry`=9584;
UPDATE `quest_template` SET `OfferRewardText`='<Harbinger Mikolaas accepts the last crystal from you.>$B$BThat rounds out the set. All that remains to be done is to box them and send them to the Exodar.$B$B<The harbinger seems glad to be done with the task.>$B$BDon''t get me wrong, $N, I''m sure the research is valuable, but we''re faced with a number of other pressing problems out here. ' WHERE `entry`=9585;
UPDATE `quest_template` SET `OfferRewardText`='Thank you for helping Tavara. So many are unfamiliar with these lands and find trouble where they least expect.$B$BIt would honor me if you were to wear these robes. They mark you as one of the protectors of Azure Watch and a devout follower of the Light.' WHERE `entry`=9586;
UPDATE `quest_template` SET `OfferRewardText`='It''s signed by Illidan you say?! Let me have that.$B$B<The commander reads the letter, and then again a second time, thinking a moment before going on.>$B$BThis news that you bring is ominous indeed. Knowing this, we must accelerate our plans against Hellfire Citadel and this Blood Furnace. Because you have shown that you can get the job done, I want you to head up those plans.$B$BGunny will give you your next mission, though I suspect it will be far deadlier than your first.$B$BLight be with you, $N!' WHERE `entry`=9587;
UPDATE `quest_template` SET `OfferRewardText`='Looks like the timberstrider didn''t peck your eyes out.$B$B<Kella looks away for a moment.>$B$BNot that I thought that would happen, of course! ' WHERE `entry`=9592;
UPDATE `quest_template` SET `OfferRewardText`='I must say, $N, you have learned far more quickly than I first imagined.  Looks like we won''t need to use this last taming totem.  And honestly, I''m not even sure what it is.  It appears to be some sort of monstrous lizard with wings and a long tail.  Oh well, perhaps another time!$B$BYou''ve experienced enough to try it on your own now, without the aid of a taming totem.  Good luck! ' WHERE `entry`=9593;
UPDATE `quest_template` SET `OfferRewardText`='You''ve done well in bringing this to me, $N. This is, without a doubt, an armor fragment from a felguard.$B$BThen, it is as I feared. The Nazzivus satyr are renewing their contacts with the Burning Legion. If we don''t stop them, the satyrs and their demonic allies will overrun us. I will notify Harbinger Mikolaas right away.' WHERE `entry`=9594;
UPDATE `quest_template` SET `OfferRewardText`='With every spell you must steel yourself against its seductive lure, using it only as needed for the purposes of good. Hopefully the wraith granted a glimpse of what you might turn into should you become careless--a mindless slave to magic.' WHERE `entry`=9595;
UPDATE `quest_template` SET `OfferRewardText`='who.....who are you? .....Jol? Yes! Praise the Light! We are ok thanks to the forces Jol sent us to help in our battles. Yes I am fine...although I cannot say the same about my brothers....' WHERE `entry`=9600;
UPDATE `quest_template` SET `OfferRewardText`='Ahh... it seems it is time.$B$B<Mehlar nods knowingly.>' WHERE `entry`=9601;
UPDATE `quest_template` SET `OfferRewardText`='<Exarch Menelaous takes the letter from you and begins to read it.>$B$BDamn them... Damn them all to the Nether. They''ve had a spy watching everything that we''ve done! And for how long?$B$BI will notify Velen at once!$B$BYou''ve done us a great service, $N. Be on guard as I will be contacting you once the Prophet has given me instruction as to what to do.' WHERE `entry`=9602;
UPDATE `quest_template` SET `OfferRewardText`='So you''ve brought Topher''s list. Excellent! I was hoping to receive this today. Let''s see what he needs.$B$B<Nurguni reads over the list and begins placing various items in a box.>$B$BThat''s most of what he requested. The pieces for the beds are simply too large to be delivered by hippogryph, but I''ll make arrangements to have them sent by wagon. ' WHERE `entry`=9604;
UPDATE `quest_template` SET `OfferRewardText`='<Handing Topher the box, you tell him that Nurguni is making arrangements to have the larger items delivered by wagon.>$B$BSplendid! Now, I''ll finally be able to set up some beds and a first aid station so that we can better treat the wounded and any survivors we encounter.$B$BI can''t thank you enough for your help, $N. You have my thanks and that of the Blood Watch''s vindicators.' WHERE `entry`=9606;
UPDATE `quest_template` SET `OfferRewardText`='THEY HAVE A PIT LORD?!$B$B<Nazgrel notices the glances of the others assembled and lowers his voice to a whisper.>$B$BThat seals it. They must be using the blood from this pit lord to create new fel orcs that are somehow not aligned with the Burning Legion. And if they can do this to the Mag''har brown orcs, they can do it to us!$B$BWe''ll have to strike at the heart of their military might, and soon!' WHERE `entry`=9608;
UPDATE `quest_template` SET `OfferRewardText`='What? A draenei sent you here from the Harborage? How odd.$B$BWell, I''m not one to turn down assistance. Thanks for coming, $C!' WHERE `entry`=9609;
UPDATE `quest_template` SET `OfferRewardText`='By the beardless, geometric head of O''ros! It is good you brought this to me, $N. These blood elves are out for... well, blood. Velen will be informed at once! Take this as a reward.' WHERE `entry`=9616;
UPDATE `quest_template` SET `OfferRewardText`='$N, it is good you have come. Our list of allies grows thin, and even those who share our cause are not completely trusted. It is because of this that we, the rangers, turn to nature for aid.$B$BIn the allies of the forest we find a deep bond that does not know deceit.' WHERE `entry`=9617;
UPDATE `quest_template` SET `OfferRewardText`='All of these reports are from Keltus?  He''s been quite busy, that''s for sure.$B$BKeltus is a $c among rogues--he rarely follows orders to the letter, and often takes matters into his own hands!  Don''t take that wrong, however, as he is one of my most trusted spies and we would be lost without him.$B$BYou''ve done an exemplary job today.  Please accept this blade and guide it into our enemy''s back. ' WHERE `entry`=9618;
UPDATE `quest_template` SET `OfferRewardText`='I''m impressed you are standing here, $N. Many an apprentice has perished to the voidwalker, or even the voidstone itself.$B$BThe voidwalker is now yours to command. Use your new servant well.' WHERE `entry`=9619;
UPDATE `quest_template` SET `OfferRewardText`='It is done then.  The foul traitor got what he deserved.$B$BYou did this yourself?  An impressive feat that proves that your race remains worthy, $N.$B$BI see that Lor''themar has additional news that will greatly improve his relations with Thrall. ' WHERE `entry`=9621;
UPDATE `quest_template` SET `OfferRewardText`='Visions you say? Interesting... And this prophecy has come to pass?$B$BBut you say they saw the power core of the Exodar? And O''ros was also in the vision? What can it mean?' WHERE `entry`=9622;
UPDATE `quest_template` SET `OfferRewardText`='Did you have a difficult time finding enough? It''s been taking me longer with each trip.$B$BSoon, I''ll have to stop altogether since I won''t be able to spare the time. Thank you for gathering the pears for me, $N. It gives me a chance to make a last pie or two before the season''s out.' WHERE `entry`=9624;
UPDATE `quest_template` SET `OfferRewardText`='<Thrall begins to read the letter.>$B$BSylvanas is a persistent one.  So she''s sent one of Silvermoon''s own champions... how does this change anything?' WHERE `entry`=9626;
UPDATE `quest_template` SET `OfferRewardText`='Your work has helped advance our race''s cause a tremendous deal. Not only does Thrall believe we''re capable of handling ourselves in the face of the enemy, he also believes he can use our link with Outland as a means to reach his people.$B$BNot exactly the truth, but not a lie either.$B$BBrace yourself for great changes, $N. We are now officially part of the Horde.' WHERE `entry`=9627;
UPDATE `quest_template` SET `OfferRewardText`='<You tell Harbinger Mikolaas of the survey team''s fate. He accepts the crystal from you, but remains silent for a long moment.>$B$BThey were good men, $N, and they knew their mission would be dangerous. I''m grateful for your help in locating the team and recovering the crystal.$B$B<The harbinger''s fists clench.>$B$BWe''ve lost too many good men already, and our mission has only just begun.' WHERE `entry`=9628;
UPDATE `quest_template` SET `OfferRewardText`='A vast wealth of information... I could spend years here!  I''m sure Dalaran will understand...' WHERE `entry`=9630;
UPDATE `quest_template` SET `OfferRewardText`='Alturus wants to raise a whole dragon back from the dead? Not an easy task by any stretch of the imagination.$B$BLet us discuss how we can be of mutual assistance, $N.' WHERE `entry`=9631;
UPDATE `quest_template` SET `OfferRewardText`='<Thundris accepts the letter from you and reads it quickly, nodding.>$B$BThe isles the $R call Azuremyst and Bloodmyst were inhabited long ago by my people. Some of the threats faced by Anchorite Paetheus and his brethren are ancient enemies of the night elves.$B$BI am certain that the people of Auberdine are willing to provide what aid we can to our new allies. As soon as I have spoken with the townspeople and the sentinels, I will send word to Paetheus.' WHERE `entry`=9633;
UPDATE `quest_template` SET `OfferRewardText`='Alright!  Now if we only had a stretchy loop, a parchment clamp, a guzzle tube and some sticky duck ribbon.  Then we could really make something!$B$BOk, ok, I guess you''ve earned this, $N.  Have fun!' WHERE `entry`=9635;
UPDATE `quest_template` SET `OfferRewardText`='Shiny!  And really, what engineer ever has enough spare parts just hanging around?  Ooh, maybe I could sell off the extra and buy me some of that Tigule and Foror''s Strawberry Ice Cream?!  I just love strawberries!  Do you think they have any around here?$B$BOk, ok, I guess you''ve earned this, $N. Have fun!' WHERE `entry`=9636;
UPDATE `quest_template` SET `OfferRewardText`='Excellent, $N. I''ve been trying to attempt these books for a very long time. It is fortunate that we were able to be of mutual assistance.' WHERE `entry`=9637;
UPDATE `quest_template` SET `OfferRewardText`='Can''t you see I''m in the middle of something here? What do you want?' WHERE `entry`=9638;
UPDATE `quest_template` SET `OfferRewardText`='Did you find what you were looking for? You were looking for something, weren''t you?' WHERE `entry`=9640;
UPDATE `quest_template` SET `OfferRewardText`='This is astounding! Not only have you brought back Medivh''s Journal, but you''ve also retrieved a fragment of his very essence.$B$BAs faint as this lingering essence is, it will reveal to us vital information about Medivh. We will not forget this, $C.' WHERE `entry`=9644;
UPDATE `quest_template` SET `OfferRewardText`='I hope this wasn''t too strenuous a task, $N. Once again you have proven yourself a competent and considerate $r. I offer my gratitude and a small bit of monetary compensation.

\
' WHERE `entry`=9649;
UPDATE `quest_template` SET `OfferRewardText`='Very good, $N. It will be important for us to hold these towers against future attacks, and for that we may need your assistance until reinforcements can be brought in to secure the area.' WHERE `entry`=9664;
UPDATE `quest_template` SET `OfferRewardText`='This is good news, $N. It will be a constant struggle here in the Plaguelands until we have fully driven back the forces of the Alliance.$B$BUntil that day, I hope that we will have your continued assistance.' WHERE `entry`=9665;
UPDATE `quest_template` SET `OfferRewardText`='So you''ve learned a bit, have you?$B$B<Halthenis looks at you carefully.>$B$BYou''ll serve the city, and our greater cause, well with your newly-learned skills. Allow me a moment to show you how to train your pet to do some interesting tricks, like disemboweling your enemy, and you can be on your way.' WHERE `entry`=9673;
UPDATE `quest_template` SET `OfferRewardText`='Knowing how to feed and revive your pet from death is not just an extra "tidbit" as your last teacher so mildly put it. Even more so, training allows your pet to improve in ways they couldn''t have on their own.$B$BI''ve already learned much from the furbolgs, so pay attention and I''ll pass the knowledge on to you.' WHERE `entry`=9675;
UPDATE `quest_template` SET `OfferRewardText`='Excellent! Though small in size, this fragment is teeming with energy, I can feel it!' WHERE `entry`=9680;
UPDATE `quest_template` SET `OfferRewardText`='Welcome, young $C.$B$BThe power of the Blood Knights is taken from a being of immense power.$B$B<The magister gestures to the large, captive being in the center of the room.>$B$BIsn''t it magnificent? ''Twas a gift from our beloved Prince Kael''thas, and it is the foundation of the Blood Knights'' mastery of the Light. This creature begrudges us its power, so we have devised a method for claiming it on our own terms.' WHERE `entry`=9681;
UPDATE `quest_template` SET `OfferRewardText`='You did it! Hundreds of souls are grateful for all that you have done.$B$BAllow me to make an offering...' WHERE `entry`=9683;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $N. The powers granted by the Light will never come ''naturally'' to the Blood Knights, but we are not so naive as to be thwarted by the will of a single being, however powerful.$B$BOur mastery of the arcane has unlocked this path and these powers for you, initiate. Few have the stomach or the aptitude to wield them, but I know you will not disappoint the order.' WHERE `entry`=9684;
UPDATE `quest_template` SET `OfferRewardText`='A ritual? The owlkin had lived in harmony with the land for thousands of years. Such a thing is an aberration!$B$BSuch a pity...' WHERE `entry`=9687;
UPDATE `quest_template` SET `OfferRewardText`='Ah, $N... I''ve heard about you. You''re the one that made the Kessel Run in under 15 minutes, right? Bah, probably not.$B$BAre you ready to spill some blood in the name of the Light? For Velen? For Argus?$B$B<Boros laughs.>$B$BI''ll slow down.' WHERE `entry`=9693;
UPDATE `quest_template` SET `OfferRewardText`='You have returned - and in one piece!$B$BI have some good news, $N. We have received some new information about the possible location of more survivors. A new crash site has been discovered! When I am done attending to those matters, I will call for you.' WHERE `entry`=9694;
UPDATE `quest_template` SET `OfferRewardText`='<Elysia reads from the document.>$B$BIf what this document says is true, the blood elves have opened a portal to the Outland! It would certainly explain their seemingly endless numbers...' WHERE `entry`=9696;
UPDATE `quest_template` SET `OfferRewardText`='<Velen begins to read the document.>$B$BInteresting... This does indeed explain much.' WHERE `entry`=9698;
UPDATE `quest_template` SET `OfferRewardText`='This is what you found?  That''s odd.  These husked mushroom remains are both unusual and somehow look familiar.$B$BI have to think on this a moment.  Don''t go anywhere!' WHERE `entry`=9702;
UPDATE `quest_template` SET `OfferRewardText`='The outrunner''s belongings have all been stolen with the exception of one package. It seems to match Alarion''s description of Erona''s package.' WHERE `entry`=9704;
UPDATE `quest_template` SET `OfferRewardText`='<Kuros'' face turns pale as he reads the journal; tears stream down his face.>$B$BSaruan was my master... my teacher... my mentor... I took his place among the Triumvirate only recently - after we had given up searching for him.$B$B<Kuros'' face contorts in anger.>$B$BMatis...' WHERE `entry`=9706;
UPDATE `quest_template` SET `OfferRewardText`='We definitely have a match here.  And the presence of the ogres and what they were doing there explains everything.  Now I get why it''s called the Hewn Bog, duh!$B$BWe have to do something about this situation, but what?  We can''t just wipe out all of those ogres; they have every bit as much a right to be here as any of the other creatures in the marsh!' WHERE `entry`=9708;
UPDATE `quest_template` SET `OfferRewardText`='These are perfect!  Oh, thank you, $C!$B$BYou''ve been ever so careful not to disturb the natural order of things, and we''ve gathered so much information in such a short amount of time!$B$BNow, let''s see if our little plan to grow a new food supply for the bog lords is going to work.' WHERE `entry`=9709;
UPDATE `quest_template` SET `OfferRewardText`='The Triumvirate has decided to try Matis immediately. You have brought an arch-criminal to justice on this day, young $r.$B$BYou have performed admirably for two of three; only Aesom remains.

\
' WHERE `entry`=9711;
UPDATE `quest_template` SET `OfferRewardText`='These will do nicely, but we can always use more.  Perhaps you will find yourself in the Underbog again soon?' WHERE `entry`=9714;
UPDATE `quest_template` SET `OfferRewardText`='These will do nicely, but we can always use more.  Perhaps you will find yourself in the Underbog again soon?' WHERE `entry`=9715;
UPDATE `quest_template` SET `OfferRewardText`='<The sporeling makes a sound that is vaguely reminiscent of snorting laughter.>$B$BPerfect!  No doubt the morale of the spore giants will be at an all time low once they realize what you''ve done.$B$BEither that, or they''ll be so incensed that they''ll attack us again soon.$B$B<T''shu makes a shrugging motion.>' WHERE `entry`=9717;
UPDATE `quest_template` SET `OfferRewardText`='The Black Stalker is dead!  Normally I would not revel in such butchery, but the pain that the great mother and her brood have put my people through over the centuries is unspeakable.$B$BIt is unfortunate that now another of her progeny will transform to replace her, but that will take time and give us some breathing room so that we will not have to worry about the marsh walkers for a while.' WHERE `entry`=9719;
UPDATE `quest_template` SET `OfferRewardText`='That you have chosen to accept my offer speaks well of you, $N. I wish you luck in the tasks I am about to set for you, but I''m certain you''ll prove yourself more than capable.$B$BI will present the tasks in order from easiest to most difficult and we may begin when you are prepared.' WHERE `entry`=9722;
UPDATE `quest_template` SET `OfferRewardText`='Excellent. It appears everything is here.$B$BDon''t worry. your next task will include plenty of opportunities to wield your weapon again, I promise.$B$BI''ll have an initiate bring it all to Magister Astalor. There''s no need to send you on such a trivial errand when there are more important things to be done.' WHERE `entry`=9723;
UPDATE `quest_template` SET `OfferRewardText`='<Gzhun''tt nods to you.>$B$BWe are pleased that you have affirmed our friendship, $N.  Perhaps the naga heathens will think twice about harassing us in the future now that we have such a powerful ally?' WHERE `entry`=9726;
UPDATE `quest_template` SET `OfferRewardText`='Hmm... this is a rather small amount. but if we''re careful. it should be sufficient. You see. the Scarlet Crusade believes itself dedicated to the Light. I suppose they still are, in a twisted sort of way, and that''s exactly what I''m hoping to capitalize on.$B$BTheir misguided zeal has even tainted the blessing spoken over this water, making it ideal for my purpose.' WHERE `entry`=9735;
UPDATE `quest_template` SET `OfferRewardText`='Now that we have all the reagents, I can prepare the mixture.$B$B<A slow smile spreads across Lady Liadrin''s face.>$B$BIt''s all coming together perfectly, $N. When this is finished, I''ll give you the details about what remains to be done.' WHERE `entry`=9736;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $N. All who would oppose us would do well to heed the warning you delivered. Our foes should know that they are in peril, from the lowest foot soldier to the mightiest $Ghero:heroine;.$B$BYou have earned your place in the ranks of the masters. Your dedication and prowess serve as an example for all Blood Knights. As a symbol of your new status, I grant you the ability to summon and command the thalassian charger.' WHERE `entry`=9737;
UPDATE `quest_template` SET `OfferRewardText`='I''m glad that some of my friends yet live, but it breaks my heart to hear of the fate of others.  <sigh>$B$BAt least they died doing what they loved most in life.  You have my eternal gratitude for helping me with this, $N.$B$BPlease, take one of these as a sign of gratitude.' WHERE `entry`=9738;
UPDATE `quest_template` SET `OfferRewardText`='It''s a real mess up there, eh? You''ve done well, $N. I''ll send some anchorites out to help Loryi and Jorli.

\
' WHERE `entry`=9741;
UPDATE `quest_template` SET `OfferRewardText`='Unbelievable!  It would take hundreds of sporelings to slay as many giants as you have.  I will make sure to let everyone know of your feats!$B$B<This quest is repeatable up to friendly reputation.>' WHERE `entry`=9744;
UPDATE `quest_template` SET `OfferRewardText`='Thank you, $N.  I will finally sleep comfortably at night.  Were I not so old and weakened I would deal with my own enemies.$B$BTake this gold.  It is not much, but your kindness cannot go unpaid.' WHERE `entry`=9747;
UPDATE `quest_template` SET `OfferRewardText`='As I suspected, the water has turned red due to contamination from leaking core fluid.$B$BI hope you didn''t swim in any of that contaminated water.

\
' WHERE `entry`=9748;
UPDATE `quest_template` SET `OfferRewardText`='I am in need of your services, $N. I have a plan to topple the entire Sunhawk army, but before we can progress, we need to gather some vital information.$B$BWe need to identify the weaknesses in their primary defense. Unfortunately, we have been unable to get close enough to the Vector Coil to gauge their defenses. If we could get the prisoner to talk, we could get the information that we needed to break through the line and destroy the Vector Coil.$B$BYou heard me, I want to blow the damned thing up.' WHERE `entry`=9753;
UPDATE `quest_template` SET `OfferRewardText`='Oh good, there you are! And just in time... there is much to be done!' WHERE `entry`=9758;
UPDATE `quest_template` SET `OfferRewardText`='You have saved the whole of Bloodmyst and Azuremyst, securing the $R way of life on Azeroth, $N! For this, there can be no amount of thanks, no reward, nothing large enough in scope to truly express our appreciation.$B$BYet, there are still so many that were left behind on Draenor who cannot be here for this historic event. You must find your way back. Find your way back to the Outland, Hero of Argus. Bring our people home. Home to the land that you saved. Home to Azeroth...' WHERE `entry`=9759;
UPDATE `quest_template` SET `OfferRewardText`='Our biggest enemy in the region is finally dead.  You''ve done the expedition a great favor, $N.$B$BWe shall be forever in your debt.' WHERE `entry`=9763;
UPDATE `quest_template` SET `OfferRewardText`='Vashj!$B$BThis is much more than we bargained for.  Our small victories here and there against the naga mean nothing.$B$BIf Lady Vashj is involved in this, then forces much greater than us are at work. $B$BYou''ve done well in bringing this to us, $N.  Now, we must prepare for war.' WHERE `entry`=9764;
UPDATE `quest_template` SET `OfferRewardText`='Excellent work, $N.  The naga will learn not to underestimate us.' WHERE `entry`=9766;
UPDATE `quest_template` SET `OfferRewardText`='These be fine ones, $N. Here''s your payment.$B$B<Magasha bends one of the wings and holds it up to her head.>$B$BNope, not my thing, but who''m I to complain?$B$B<Magasha shrugs.>$B$BCoin speaks.' WHERE `entry`=9769;
UPDATE `quest_template` SET `OfferRewardText`='Had your fill already?$B$B<Reavij laughs.>$B$BThere''s a reason why our visitors don''t stay long.$B$BIf I had a choice, I''d find a more agreeable spot for the post, but I''ll take marshfangs over Denjai''s temper any day.' WHERE `entry`=9770;
UPDATE `quest_template` SET `OfferRewardText`='Finally, a break from the monotony of mushrooms! If you didn''t smell like fish, I''d hug you.$B$BLet''s see how jealous the others get when they smell the meat cooking over the fire.' WHERE `entry`=9773;
UPDATE `quest_template` SET `OfferRewardText`='Thank you, $N. Every little bit helps.$B$BI''ve still got a long way to go, but let''s face it, what else am I going to do between patrols?' WHERE `entry`=9774;
UPDATE `quest_template` SET `OfferRewardText`='Ysiel sent you?  Of course I can use someone like you!  We''re always in need of a little muscle.' WHERE `entry`=9778;
UPDATE `quest_template` SET `OfferRewardText`='Thank you for your help, $N. Your generosity will not be forgotten.' WHERE `entry`=9780;
UPDATE `quest_template` SET `OfferRewardText`='These should be more than sufficient, $N. They seem to be fixated on birds, which is odd, because there aren''t any bird species native to Zangarmarsh. What could this mean?$B$BCould they have encountered the arakkoa? To a shamanistic people, they might seem like the embodiment of a powerful bird spirit.' WHERE `entry`=9787;
UPDATE `quest_template` SET `OfferRewardText`='A fair start. But that''s just the beginning.$B$BThe lesser clefthoof prove nothing. Let''s move you up to a bigger challenge' WHERE `entry`=9789;
UPDATE `quest_template` SET `OfferRewardText`='Thank you, $N.$B$B<Haalrun smiles sympathetically.>$B$BAt least you don''t have to clean them. That''s the worst job of the lot, but once it''s done, you''d never know they were attached to a giant insect.' WHERE `entry`=9790;
UPDATE `quest_template` SET `OfferRewardText`='Thank you for your help in clearing out some of the marshfang rippers, $N. If they had any intelligence, perhaps they''d learn that it''s best to live and let live.$B$B<Noraani shrugs.>$B$BGiant, overgrown bugs with intelligence. I wonder what that would be like...' WHERE `entry`=9791;
UPDATE `quest_template` SET `OfferRewardText`='So you''ve brought Timothy''s response?$B$B<Kialon pauses a moment to read the letter, then laughs.>$B$BHe''s got everything under control, he says. Doesn''t need help, he says. I could''ve predicted that!$B$BSome people never change. Look, he even took the time to correct my spelling.$B$B<Kialon lets out a half-hearted sigh.>$B$BI shouldn''t have sent the letter. I forgot. The specialist always has the situation under control. Always.' WHERE `entry`=9794;
UPDATE `quest_template` SET `OfferRewardText`='<Even though he endeavors to hide it, a look of relief spreads over Kroghan''s face.>$B$BIt''s about time you got here! Granted, you''re not an army, but any able-bodied $R than can wield a weapon or chant a spell is welcome here. The people of Garadar are kin to all the Horde and we are proud to shed our blood in their defense.' WHERE `entry`=9797;
UPDATE `quest_template` SET `OfferRewardText`='Here, let me read those plans.$B$BThe blood elves have followed us here?  They are evil to the core and should be wiped from existence!$B$B<The vindicator takes a moment to regain his composure.>$B$BI apologize, that was uncalled for.  We are indebted to you for uncovering this information, $N.' WHERE `entry`=9798;
UPDATE `quest_template` SET `OfferRewardText`='These look like fine specimens. Thank you for performing the field work. Once I can find the time to analyze these, I should be able to tell what it will take to restore the fields.' WHERE `entry`=9799;
UPDATE `quest_template` SET `OfferRewardText`='Please do not wash yourself in the sacred waters of the Throne.$B$B<Elementalist Lo''ap holds a prepared caracoli tablet up.>$B$BYou place this under your tongue and allow it ample time to dissolve. Once it has dissolved, you will be able to breathe water as if it were air.' WHERE `entry`=9800;
UPDATE `quest_template` SET `OfferRewardText`='The decrease in native species is certainly a cause for concern.  The increase in invasive species could be related to the recent disturbance in the ecosystem.  I don''t have enough information to make a conclusion, yet.$B$B<Lauranna jots down some notes on a journal as she goes through the plant parts.>$B$BTake these, $N.  They might be of some use to you.$B$BBring me any other plant parts you find.  I''ll incorporate them into my statistics.' WHERE `entry`=9802;
UPDATE `quest_template` SET `OfferRewardText`='They refused? They are welcome to choose their own path, of course, but their choice surprises me. I would think that all the draenei, including the Broken and Lost Ones, would still remember that we''re all a part of the same people.$B$BI suppose he is right about the folly of deceiving them, but still, could he not see that our intentions were friendly?' WHERE `entry`=9803;
UPDATE `quest_template` SET `OfferRewardText`='<Elementalist Lo''ap kneels in the water and says a prayer.>$B$BThe Earthen Ring takes no pride in what was done. We do what we must to heal the land.' WHERE `entry`=9804;
UPDATE `quest_template` SET `OfferRewardText`='These are great spores, $N!  Tallstalks are vital to rebuilding our town.  And after all the bog lord attacks we''ve suffered, we''re in quite the short supply.' WHERE `entry`=9806;
UPDATE `quest_template` SET `OfferRewardText`='This will help us trade with other sporelings for food and supplies.  Sporeggar thanks you, $N!' WHERE `entry`=9808;
UPDATE `quest_template` SET `OfferRewardText`='Thank you, $N.  As Sporeggar''s elder, I must ensure my people have adequate supplies.  You make my task that much easier.' WHERE `entry`=9809;
UPDATE `quest_template` SET `OfferRewardText`='<Thrall begins to read the letter.>So the blood elves finally took care of their little problem.  Never mind that it took your help as well as that of an entire Forsaken regiment to get the job done.<Thrall breaks into laughter.>I suppose there''s no stopping this.  In the end we need them just as much as they need us. Welcome to the horde Blood Elf.' WHERE `entry`=9813;
UPDATE `quest_template` SET `OfferRewardText`='The Earthen Ring thanks you, $N. The elements also give their thanks. Your continued efforts in cleansing our world are appreciated and noted.
\
' WHERE `entry`=9815;
UPDATE `quest_template` SET `OfferRewardText`='<Gordawg appears to be nodding at you.>$B$BSit.$B$B' WHERE `entry`=9818;
UPDATE `quest_template` SET `OfferRewardText`='<Gordawg nods in approval.>$B$BGood. Spirits sleep now.' WHERE `entry`=9819;
UPDATE `quest_template` SET `OfferRewardText`='<Gordawg spits out the chewed up rock, pelting you with a hail of rubble.>$B$BPoison. These rocks are not Nagrand. These rocks are from poison. You destroy poison rock. You find usurper.' WHERE `entry`=9821;
UPDATE `quest_template` SET `OfferRewardText`='Your victory over the Ango''rosh is to be celebrated, $N. I wonder how long it will be before those ogre brutes find themselves another bloodthirsty chieftain.$B$BNo matter, we''ll be ready for them.' WHERE `entry`=9823;
UPDATE `quest_template` SET `OfferRewardText`='Fascinating. I will study these essences, $N. I thank you for your help.' WHERE `entry`=9825;
UPDATE `quest_template` SET `OfferRewardText`='You know of the Violet Eye? You do not look familiar.' WHERE `entry`=9826;
UPDATE `quest_template` SET `OfferRewardText`='It looks like the basidium of a bog giant, but I haven''t seen one in this condition before. I''d heard that the giants in the Dead Mire had begun to wither, but it''s far more advanced than I expected.$B$BThe Dead Mire was once a lake like the others in the marsh, and it served as the spawning ground for the giants. With the waters receding, it seems the changes are preventing the giants from sporing. If this continues, the giants may disappear entirely.' WHERE `entry`=9827;
UPDATE `quest_template` SET `OfferRewardText`='The Violet Eye? You don''t say.$B$BShow me this report you speak of.' WHERE `entry`=9829;
UPDATE `quest_template` SET `OfferRewardText`='You''ve done well, $N.  I wasn''t sure you would succeed.$B$BThe containers are enchanted with a potent spell that masks their presence from unworthy eyes.  I''m glad to see they did not elude you.' WHERE `entry`=9831;
UPDATE `quest_template` SET `OfferRewardText`='You have the fragments. This is most impressive, $N. You''re certainly worthy of holding the key to Karazhan.$B A small problem remains.' WHERE `entry`=9832;
UPDATE `quest_template` SET `OfferRewardText`='These are good hides, Maktu thinks. They will make very good armor.$B$BWho knows? There might even be enough left over for Maktu to make some armor for the draenei.' WHERE `entry`=9834;
UPDATE `quest_template` SET `OfferRewardText`='That key, I recognize it. That is Kadghar''s key... of course I haven''t given it to him yet.' WHERE `entry`=9836;
UPDATE `quest_template` SET `OfferRewardText`='His own key? That''s incredible!$B$BI do not sense any disturbances in our timeline, so I suppose it was meant to occur all along. There''s no turning back now, $N. The key is yours and only yours.' WHERE `entry`=9837;
UPDATE `quest_template` SET `OfferRewardText`='I sent you to deliver a report and you come back with a key to this place? There must be more to you than meets the eye, $N.' WHERE `entry`=9838;
UPDATE `quest_template` SET `OfferRewardText`='<Koren looks at you with an uncertain look.>$B$BI know nothing of this Violet Eye you speak of. A blacksmith is all I am.' WHERE `entry`=9840;
UPDATE `quest_template` SET `OfferRewardText`='You found the log. I sure hope the information we need is in here, $N.' WHERE `entry`=9843;
UPDATE `quest_template` SET `OfferRewardText`='You did it! Yes, the readings are becoming normal once again!$B$BWe must give this news to Cedric. He''s going to be very impressed with your achievement.' WHERE `entry`=9844;
UPDATE `quest_template` SET `OfferRewardText`='<Timothy leafs through the manual.>$B$BThey''re using ragveil as a base for the poison? No, that can''t be right. Ragveil has no toxic properties.$B$BIncluding ragveil in a poison is like a rogue wielding two maces. Sure, you can do it, but it isn''t true to the essence of your calling! I just can''t understand...$B$B<Timothy clears his throat.>$B$BI mean, thank you for fetching these for me. I''ll try out the poison as soon as time permits.' WHERE `entry`=9848;
UPDATE `quest_template` SET `OfferRewardText`='Impressive. Most impressive.$B$BYou''ve got potential, kid. Now I''m going to give you the chance to have some real fun!' WHERE `entry`=9850;
UPDATE `quest_template` SET `OfferRewardText`='$N! You bring joy to this old dwarf''s heart.$B$BYou have now proven yourself; you''ve joined the ranks of the elite! Others ran away in fear, or died, trampled under the foot of the beast. You used your mind, your cunning, your determination to prove your mastery of the hunt.$B$BTake this and know that you are always welcome to hunt at my side!' WHERE `entry`=9852;
UPDATE `quest_template` SET `OfferRewardText`='<Gordawg chomps down hard on Gurok''s earthen head, nearly disintegrating the stone formation.>$B$BGurok''s reign has come to an end. The earthen elements are free. All sleep now. Champion gets reward!' WHERE `entry`=9853;
UPDATE `quest_template` SET `OfferRewardText`='You have proven your skill once more, $C. Now you must go on to stalk the fiercest of the windrocs.' WHERE `entry`=9855;
UPDATE `quest_template` SET `OfferRewardText`='Her eye looks as if it is still alive. Do you think that she can still see into your soul?$B$B$N, you can now count yourself as one of the elite safari hunters. And you are another step closer to stalking the ultimate prey of this land, Tusker!$B$BYou''ve earned the right to have this. May it serve you well.' WHERE `entry`=9856;
UPDATE `quest_template` SET `OfferRewardText`='<cough>, <cough>... $N! You did it. There''s only...<cough>... one thing left to...<cough>... do then.' WHERE `entry`=9858;
UPDATE `quest_template` SET `OfferRewardText`='Wow! You did it! That''s really Bach''lor''s hoof!$B$BUm, I''m starting to feel much better it would seem. Here, let me give you something in celebration of your proven hunting prowess!' WHERE `entry`=9859;
UPDATE `quest_template` SET `OfferRewardText`='You saw them controlling the elements? The wind bent to their will?$B$B<Morgh is lost in thought for a moment.>$B$BThis is troubling, $N. I must consult with the others.$B$BWe thank you for your efforts, $N. Perhaps you should return to your village and see if they have any other information about the Murkbloods and their nefarious goals.' WHERE `entry`=9862;
UPDATE `quest_template` SET `OfferRewardText`='<Saurfang turns to face you.>$B$BIs it blood that I smell? I regret being unable to lend assistance. How proud you must be. My chest swells just knowing what you have done.$B$BAre there others like you? Where you come from, do more heroes exist?' WHERE `entry`=9865;
UPDATE `quest_template` SET `OfferRewardText`='<Farseer Corhuk stares at the ground, lost in contemplation. He nods his head affirmatively.>$B$B<Farseer Corhuk wipes a tear away.>$B$BThe son is the father... May the spirits have mercy on those that stand in his way.' WHERE `entry`=9866;
UPDATE `quest_template` SET `OfferRewardText`='<Arechron slams his fist into his hand.>Ortor... Treacherous bastard! ' WHERE `entry`=9871;
UPDATE `quest_template` SET `OfferRewardText`='<Garrosh crumples up the map and throws it into the fire.>$B$BWhat''s the use? They''ve been attacking us for weeks. This is nothing new.$B$BDon''t you understand? We''re done for... Greatmother Geyah is dying.' WHERE `entry`=9872;
UPDATE `quest_template` SET `OfferRewardText`='A new species!  Are you sure?$B$B<Lauranna flips through pages of notes and diagrams.>$B$BNice job, $N.  We''ll have to add this one to our list.  How does "Purple Leafed $Nrium" sound to you?  It does have a ring to it.' WHERE `entry`=9875;
UPDATE `quest_template` SET `OfferRewardText`='Thank Cenarius you showed up.  My injuries prevented me from going back to the outside for help.' WHERE `entry`=9876;
UPDATE `quest_template` SET `OfferRewardText`='Janeda''s sending you to rescue the Deatholme prisoners? She must think very highly of you, $N.' WHERE `entry`=9877;
UPDATE `quest_template` SET `OfferRewardText`='Color me impressed.  These are in excellent condition, for the most part.$B$BI will make sure to put in a good word for you with our people.' WHERE `entry`=9882;
UPDATE `quest_template` SET `OfferRewardText`='Keep the crystal fragments coming, $N. We cannot let these thieves take our property.$B$BEven if it''s not ours just quite yet. A technicality, of course.' WHERE `entry`=9883;
UPDATE `quest_template` SET `OfferRewardText`='<Kilrath speaks in a hushed tone.>$B$BThese ogres are extremely peculiar. They are also extremely stupid. Look how the fat one makes the, um, lesser fat ones dance. It''s mesmerizing.' WHERE `entry`=9888;
UPDATE `quest_template` SET `OfferRewardText`='We''ll make a good profit on these, $N. I''ll make sure Khoraazi hears about your work here.' WHERE `entry`=9892;
UPDATE `quest_template` SET `OfferRewardText`='Excellent. This will keep us in business while we wait for the Sha''tar to finish whatever housekeeping it is they need to do inside Oshu''gun. ' WHERE `entry`=9893;
UPDATE `quest_template` SET `OfferRewardText`='I can''t thank you enough, $g lad:lass;. I''m going to enjoy this...' WHERE `entry`=9896;
UPDATE `quest_template` SET `OfferRewardText`='Well, I couldn''t see if you helped out with saving Kristen, or not. But if she handed you one of her bundles of skins then you''re alright in my book.Here''s your reward.' WHERE `entry`=9897;
UPDATE `quest_template` SET `OfferRewardText`='Thank you, $N. Perhaps with the help of the draenei, this marsh will one day be free of naga. I can''t imagine what it must be like to be forced to serve them.$B$BHe doesn''t talk about it often, but Maktu was once a slave.' WHERE `entry`=9902;
UPDATE `quest_template` SET `OfferRewardText`='<Maktu nods approvingly.>$B$BMaktu is thankful for your help. Maktu''s pride is satisfied. He will not be caught off guard again.' WHERE `entry`=9905;
UPDATE `quest_template` SET `OfferRewardText`='Are you sure that''s real? I mean, I knew there was large wildlife in the marsh, but there are giant creatures and then there are GIANT bugs.$B$BCome to think of it, the sporelings did mention a story about a fearsome nether ray that used to terrorize them before the boglord incursion.$B$BWhat if the stories are true? Oh, dear. I''d better take that for safekeeping. The expedition will want to know about this.' WHERE `entry`=9911;
UPDATE `quest_template` SET `OfferRewardText`='Welcome to Cenarion Refuge, $N.  I hope you''ve come to aid us in our mission.  We''ve much work ahead of us.' WHERE `entry`=9912;
UPDATE `quest_template` SET `OfferRewardText`='Are you ready to get to work, $R? I think I''ve got the perfect task for you.' WHERE `entry`=9913;
UPDATE `quest_template` SET `OfferRewardText`='Never doubted you for a second, friend.  Most of those look like fine specimens, if a bit dirty and scratched up.  Still, I think they''re worth the value we agreed upon previously.$B$BI hope that we can continue to do business in the future.' WHERE `entry`=9914;
UPDATE `quest_template` SET `OfferRewardText`='Excellent, more fine tusk specimens, though some look a bit dingy.You have the far-reaching gratitude of the Consortium, $N. ' WHERE `entry`=9915;
UPDATE `quest_template` SET `OfferRewardText`='<Bintook reads the plans.>BY THE LIGHT! Their penmanship is atrocious. From what I can gather, they''re either planning to "eat the blue skins and take their village" or bake a blueberry pie. It really could go either way. We must get to the bottom of this! ' WHERE `entry`=9917;
UPDATE `quest_template` SET `OfferRewardText`='You bring a smile to my face, $N.  Or you would, rather, if I had a face.$B$BKeep it up and you and I are going to be the best of friends.' WHERE `entry`=9925;
UPDATE `quest_template` SET `OfferRewardText`='Thirty orcs, $r! Of those original thirty, only Ungriz and I remain. We found the young orc, Saurfang, nearly dead near Sunspring. Apparently he was here for another reason...
\
' WHERE `entry`=9944;
UPDATE `quest_template` SET `OfferRewardText`='You have done what none thought was possible and brought back our missing brothers and sisters. You are a hero to the Mag''har, $N. All will know your name and the deeds that you have performed for us.\
\
' WHERE `entry`=9948;
UPDATE `quest_template` SET `OfferRewardText`='I''m glad that Stonebreaker Hold sent you. The druids of the thicket have been slain! Only myself and one other have survived. and he''s insane.$B$BI don''t know what happened, but I intend to get to the bottom of it. Whatever it was, it happened quickly and feels unnatural.$B$BWill you help me?' WHERE `entry`=9961;
UPDATE `quest_template` SET `OfferRewardText`='Oh boy. Mogor has invoked his right of battle as hero of the Warmaul. You have to fight him!$B$BNobody ever said the Warmaul were good sports... erm... ogres.\
' WHERE `entry`=9973;
UPDATE `quest_template` SET `OfferRewardText`='Yes?  How may I help you today, $r?' WHERE `entry`=9979;
UPDATE `quest_template` SET `OfferRewardText`='Calm down, bright eyes! Sal''salabim will help.' WHERE `entry`=10004;
UPDATE `quest_template` SET `OfferRewardText`='We are victorious! The Legion''s advances have been halted!$B$BI offer you a choice of rewards for your heroic deeds!' WHERE `entry`=10011;
UPDATE `quest_template` SET `OfferRewardText`='You have my thanks, $N. We are keepers of the light and cannot forsake our responsibilities, even in the most difficult of times.' WHERE `entry`=10021;
UPDATE `quest_template` SET `OfferRewardText`='The pelt is even more magnificent than I had hoped! This is a good omen, $N, and the spirits will favor you for your contribution to this ceremony.$B$BI have fashioned a helmet for you from the remaining pelts, $N. It identifies you as a mighty hunter and an ally of the great wolf spirit of Terokkar Forest.' WHERE `entry`=10023;
UPDATE `quest_template` SET `OfferRewardText`='These are all in excellent state, $N. Carry on and you will soon count the Scryers as your friends.' WHERE `entry`=10024;
UPDATE `quest_template` SET `OfferRewardText`='I thank you, $N. Voren''thal''s visions might one day decide the fate of our race. It would behoove us to do our best to ensure that those visions are as accurate as possible.$B$B<This quest can be repeated up to Neutral reputation.>' WHERE `entry`=10025;
UPDATE `quest_template` SET `OfferRewardText`='Yeah, I''m sure that you killed all of those bonelashers. It''s obvious since the captain asked for you to turn in proof on that wanted poster.$B$B<Taela gives you a sarcastic look.>$B$BI''ll take your word for it. I''m not certain who I angered to pull this duty, but thanks for your efforts on behalf of the Alliance. Here''s a little something for all of your trouble.' WHERE `entry`=10033;
UPDATE `quest_template` SET `OfferRewardText`='You must have killed a lot of those bonelashers! Good, I hate them! Ever since I was bit by one of them, I keep having fainting spells.$B$BDo you realize how embarrassing that is? Here, take this as thanks for exacting some revenge for me.' WHERE `entry`=10034;
UPDATE `quest_template` SET `OfferRewardText`='Color me impressed, $C. Torgos was one of the toughest creatures I know of this side of Nagrand.$B$BWell, I suppose that''s good enough for something from the Allerian Stronghold treasury. Take your pick.' WHERE `entry`=10035;
UPDATE `quest_template` SET `OfferRewardText`='I thank you, $N! You have exacted my revenge, and as promised you will be rewarded!$B$BTake your pick of one of these and use it well!' WHERE `entry`=10036;
UPDATE `quest_template` SET `OfferRewardText`='Thanks! I can''t remember the last time I had eel!$B$BHow should I cook ''em?' WHERE `entry`=10037;
UPDATE `quest_template` SET `OfferRewardText`='It''s about time someone came out here. I sent that report to the Allerian Stronghold over a week ago!$B$BBureaucracy!' WHERE `entry`=10038;
UPDATE `quest_template` SET `OfferRewardText`='Good, you finally made it back! Okay, what did you figure out? Who are they?' WHERE `entry`=10040;
UPDATE `quest_template` SET `OfferRewardText`='That''s dire news indeed! Well, it would seem I made the right choice in sending you out there to help Weeks. The last thing that we want is the Shadow Council establishing themselves right on our doorstep!$B$B$N, in recognition of your efforts at Grangol''var Village, I hereby grant you the right to your pick of any of these fine rewards.' WHERE `entry`=10042;
UPDATE `quest_template` SET `OfferRewardText`='You are very resourceful, $N. Our greatest gatherers would have taken twice as long to collect the herbs.<Greatmother Geyah mixes the herbs into a potion and then places the tincture to your lips, forcing you to drink.>Do not be afraid. ' WHERE `entry`=10045;
UPDATE `quest_template` SET `OfferRewardText`='This is in better condition than I thought it''d be. Sure. it''s going to take some time to work off all the rust. the char. and the like, but I''ll not complain.' WHERE `entry`=10055;
UPDATE `quest_template` SET `OfferRewardText`='I am always accepting crystal powder contributions, $N. You will be compensated for each set of samples that you recover.' WHERE `entry`=10075;
UPDATE `quest_template` SET `OfferRewardText`='This stuff is great! A little bent and a little burnt, but I''ve never let low grade materials stop me from making precision high explosives.$B$BThanks, $N. You really have an eye for quality trash!' WHERE `entry`=10086;
UPDATE `quest_template` SET `OfferRewardText`='To''gun was here earlier giving me his report. He should have stayed with you to help!$B$BI sent him back out there to assist Grik''tha. I think they make a cute couple.$B$BSo, these are the soul devices that the Shadow Council were using to enhance their summoning power? They look dangerous to me ' WHERE `entry`=10091;
UPDATE `quest_template` SET `OfferRewardText`='Opening the magically suspended tome, a sense of dread overwhelms you.$B$BSomething is most definitely wrong here!$B$BYou read on, but what you read seems unbelievable!' WHERE `entry`=10094;
UPDATE `quest_template` SET `OfferRewardText`='Murmur almost broke free?! They''ve had that thing contained in there for two years... I wonder what they did wrong to lose control over it after all this time?$B$B$N, by putting that beast down you''ve likely saved all of us! I cringe to think what would have happened to all of us here, and the rest of Outland, if that thing had somehow managed to break free!$B$BI''m glad you helped us to take matters into our own hands and deal with the Shadow Council threat at Auchindoun. How can we ever reward you?' WHERE `entry`=10095;
UPDATE `quest_template` SET `OfferRewardText`='I may never truly be forgiven for my role in the crimes of the Sethekk, but perhaps by restoring the relics of Terokk to my people, I can begin to redeem myself.$B$BThank you for helping me in this, $N. You have no idea of the magnitude of what you''ve done this day.' WHERE `entry`=10098;
UPDATE `quest_template` SET `OfferRewardText`='<A gentle, melodic voice fills your mind.>$B$BI am K''ure of the naaru, $N. You stand within the heart of my ancient vessel.$B$BOshu''gun, as the orcs named it, is the ship that first brought the draenei to this world. Though we fell from the heavens and crashed here many hundreds of years ago, my weakened energies have remained trapped within this wreckage. Regrettably, I am the source of the orc spirits'' pain.' WHERE `entry`=10101;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $N. Your actions in the field are instrumental in our battle for Hellfire Peninsula.' WHERE `entry`=10106;
UPDATE `quest_template` SET `OfferRewardText`='Excellent! Now just a few adjustments and this thing will be as good as new. Oh yes, your key! Here you go.$B$BBy the way, the Jump-a-tron still has a few kinks that I need to work out. Um, just be careful.
\
' WHERE `entry`=10109;
UPDATE `quest_template` SET `OfferRewardText`='I am relieved to hear that he is safe. Have you come to join the hunt?
\
' WHERE `entry`=10114;
UPDATE `quest_template` SET `OfferRewardText`='Remarkable! There have been others who tried to claim the bounty, but they never returned. It''s not hard to figure out what happened to them.$B$BI''m relieved that we''ll no longer be troubled by Mummaki and his degenerates.' WHERE `entry`=10116;
UPDATE `quest_template` SET `OfferRewardText`='Welcome to Outland, $N -- welcome to the nightmare! Though the initial Expeditionary Force made it through unscathed, the Legion is attempting to retake the Dark Portal and prevent any of our reinforcements from coming though.$B$BAs much as I''d like your aid here, our troops and the Horde soldiers are able to fend off the Legion platoons that are attempting to take control of this platform.$B$BWe need you where your talents can best be utilized.' WHERE `entry`=10119;
UPDATE `quest_template` SET `OfferRewardText`='Outstanding work, soldier. The frequency of the attacks is sure to lessen - at least until they bring forth more dreadlords.$B$BNow for the bad news: I''ve got your new orders...' WHERE `entry`=10123;
UPDATE `quest_template` SET `OfferRewardText`='Hmph.  Just looks like a big lump of unrefined crystal to me.$B$BAdmittedly, I can feel a sickly, evil aura emanating off of it, but that''s not exactly in my line of work.  I''m just here to put an end to the mountain giant menace.' WHERE `entry`=10134;
UPDATE `quest_template` SET `OfferRewardText`='For generations to come, they will sing songs of this day, $N - songs of your valor. I wish Thrall had been here to celebrate this victory with us. The Legion is undone - and Hellfire now belongs to the Horde once again! There may yet be hope for this ravaged world - and our peoples'' place within it. $B$BLok''tar ogar!$B$B' WHERE `entry`=10136;
UPDATE `quest_template` SET `OfferRewardText`='Our expedition to this forsaken, wreck of a world has almost ground to a halt, $n. We encountered more resistance than we bargained for.$B$BAs if facing the Burning Legion again wasn''t bad enough - there are horrors in this land unlike anything we''ve ever encountered.' WHERE `entry`=10140;
UPDATE `quest_template` SET `OfferRewardText`='Force Commander Danath may have misunderstood my request for reinforcements. You look capable, but... I asked for a full sized battalion!$B$BYou see, we have a bit of a demon problem...' WHERE `entry`=10141;
UPDATE `quest_template` SET `OfferRewardText`='Outstanding work, soldier. The frequency of the attacks is sure to lessen - at least until they bring forth new dreadlords.$B$BNow for the bad news: I''ve got your new orders...' WHERE `entry`=10142;
UPDATE `quest_template` SET `OfferRewardText`='Glad to meet you, soldier.$B$BEnough chatting... now listen up -- I have a vital mission for you and I want you to succeed... and survive!' WHERE `entry`=10143;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $n.  Disabling those portals will stem the flow of Legion reinforcements for a long time!$B$BBut we can''t rest yet...' WHERE `entry`=10144;
UPDATE `quest_template` SET `OfferRewardText`='You fly as if you''ve been doing this your entire life, $N. Outstanding performance out there! Not even a scratch on the gryphon destroyers!' WHERE `entry`=10163;
UPDATE `quest_template` SET `OfferRewardText`='I no longer belong to this world and must admit defeat.  The land has forever changed and nothing will ever be the same.Leave the pendant here with me, maybe one day, long after the elves are gone, a new tree will grow on this very spot - amongst a burnt forest and the husks of dead treants. ' WHERE `entry`=10166;
UPDATE `quest_template` SET `OfferRewardText`='The memory is vivid, $N. My energies were wholly drained from the crash. I was only a dim speck of void energies when the Prophet Velen and his draenei compatriots lifted my remains and brought them here. After much ceremony, my diminished form was laid to rest within this sarcophagus. I have been regenerating for nearly a thousand years. The cycle is almost complete...' WHERE `entry`=10167;
UPDATE `quest_template` SET `OfferRewardText`='<Archmage Vargoth''s image examines you as you convey Ravandwyr''s message.>$B$BRavandwyr has everything a master can expect of his apprentice. When I gave him the staff and told him to flee. I hoped that he would use it to find help and free me once Kael''thas''s forces withdrew from the tower. Since then, I have learned a great deal about the nature of the curse.$B$BIt can be broken, $N, but it will require your help.' WHERE `entry`=10174;
UPDATE `quest_template` SET `OfferRewardText`='<Thrall''s voice takes on the hollow essence of a storm cloud.>I... I have a grandmother? She lives? ' WHERE `entry`=10175;
UPDATE `quest_template` SET `OfferRewardText`='What? Grik''tha sent you in here after me?$B$BI don''t know whether to be touched or call her a fool!$B$BDo you think you could help me get out of this cage? It''s a bit cramped.' WHERE `entry`=10178;
UPDATE `quest_template` SET `OfferRewardText`='It is not what they deserved, but it is the best we can do.' WHERE `entry`=10184;
UPDATE `quest_template` SET `OfferRewardText`='Hey, watch where you''re pointing that thing! You''ve got it set to ''Kill''!!!$B$BIt looks like you''ve recharged the battery, and then some. This''ll help immensely to keep these guys going.' WHERE `entry`=10190;
UPDATE `quest_template` SET `OfferRewardText`='Wow! Alright, now we''re talking!$B$BLet me just take those little beauties and squeeze the badness right out of them. This should make a rocket fuel brew that''ll blow everyone''s socks off!$B$BHere, just let me mix the shale oil and this stinger venom together, and we''ll see what happens....' WHERE `entry`=10199;
UPDATE `quest_template` SET `OfferRewardText`='You must be the one that zapped all of that sapping equipment back to us here from the ruins! Hooray for you!$B$BI''ve already reallocated the equipment out to our other locations. Now we''ll be able to expedite our fissure operations on this whole island by an order of magnitude! The nether' WHERE `entry`=10203;
UPDATE `quest_template` SET `OfferRewardText`='It''s a relief to hear that scum is finally dealt with. You do good work, $N... may I be so forward as to call you by your name?$B$BIf you''re willing, I have another task that needs doing. One that is very important and someone of your obvious skill should be able to handle with ease.' WHERE `entry`=10205;
UPDATE `quest_template` SET `OfferRewardText`='Well done! I could almost feel the tremors of the explosions from here!$B$BNow, we have one more bombing mission for you...' WHERE `entry`=10208;
UPDATE `quest_template` SET `OfferRewardText`='<You''re not sure whether it''s just distortion. or the archmage really is smiling.>$B$BWith the last of my possessions restored, I have everything I need to break through Kael''thas''s magic. I''ll begin working the spell right away.' WHERE `entry`=10209;
UPDATE `quest_template` SET `OfferRewardText`='I hope you learned a thing or two about Shattrath, $N.  It might take some time for things to sink in.' WHERE `entry`=10211;
UPDATE `quest_template` SET `OfferRewardText`='We were shot down by the Burning Legion, even though we waved a flag of truce.  Who knew the Burning Legion was so mean? $B$BWe cannot come with you to Spinebreaker Post.  We need to repair our zeppelin and be on our way.  ' WHERE `entry`=10213;
UPDATE `quest_template` SET `OfferRewardText`='Seeing as how this was Morphalius''s idea, I decided to give him his old job back. Well done little flesh beast. Well done, indeed!$B$BRemember, if you''re ever looking for work and happen to be in Netherstorm, come find me at the Stormspire.\
' WHERE `entry`=10218;
UPDATE `quest_template` SET `OfferRewardText`='Wow, that''s a lot of essence!$B$BOk, let''s see what happens when I mix it with the etherlithium matrix crystals.' WHERE `entry`=10224;
UPDATE `quest_template` SET `OfferRewardText`='Ooh, etherlithium matrix crystals. Yeah, those sound important!$B$BLet''s just put them over here and I''ll get to figuring them out in a moment.' WHERE `entry`=10225;
UPDATE `quest_template` SET `OfferRewardText`='That''s more like it! Alright, now I think we''re in business.$B$BJust let me dump this stuff into the thing' WHERE `entry`=10226;
UPDATE `quest_template` SET `OfferRewardText`='I have studied ancient history my entire un-life.  I have never seen anything like this book.  It tells the entire history of the Armory, including events that happened after its destruction.  $B$BThe Unyielding have kept their history, even after they had fallen in battle.  With this book we will be able to understand the Unyielding and convince them to join us.  ' WHERE `entry`=10229;
UPDATE `quest_template` SET `OfferRewardText`='You have done well $N.  This ancient horn will allow us to summon the Unyielding. $B$BThat is, if they are willing.  ' WHERE `entry`=10230;
UPDATE `quest_template` SET `OfferRewardText`='Well, that''s good and bad news, now isn''t it? We''ve dealt them a blow, but with the Burning Legion running free all over the Netherstorm ' WHERE `entry`=10232;
UPDATE `quest_template` SET `OfferRewardText`='These will have to do for now, I suppose. If only we could scare them off.$B$BHey, that gives me an idea!' WHERE `entry`=10234;
UPDATE `quest_template` SET `OfferRewardText`='He, uh... he said what? THEY''RE GONNA GO AFTER AREA 52?!$B$BOh, this is not good... not good!' WHERE `entry`=10235;
UPDATE `quest_template` SET `OfferRewardText`='Heh, you''re kidding, right? The Burning Legion is blaming us for all of that?$B$BBut YOU''RE the one that did it!$B$BOy, I have a headache and it''s as big as this rocket. Okay, okay, this calls for a change of plans.$B$BIf the Burning Legion thinks that it''s going to come here, destroy our town and ruin my dream of cruising through the Twisted Nether, they are sadly mistaken.$B$BAnd I know just the goblin to help us out.' WHERE `entry`=10237;
UPDATE `quest_template` SET `OfferRewardText`='Thank you for saving my peons.  Now maybe I can get them to fix my shredder with those parts you found. earn some money and get out of Outland.  I can''t wait to be back in Booty Bay.' WHERE `entry`=10238;
UPDATE `quest_template` SET `OfferRewardText`='I don''t believe I''ve seen anything like this before. There''s certainly a lot of energy suspended in here, but it''s in a raw form. We''ll have to be careful with it, but I think we can find a way to adapt this to help ward off the mana creatures.' WHERE `entry`=10239;
UPDATE `quest_template` SET `OfferRewardText`='Excellent work, $N. The Scryers have uncovered valuable information thanks to your distraction. Maybe they''ll actually share it with us this time.' WHERE `entry`=10241;
UPDATE `quest_template` SET `OfferRewardText`='You''ve done well, $N. Allow me a few moments to go over your transcription.$B$BYou have the priesthood''s thanks, $C.' WHERE `entry`=10245;
UPDATE `quest_template` SET `OfferRewardText`='Well. well, it would appear that we are in luck, young man.$B$BI was just recently able to finish the construction of my latest invention, the Scrap Reaver X6000!$B$BAnd you''re going to have the honor of helping me test it so that it can be used in defense of Area 52!' WHERE `entry`=10247;
UPDATE `quest_template` SET `OfferRewardText`='Well, my boy that certainly was exciting! And for my money, I''d say that the Scrap Reaver X6000 performed admirably, despite its rookie pilot.$B$BHehe, no, don''t take offense, I was just kidding. After all, you just saved Area 52 and the X' WHERE `entry`=10248;
UPDATE `quest_template` SET `OfferRewardText`='$N! Or, should I say Junior Technician 1st Grade $N?! Oh hell, who am I kidding? Skipping a grade isn''t a good enough reward for what you''ve done. I''m going to make you my first officer!$B$BYou''ve saved all of us, and more importantly the X-52 Nether-Rocket! I could just kiss you... but I won''t.$B$BInstead, please let me present you with the gratitude of Area 52. Take your pick!' WHERE `entry`=10249;
UPDATE `quest_template` SET `OfferRewardText`='I am glad to hear that the Unyielding joined you in your battle.  I thought they might come to the sound of their own battle horn, but I could not be sure.  Perhaps we have given some of them the vengeance they so desperately crave.  $B$BYou have slain Urtrak and we must report your victory to Commander Hogarth in the Expedition Armory.  He will understand the risks you have taken on his behalf.' WHERE `entry`=10250;
UPDATE `quest_template` SET `OfferRewardText`='Well met, my $gbrother:sister;.  I''m glad you''ve come. I am Danath - leader of the Sons of Lothar, and force commander of this hold.' WHERE `entry`=10254;
UPDATE `quest_template` SET `OfferRewardText`='Commander Sarannis, you say? Hmm...$B$BShe''s one of Kael''thas''s advisors, but certainly not a mage. I remember her from the attack on Kirin''Var Village. I think your impressions are correct, $N. She''s not maintaining the curse personally, but she holds the key to it.' WHERE `entry`=10256;
UPDATE `quest_template` SET `OfferRewardText`='We lost our battle against the fel orcs so very long ago. You have restored some of our lost honor by killing Urtrak. $B$BTake one of our weapons with you.  When you are fighting our most hated foes, use this weapon, and those who are free of our curse will come to your aid.  $B$BBefore you leave, those who died at the siege tower wish to honor you for destroying our enemies. ' WHERE `entry`=10258;
UPDATE `quest_template` SET `OfferRewardText`='Woo hoo! Do you know how hard these things are to come by? It''s not like I''m getting a regular shipment of parts out here.$B$BTell you what, as payment I want you to take something out of my box of junk. I''m sure there''ll be something in there you can use. And if not, sell it.$B$BAlright, let me just take that off of your hands and get it into my Long Neck Spectrum Analyzer before the failing servo in it explodes!' WHERE `entry`=10261;
UPDATE `quest_template` SET `OfferRewardText`='Let me have a look at that.$B$BHmm, there doesn''t appear to be anything special about it. I doubt this is it, though the manner in which you describe the Burning Legion''s activities at the ruins, it sounds as if they''re searching for something in particular as well.$B$BLet us hope that it''s not the crystal that the nexus-prince wants so badly.' WHERE `entry`=10265;
UPDATE `quest_template` SET `OfferRewardText`='Yes, it''s true. The blood elves have reneged on yet another purchase of goods that has already been delivered.$B$BAs Nether-Stalker Khay''ji has vouched for you, I am hopeful that you will be able to assist me in this matter.' WHERE `entry`=10266;
UPDATE `quest_template` SET `OfferRewardText`='Well, I for one am glad that this petty little business is behind us. I cannot remember a time when the Consortium has had dealings with such boorish and untrustworthy beings.$B$BYou, however, seem to be very trustworthy, $N. Perhaps you wouldn''t mind doing me one more favor?' WHERE `entry`=10267;
UPDATE `quest_template` SET `OfferRewardText`='I welcome you to the Stormspire, $C. Please enjoy the hospitality of the Consortium.$B$BYou may place that equipment anywhere. I suspect that you''ll be picking it back up rather soon.' WHERE `entry`=10268;
UPDATE `quest_template` SET `OfferRewardText`='<Dealer Hazzin lowers his voice to a whisper.>$B$BAh, I know of your mission. It is one of great importance to Nexus-Prince Haramad!$B$BNow that we know the location of this first triangulation point, you must move swiftly to find the second!' WHERE `entry`=10269;
UPDATE `quest_template` SET `OfferRewardText`='This power cell should hold for our purposes. Once the money starts rolling in, we''ll improve it even more.$B$BEnough with such things. Every moment spent in discussion translates to lost profit.' WHERE `entry`=10270;
UPDATE `quest_template` SET `OfferRewardText`='Very good indeed. The nexus-prince shall be pleased!$B$BWe now have the second point, which will now tell us where the third is, and the general vicinity of the crystal!' WHERE `entry`=10275;
UPDATE `quest_template` SET `OfferRewardText`='Beyond my wildest dreams, I never thought that you would be able to retrieve the crystal!$B$BAnd then to actually give it to me! Do you have any idea how powerful it is?$B$BYour selflessness is inspirational and beyond reproach, $N! You have given me much to think about.' WHERE `entry`=10276;
UPDATE `quest_template` SET `OfferRewardText`='Hopefully you now have a better understanding of what is expected of you.$B$B' WHERE `entry`=10277;
UPDATE `quest_template` SET `OfferRewardText`='I''ll talk, $c.  Put your weapon down, I don''t want any more trouble.' WHERE `entry`=10286;
UPDATE `quest_template` SET `OfferRewardText`='Viera Sunwhisper?  That lousy little brat.$B$BI will show her I''m not one to be trifled with!' WHERE `entry`=10287;
UPDATE `quest_template` SET `OfferRewardText`='$BExcellent. the warp rift generator is almost complete. There is only one final ingredient we require. Soon we shall be able to open up a warp rift to the deepest parts of the abyss. $B$BWho knows what strange creature may come through? Think of it $N. the power such knowledge will bring is limitless.' WHERE `entry`=10294;
UPDATE `quest_template` SET `OfferRewardText`='You have saved my life''s work $N.$B$BThey called me insane. they laughed at me. they thought I was mad for my obsession with the Void Ridge and Warp Fields. Now with this soul shard I can unlock the secrets of the voidwalkers. I will command the power of the abyss.' WHERE `entry`=10295;
UPDATE `quest_template` SET `OfferRewardText`='Indeed, if the orcs never make it to Azeroth, the Alliance will never form. Eventually civil war will break out, further weakening the human kingdoms.$B$BUltimately the Burning Legion will invade Azeroth, destroying it in the absence of any defenders.' WHERE `entry`=10296;
UPDATE `quest_template` SET `OfferRewardText`='The Light smiles upon you, $N. We were all praying for your success.' WHERE `entry`=10299;
UPDATE `quest_template` SET `OfferRewardText`='<Ravandwyr carefully examines the crystals. then selects one.>$B$BThis crystal should work. I''ll reshape the stave''s socket to secure the new headpiece.$B$BWhen Archmage Vargoth sees it, he will be disappointed, but I can bear my master''s disappointment if it means we''ve freed him.' WHERE `entry`=10300;
UPDATE `quest_template` SET `OfferRewardText`='Excellent, $N. Now, we have most of what we''ll need to attempt to break Kael''thas''s magic.$B$BAnd if the blood elves suffer from the loss of their local commander, so much the better.' WHERE `entry`=10301;
UPDATE `quest_template` SET `OfferRewardText`='You''re finished? That''s good news. Hopefully, we can find a way to avoid the killing of these mutated beasts in the future.$B$BI believe I have formed a plan that might give us an alternative solution to this problem, but I will need your help.' WHERE `entry`=10302;
UPDATE `quest_template` SET `OfferRewardText`='<The custodian smiles at the mention of Cohlien''s name.>$B$BYou''re absolutely right about the hat. He wore it all the time and wouldn''t let it out of his sight.$B$BThere were a couple of times when a fellow mage, who shall remain nameless, ''borrowed'' the hat and hid it as a prank. Needless to say the threat of one of Cohlien''s frostbolts changed his mind.$B$BI''m going to miss little Cohlien. He had quite a way with the elven women.' WHERE `entry`=10307;
UPDATE `quest_template` SET `OfferRewardText`='Traitors, all of them!$B$BGood work, $C! If you find your way back down there again, I''m always looking to add to my collection of their insignia!' WHERE `entry`=10308;
UPDATE `quest_template` SET `OfferRewardText`='Wow, look at that... a beating fel reaver heart! Well, it''s not really ''beating'', but you know what I mean.$B$BI can''t wait to put this thing to good use. Or, maybe sell it. I know a few suck... er, clients that might be interested.$B$BHere, you''ve earned your pay and then some!' WHERE `entry`=10309;
UPDATE `quest_template` SET `OfferRewardText`='Hmm...$B$BIt seems I was right. There is a pattern here.$B$BThe most aggressive and dangerous ghosts coincide with the most powerful and highest ranking Kirin Tor who resided in the village. The townspeople and tradesmen seem overlooked by comparison. What could this mean?' WHERE `entry`=10312;
UPDATE `quest_template` SET `OfferRewardText`='<Custodian Dieworth examines the remnants.>$B$BThe device you described sounds like a necromantic focus... I should''ve known that no-good apprentice would stoop to this. I thought his training would keep him from going this far. but I guess he''s proven me wrong.' WHERE `entry`=10314;
UPDATE `quest_template` SET `OfferRewardText`='Anything that we can do to encourage them to stop what they''re doing at these manaforges is a good thing.$B$BThey certainly do not seem to be able to be reasoned with. And it seems clear to me that whatever their leaders have in mind, they are insane.$B$BAs remuneration for your faithful service to the goals of the Consortium, I would like to offer you the coin of your realm if it does not offend you.' WHERE `entry`=10315;
UPDATE `quest_template` SET `OfferRewardText`='A doomguard overmaster? That''s odd! What''s the Burning Legion doing in there?$B$BSo, some of the blood elves are defecting. We''ll keep that in mind if we ever attempt to take the place by force. At least there''s some good news that has come from all of this, no?$B$BPlease, $N, take this with my deepest gratitude.' WHERE `entry`=10318;
UPDATE `quest_template` SET `OfferRewardText`='Excellent work. Only two manaforges remain active.$B$BSoon Kael''thas will be cut off from his main source of power.' WHERE `entry`=10321;
UPDATE `quest_template` SET `OfferRewardText`='The Burning Legion? Allied with Kael''thas Sunstrider?$B$BThis is dire news. It explains much about what we''ve seen here and in Shadowmoon.$B$BWe must send word back to Shattrath City immediately.' WHERE `entry`=10323;
UPDATE `quest_template` SET `OfferRewardText`='Wonderful! You''re turning into quite the hunter, $N.$B$BHow would you like to look more like me? Well here is your chance! While you were out hunting, I fashioned these items out of some buck hides I had laying around. Take your pick!' WHERE `entry`=10324;
UPDATE `quest_template` SET `OfferRewardText`='Facing the demons of the Burning Legion and the mad cultists that worship them is no small feat, $N.  You''ve shown great dedication and courage.  Keep it up and your renown among the Aldor will continue to grow.' WHERE `entry`=10325;
UPDATE `quest_template` SET `OfferRewardText`='You continue to prove your worth, $N.  Fight the enemies of the Light wherever you may find them; your actions will be well-rewarded.' WHERE `entry`=10326;
UPDATE `quest_template` SET `OfferRewardText`='What?! He called me his ''partner''? I''m his wife!$B$BAnd he said I had a sharp tongue! Ooh, when I get back to Area 52, I''m going to box his big, green ears!$B$BBut I''m glad that you''re here. He was right about one thing; I can definitely use your help!' WHERE `entry`=10333;
UPDATE `quest_template` SET `OfferRewardText`='You''re not just pulling my bandage, right? That''s most excellent news!$B$BNow that you''ve done the surveying grunt' WHERE `entry`=10335;
UPDATE `quest_template` SET `OfferRewardText`='Truly an exceptional job.$B$BWith the demons of Culuthas slain, Zephyrion will be able to safely take his excavation team into the Ruins of Farahlon.$B$BAccept this coin as a token of my gratitude.' WHERE `entry`=10336;
UPDATE `quest_template` SET `OfferRewardText`='Bessy, is that you?$B$BThank you for bringing back my Bessy, $N. I couldn''t live without her!' WHERE `entry`=10337;
UPDATE `quest_template` SET `OfferRewardText`='OK! Ingredient number one is down.$B$BNow, if you''re up to it, we''ll move on to something that''ll give the shale oil that little extra kick that it''ll need to blast the nether rocket into the Twisting Nether... or oblivion, whichever comes first.' WHERE `entry`=10342;
UPDATE `quest_template` SET `OfferRewardText`='A mana bomb?$B$B<Morran turns the fragment over in his hands.>$B$BIt''s nigh unthinkable! Even the best minds in Dalaran couldn''t have conceived of a weapon like this. The sheer magnitude of the disturbance must''ve torn a rift in the nether, giving these creatures access to our lands.' WHERE `entry`=10343;
UPDATE `quest_template` SET `OfferRewardText`='The other windrider pilots speak highly of you, $n.  You''ve scored quite a lot of kills on the Abyssal Shelf.  Keep up the good works!' WHERE `entry`=10347;
UPDATE `quest_template` SET `OfferRewardText`='Goliathon?  Pathaleon the Calculator?$B$BKAEL''THAS!?$B$BPrince Kael''thas has a hand in this?$B$B<The earthbinder fumes.>$B$BIt is insanity what he has done!  Dropping giant crystals from the sky and decimating the land can only be the work of a madman!$B$BI can assure you, the Cenarion Expedition will counter any further attempts by their forces to do this ever again.$B$BWe owe you a great debt, $N.' WHERE `entry`=10351;
UPDATE `quest_template` SET `OfferRewardText`='<Ruam examines the samples, looking distressed.>$B$BIt''s exactly as I''d feared, $N. The drying environment is taking a heavy toll on creatures never meant to live outside swampy environments. We''ll have to continue to monitor the area and consult with the Cenarion Expedition to see if anything can be done.' WHERE `entry`=10355;
UPDATE `quest_template` SET `OfferRewardText`='Fantastic - these will go right to use, I assure you. Thank you again for your assistance! We''d certainly be lost without you.$b$bWith all the donations you''ve made, I would certainly process any additional runecloth donations you care to make in the future. Just be sure to check in with me, and I''ll personally make sure that your good deeds won''t go unrecognized!' WHERE `entry`=10357;
UPDATE `quest_template` SET `OfferRewardText`='Fantastic - these will go right to use, I assure you. Thank you again for your assistance! We''d certainly be lost without you.$b$bWith all the donations you''ve made, I would certainly process any additional runecloth donations you care to make in the future. Just be sure to check in with me, and I''ll personally make sure that your good deeds won''t go unrecognized!' WHERE `entry`=10362;
UPDATE `quest_template` SET `OfferRewardText`='The Burning Legion is in cahoots with Kael? Hah! Voren''thal is going to have a field day with this information.$B$BDo you think the thousands of pilgrims that have come from Azeroth want to be allied with the Burning Legion? I think not!' WHERE `entry`=10365;
UPDATE `quest_template` SET `OfferRewardText`='$N, I have been expecting you.$B$BTullas has sung your praises and I am eager to continue your training on the path of Light. When you are ready to unlock greater understanding of your abilities and power, I will guide you.' WHERE `entry`=10366;
UPDATE `quest_template` SET `OfferRewardText`='I thank you, $N.  My people will soon be free thanks to you.' WHERE `entry`=10367;
UPDATE `quest_template` SET `OfferRewardText`='I can feel it, $N!   The spirits are returning to us.' WHERE `entry`=10368;
UPDATE `quest_template` SET `OfferRewardText`='It is true, $N.  I was once Naladu the Keeper of Earth.$B$BIt was I who betrayed the other Dreghood elders in exchange for empty promises of power.  You can despise me now if you wish to.  What matters is that my tribe is free once again and that the spirits have returned to us.$B$BI will not be joining the rest of the tribe, but I can die in peace now.  May the spirit of earth find a new servant among my brothers.' WHERE `entry`=10369;
UPDATE `quest_template` SET `OfferRewardText`='Welcome to the Plaguelands, hero. This is one of the most dangerous frontiers in Azeroth, with the looming threat of the Scourge to our east, and then even further still eastward from there. I am glad to hear that the call of duty and service to the Horde did not fall on deaf ears with you!$B$BIf you are ready to get your hands dirty, then there is plenty for willing and able heroes to do here on the edge of the Plaguelands.' WHERE `entry`=10374;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $C, That''s one less forge camp we''ll need to worry about. It''ll take the Legion a while to get that facility back up and running. You''ve just bought us the one thing we''d run out of ' WHERE `entry`=10390;
UPDATE `quest_template` SET `OfferRewardText`='Praise the ancients, you''ve done it, $N! The Legion has suffered a terrible defeat - and Thrallmar is safe once again. Ah, if I had but a hundred warriors with your heart and cunning, this broken land would be tamed already! I salute you. $B$B<Nazgrel salutes you crisply>' WHERE `entry`=10392;
UPDATE `quest_template` SET `OfferRewardText`='You were right to bring this to my attention. This could be a production order for additional fel reavers - or new attack plans! This will take some time to decipher. Leave me. I will summon you when I know more. $B$B<Magister Bloodhawk nods to you as you turn to leave> $B$BYou are a sharp one, $N. I shall be watching your progress with interest. ' WHERE `entry`=10393;
UPDATE `quest_template` SET `OfferRewardText`='Well, I must say, I am impressed, $N. I didn''t think you had the mettle for this mission. Well done. Well done, indeed. \
' WHERE `entry`=10394;
UPDATE `quest_template` SET `OfferRewardText`='It is fortuitous that you intercepted this missive when you did, $N. Though it will take me some time to decipher, I can already sense the hatred and urgency woven into this scroll. I fear the Legion''s true motives in this land will soon be made evident...$B$BGive me a moment to decipher this script. $B$B<Warp-Scryer Kryv begins to read the demonic missive>    \
' WHERE `entry`=10395;
UPDATE `quest_template` SET `OfferRewardText`='I have to hand it to you, $N, you''re a fighter born! Those Horde yokels may never know how close they came to the end. It takes real character to step in harm''s way on behalf of your enemies. That''s the kind of honor and commitment that holds the Alliance together!  $B$B<Field Marshal Brock salutes you crisply.>\
' WHERE `entry`=10396;
UPDATE `quest_template` SET `OfferRewardText`='I foresaw this great victory, $N. The blessed naaru smile upon you this day. \
' WHERE `entry`=10399;
UPDATE `quest_template` SET `OfferRewardText`='Light be praised, I knew you''d do it! Arazzius and his minions are no more! Soon, we''ll have the Legion running for home and this battered world will be safe once more. Then, when justice has been met, we can return home as well. $B$BThanks you, $N - the Alliance and the Sons of Lothar honor you this day! \
' WHERE `entry`=10400;
UPDATE `quest_template` SET `OfferRewardText`='WHAT!? You faced off against a void horror? And lived?! Incredible!$B$BThis sample is worth its weight in gold. A find like this deserves a reward.' WHERE `entry`=10413;
UPDATE `quest_template` SET `OfferRewardText`='Yes... Kael''s numbers continue to dwindle as our numbers continue to grow.$B$B<This quest can be repeated up to Honored reputation.>' WHERE `entry`=10414;
UPDATE `quest_template` SET `OfferRewardText`='Excellent!  All who oppose us will be crushed!$B$B<This quest can be repeated up to Honored reputation.>' WHERE `entry`=10415;
UPDATE `quest_template` SET `OfferRewardText`='This is worrisome. The damage is much more severe than I believed. I can send to the Stormspire for some tools to begin repairs, but that''s useless unless we''ve isolated what''s damaging the equipment in the first place.' WHERE `entry`=10417;
UPDATE `quest_template` SET `OfferRewardText`='Watch as foul materials disintegrate. Watch as metal turns to dust.$B$BThe Light cleanses all and only the purest residue remains.' WHERE `entry`=10420;
UPDATE `quest_template` SET `OfferRewardText`='Thank you, $N. Tyralius suffered massive injuries but we think he''s going to make it.$B$BHe mentioned fields of prisons, much like the one you rescued him from. Prisons full of creatures from all across the universe!$B$BWe''ll be in touch should a need arise to crack those open. The Consortium has already expressed some interest in sending some teams out and is working on some technology to break through the Ethereum''s locks.' WHERE `entry`=10422;
UPDATE `quest_template` SET `OfferRewardText`='Even for a creature of that size, this heart is far too large. It struggled to keep up with the creature''s gigantic body. I have little doubt it would''ve died before reaching half its normal lifespan.$B$BEven with such risks, I''m determined to convince the Consortium to share their technology. There''s too much promise here to give up now.' WHERE `entry`=10429;
UPDATE `quest_template` SET `OfferRewardText`='This looks a little peculiar. Ghabar definitely didn''t have Netherstorm in mind when he designed it.$B$BDon''t look so surprised, $N. Netherstorm is tame compared to some of the environments I''ve worked in. Nevertheless, a failing dome is always a concern.' WHERE `entry`=10430;
UPDATE `quest_template` SET `OfferRewardText`='These are magnificent, utterly magnificent! I''ll pay you top coin for these! How much to retain your services?' WHERE `entry`=10433;
UPDATE `quest_template` SET `OfferRewardText`='<You introduce yourself and tell Audi that Shauly sent you.>$B$BAh, yes, we''ve been expecting someone to help us, err move some, uh, merchandise.' WHERE `entry`=10434;
UPDATE `quest_template` SET `OfferRewardText`='Bomb parts. So my suspicions were true. That''s not something that I wanted to be right about.$B$BOkay, you and I have some grim business ahead of us then.' WHERE `entry`=10444;
UPDATE `quest_template` SET `OfferRewardText`='I''ve asked the impossible of you, yet I expect you to succeed. Much depends on it.' WHERE `entry`=10445;
UPDATE `quest_template` SET `OfferRewardText`='YOU DID IT! YOU SAVED US! YOU SAVED THE ALLERIAN STRONGHOLD!!$B$BWith their forces decimated, their leader dead and the mana bomb destroyed, we can all breathe much easier now.$B$B$N, I''ve never seen such selflessness... such heroism! Please, accept this on behalf of all of us.' WHERE `entry`=10446;
UPDATE `quest_template` SET `OfferRewardText`='Ah, yes.  The blood of the Bonechewer clan.  I am very curious about these orcs... they are still the depraved fiends of the past, but their strength and power is greater than what I had heard...$B$BWell, let us begin, shall we?' WHERE `entry`=10449;
UPDATE `quest_template` SET `OfferRewardText`='Very good. I''m sure their loss will be felt in Hellfire Citadel. Although that dark bastion looms over us and seems nigh insurmountable, it is only with bold moves like you have made that we will find victory over the fel orcs!' WHERE `entry`=10482;
UPDATE `quest_template` SET `OfferRewardText`='You''ve done it!  Morkh is slain!  Now, we have a fighting chance against the fel orc beasts!$B$BThank you, $N.  Your aid to the war effort here is beyond measure.' WHERE `entry`=10485;
UPDATE `quest_template` SET `OfferRewardText`='Now that you have strengthened the wolves, and the Jagged Ridge''s defenses, perhaps we can refocus our attentions on more deadly matters, such as the ogres?$B$BYou have done a good job in aiding us here. We could use the help of someone capable, such as yourself, should you decide to stay.$B$BWhatever you do, you have earned my respect and appreciation.' WHERE `entry`=10488;
UPDATE `quest_template` SET `OfferRewardText`='We meet again. I have been watching your progress from afar, $c, and I am pleased.$B$BThe time has come for you to commune with the element of water, to learn its mysteries and give yourself over to the water so that you might in turn learn to master it. ' WHERE `entry`=10490;
UPDATE `quest_template` SET `OfferRewardText`='And finally we come to it, the last of the four great elements: air. Do you think yourself wise enough to continue, $N?' WHERE `entry`=10491;
UPDATE `quest_template` SET `OfferRewardText`='Throm''ka, $c! Good to see so many of the Horde, such as yourself, $n, coming out to lend your support in laying the groundwork for the upcoming Ahn''Qiraj War. The effort here will ensure that we are victorious against the Silithid and their evil masters hidden away inside Ahn''Qiraj.$b$bSo now that you are here, be sure to speak with the various collectors and offer your assistance in gathering those materials that you are suited to.' WHERE `entry`=10500;
UPDATE `quest_template` SET `OfferRewardText`='You are an individual of formidable power, $N. The Scryers are fortunate to count you as an ally.$B$BAs word of Kael''s new allegiance spreads, more people will see things our way. The fact that we can claim such a decisive victory against Kael''thas'' new overlords puts us in a most favorable situation.$B$BI will not forget your deeds.' WHERE `entry`=10507;
UPDATE `quest_template` SET `OfferRewardText`='Are you certain of your choice, $N? $BThe Aldor will welcome you as an ally, but the Scryers will not easily forgive your decision.' WHERE `entry`=10551;
UPDATE `quest_template` SET `OfferRewardText`='Are you certain of your choice, $N?  The Scryers will welcome you as an ally, but the Aldor will not easily forgive your decision.' WHERE `entry`=10552;
UPDATE `quest_template` SET `OfferRewardText`='Khadgar sends a new recruit?  Let us put you to work, $c.' WHERE `entry`=10553;
UPDATE `quest_template` SET `OfferRewardText`='Flipping through the pages of the scratched notes and spindly script of the Lashh''an arrakoa, you find a page with a pictogram of the circles of power you have seen in Veil Lashh.' WHERE `entry`=10555;
UPDATE `quest_template` SET `OfferRewardText`='I don''t know what to say. This spell is very strange. It is not a simple conjuration or enchantment, but some sort of communion or communication spell.$B$BI''m not sure what to make of it, $N. I''ll have to think about it some more.$B$BBut thanks for your help, anyways! I''m sure I''ll think through this sooner or later.$BGains.' WHERE `entry`=10556;
UPDATE `quest_template` SET `OfferRewardText`='<Kieran leafs through the journal pages.>$B$BMuch of this is unintelligible. but I can make out bits here and there about preparations for a spell gone awry. casualties, and a deteriorating situation. There''s also a curious note here about a ''deserter.''' WHERE `entry`=10569;
UPDATE `quest_template` SET `OfferRewardText`='Akama''s very own handwriting. It is truly sad to think of what became of one as wise and beloved as he.' WHERE `entry`=10571;
UPDATE `quest_template` SET `OfferRewardText`='Yes! The four fragments of the medallion. Now to put them together...' WHERE `entry`=10574;
UPDATE `quest_template` SET `OfferRewardText`='We''ve been expecting you, $N. Akama said you would arrive sooner or later.' WHERE `entry`=10575;
UPDATE `quest_template` SET `OfferRewardText`='<The orc nods.>$B$BIt''ll be good to have the backup. We''ve gathered some preliminary information on what the Shadow Council is up to in there, but it''s time for the hammer to fall.' WHERE `entry`=10599;
UPDATE `quest_template` SET `OfferRewardText`='I''d''ve been down there cracking skulls myself, but I''m under strict orders not to engage the enemy.$B$BLet''s get to work on shutting down production in there.' WHERE `entry`=10600;
UPDATE `quest_template` SET `OfferRewardText`='<Ordinn accepts the weapon fragment from you.>$B$BI haven''t seen something like this in a long time. Sure, it''s made from a rare ore, but this is destined for no mundane weapon, $N. It''s infused with a magic intended to destroy demons. If you obtained this from the Legion, it must be some kind of ''secret weapon'' they''re planning to deploy against Illidan. What a find!' WHERE `entry`=10621;
UPDATE `quest_template` SET `OfferRewardText`='Very well, $N. Your allegiance is no longer in question. You may see Akama now.' WHERE `entry`=10622;
UPDATE `quest_template` SET `OfferRewardText`='<Grokom accepts the weapon fragment from you.>$B$BI haven''t seen this in years. Not only is it made from a rare ore. but it''s not about to be used in an ordinary weapon, $N.$B$BThese runes imbue the blade with the power to obliterate demons. This shows how much the Legion hates Illidan, if they''re willing to arm their own troops with demon-destroying weapons. We could use this to our advantage.' WHERE `entry`=10623;
UPDATE `quest_template` SET `OfferRewardText`='Gorefiend? T... Teron Gorefiend? But... How?$B$BHow could Gorefiend be here? This is impossible!$B$BThe legend of Teron Gorefiend is one that causes even the Forsaken to tremble in fear. By all accounts, Gorefiend was a warlock of Gul''dan ' WHERE `entry`=10625;
UPDATE `quest_template` SET `OfferRewardText`='Hail, $N. There is much we need to talk about.$B$BI hope your mind is an open one. The decisions I make are not understood by many. Only my closest collaborators have understanding of the portents I see and the signs I await.$B$BWhen I joined forces with Illidan it was based on visions foretelling that otherwise my race would have been destroyed. I''ve waited patiently for other signs and visions to come to pass... Velen''s exodus... the opening of the Dark Portal... and now... your arrival.' WHERE `entry`=10628;
UPDATE `quest_template` SET `OfferRewardText`='You smell terrible.  But you found my keys!  Thank you so much.  Now I can get my shredder started and make some money.  Pretty soon I will have enough money to leave Outland.  I don''t know why you stay, I hate this place.  Wouldn''t you rather be back in Booty Bay?$B$BMaybe do some fishing?' WHERE `entry`=10629;
UPDATE `quest_template` SET `OfferRewardText`='Gorefiend? Why, I have not heard that name in ages!$B$BAfter the Second War, Gorefiend returned here, along with his death knights. Unable to cope with the terrible nature of his new form and without the support of his beloved leader, Gul''dan, Gorefiend killed himself.$B$BIf he walks these lands now as a spirit, it is news to me. Yet, perhaps I can divine such knowledge with your assistance.' WHERE `entry`=10633;
UPDATE `quest_template` SET `OfferRewardText`='You did what? FOOL!$B$BYou must right this wrong. After all, it is your fault. Take one of these helmets. They are each infused with the ever-burning ash that you retrieved for me. More importantly, they will allow you to see the ghosts of Shadowmoon, including Teron Gorefiend.$B$BShould you ever find Teron Gorefiend, destroy him.' WHERE `entry`=10639;
UPDATE `quest_template` SET `OfferRewardText`='You''ve come a long way, stranger. I''m surprised whoever sent you has heard of me.' WHERE `entry`=10640;
UPDATE `quest_template` SET `OfferRewardText`='You know the story now. Only one thing remains to be done.' WHERE `entry`=10646;
UPDATE `quest_template` SET `OfferRewardText`='I was able to sense the book''s power from yards away. The temptation to keep it is... very strong.' WHERE `entry`=10649;
UPDATE `quest_template` SET `OfferRewardText`='You bring this abomination of a book to this holy site? You''d better have a very good explanation, $N?' WHERE `entry`=10650;
UPDATE `quest_template` SET `OfferRewardText`='Excellent work, $N! Your victory over Varedis will have a tremendous impact on our war against Illidan.$B$BYou''ve proven yourself not just to the Aldor but to all of Outland. Allow me to destroy what remains of that horrible book.' WHERE `entry`=10651;
UPDATE `quest_template` SET `OfferRewardText`='Excellent! That''ll show Kael''thas not to underestimate our power.' WHERE `entry`=10658;
UPDATE `quest_template` SET `OfferRewardText`='Ordinn sent you with these?$B$B<The smith examines the ingots.>$B$BHe was right. Most of the magic is gone, but I can still sense traces of it. With some work and a few ''exotic'' resources, I can forge you a powerful anti-demon sword from this metal.' WHERE `entry`=10662;
UPDATE `quest_template` SET `OfferRewardText`='<The smith frowns and examines the ingots.>$B$BI''ll be frank with you, $C. I''m a relic of an age when cooperation with the Horde was unthinkable.$B$BI am not so blind as to see that we do not have common enemies. I will help you to reforge the anti-demon weapon but it''s going to take a lot of hard work and a few ''exotic'' resources.' WHERE `entry`=10663;
UPDATE `quest_template` SET `OfferRewardText`='So you''re not with Illidan. You''re one step closer to gaining my full trust.' WHERE `entry`=10668;
UPDATE `quest_template` SET `OfferRewardText`='At last! Total protection against lava is mine! Of course you get a cut of this technology too, $N. You''ve earned it!' WHERE `entry`=10673;
UPDATE `quest_template` SET `OfferRewardText`='The Baa''ri tablets! Yes, this might provide us with very useful information.' WHERE `entry`=10683;
UPDATE `quest_template` SET `OfferRewardText`='Yes! The four fragments of the medallion. Now to put them together...' WHERE `entry`=10685;
UPDATE `quest_template` SET `OfferRewardText`='We''ve been expecting you, $N. Akama said you would arrive sooner or later.' WHERE `entry`=10686;
UPDATE `quest_template` SET `OfferRewardText`='Let''s take a closer look at these weapons, $N. Hmmm... this is rather unsettling.' WHERE `entry`=10687;
UPDATE `quest_template` SET `OfferRewardText`='You''ve come a long way, stranger. I''m surprised whoever sent you has heard of me.' WHERE `entry`=10689;
UPDATE `quest_template` SET `OfferRewardText`='Many would pay a great price for the book you carry with you. It is a shame we''ll have to destroy it.' WHERE `entry`=10691;
UPDATE `quest_template` SET `OfferRewardText`='You''ve done well, $N. By slaying Varedis you''ve put an end to one of Illidan''s most dangerous projects.$B$BYour name will definitely get around after this.$B$BAllow me to take what remains of the Book of Fel Names. I will make sure it''s properly... disposed of.' WHERE `entry`=10692;
UPDATE `quest_template` SET `OfferRewardText`='Oh! Oh... you took care of Netherock. Good news that!$B$BWith that troublesome mountain giant out of the picture, we should have an easier time of exploi... er, husbanding the resources of the Crumbling Wastes.$B$BGlad to hear that those poor, innocent elementals down there won''t be getting squished by him.$B$BHow ever can I repay you?' WHERE `entry`=10701;
UPDATE `quest_template` SET `OfferRewardText`='I am impressed, $N, though I should expect nothing less of the hero who returned the ata''mal crystal to us.$B$BGive over the two shards and I will see to it that they are combined into their final form.  Then you will have access to the Arcatraz.' WHERE `entry`=10704;
UPDATE `quest_template` SET `OfferRewardText`='Yes... of course! It all becomes clear now.' WHERE `entry`=10706;
UPDATE `quest_template` SET `OfferRewardText`='The crystal! Its power... now in my hands!' WHERE `entry`=10707;
UPDATE `quest_template` SET `OfferRewardText`='<As you give the medallion to A''dal, it disappears into his being in a flash of light.>$B$B<You are briefly shown a glimpse of a moment... perhaps in the future. You see Akama and Maiev coming out of the Warden''s Cage, fighting their way to the Dark Temple. A third figure shrouded in shadows is aiding them. Upon closer inspection you notice that the figure is you.>' WHERE `entry`=10708;
UPDATE `quest_template` SET `OfferRewardText`='$N, I have a pet boar named, Huffer. He wants to help you to have some fun with one of the nearby sons of Gruul.$B$BGrulloc inhabits a place known as the Cursed Hollow. When you get there, let Huffer loose. The gronn will have a fine time chasing him around, and you will retrieve the bag that he guards and deliver it to Baron Sablemane.$B$BTo get to the Cursed Hollow, head down the northern ramp and east through Dragons'' End. The hollow is on the eastern edge.' WHERE `entry`=10721;
UPDATE `quest_template` SET `OfferRewardText`='The signet you now hold is as powerful as that of any Archmage of the Council. Wear it wherever you go so that the initiated may recognize your allegiance. Wear it wherever you go so its power may serve you as you''ve served us!' WHERE `entry`=10725;
UPDATE `quest_template` SET `OfferRewardText`='The signet you now hold is as powerful as that of any Archmage of the Council. Wear it wherever you go so that the initiated may recognize your allegiance. Wear it wherever you go so its power may serve you as you''ve served us!' WHERE `entry`=10727;
UPDATE `quest_template` SET `OfferRewardText`='Are you certain of your choice, $N? This is not a decision you ought to take lightly.$B$BThe Violet Signet will grow in power as you continue to prove yourself to the Violet Eye.' WHERE `entry`=10730;
UPDATE `quest_template` SET `OfferRewardText`='Are you certain of your choice, $N? This is not a decision you ought to take lightly.$B$BThe Violet Signet will grow in power as you continue to prove yourself to the Violet Eye.' WHERE `entry`=10731;
UPDATE `quest_template` SET `OfferRewardText`='Are you certain of your choice, $N? This is not a decision you ought to take lightly.$B$BThe Violet Signet will grow in power as you continue to prove yourself to the Violet Eye.' WHERE `entry`=10732;
UPDATE `quest_template` SET `OfferRewardText`='You honor us with your service, $N. Behold as I unleash the power contained in your signet!' WHERE `entry`=10734;
UPDATE `quest_template` SET `OfferRewardText`='You honor us with your service, $N. Behold as I unleash the power contained in your signet!' WHERE `entry`=10735;
UPDATE `quest_template` SET `OfferRewardText`='You honor us with your service, $N. Behold as I unleash the power contained in your signet!' WHERE `entry`=10736;
UPDATE `quest_template` SET `OfferRewardText`='Your services have not gone unnoticed, $N. Your signet may look the same, but its powers grow as you continue to prove your loyalty.' WHERE `entry`=10738;
UPDATE `quest_template` SET `OfferRewardText`='Your services have not gone unnoticed, $N. Your signet may look the same, but its powers grow as you continue to prove your loyalty.' WHERE `entry`=10740;
UPDATE `quest_template` SET `OfferRewardText`='Your services have not gone unnoticed, $N. Your signet may look the same, but its powers grow as you continue to prove your loyalty.' WHERE `entry`=10741;
UPDATE `quest_template` SET `OfferRewardText`='Nazgrel wants me to work on a key? Does he forget we''re in a battlefield? There are blades and spears to forge!' WHERE `entry`=10756;
UPDATE `quest_template` SET `OfferRewardText`='I don''t see much of use here, but there are a couple of entries that could prove useful. It looks as though these arakkoa were preparing some kind of elaborate magical ritual up until the time of their deaths, but why? There''s also a curious note here about a ''deserter.''' WHERE `entry`=10760;
UPDATE `quest_template` SET `OfferRewardText`='A key? Danath should have us working on siege engines!' WHERE `entry`=10762;
UPDATE `quest_template` SET `OfferRewardText`='So they are attempting to gain the favor of the giants. eh? I have a plan that promises to sever this unholy union.' WHERE `entry`=10765;
UPDATE `quest_template` SET `OfferRewardText`='So the world traveler returns...$B$BI hope my sarcasm is evident, $N, for you have inconvenienced me greatly by forcing me to send out a summons. Consider that you are but a felguard''s hair away from incineration, and they don''t have any hair.$B$BPay attention closely, this is not a lesson you''ll get twice.' WHERE `entry`=10788;
UPDATE `quest_template` SET `OfferRewardText`='Very well, I chose wisely when I selected you to spearhead my fight. Time to ramp things up to a whole new level, I think.$B$BYou remember that little goodie that you stole for me out from underneath Grulloc''s nose? You''re going to get a chance to put it to good use.' WHERE `entry`=10805;
UPDATE `quest_template` SET `OfferRewardText`='Glory to the Scryers, $N. You''ve done the Seer''s bidding by defeating those who follow Illidan.' WHERE `entry`=10807;
UPDATE `quest_template` SET `OfferRewardText`='Excellent work, $C. May the Light continue to protect you.' WHERE `entry`=10816;
UPDATE `quest_template` SET `OfferRewardText`='That will surely teach those that don''t do as I say...$B$BBy the way... where is Doomcryer? Why have you reported this revolt to me and not she?' WHERE `entry`=10820;
UPDATE `quest_template` SET `OfferRewardText`='Excellent! That''ll show Kael''thas not to underestimate our power.' WHERE `entry`=10823;
UPDATE `quest_template` SET `OfferRewardText`='Kael''s elves are extremely well-trained. Excellent job.' WHERE `entry`=10824;
UPDATE `quest_template` SET `OfferRewardText`='Yes, it''s that orb you have there!  Odd, it appears to be of arakkoan design.  Were you recently at Grishnath?$B$BAll right, that explains that, but I wonder what diabolical purpose this object serves.  Though it radiates evil, it also somehow feels as if it were connected to the natural world as well.$B$BHere, allow me to try activate it.  The evil is so strong within it, there''s some sort of residual memory here....' WHERE `entry`=10825;
UPDATE `quest_template` SET `OfferRewardText`='Your courage is strong, friend. Let it be known to all that you are a true ally of the priesthood!' WHERE `entry`=10826;
UPDATE `quest_template` SET `OfferRewardText`='<Neltharaku takes the crystals from you.>$B$BI will prepare the crystals for you now.' WHERE `entry`=10837;
UPDATE `quest_template` SET `OfferRewardText`='You obtained the reading? Excellent -- I am sure this data will prove invaluable to our research. I will disseminate it to Apothecaries Zelana and Albreck.$B$BYou should be proud, $N. Your strength and bravery is unquestionable... as is your service to the Horde.' WHERE `entry`=10838;
UPDATE `quest_template` SET `OfferRewardText`='Out here in the wilds of Outland we are weak with few heroes to defend our rights, but you have given them something to fear $C. I do not think the ethereals will soon forget the strong right arm of $N.' WHERE `entry`=10840;
UPDATE `quest_template` SET `OfferRewardText`='You cannot know what you have done here $N. You have saved so many of us from an eternity of darkness. There is little that I can do for the living and nothing that I could give that would thank you enough. Take what seems useful to you.' WHERE `entry`=10842;
UPDATE `quest_template` SET `OfferRewardText`='That is excellent news, $N. Now that we know how to deal with these, I can have hirelings sabotage any remaining reavers.' WHERE `entry`=10855;
UPDATE `quest_template` SET `OfferRewardText`='Thanks to you, $N, I''ll breathe a little easier. Figure of speech, of course!$B$BI suppose you''ll want some form of reward now.' WHERE `entry`=10857;
UPDATE `quest_template` SET `OfferRewardText`='It is grim work toiling with someone''s hatchlings, yet ignoring the brewing evil would be a bleak proposition as well. You have done well. A''dal''s favor shines upon your heart.' WHERE `entry`=10861;
UPDATE `quest_template` SET `OfferRewardText`='Your people are angry but there is little I can do. Some of us have been touched by the power of the naaru and we are forever changed. Those of us who remain in the wild are as we have always been.' WHERE `entry`=10862;
UPDATE `quest_template` SET `OfferRewardText`='You are wise to find me. There is much that I can show you.' WHERE `entry`=10863;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $N. Your soul is burdened with many deaths... and the Demonaic Scryer will now perform its duties for you.$B$BLet us hope you are ready for the coming trial...' WHERE `entry`=10864;
UPDATE `quest_template` SET `OfferRewardText`='Well done $C. The arakkoa have learned to fear the might of the Alliance.' WHERE `entry`=10869;
UPDATE `quest_template` SET `OfferRewardText`='It is good to hear of all your moves against the fel orcs, $N. The apothecaries have spent much time and resources studying the cause of their corruption, and although such information in invaluable... my orc blood burns to strike a severe blow against these betrayers!$B$BListen close, and I will explain my task...' WHERE `entry`=10875;
UPDATE `quest_template` SET `OfferRewardText`='You have done a great deed, $N. The fel orcs are a shame to all true orcs. If we have one fear, it is the fear of succumbing to demonic corruption once again. So you see, our war against the fel orcs is more than merely a battle with fierce foes -- it is also a battle within ourselves.$B$BAnd with strength, strength you have shown time again, it is a battle we will win.' WHERE `entry`=10876;
UPDATE `quest_template` SET `OfferRewardText`='I can breath a sigh of relief for now, $N. The Shadow Council will be held off for the time being.$B$BThey are murderers and cowards and your display of courage will keep them at bay.' WHERE `entry`=10878;
UPDATE `quest_template` SET `OfferRewardText`='I applaud your prowess in combat, $C. You have proven yourself to be a true defender of the Light. May A''dal''s blessing shine upon your darkest hours.$B$BBut look far into the horizon. Dark skies loom above Skettis. Terokk is undoubtedly plotting his next move. Shattrath is safe for now. But only tomorrow knows what terror will descend upon us.' WHERE `entry`=10879;
UPDATE `quest_template` SET `OfferRewardText`='Once again you have proven your mettle. Had Harbinger Skyriss broken free, countless thousands would have perished in the ensuing conflict, just as happened with another servant of the Old Gods, Skeram, on your world of Azeroth.$B$B$N, what I have to offer in return may seem a pittance in comparison, but know that it comes with the everlasting gratitude of the Sha''tar.' WHERE `entry`=10882;
UPDATE `quest_template` SET `OfferRewardText`='Of course I''ll teach you how to make imperial plate armor! It might cost you a bit of gold... in the form of thorium bars!' WHERE `entry`=10892;
UPDATE `quest_template` SET `OfferRewardText`='I could see the smoke and flames from here!  Good job, $n!  You received more than a few words of praise from our gryphon riders -- what you just did took a lot of guts...' WHERE `entry`=10895;
UPDATE `quest_template` SET `OfferRewardText`='You have done much to help Terokkar Forest, $N. With the worst of the mite colonies destroyed we may yet be able to reclaim this wasted land.' WHERE `entry`=10896;
UPDATE `quest_template` SET `OfferRewardText`='Excellent! It looks like you''re eager to learn, so let''s get to it. I will teach you how to make the most out of the plants you use in your alchemical potions.$B$BYou will find that you can make herbs go a really long way if you know what you''re doing. Sometimes you will be able to make two potion with materials you initially judged necessary for just one.' WHERE `entry`=10897;
UPDATE `quest_template` SET `OfferRewardText`='Excellent work, $N! These transmutations are perfect in every way!$B$BI will now teach you the manner in which the alchemical transmutation process can conjure matter out of thin air! Make good use of your knowledge, master transmuter.$B$BNow, if you''ll excuse me, I have to go see a buyer interested in primal might.' WHERE `entry`=10899;
UPDATE `quest_template` SET `OfferRewardText`='You are very good with elixirs, if these are any indication. You will make a fine student.$B$BThese essences will provide me enough materials to formulate my recipe. I will be known among all alchemists for this discovery!$B$BNow, if you''re willing to learn, I am willing to teach.' WHERE `entry`=10902;
UPDATE `quest_template` SET `OfferRewardText`='Yes, it is true.  Colonel Jules'' situation has grown much worse these past days.  Anchorite Barada is busy praying for him... let us hope he may be cured.' WHERE `entry`=10903;
UPDATE `quest_template` SET `OfferRewardText`='You want to learn from me? Hmmm, yes. Perhaps you''ll be a suitable student.' WHERE `entry`=10906;
UPDATE `quest_template` SET `OfferRewardText`='You want me to help you with your study of transmutations? Very well, $N. Let''s see what we can do.' WHERE `entry`=10907;
UPDATE `quest_template` SET `OfferRewardText`='You found the prayer beads!  Well done, $n.  You are a wonder, indeed -- you slay the horrors of Hellfire Peninsula one moment and find lost treasures the next.  Your people truly inspire!$B$BIt is good that you recovered these beads... for they will be invaluable in the exorcism ritual to come.' WHERE `entry`=10916;
UPDATE `quest_template` SET `OfferRewardText`='<Vekax squawks in glee as you present him with proof of his enemies'' demise.>$B$BYes, that will show Skettis that we Outcasts will not take their punishment lying down.  Here is the reward I promised you.  I can arrange for more, should you provide me with additional feathers.' WHERE `entry`=10917;
UPDATE `quest_template` SET `OfferRewardText`='<Vekax squawks in glee as you present him with proof of his enemies'' demise.>$B$BYes, that will show Skettis that we Outcasts will not take their punishment lying down.  Here is the reward I promised you.  I can arrange for more, should you provide me with additional feathers.$B$B<This quest can be repeated up to Honored reputation.>' WHERE `entry`=10918;
UPDATE `quest_template` SET `OfferRewardText`='A great evil has been cleansed from Terokkar. The Sha''tar are in your debt.' WHERE `entry`=10923;
UPDATE `quest_template` SET `OfferRewardText`='This should prove a large enough supply for my needs.$B$BI hope the imp didn''t give you too much trouble. He has a bit of a nasty mouth on him.' WHERE `entry`=10924;
UPDATE `quest_template` SET `OfferRewardText`='You have done it, $n.  You have saved Colonel Jules'' soul and cast the darkness within him back to where it came.  A great, noble deed this is!  A hero''s day!' WHERE `entry`=10935;
UPDATE `quest_template` SET `OfferRewardText`='It''s about time!  I heard all about what you''ve been up to with that draenei priest. You totally freaked my messenger out!$B$BNow that you''re done with that, I have a little mission planned for you to Hellfire Citadel.' WHERE `entry`=10936;
UPDATE `quest_template` SET `OfferRewardText`='I wasn''t going to believe it until I heard it from you, personally.  Already our scouts are trickling in with information that the Shattered Hand are in disarray without their precious drillmaster to tell them what to do.$B$BYou''ve traveled a long road, $N.  I trust that you will accept this armor along with my thanks.  Wear it proudly, you''ve earned it!' WHERE `entry`=10937;
UPDATE `quest_template` SET `OfferRewardText`='Wonderful! Terenthis found someone to help me.$b$bAnd look. a moonstalker cloak...<cough> Oh... that hurts. Thank you, $N.$b$bThe furbolgs wounded me before I managed to evade them. Give me a moment, and I should be fine to talk some more.' WHERE `entry`=993;
UPDATE `quest_template` SET `OfferRewardText`='You''ve done well, $N. This will bring us a step closer to shifting Illidan''s focus away from us and from...$B$B<Akama looks in Maiev Shadowsong''s direction.>$B$BMore work remains to be done, $N.' WHERE `entry`=10946;
UPDATE `quest_template` SET `OfferRewardText`='You''ve proved your worth, $r. Up to a certain point, at least.$B$BThe favor of Nozdormu''s prime mate is not obtained easily.' WHERE `entry`=10466;
UPDATE `quest_template` SET `OfferRewardText`='Are you sure this is the path you seek to take, $N? This is not a decision you ought to take lightly.$B$BThis ring is imbued with a droplet from the Well of Eternity. It will grow in power as you prove yourself to the Scale of the Sands.' WHERE `entry`=10462;
UPDATE `quest_template` SET `OfferRewardText`='It is as it was foretold, $N.  One by one, Illidan''s lieutenants have fallen... and now the Betrayer himself has met his demise!$B$BKnow this, $N: every decision Akama made and every moment of his life since Illidan arrived, Akama planned for this moment.  Illidan is finally dead and our people... are free!' WHERE `entry`=10959;
UPDATE `quest_template` SET `OfferRewardText`='<The druid emerges from his sleep, groggy and haggard looking. His gaze darts around the room in search on unseen pursuers.>$B$BMorthis?$B$BNo, you''re not Morthis... Who are you, $R, and why have you disturbed my rest?$B$B<Despite the hostility of the question, the Druid looks almost relieved to have been awakened.>' WHERE `entry`=10964;
UPDATE `quest_template` SET `OfferRewardText`='I gladly give you this necklace, mighty $C.  You have done me an invaluable service, and for that I thank you.  Wear it with pride, and make sure you mention loudly and repeatedly who made it for you!$B$BAlso, if you could toss in the fact that it really isn''t cursed, that would be great.' WHERE `entry`=2361;
UPDATE `quest_template` SET `OfferRewardText`='' WHERE `entry`=3482;
UPDATE `quest_template` SET `OfferRewardText`='What a relief that Slaag is gone.  No longer will we be threatened by the looming specter of his return!$B$BIf you do not mind, I will take the standard as a symbol of hope for all of the ogres of the mountains.$B$BThank you, $N.' WHERE `entry`=10997;
UPDATE `quest_template` SET `OfferRewardText`='This defeat is not only a blow to Illidan. The Legion too reels... A pit lord commander has been defeated. The siege of Hellfire Citadel now holds no purpose for the Burning Legion. All of their efforts will undoubtedly be turned upon the Black Temple.$B$BRedemption comes for Illidan... and soon.' WHERE `entry`=11002;
UPDATE `quest_template` SET `OfferRewardText`='This defeat is not only a blow to Illidan. The Legion too reels... A pit lord commander has been defeated. The siege of Hellfire Citadel now holds no purpose for the Burning Legion. All of their efforts will undoubtedly be turned upon the Black Temple.$B$BRedemption comes for Illidan... and soon.' WHERE `entry`=11003;
UPDATE `quest_template` SET `OfferRewardText`='<Chu''a''lor''s left head begins to speak.>$B$BThese will do fine.$B$BRemember, $B, the value of the shard is not in what it can purchase for you. It is not even in what it can potentially do for you when properly forged, though there is some debate over that.$B$B<His right head finishes,...>$B$BThe true value is in the journey to attain the shard.' WHERE `entry`=11025;
UPDATE `quest_template` SET `OfferRewardText`='<Chu''a''lor nods his heads at you in satisfaction at your accomplishment.>$B$BYou have a quick mind, $N. It took us much longer to successfully make use of the relic.$B$BNow that you know how, you can do so as much as you care to. Just remember that they require an apexis shard to power them.' WHERE `entry`=11058;
UPDATE `quest_template` SET `OfferRewardText`='You continue to amaze us with your acumen as concerns the relics. $B. May we suggest that you practice with the relics at least once a day to maintain such a sharp edge to your mental acuity?' WHERE `entry`=11080;
UPDATE `quest_template` SET `OfferRewardText`='Make this next decision carefully.  We do our best to accommodate our allies, but even Dalaran''s resources have their limits.' WHERE `entry`=11031;
UPDATE `quest_template` SET `OfferRewardText`='Make this next decision carefully.  We do our best to accommodate our allies, but even Dalaran''s resources have their limits.' WHERE `entry`=11032;
UPDATE `quest_template` SET `OfferRewardText`='Make this next decision carefully.  We do our best to accommodate our allies, but even Dalaran''s resources have their limits.' WHERE `entry`=11033;
UPDATE `quest_template` SET `OfferRewardText`='Make this next decision carefully.  We do our best to accommodate our allies, but even Dalaran''s resources have their limits.' WHERE `entry`=11034;
UPDATE `quest_template` SET `OfferRewardText`='You''re done for today, kid. Come back tomorrow if you''re still alive.' WHERE `entry`=11018;
UPDATE `quest_template` SET `OfferRewardText`='So you have put together a deck of Lunacy. Your gesture of returning it to us will create a tie between you and the Darkmoon that will not soon be forgotten. Allow me to present you with one of the greater Darkmoon cards as a small token of our appreciation.' WHERE `entry`=10941;
UPDATE `quest_template` SET `OfferRewardText`='You''re wet and smudged with soot!  You must have been extinguishing fires!$B$BWell done!  As an honorary member of the Goldshire Fire Brigade, I beg you to return here if ever the village needs you!' WHERE `entry`=11360;
UPDATE `quest_template` SET `OfferRewardText`='The children love to watch heroes at their work.  It is my hope that, one day, each of these orphans will grow into a strong member of the Horde, and ultimately die in glorious battle!$B$BAh, thoughts of such a fine fate brings mist to my eyes...' WHERE `entry`=11357;
UPDATE `quest_template` SET `OfferRewardText`='You''re smudged with soot!  You must have been extinguishing fires!$B$BWell done!  As an honorary member of the Kharanos Fire Brigade, I beg you to return here if ever the village needs you!' WHERE `entry`=11439;
UPDATE `quest_template` SET `OfferRewardText`='You''re wet and smudged with soot!  You must have been extinguishing fires!$B$BWell done!  As an honorary member of the Azuremyst Fire Brigade, I beg you to return here if ever the village needs you!' WHERE `entry`=11440;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $N.  Children, take a good look at this $c.  Let $ghim:her; be a fine example for you to follow.' WHERE `entry`=11450;
UPDATE `quest_template` SET `OfferRewardText`='So you have put together a deck of Blessings. Your gesture of returning it to us will create a tie between you and the Darkmoon that will not soon be forgotten. Allow me to present you with one of the greater Darkmoon cards as a small token of our appreciation.' WHERE `entry`=10938;
UPDATE `quest_template` SET `OfferRewardText`='You''ve proved your worth, $r. Up to a certain point, at least.$B$BThe favor of Nozdormu''s prime mate is not obtained easily.' WHERE `entry`=10465;
UPDATE `quest_template` SET `OfferRewardText`='Are you sure this is the path you seek to take, $N? This is not a decision you ought to take lightly.$B$BThis ring is imbued with a droplet from the Well of Eternity. It will grow in power as you prove yourself to the Scale of the Sands.' WHERE `entry`=10463;
UPDATE `quest_template` SET `OfferRewardText`='You''ve proved your worth, $r. Up to a certain point, at least.$B$BThe favor of Nozdormu''s prime mate is not obtained easily.' WHERE `entry`=10464;
UPDATE `quest_template` SET `OfferRewardText`='What have you brought to me? I can''t make out the writing on this tome, $N... my loss of blood... must''ve blurred my vision.' WHERE `entry`=11021;
UPDATE `quest_template` SET `OfferRewardText`='This cannot be... this belonged to a talonpriest once. How did you ever come across it?' WHERE `entry`=11024;
UPDATE `quest_template` SET `OfferRewardText`='The arakkoa seek to bring Terokk back beyond the veil of time and Rilak... wants to find a way to accelerate the process? Is he out of his mind?$B$B<Adaris lays back down as his strength fades.>$B$BYou''ve done your duty, $N. It is time you let my men take over from here. This has become a purely military matter.' WHERE `entry`=11028;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $N. I think we managed to catch them off guard. Their agents probably thought themselves safe within the city walls.$B$BGiven time, the agitators will return and spread their lies again. We''ll use the time you''ve bought to shut out the deserters further.' WHERE `entry`=11126;
UPDATE `quest_template` SET `OfferRewardText`='<The SI:7 agent nods in approval.>$B$BExcellent. All that remains is to discredit the deserters so that they''ll never gain a foothold in Theramore again, and I have just the plan to do it.' WHERE `entry`=11128;
UPDATE `quest_template` SET `OfferRewardText`='<Budd reads the note.>$B$BAhh! A friend of Griftah? Welcome!$B$BYou have impeccable timing, friend. As fate would have it, I recently lost my latest partners. Tragic, truly, but great rewards often have a high price. Best not to dwell on the negative!$B$BYou''ve doubtlessly heard of my countless exploits and discoveries. Well, all of that was nothing compared to this! Truth is, we''re close to making history here at Zul''Aman and, by fate''s decree, you''re in on the ground floor!' WHERE `entry`=11130;
UPDATE `quest_template` SET `OfferRewardText`='<Calia chuckles as you describe the guards'' reactions to the propaganda.>$B$BJust as I''d hoped! I think it''s safe to say any deserter agents who try to infiltrate Theramore will be laughed right out of town!' WHERE `entry`=11133;
UPDATE `quest_template` SET `OfferRewardText`='Gavis'' request isn''t as outlandish as it might sound. With the proper handling, Lady Jaina can return the deserters to the fold, but that is her decision, of course.$B$BIt''s been a pleasure working with you, $N. Without your help, I doubt the operation would''ve gone so smoothly. When I make my report in Stormwind, it will name you as the $C who ended the deserter threat.' WHERE `entry`=11134;
UPDATE `quest_template` SET `OfferRewardText`='<Captain Wymor accepts the orders from you and reads over them.>$B$BWhat in the world could ''precious cargo'' refer to? The Defias have done some small time smuggling back in lands of Stormwind, but this seems out of their league. The language of these orders suggests a wealthy or noble patron.' WHERE `entry`=11137;
UPDATE `quest_template` SET `OfferRewardText`='<Renn looks over the orders.>$B$BSo there was valuable cargo on board! We have to locate it before the Defias recover it. These guys are no divers, but we''re going to need some of their gear if you''re to help me find the cargo.' WHERE `entry`=11138;
UPDATE `quest_template` SET `OfferRewardText`='Wow, this is in worse shape than I''d thought, and these tools...$B$BWell, I said I''d get this back into working condition for you, so I''d better get to work.' WHERE `entry`=11139;
UPDATE `quest_template` SET `OfferRewardText`='<Renn rifles through the contents of the strongboxes you recovered.>$B$BGood work. Now, let''s see if our ''precious cargo'' is in here....' WHERE `entry`=11140;
UPDATE `quest_template` SET `OfferRewardText`='You and Renn have done excellent work in bringing this information to light and reporting it immediately. There''s no denying the Defias have hatched some sinister plan to strike at Stormwind and its allies. There''s a level of complexity here that''s beyond anything they''ve ever attempted, which means they must have a wealthy sympathizer somewhere.' WHERE `entry`=11141;
UPDATE `quest_template` SET `OfferRewardText`='<Lady Jaina listens intently as you report the results of your aerial survey.>$B$BA rune circle, dragonkin? The Defias certainly have hedge mages among their ranks, but no one powerful enough to make use of such a thing!$B$BAnd why would the black dragonkin be interested in an island full of naga? There are many unanswered questions, but I one thing is for certain: the Defias have a powerful ally in upper echelons of the Alliance.' WHERE `entry`=11142;
UPDATE `quest_template` SET `OfferRewardText`='<Captain Darill glances at the battle plan.>$B$BI''d say it doesn''t get any clearer than this. They''ve taken it upon themselves to fight back against human settlements in the area and I have little doubt Theramore is next on their list.' WHERE `entry`=11144;
UPDATE `quest_template` SET `OfferRewardText`='The freed captives have already begun returning from Blackhoof Village. The information the captain is receiving from the prisoners will give us an advantage in our next battle against the Grimtotems.$B$BYou have my thanks and that of the men.' WHERE `entry`=11145;
UPDATE `quest_template` SET `OfferRewardText`='<Captain Darill inspects the armaments you''ve brought from Blackhoof Village.>$B$BThere''s no doubt about it. These match the description exactly, but there''s just one problem -- these have never been used in battle. Blackhoof Village must not be the only Grimtotem post in the marsh.' WHERE `entry`=11148;
UPDATE `quest_template` SET `OfferRewardText`='So you want me to scry for Grimtotems, eh? And what will you say when I tell you there''s no need?' WHERE `entry`=11149;
UPDATE `quest_template` SET `OfferRewardText`='I hope the Grimtotems got the message. Any attempt to return will be met with far worse than a mere torch. My apprentices and I will see to that.' WHERE `entry`=11150;
UPDATE `quest_template` SET `OfferRewardText`='<The captain listens to your report intently.>$B$BWe have avenged James and his family, but not even that can restore what was destroyed.' WHERE `entry`=11151;
UPDATE `quest_template` SET `OfferRewardText`='<Captain Vimes smiles slightly as you relate the events you witnessed at the Hyal family grave.>$B$BIt''s good to know that they understand. You didn''t tell them about James, did you?$B$BI''ll deliver his wife''s message to him, but I doubt he''ll understand.' WHERE `entry`=11152;
UPDATE `quest_template` SET `OfferRewardText`='<Donna looks around and then whispers to you.>$B$B$N, what I''m about to tell you must remain confidential, understood?$B$BI''ve been sent by the Shattrath Peacekeepers to infiltrate Budd''s gang here. Truth be told, since you first arrived you''ve been a key person of interest in my investigation.$B$BBut your deeds have since cleared you of any suspicion. In fact, for your slaying of the crazed warlord, Zul''Jin, I''m compelled to reward you for your efforts.' WHERE `entry`=11163;
UPDATE `quest_template` SET `OfferRewardText`='I be free!$B$BDey took most everyting when dey nabbed me, but here - take the last of my coin fer your troubles.$B$BAnd the least I can be doin'' is stickin'' around to offer my services....' WHERE `entry`=11165;
UPDATE `quest_template` SET `OfferRewardText`='So those hermit mages sent you? How can I be sure that I can trust you?$B$BI suppose I can use the help. There''s not much here a mage would be interested in, anyway.' WHERE `entry`=11172;
UPDATE `quest_template` SET `OfferRewardText`='Get off my lawn... unless, that is, you want to help old "Swamp Eye" with a little bit of cooking. Whad''ya say?' WHERE `entry`=11177;
UPDATE `quest_template` SET `OfferRewardText`='Th-the Blood of Zul''jin himself you say?$B$B<Gathering himself, Budd continues>$B$BWell, I appreciate the gesture, $C, but I could''ve taken him down with ease. There''s no way he was as fearful as the legends say. These things have a way of being utterly overstated, as you''ll learn in time. More likely, the pitiful old cretin was overcome with arthritis!$B$BAnyway, I suppose it was the least you could do as payment for the kindness I''ve shown you here.$B$BNow off with you - I must dispose of this vile vial!' WHERE `entry`=11178;
UPDATE `quest_template` SET `OfferRewardText`='<Andello reads the letter, shocked at its contents.>$B$BWe''ve long had misgivings about the cooperation between the Horde and the Forsaken, and this only confirms those suspicions. With the backing for Forsaken magic and arms, the Grimtotems would become an even more fearsome enemy. The balance of power in Kalimdor could shift considerably.' WHERE `entry`=11185;
UPDATE `quest_template` SET `OfferRewardText`='Good. I can use all the help you can offer. My first priority is to get that lamp re-lit.' WHERE `entry`=11191;
UPDATE `quest_template` SET `OfferRewardText`='Well, I have my doubts, but this is the only solution available right now. Once we have it up and running, I''m sure there will be time to look at other ways to fuel the lamp.' WHERE `entry`=11192;
UPDATE `quest_template` SET `OfferRewardText`='Well, now, that was thoughtful o'' Babs to send that over. I don''t know if you''ve leafed through it or not, but there''s a lot of truth to the tales in that book. Sailors didn''t just make it all up, you know.' WHERE `entry`=11193;
UPDATE `quest_template` SET `OfferRewardText`='So you want to know about sea monsters? Hmm... well, I''ll make you a deal, but it''s going to involve a lot of alcohol and some embarrassment on your part.' WHERE `entry`=11194;
UPDATE `quest_template` SET `OfferRewardText`='Hey now, where ya be gettin'' this?$B$BNo, no, don''t tell me - this be comin'' from the Hex-Lord himself! It all be clear now. Strong mojo! The bearer of this relic, no matter how many disgraces he be sufferin'', be always honored by his peers. Incredible!$B$B<As Griftah holds the doll in the air, a small, rusty charm falls from around its neck. The troll begins to discard it, but then turns toward you with a gleam in his eye.>$B$BI gots no coins right now, mon, but ya be welcome to this here...' WHERE `entry`=11195;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $N! I''ll admit, when I caught my first glimpse of that beast, I had doubts about our ability to defend the docks, but you held together the defenders brilliantly!' WHERE `entry`=11198;
UPDATE `quest_template` SET `OfferRewardText`='Not bad at all, but you know, I think I''d get a bath in as soon as possible, if I was you.$B$BNow, about your sea monster...$B$BHelp yourself to a brew or two in the meantime.' WHERE `entry`=11209;
UPDATE `quest_template` SET `OfferRewardText`='<You recount your experiences with Nat Pagle, carefully omitting the portion about the ''bait test.''>$B$BWell, it sounds like we''ve got our work cut out for us. I''ll make the preparations.' WHERE `entry`=11210;
UPDATE `quest_template` SET `OfferRewardText`='It''s good of Tabetha to send you down here. I''d prevail upon her for some food until the wreckage from the zeppelin is taken care of, but I know she''s got none to spare at the moment. If you''re feeling adventurous, I''ve posted a bounty for the death of a particularly nasty raptor.' WHERE `entry`=11211;
UPDATE `quest_template` SET `OfferRewardText`='I thank you for taking the time to come to our aid.  We''ve important work ahead of us.' WHERE `entry`=11216;
UPDATE `quest_template` SET `OfferRewardText`='<Highlord Bolvar listens while you deliver Jaina''s message.>$B$BAre you certain? This is a very serious charge...' WHERE `entry`=11222;
UPDATE `quest_template` SET `OfferRewardText`='Excellent news, $c!  If our tactical deployments continue to be this successful, the Horde will be in full retreat before long.' WHERE `entry`=11335;
UPDATE `quest_template` SET `OfferRewardText`='Just what I wanted to hear! A victory in Alterac Valley - even a temporary one - is crucial to our overall strategy against the Horde.' WHERE `entry`=11336;
UPDATE `quest_template` SET `OfferRewardText`='We''ve come one step closer to achieving total victory over the Horde. We cannot allow the enemy to obtain a foothold in this world or any other.' WHERE `entry`=11337;
UPDATE `quest_template` SET `OfferRewardText`='Excellent work, $n. The integrity of our borders must be preserved at all costs!' WHERE `entry`=11338;
UPDATE `quest_template` SET `OfferRewardText`='You''ve brought great honor to the Horde, $n. Your victory today will ensure a thousand victories tomorrow!' WHERE `entry`=11339;
UPDATE `quest_template` SET `OfferRewardText`='There is no greater honor than driving invaders from Horde territories. We salute your great courage in aiding our forces today!' WHERE `entry`=11340;
UPDATE `quest_template` SET `OfferRewardText`='You bring honor to us all, $n. We must show the enemy that we will fight them wherever we find them.' WHERE `entry`=11341;
UPDATE `quest_template` SET `OfferRewardText`='The Horde is in your debt, $n. You''ve made your people proud with your courage in defending our lands.' WHERE `entry`=11342;
UPDATE `quest_template` SET `OfferRewardText`='Another soon-to-be satisfied customer. It looks like it''s in fine condition. You are to be rewarded.$B$BCome back tomorrow and I will have another request for you to fulfill.' WHERE `entry`=11354;
UPDATE `quest_template` SET `OfferRewardText`='Perhaps I will have new feathers tied onto it before shipping it on to the buyer. I''m certain with so many arakkoa hereabouts it will not prove difficult. A small matter, and nothing to detract from your reward in any case.$B$BCome back tomorrow and I will have another request for you to fulfill.' WHERE `entry`=11362;
UPDATE `quest_template` SET `OfferRewardText`='Truly a daring acquisition that the bards should put pen to parchment for. Here, you have more than earned this.$B$BCome back tomorrow and I will have another request for you to fulfill.' WHERE `entry`=11363;
UPDATE `quest_template` SET `OfferRewardText`='Very well, you have earned your bounty.$B$BReturn again tomorrow and the winds will have whispered once more to Mah''duun.' WHERE `entry`=11364;
UPDATE `quest_template` SET `OfferRewardText`='Now that I think of it, it''s a pity I didn''t ask you to return with the other two hearts as well. Perhaps next time. In any case, you''ve earned your commission.$B$BCome back tomorrow and I will have another request for you to fulfill.' WHERE `entry`=11368;
UPDATE `quest_template` SET `OfferRewardText`='Is it not amazing to feel the life pulsing within the egg? I must hurry to deliver it to the purchaser. We wouldn''t want it hatching here now would we?$B$BYour payment is ready.$B$BCome back tomorrow and I will have another request for you to fulfill.' WHERE `entry`=11369;
UPDATE `quest_template` SET `OfferRewardText`='Indeed, I fear my customer will not have time to peruse the entirety of this book. Nevertheless, that is not our concern. Here is your reward.$B$BCome back tomorrow and I will have another request for you to fulfill.' WHERE `entry`=11370;
UPDATE `quest_template` SET `OfferRewardText`='I trust that it was a fight worthy of your time? Certainly this bounty will be.$B$BReturn again tomorrow and the winds will have whispered once more to Mah''duun.' WHERE `entry`=11371;
UPDATE `quest_template` SET `OfferRewardText`='I am sure that these feathers will make a fine addition to the chieftain''s headdress. You have earned your compensation, $C.$B$BCome back tomorrow and I will have another request for you to fulfill.' WHERE `entry`=11372;
UPDATE `quest_template` SET `OfferRewardText`='<You sense a deep level of satisfaction from the wind trader.>$B$BGood, I am glad to hear of his demise. And perhaps I will be able to unlock the secrets of his amulet for myself. If not, then I will sell it for a handsome price.$B$BI trust that this reward is sufficient.$B$BCome back tomorrow and I will have another request for you to fulfill.' WHERE `entry`=11373;
UPDATE `quest_template` SET `OfferRewardText`='You''re quite the heroine, $N. I am certain that my customer will find a way to free the spirit of their loved one from within the gem. For a job well done, your payment awaits.$B$BCome back tomorrow and I will have another request for you to fulfill.' WHERE `entry`=11374;
UPDATE `quest_template` SET `OfferRewardText`='I was worried that you might not return. I trust that you didn''t go deaf from fighting Murmur?$B$BHere is your reward. The professor will be pleased no doubt, though I worry what he ultimately wishes to do with this thing.$B$BCome back tomorrow and I will have another request for you to fulfill.' WHERE `entry`=11375;
UPDATE `quest_template` SET `OfferRewardText`='I am satisfied. He who speaks through the nether shall be as well. Mah''duun has your bounty prepared.$B$BReturn again tomorrow and the winds will have whispered once more to Mah''deen.' WHERE `entry`=11376;
UPDATE `quest_template` SET `OfferRewardText`='Oh, I do smell something tasty! I hope you gave that bird quite a good beating.$B$BPlease, help yourself to some of my extra stock. I''m sure someone of your talent could put it to good use.' WHERE `entry`=11377;
UPDATE `quest_template` SET `OfferRewardText`='I see you are returned to the present time intact.$B$B<The wind trader looks around.>$B$BIt doesn''t appear that anything has changed. But then again, how would I know?$B$BThat''s a nice cut; my customer will be pleased. Here is your reward.$B$BCome back tomorrow and I will have another request for you to fulfill.' WHERE `entry`=11378;
UPDATE `quest_template` SET `OfferRewardText`='Now look at that...$B$B<The Rokk takes a sip of the concoction and his face twists into a bizarre mask of pain and delight.>$B$BSweet A''dal that''s good! A cook with your potential shouldn''t be without his proper materials. Take some of my extra stock and make me proud.' WHERE `entry`=11379;
UPDATE `quest_template` SET `OfferRewardText`='Those are the juiciest mana berries I''ve ever seen. I think I''m getting smarter just by looking at them.$B$BSince I no longer need most of my meat and fish stock, why don''t you take some? I''m certain you could make something delicious.' WHERE `entry`=11380;
UPDATE `quest_template` SET `OfferRewardText`='That is a fine batch of spiritual soup if I ever did smell one. Just a pinch of pepper and it''s done.$B$BAs promised, here''s your cut. And because you did such a fine job, I''m going to throw in some of my extra stock.' WHERE `entry`=11381;
UPDATE `quest_template` SET `OfferRewardText`='Aw, you did get it! It''s so tiny. And yet, when the druids are done with it -- a process I am told will take a very long time -- Warp Splinter will be regrown anew.$B$BAnd here is your reward as promised.$B$BCome back tomorrow and I will have another request for you to fulfill.' WHERE `entry`=11384;
UPDATE `quest_template` SET `OfferRewardText`='And now they are dead, channeling no longer. He who whispers upon the nether is satisfied and you have secured the bounty.$B$BReturn again tomorrow and the winds will have whispered once more to Mah''duun.' WHERE `entry`=11385;
UPDATE `quest_template` SET `OfferRewardText`='I''m tempted to keep it for myself and return my client''s money. It could certainly expand the reach of my business.$B$B<The wind trader sighs.>$B$BHowever, I have a reputation to uphold.$B$BSpeaking of my reputation, thank you for helping me to maintain it. Here is your commission.$B$BCome back tomorrow and I will have another request for you to fulfill.' WHERE `entry`=11386;
UPDATE `quest_template` SET `OfferRewardText`='Mah''duun enjoys fighting constructs; they are less messy than organic beings.$B$BThe bounty is yours.$B$BReturn again tomorrow and the winds will have whispered once more to Mah''duun.' WHERE `entry`=11387;
UPDATE `quest_template` SET `OfferRewardText`='I dare not touch the scroll lest I too risk the notice of the Old Gods. I will have one of my assistants handle its delivery.$B$BYou have more than earned your reward, $C, and I wish you all the luck in the known worlds.$B$BCome back tomorrow and I will have another request for you to fulfill.' WHERE `entry`=11388;
UPDATE `quest_template` SET `OfferRewardText`='With the sentinels destroyed, perhaps the naaru will ask the Consortium to replace them? Mah''duun does not know and does not care.$B$BYou have earned the bounty.$B$BReturn again tomorrow and the winds will have whispered once more to Mah''duun.' WHERE `entry`=11389;
UPDATE `quest_template` SET `OfferRewardText`='<K. Lee looks at the engine part and then stares off into the distance for a moment.>$B$BThis is somethin'' real special.  Difficulty to say where it''s from--like it just fell out of the sky. I''m gonna hold on to this and pay you for your troubles.$B$BBetween you and me though, I think it''s best if we didn''t mention this to anyone.$B$B<K. Lee puts on her most charming smile.>' WHERE `entry`=11531;
UPDATE `quest_template` SET `OfferRewardText`='I thank you, $N. I will administer a small amount to the commander... to humor him. You can keep the rest, perhaps you''ll find a use for it.' WHERE `entry`=11004;
UPDATE `quest_template` SET `OfferRewardText`='Neato! A dragon of my very own! One day I hope that I''m lucky enough to have a dragon as a friend.$B$B<Dornaa bounces up and down with joy, fiercely hugging her new toy.>$B$BThis has been the best trip ever! I hope it never ends.' WHERE `entry`=10962;
UPDATE `quest_template` SET `OfferRewardText`='It is good for the soul to know that there are heroes such as yourself that are willing to give of their time so selflessly.$B$BI can tell already that your time together with Salandria has made a huge impression. It''s good for the children to have a chance to get out and see the world.$B$BHere, she told me that she wanted you to take care of one of her favorite pets, just like you took care of her. Something to remember her by.$B$BDon''t be a stranger.' WHERE `entry`=10967;
UPDATE `quest_template` SET `OfferRewardText`='Aye, it is true, but the Consortium are not the only group claiming losses.' WHERE `entry`=10969;
UPDATE `quest_template` SET `OfferRewardText`='Stand back, $N. This could very well be an Ethereum trap.' WHERE `entry`=10970;
UPDATE `quest_template` SET `OfferRewardText`='It seems to be more than just an identifier. There is some sort of code written on these tags. I''m on the verge of breaking it wide open. Perhaps if I had a few more pieces.' WHERE `entry`=10971;
UPDATE `quest_template` SET `OfferRewardText`='We are close to the truth, $N.' WHERE `entry`=10972;
UPDATE `quest_template` SET `OfferRewardText`='<Ameer deftly combines the keys and begins to read the markings on the newly formed key tablet.>$B$B"A thousand worlds shattered, a thousand worlds more to overcome... Such is the will of the Nexus-King."$B$B<Ameer turns the tablet over and begins to read from the back-side.>$B$BStasis chambers of Bash''ir?' WHERE `entry`=10973;
UPDATE `quest_template` SET `OfferRewardText`='<The image of Commander Ameer rummages through the evidence.>$B$BIt is worse than I thought... These chambers hold ferocious beasts and creatures from many, many different worlds. They hope to one day command the beasts to do their bidding. We must destroy them all!' WHERE `entry`=10974;
UPDATE `quest_template` SET `OfferRewardText`='At last!$B$B<Commander Ameer reads from the Mark of the Nexus-King.>$B$BTwo final prisons? I shudder to think what horrors lie in wait...' WHERE `entry`=10976;
UPDATE `quest_template` SET `OfferRewardText`='<Arcus grins.>$B$BThe deadliest trap ever laid...' WHERE `entry`=11100;
UPDATE `quest_template` SET `OfferRewardText`='<Mor''ghor laughs.>$B$BHAH! I knew you wouldn''t let me down, commander! I want you to lead a raid on the Altar of Sha''tar at least once per day. They will have no choice but to leave Shadowmoon!' WHERE `entry`=11101;
UPDATE `quest_template` SET `OfferRewardText`='Well, well, well, I guess you had it in you after all. Good work. Maybe Old Man Keller was wrong about you after all.$B$B<Sky Sergeant Vanderlip smirks.>' WHERE `entry`=11102;
UPDATE `quest_template` SET `OfferRewardText`='The origin of this shrine is unknown, but there is no doubt to whom it pays homage...' WHERE `entry`=11135;
UPDATE `quest_template` SET `OfferRewardText`='The origin of this shrine is unknown, but there is no doubt to whom it pays homage...' WHERE `entry`=11220;
UPDATE `quest_template` SET `OfferRewardText`='What is this? The tome of Thomas Thomson? But that is the name of the Horseman before he was cursed! Does this mean that he is finally free? Does this mean he will no longer torment the good people of Azeroth?$B$BWhat a joyous day! $N, your feat will live long with us. The children, and their children, will sing your name!' WHERE `entry`=11242;
UPDATE `quest_template` SET `OfferRewardText`='Good job! That''ll show those arrogant Barleybrews.$B$BWell we promised you a reward and here it is. We Thunderbrew reward you with prizes, the Barleybrew reward you with foul odors and false promises.$B$BYou chose wisely.$B$BIf you want to keep making the right choice, stop by another day and help us spread the word.' WHERE `entry`=11294;
UPDATE `quest_template` SET `OfferRewardText`='What? This holy tome once belonged to an infamous paladin of the Alliance. Was he the Headless Horseman? Does this mean that the Horseman is defeated?$B$BThis is a glorious day, $N! Your legend will shine bright, and may it last for twice the years of the Horseman''s reign of fear.' WHERE `entry`=11403;
UPDATE `quest_template` SET `OfferRewardText`='You kept your word and let people know about our brewmasters. Thank you. We promised you these tickets, and gladly give them to you. I imagine the trolls are a bit more stingy with handing over their tickets...$B$BCome back another day to help us spread the word about Brewfest.' WHERE `entry`=11407;
UPDATE `quest_template` SET `OfferRewardText`='Ya did it! We gotta get ready for the flood of customers that are sure to come our way! Thanks!$B$BOh, that''s right, and we promised you a reward. Can''t forget about that...$B$BFeel free to stop by again another day to help us spread the word some more.' WHERE `entry`=11408;
UPDATE `quest_template` SET `OfferRewardText`='Thanks for your help! As long as Brewfest is going and the Dark Iron Dwarves are attacking and our supplier is stuck in that canyon, I''ll need some help shipping kegs. So if you want to work for more tickets, talk to me every day.$B$BHere are the tickets we promised you. Have fun!' WHERE `entry`=11412;
UPDATE `quest_template` SET `OfferRewardText`='What''s this? A stein voucher? So you like drinking? Great! After I give you this stein, go have a few drinks! Then a few more. Maybe have a few more after that... Then, now this is important, come see me.$B$BLook, I know you''ll be back eventually. If you want your Brewfest tickets redeemed, or Keg Protector marks redeemed, you have to see me.$B$BAnyways, here''s the stein, and remember to talk to me later.' WHERE `entry`=11413;
UPDATE `quest_template` SET `OfferRewardText`='What?! A free beer? Yeah, yeah. I guess we said we''d do that this year.' WHERE `entry`=11446;
UPDATE `quest_template` SET `OfferRewardText`='It''s a damn shame, it is, you lot cavorting up there without drinking the finest of the fine brews - ours! Did we get an invite to the competition? Of course not. Ya fight in some war and suddenly yer beer''s not good enough! So aye, we smashed up yer kegs a bit, and rightly so!$B$BEr... seeing as you''ve smashed through our defenses and all, though, maybe ya can do something fer me...' WHERE `entry`=11454;
UPDATE `quest_template` SET `OfferRewardText`='So you visited the Dark Iron and sought to put a stop to their sabotage? They attacked again a bit ago. Seems a Dark Iron''s word is as good as their brew, eh?$B$BStill, what you did to help is appreciated. Here, take a mug of the "ale" you brought from the depths of that mountain as your reward. Thirsty work, defeating all those Dark Irons!' WHERE `entry`=11486;
UPDATE `quest_template` SET `OfferRewardText`='So you visited the Dark Iron and sought to put a stop to their sabotage, eh, kid? They attacked again, you know. Seems a Dark Iron''s word is as good as their brew.$B$BStill, what you did to help is appreciated, I guess. Here, take a mug of the "ale" you brought from the depths of that mountain as your reward. No, really. It''s the least I can do.' WHERE `entry`=11487;
UPDATE `quest_template` SET `OfferRewardText`='So you wanna join the Skybreakers, eh? You''ve certainly proven yourself an able Dragonmaw but that means nothing in the skies of Outland. The question has to be answered: CAN YOU FLY?$B$BAnd I don''t just mean being able to mount up on a nether drake and delivering a shipment of crystals to the fort like those transporter scrubs. I''m talking about being the best... The top orc...$B$BOver to the west there are six riders. Defeat them all and I will grant you Skybreaker wings.' WHERE `entry`=11063;
UPDATE `quest_template` SET `OfferRewardText`='Didn''t think we''d leave you to face the fel orc army by yourself, did you?$B$B<Yarzill''s eyes flicker a translucent blue.>$B$BAye, we are here with you, $N. For every service you perform for the fel orcs in your quest to reclaim Netherwing lands, we''ll be at your side to make sure that they suffer a sufficient setback.$B$BYou''ll need to keep a low profile so as not to draw any unwanted attention to yourself during your sabotage missions.' WHERE `entry`=11019;
UPDATE `quest_template` SET `OfferRewardText`='Are you sure this is the path you seek to take,$N? This is not a decision you ought to take lightly.$B$BThis ring is imbued with a droplet from the Well of Eternity. It will grow IN power as you prove yourself to the Scale of the Sands.' WHERE `entry`=10461;
UPDATE `quest_template` SET `OfferRewardText`='The sands of time flow forwards easily.  They can be made to flow backward, but with great difficulty.' WHERE `entry`=11105;
UPDATE `quest_template` SET `OfferRewardText`='The sands of time flow forwards easily.  They can be made to flow backward, but with great difficulty.' WHERE `entry`=11106;
UPDATE `quest_template` SET `OfferRewardText`='Another soldier from Shattrath? A welcome sight!$b$bWish there were more of you, but we''ll make due with what we have. Whatever''s going on out here won''t wait for us to make ready.$b$bHave a look around, $c. There''s much that needs doing. Pitch in and do your share.$b$bOh, yeah, and don''t go tauntin'' the cryers - err, Scryers. Looks like we''re in this thing together....' WHERE `entry`=11481;
UPDATE `quest_template` SET `OfferRewardText`='...Come closer, $r... Listen carefully to my words....' WHERE `entry`=11488;
UPDATE `quest_template` SET `OfferRewardText`='<Larethor listens intently as you explain your deeds in Magisters'' Terrace.>$b$bTyrith will be missed - good man, that one. Thanks to you though, his death wasn''t in vain.$b$bI''ve underestimated you, $r. Please, accept this on behalf of the Sunwell Offensive - a gift worthy of a hero such as yourself.' WHERE `entry`=11492;
UPDATE `quest_template` SET `OfferRewardText`='So, the blood elf prince is truly dead this time? A pity, I always thought he had class. To think that one so lofty could be brought down for such a paltry sum.$b$bBut as they say, business is business. Your reward is earned, adventurer.$b$bCome back tomorrow and I will have another request for you to fulfill.' WHERE `entry`=11499;
UPDATE `quest_template` SET `OfferRewardText`='You bring great honor to our people. You have our thanks.' WHERE `entry`=11503;
UPDATE `quest_template` SET `OfferRewardText`='Fools.  They learned to drain fel energy but did not learn how to retain it.$b$bWe were lucky, $n.  An experienced felblood would''ve surely been a formidable opponent.' WHERE `entry`=11515;
UPDATE `quest_template` SET `OfferRewardText`='Excellent work, $n.  The demons might repair the gateway in due time.  I suppose we''ll just have to blow it up again.' WHERE `entry`=11516;
UPDATE `quest_template` SET `OfferRewardText`='These should do nicely, $c.$b$bI thank you for your assistance.' WHERE `entry`=11520;
UPDATE `quest_template` SET `OfferRewardText`='It''s very sweet of Theris to worry about my hide, but we''ve got bigger problems here.  Much bigger.' WHERE `entry`=11526;
UPDATE `quest_template` SET `OfferRewardText`='You''ve got some real talent, kid.  Did you ever think of joining the Skyguard?$b$bI jest, $n.  We need you here if we want to take the docks any time soon.' WHERE `entry`=11532;
UPDATE `quest_template` SET `OfferRewardText`='Any demons we kill today are demons that we do not have to fight tomorrow.  Keep it up.' WHERE `entry`=11533;
UPDATE `quest_template` SET `OfferRewardText`='Your dedication is exemplary, $n.  We will show the forces of the Burning Legion what we''re capable of.' WHERE `entry`=11537;
UPDATE `quest_template` SET `OfferRewardText`='Your dedication is exemplary, $n.  We will take the armory from the forces of the Legion in no time!' WHERE `entry`=11538;
UPDATE `quest_template` SET `OfferRewardText`='Excellent work, $c. Kael''s armies will falter and once we take the harbor we shall deliver the killing blow!' WHERE `entry`=11539;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $n.  It should be a long time before the harbor receives any reinforcements.' WHERE `entry`=11542;
UPDATE `quest_template` SET `OfferRewardText`='Your aid in the offensive has not gone unnoticed, $n. The combined forces of the Aldor and Scryers offer you their thanks.' WHERE `entry`=11554;
UPDATE `quest_template` SET `OfferRewardText`='You continue to prove yourself in this most important battle, $n. Please accept this as a token of our continued gratitude.' WHERE `entry`=11555;
UPDATE `quest_template` SET `OfferRewardText`='We couldn''t have gotten where we are without you, $n. The combined might of the Aldor and Scryers is not enough to crush the Legion and Kael. We are thankful to have allies of your caliber among us.' WHERE `entry`=11556;
UPDATE `quest_template` SET `OfferRewardText`='You are one of our very best, $n. Your name will be known throughout our ranks for a long time to come. Please accept this small gift on behalf of our forces.' WHERE `entry`=11557;
UPDATE `quest_template` SET `OfferRewardText`='Honor the Silverpine Forest flame.' WHERE `entry`=11584;
