UPDATE `quest_template` SET `OfferRewardText`='<Lord Torvos accepts the plans and looks over them.>$b$bYou''ve done the offensive a great service, $n, but we should not rest. I wouldn''t put it beyond our foes to plan more mischief in the future.' WHERE `entry`=11877;
UPDATE `quest_template` SET `OfferRewardText`='Excellent! Take this. I''ve prepared this bundle with items symbolizing the foes you''ve defeated. They will allow you to summon Terokk.$b$bBeware, $n. He is the most powerful arakkoa to ever exist. Do not underestimate him!' WHERE `entry`=11885;
UPDATE `quest_template` SET `OfferRewardText`='This fire seems new... Yet, you say it came from the Exodar? Fascinating! To make your way into that ship...  Of course, I''ll pay you for this. If you find anything else like this, be sure to speak with me again.' WHERE `entry`=11933;
UPDATE `quest_template` SET `OfferRewardText`='What a glorious fire! You received this from Silvermoon, you say? Unbelievable! With the flames of all four cities, who knows what we could accomplish?' WHERE `entry`=11935;
UPDATE `quest_template` SET `OfferRewardText`='Yes, these shards hold the final essence of the Frost Lord in this land.  We will dispose of them and banish Ahune to the nether regions of cold.$B$BThank you, $N.  Your name will echo in the chants of the Earthen Ring for days without end.  Please honor us by accepting this vestige, a symbol of your kinship with warmth and light.' WHERE `entry`=11972;
UPDATE `quest_template` SET `OfferRewardText`='Did you see that?  They were cheering for me!!$B$BNow I know how they feel when they are up on stage singing!  I felt the power and the energy!$B$BJust like they say in their song!$B$BMy mind is made up, I am going to be a rock star when I grow up!' WHERE `entry`=11975;
UPDATE `quest_template` SET `OfferRewardText`='You have my thanks, $n. I know that you do not have any duty to me or my people.$b$bWhat you say about that place troubles me still, and I sense that our culling is not quite at an end.' WHERE `entry`=11263;
UPDATE `quest_template` SET `OfferRewardText`='I''m glad you''ve proven you can follow orders. If I had a copper piece for every arrogant fool in shiny armor to come here and think they''re above the chain of command... well, I''d have a few gold.$b$bNow that you''ve demonstrated a measure of discipline, I have other tasks more suitable for someone of your caliber.' WHERE `entry`=11270;
UPDATE `quest_template` SET `OfferRewardText`='Revenge feels good. To think that this is but a taste of what''s to come.$b$bArthas will get what he deserves soon enough. Then and only then will I die a happy man.' WHERE `entry`=11272;
UPDATE `quest_template` SET `OfferRewardText`='You do some good killings over there. I see vrykul men fall and get stabbed with Sylvanas flag. Our side doing good!' WHERE `entry`=11282;
UPDATE `quest_template` SET `OfferRewardText`='You must have lots of practice with doing killings. You almost as good as Gorth!' WHERE `entry`=11283;
UPDATE `quest_template` SET `OfferRewardText`='I guess you burned everything. I see couple of spots not burning... but is close enough for Gorth.' WHERE `entry`=11285;
UPDATE `quest_template` SET `OfferRewardText`='Many men and women died to recover this blade. $n, I fear valiant Ares will not be the last.$b$bBut you do the Light''s work, hero. This sacred blade will be wielded by Lord Tirion Fordring himself. Even now the Argent Crusade works toward Icecrown. Lord Fordring has vowed that he will tear down the walls of the cursed place himself! And with the blade, he just might stand a chance against the Lich King.$b$bLord Fordring remains our greatest hope.' WHERE `entry`=11289;
UPDATE `quest_template` SET `OfferRewardText`='You come to help? Good... good...$b$bGorth was getting tired of killing vrykuls all day. Help is welcome!' WHERE `entry`=11295;
UPDATE `quest_template` SET `OfferRewardText`='These brains are beautiful! Gorgeous, even! They''re exactly what I need.$b$bThank you for your help, $n. Now I''ll show Malthus the truth his beer goggles couldn''t reveal.' WHERE `entry`=11301;
UPDATE `quest_template` SET `OfferRewardText`='This strain is far from worthless, my friend! Those fools at Vengeance Landing have had all the answers right under their own noses!' WHERE `entry`=11304;
UPDATE `quest_template` SET `OfferRewardText`='This will do. It''s time for some real apothecary work now, $n!' WHERE `entry`=11305;
UPDATE `quest_template` SET `OfferRewardText`='Excellent! You are an apt pupil, $n.$b$bNow comes the fun part. Deployment!' WHERE `entry`=11306;
UPDATE `quest_template` SET `OfferRewardText`='The plague didn''t disintegrate our subjects? Are you certain, $n??!$b$bThere must be an external factor we''re not accounting for... perhaps the low temperatures of this climate? Perhaps... a mutation in the strain!' WHERE `entry`=11307;
UPDATE `quest_template` SET `OfferRewardText`='What do you want? Can''t you see I''m in the middle of something?' WHERE `entry`=11308;
UPDATE `quest_template` SET `OfferRewardText`='Excellent! Yes, yes, these will do just fine!' WHERE `entry`=11309;
UPDATE `quest_template` SET `OfferRewardText`='Great job, $n. Say, you wouldn''t be looking for something more... permanent, would ya? I could sure use some help around these parts!' WHERE `entry`=11310;
UPDATE `quest_template` SET `OfferRewardText`='<Lurielle accepts the cores from you quietly.>$b$bThank you, $n.$b$b<Lurielle glances at the icy cores sadly.>$b$bI promise, my friends, I will do all I can to restore you.' WHERE `entry`=11313;
UPDATE `quest_template` SET `OfferRewardText`='So there is hope for my sisters?$b$b<Lurielle looks away from you, then down at the ground.>$b$bI feel guilty for not thinking of the pendant sooner. We might have saved even more of the sisters.' WHERE `entry`=11314;
UPDATE `quest_template` SET `OfferRewardText`='Holy... what the hell?! Look at this stuff!$B$BWe need to get this back to the keep a.s.a.p.!' WHERE `entry`=11327;
UPDATE `quest_template` SET `OfferRewardText`='Yes, $N, what is it now?$B$BWHAT?!! A Forsaken super plague that melts you in no time?$B$BYou oozed my vrykul prisoner?$B$B<The captain looks almost sad and spits in disgust.>$B$BAlright, I know what we need to do. Or rather, what YOU need to do!' WHERE `entry`=11331;
UPDATE `quest_template` SET `OfferRewardText`='Nicely done, $N, nicely done!$B$B<The captain seems beside himself with glee.>$B$BThat''ll show those good-for-nothing Forsaken to think about messing with us!$B$BI''d say you''ve earned yourself something from the treasury!' WHERE `entry`=11332;
UPDATE `quest_template` SET `OfferRewardText`='<The explorer beams a smile as you tell him who sent you. He continues in hushed tones.>$b$bIrena was concerned about me? She gets that from her father you know.' WHERE `entry`=11393;
UPDATE `quest_template` SET `OfferRewardText`='I know what this is! $n, it''s a controlling device for those scourging crystals!$b$bI bet anything that it can be used to shut down their force fields. Hmmm.$b$b<The explorer looks thoughtful as he ponders the implications of you having the device.>' WHERE `entry`=11395;
UPDATE `quest_template` SET `OfferRewardText`='I can tell you what this is, $n. It''s a controlling device for those scourging crystals down there!$b$bI bet anything that it can be used to shut down their force fields. Hmmm.$b$b<The apothecary looks thoughtful as she ponders the implications of you having the device.>' WHERE `entry`=11398;
UPDATE `quest_template` SET `OfferRewardText`='Excellent work, $N! You took out a good chunk of their dragon riders and really pissed off their leadership.$B$BAre you ready to head back to Valgarde and report the good news to Zorek? If so, I''ve got a crazy idea!\
' WHERE `entry`=11421;
UPDATE `quest_template` SET `OfferRewardText`='This is of tremendous value, $n. I must renew my efforts in salvaging and translating vrykul texts.$b$bDon''t get me wrong. Our enemies need to be destroyed... their ancient knowledge doesn''t.' WHERE `entry`=11423;
UPDATE `quest_template` SET `OfferRewardText`='Hmmmmph... these will do for now. There seems to be some oddness to them.$b$bI tell ya - I''ve handled body parts for years now and never have I had such a weird feeling in my stomach. Anyway, a deal is a deal. Here''s your payment.' WHERE `entry`=11424;
UPDATE `quest_template` SET `OfferRewardText`='For the Alliance! You''re a strong one, $N. Strong enough to crack some vrykul skull at Nifflevar.\
' WHERE `entry`=11429;
UPDATE `quest_template` SET `OfferRewardText`='You are insane, $N! What kind of degenerate would actually launch themselves from a harpoon gun as a method of travel?$B$BBut I guess you need to be a little crazy to pull off what you did up there on the bluffs! Fantastic work! We''ve gotten word that the Dragonflayer leader, Ingvar, is furious! Maybe one day you''ll be ready to stomp his face into the dirt - in the name of our beloved Alliance.' WHERE `entry`=11436;
UPDATE `quest_template` SET `OfferRewardText`='<Stanwad takes the bundle from you and begins sorting the data.>$b$bWow. How many people did you say died to get this information?$b$b<Stanwad shakes his head.>$b$bYou''ll be happy to know that what McSorf and his crew of bumbling imbeciles discovered is an ancient recipe for tundra stew. Did he not notice the icons of common vegetables and the pictograph of a humanoid mouth chompin'' down on said veggies? You don''t need a damned cipher to break this code!' WHERE `entry`=11448;
UPDATE `quest_template` SET `OfferRewardText`='Yes, $n. I can see the bond of companionship forming. She has accepted you as master.' WHERE `entry`=11460;
UPDATE `quest_template` SET `OfferRewardText`='Aye, the hawks are very territorial and often travel in packs. I suppose I could have told you that before I sent you out into the field.\
' WHERE `entry`=11468;
UPDATE `quest_template` SET `OfferRewardText`='This is good news! Now more bulls will swim across the strait to mate with the cows. Soon there will be plenty of new reef pups on the isles.$B$BThank you, $r. Whatever you might have done in the past, know that you have helped with Kamagua''s future!$B$BWe''ll have to keep up the good work if we''re going to see to it that their numbers are replenished. Please come back again tomorrow so that we can help another couple find each other.' WHERE `entry`=11472;
UPDATE `quest_template` SET `OfferRewardText`='Ku here, mate.  Ye come fe see I an'' I, aye?' WHERE `entry`=11473;
UPDATE `quest_template` SET `OfferRewardText`='Over half our team is dead or missing, junior. This is our last stand up here on the high bluffs. Those damned iron dwarves pushed us out of both Ivald''s Ruin and Baelgun''s. Now I''ve got a plan to get us back inside before they bury up all our goodies and we lose that data forever.' WHERE `entry`=11474;
UPDATE `quest_template` SET `OfferRewardText`='Well, well, well.  If it isn''t $N.  You show up at Scalawag point, no one''s heard of you except some goblin friend of that half-wit Terry.$B$BLet''s just say I''m a bit... skeptical... of your intentions here.' WHERE `entry`=11480;
UPDATE `quest_template` SET `OfferRewardText`='You''re almost ready to take this work of art into the field, $N!\
' WHERE `entry`=11485;
UPDATE `quest_template` SET `OfferRewardText`='You showed him! Now it''s time to put you in the field.$B$BFeeling confident, I hope...' WHERE `entry`=11491;
UPDATE `quest_template` SET `OfferRewardText`='Incredible! What could those iron menaces be up to? What are they doing in the Storm Peaks? And what is this Loken!? I''ll forward this information to our central base of operations in the Dragonblight, $N. I''ll also let ''em know that you were invaluable in the acquisition of said info.' WHERE `entry`=11495;
UPDATE `quest_template` SET `OfferRewardText`='Orfus is a good tuskarr - one of our strongest warriors. I knew he would not let us down.$B$BAllow me to see what it is that you have brought.\
' WHERE `entry`=11507;
UPDATE `quest_template` SET `OfferRewardText`='<Harry takes the crystal from you and gently pets it.>$B$BOh my precious! Did the big, mean whale hurt you? It''ll be ok. I''ll never let you out of my sight again!$B$B<Harry looks up at you.>$B$BSo, where were we?' WHERE `entry`=11510;
UPDATE `quest_template` SET `OfferRewardText`='Arrr, me''n''me crew pilfered that thar shield! We be tryin'' to get her back from that no good, landlubbin'' scallywag, Sorlof! Ye come to help, arrr?$B$BWell, as ye can see we be runnin'' a skeleton crew!$B$B<Captain Ellis laughs.>$B$BSister Mercy be needin'' another powder monkey to man the big''uns o''er on the poop deck. Think ye be up to the job, me hearty?$B$BHelp me crew take Sorlof down and we''ll split the booty! Ye can have the shield, me''n''me crew gets the rest!' WHERE `entry`=11519;
UPDATE `quest_template` SET `OfferRewardText`='We must return all of the artifacts, $N. When all four are gathered, you will put them back in their graves.\
' WHERE `entry`=11530;
UPDATE `quest_template` SET `OfferRewardText`='Aw, so you must be the so-called King Mrgl-Mrgl''s lackey. I suppose that $r has sent you to appease me?$b$bGood, I have just the thing that needs doing for someone as powerful as you!' WHERE `entry`=11562;
UPDATE `quest_template` SET `OfferRewardText`='Aw yes, these will do nicely.$b$bJust plop them down anywhere. You can have some of my leftover stew from last night. And since you''ve been helping us with our other problems, you can have my recipe, too.' WHERE `entry`=11564;
UPDATE `quest_template` SET `OfferRewardText`='Do not think that I have forgotten what you did for my people in Nagrand, $n. Hellscream never forgets.$b$bFor that I am indebted to you and it is why I give you this chance now: run. Leave this place and never look back.$b$bReturn to your home and say a prayer for the dying.' WHERE `entry`=11586;
UPDATE `quest_template` SET `OfferRewardText`='I can sense the upheaval in the spirit world beginning to calm. You have done well, $N. The spirits of the ancestors are fortunate to have your help in this time of need.' WHERE `entry`=11607;
UPDATE `quest_template` SET `OfferRewardText`='That''ll stop ''em - at least I think it''ll stop ''em. Either way, you''ve done your part. That''s all an $r can ask for, no?' WHERE `entry`=11608;
UPDATE `quest_template` SET `OfferRewardText`='<Hellscream reads the journal entry.>$b$bIs that all?' WHERE `entry`=11616;
UPDATE `quest_template` SET `OfferRewardText`='This is it? Hellscream sent a single $r $gboy:girl;?$b$bIf I still had a jaw it would be on the floor right now.' WHERE `entry`=11618;
UPDATE `quest_template` SET `OfferRewardText`='Imperean gave you a primal essence of herself? I can hear its howling winds!$b$bI know a ritual we can make use of it in. We must hurry before her primal rips itself apart!' WHERE `entry`=11629;
UPDATE `quest_template` SET `OfferRewardText`='<Chieftain Wintergale gingerly accepts the clods of soil you gathered.>$b$bWe should get these into Sage Aeire''s hands as soon as possible.$b$b<The chieftain grunts, pretending not to be disturbed by the tainted dirt.>$b$bWe can never know when the Scourge commander will launch the final assault on the village.' WHERE `entry`=11630;
UPDATE `quest_template` SET `OfferRewardText`='<Saurfang grins.>$b$bIt looks familiar... The Might of Kalimdor trampled a thousand bugs like this one in the desert of Silithus.$b$bThis is a different place - a different environment - but the result will be the same.$b$b<Saurfang looks you over.>$b$bYou will bring pride and honor to the Horde in Northrend, $n.$b$b<Saurfang nods.>' WHERE `entry`=11632;
UPDATE `quest_template` SET `OfferRewardText`='The dead are honored by your actions, $n.$b$b<The wounded orc nods and exhales slowly.>$b$bPerhaps now I can find my way back to being the warrior I once was.' WHERE `entry`=11639;
UPDATE `quest_template` SET `OfferRewardText`='You''re the new tank driver, $gbuddy:lassy;? Fine by me! We just need to get these things up and running again. Yea, you try to go out into the Plains of Nasam without a tank and you''re as good as dead.' WHERE `entry`=11642;
UPDATE `quest_template` SET `OfferRewardText`='Great work, $gbuddy:lassy;! Now where''d I put those spare parts...' WHERE `entry`=11643;
UPDATE `quest_template` SET `OfferRewardText`='Great work, $gbuddy:lassy;! Now where''d I put that pneumatic tank transjigamarig.' WHERE `entry`=11644;
UPDATE `quest_template` SET `OfferRewardText`='Kel''Thuzad? So it''s true - Naxxramas returns...$b$bPerhaps I underestimated you, $n. You''ve done the Horde a great service. The Warchief would be proud!$b$b<Garrosh pauses to think.>$b$bIf Kel''Thuzad is controlling these Scourge, there''s no telling what else the Lich King has in store for us... I''ll need time to think through this new information, $n. You are dismissed.' WHERE `entry`=11652;
UPDATE `quest_template` SET `OfferRewardText`='<Getry looks you over.>%B%BThis is all Ickoris could send?' WHERE `entry`=11703;
UPDATE `quest_template` SET `OfferRewardText`='I see that Skyhopper finally got around to sending help. And none too soon I might add!$B$BWelcome, $Gbrother:sister;, we need your help badly!' WHERE `entry`=11707;
UPDATE `quest_template` SET `OfferRewardText`='That''s great, $c! These parts look like they''re in serviceable condition.$B$BNow if I could only figure out how to fix this blasted thing....' WHERE `entry`=11710;
UPDATE `quest_template` SET `OfferRewardText`='Primal Mighthorn will be delighted! This is better than even I expected!$B$BPerhaps it''s time that I told you the truth.' WHERE `entry`=11719;
UPDATE `quest_template` SET `OfferRewardText`='<Hellscream picks up the head of Gammothra with one arm and spits in its face.>$B$BThey will learn, $N... They will all learn. The Horde is not to be trifled with...' WHERE `entry`=11722;
UPDATE `quest_template` SET `OfferRewardText`='<Abner listens eagerly as you report your success and the success of the Shake-n-Quake 5000.>$B$BFizzcrank will be delighted to hear the news! And who knows, perhaps we''ll make a mechanic of you yet!' WHERE `entry`=11723;
UPDATE `quest_template` SET `OfferRewardText`='My screwdriver... you found my screwdriver! I''d been wondering where that thing got lost.$B$BHmm, you found it inside one of their robots, you say? That gives me an idea....' WHERE `entry`=11729;
UPDATE `quest_template` SET `OfferRewardText`='Cultists? Below deck? I ought to have my whole crew flogged!$B$BListen... why don''t we have Admiral Cantlebree take care of this... situation?' WHERE `entry`=11790;
UPDATE `quest_template` SET `OfferRewardText`='Nice job, $N.  Show the lads how it''s done.  The only good creeper''s a dead creeper!' WHERE `entry`=11797;
UPDATE `quest_template` SET `OfferRewardText`='<You hear a voice in your head. It is Khu''nok.>$B$BYour name has been heard in the whistling winds, $N. You have done a great thing for my kin. For this we will consider you an ally. Alas, our torment cannot end without bloodshed and violence.$B$BThe price of peace for the mammoths will be the death of Kaw...' WHERE `entry`=11878;
UPDATE `quest_template` SET `OfferRewardText`='It does not surprise me that the $r chieftain does not have time to hear of our troubles. The ambassador''s efforts will likely be like so much mist blowing in the wind.$B$BBut you are here now. We shall see if he chose well in sending you.' WHERE `entry`=11888;
UPDATE `quest_template` SET `OfferRewardText`='Fascinating!$B$BAnd they''re aggressive too, you say. That would suggest that some intelligence is behind this manipulation. It may not be natural at all....$B$BPlease, $N, accept this as a token of our gratitude for your efforts. Dalaran will hear of your service.' WHERE `entry`=11911;
UPDATE `quest_template` SET `OfferRewardText`='It was wise of you to bring this to me, $n.$b$b<Raelorasz eyes the fragment and slowly nods.>$b$bIf you truly desire to contribute to our efforts, no matter the risk, I shall share with you its meaning.' WHERE `entry`=11941;
UPDATE `quest_template` SET `OfferRewardText`='Hilda''s sending us weapons?  That''s excellent news, $N.  I was about ready to tell the lads to pack things up.' WHERE `entry`=11963;
UPDATE `quest_template` SET `OfferRewardText`='Word of Keristrasza''s rescue has reached my ears. You are to be commended.$b$bI am eager to speak with her again.' WHERE `entry`=11967;
UPDATE `quest_template` SET `OfferRewardText`='This is exactly what we need, $N! Brandishing Horde arms will lift their spirits and give them the protection they need against the Scourge.$B$BAre you prepared for the ceremony of initiation?$B$B<Brighthoof nods.>$B$BYou will be the one to admit our new allies into the Horde.' WHERE `entry`=11978;
UPDATE `quest_template` SET `OfferRewardText`='<Roh''kill salutes you.>$B$BYou have preserved our honor, $N. Tor''zin and I both thank you for this selfless act!' WHERE `entry`=11980;
UPDATE `quest_template` SET `OfferRewardText`='What took you so long? Time waits only for Aspects, $r.$B$BWe have much work to do, you and I.' WHERE `entry`=11996;
UPDATE `quest_template` SET `OfferRewardText`='Curious, they seek an accord with the Ethereum. The ethereals could prove a powerful ally for Malygos and his madness.$B$BThis will not do!' WHERE `entry`=12000;
UPDATE `quest_template` SET `OfferRewardText`='That''s alright, $c, just put them down on the ground there in front of Agmar''s throne.$B$B<The hint of a smile can be seen upon the archmage''s image.>$B$BUnfortunate that Goramosh indicated the accord had already been reached.$B$BNonetheless, that''s two less worms we''ll have to worry about. Let us get on to more important business.' WHERE `entry`=12005;
UPDATE `quest_template` SET `OfferRewardText`='I''m a simple trapper. The world has turned upside-down all of a sudden. It doesn''t make sense.$B$BI hope that you''ll be able to set it right again.' WHERE `entry`=12009;
UPDATE `quest_template` SET `OfferRewardText`='That''s not the news I wanted to hear, $r.$B$BNo, no... it''s good that you told me, but I fear my old nemesis has returned to these waters.' WHERE `entry`=12011;
UPDATE `quest_template` SET `OfferRewardText`='<Brugar looks over the report.>$B$BThis isn''t good at all. Even if we could excavate the tunnels behind the blockage, there''s no guarantee they wouldn''t collapse again. It looks like some of these areas haven''t been used in generations. We''ll have to give Captain Gryan the bad news.' WHERE `entry`=12014;
UPDATE `quest_template` SET `OfferRewardText`='You were able to slay Kili''ua... perhaps you''ll be able to do the same to Tu''u''gwar.$B$BPerhaps not.' WHERE `entry`=12016;
UPDATE `quest_template` SET `OfferRewardText`='Ghosts and gibbering madness? This cannot be!$B$BWe must seek further guidance.' WHERE `entry`=12028;
UPDATE `quest_template` SET `OfferRewardText`='I''ve been expecting you, $r. I saw your spirit fly by and sensed the mystic watching behind your eyes.$B$BYour fate and that of the Kalu''ak are now tied together.' WHERE `entry`=12030;
UPDATE `quest_template` SET `OfferRewardText`='<Overlord Agmar looks over the document.>$B$BIs this what I think it is? With the information contained within these pages we will CRUSH the Anub''ar assault!$B$BYou have done well to bring this document to me, $N. Perhaps you will be allowed to watch or even participate in the final battle at Angrathar! LOK''TAR!' WHERE `entry`=12041;
UPDATE `quest_template` SET `OfferRewardText`='Excellent!  They''re even sharper than I expected them to be.  I''ll pack them in the snow until the bomb is ready.$b$bLet''s see... what next...\
' WHERE `entry`=12045;
UPDATE `quest_template` SET `OfferRewardText`='Ha ha!  One of those meat slabs landed clear over here!  Nice work there!\
' WHERE `entry`=12049;
UPDATE `quest_template` SET `OfferRewardText`='$N, if I''m not mistaken, you''ve uncovered the key to allow us to discern exactly what the mage hunter forces are up to!' WHERE `entry`=12055;
UPDATE `quest_template` SET `OfferRewardText`='<Gort takes the tome from you.>$B$BSavages... Bound in $r flesh... This language... Its existence has never been proven. It is the language of death... The tongue of the Scourge.' WHERE `entry`=12057;
UPDATE `quest_template` SET `OfferRewardText`='These will do nicely. Perhaps after I grow these beasts to full size, I will bring them back and introduce them to the giants personally.$b$bBunch of useless rocks if you ask me.' WHERE `entry`=12078;
UPDATE `quest_template` SET `OfferRewardText`='So she is dead. As it should be. Your intentions do indeed prove nobler than those of the runt.$B$BThrough the north canyon you will find Crystal Song Woods.  It is a cursed and dangerous place, $r. Should that be your next destination, proceed with caution. $b$bTake this for your efforts, little one, and leave this conflicted land with my blessing.' WHERE `entry`=12080;
UPDATE `quest_template` SET `OfferRewardText`='The oafish man-cow actually acquired a rot resistant organ? Curses... I was certain that task would keep his malformed mind occupied well into the next millennium.$B$BWell give it here, $Gboy:girl;. I have much to do without your feeble needs getting in the way.' WHERE `entry`=12101;
UPDATE `quest_template` SET `OfferRewardText`='I imagined there would be more to this than just an isolated town of hostiles.$B$BWe have men near Hollowstone Mine, perhaps it would be in our interest to do a little research.' WHERE `entry`=12105;
UPDATE `quest_template` SET `OfferRewardText`='WHAT?!$B$B<The image before you distorts for a moment as the archmage attempts to regain her composure.>$B$BOf course, we should have guessed that this was what they were up to all along. Quickly, there''s no time to waste.$B$BWyrmrest must be warned!' WHERE `entry`=12110;
UPDATE `quest_template` SET `OfferRewardText`='Outstanding!$b$bNuthin'' better with a pint than a hot morsel of meat.' WHERE `entry`=12113;
UPDATE `quest_template` SET `OfferRewardText`='Entrails? An interesting choice, $r.$b$bKraz shall see what is to be learned from them. Thank you for braving the depths of that place.' WHERE `entry`=12116;
UPDATE `quest_template` SET `OfferRewardText`='A letter of introduction to meet with the queen? Let me see that.$B$BWhatever your business is, I hope that it''s important. The skies are full of attacking blues today!' WHERE `entry`=12122;
UPDATE `quest_template` SET `OfferRewardText`='Oh, thank you! May the Light bless your good works, kind $Gsir:lady;. The shadow of the Dark Horseman yet looms, but at least, for now, the village is safe from his flames.' WHERE `entry`=12135;
UPDATE `quest_template` SET `OfferRewardText`='<Gort takes the tome from you and begins reading.>$B$BWHAT! This can''t be right. I''ve known some of these $rs for years!$B$BLeave me, $N. I have much work to do and many traitors to execute.$B$BTake one of these items for your trouble. You''ve done a great service for the Horde this day.' WHERE `entry`=12136;
UPDATE `quest_template` SET `OfferRewardText`='You have done well.$b$bPlease, sit and listen. There are many things we must discuss.' WHERE `entry`=12137;
UPDATE `quest_template` SET `OfferRewardText`='Finally, it''s ready. I only hope it holds together long enough to get the job done. If we don''t take out the thane leading Dun Argol, Captain Gryan''ll be in for a nasty surprise.' WHERE `entry`=12138;
UPDATE `quest_template` SET `OfferRewardText`='The fires are out! You and your fire brigade were victorious! Hah!$B$BThe Headless Horseman''s attack has failed, but until he and his head are destroyed together, he will return.$B$BUntil then, however, let''s take comfort in the safety you brought our children. I am honored to have watched your brave work today.' WHERE `entry`=12139;
UPDATE `quest_template` SET `OfferRewardText`='With the aid of such a powerful shaman, we are sure to be victorious at the Wrathgate!' WHERE `entry`=12140;
UPDATE `quest_template` SET `OfferRewardText`='Icefist, eh? I''ve heard his name before. Dat''s some good work, mon. Hopefully we Darkspear can turn our attention back to dat dragon menace now.' WHERE `entry`=12145;
UPDATE `quest_template` SET `OfferRewardText`='You are formidable indeed.$B$BWith Grom''thar the Thunderbringer gone, we can leave the remaining Magnataur to fight among themselves and turn our attentions back towards more prominent threats.$B$BImpressive work, $c. ' WHERE `entry`=12151;
UPDATE `quest_template` SET `OfferRewardText`='You''ve come to help me, haven''t you!' WHERE `entry`=12158;
UPDATE `quest_template` SET `OfferRewardText`='You''re a life saver, $Gbrother:sister;. If you''re interested in more work, there''s more where that came from.' WHERE `entry`=12175;
UPDATE `quest_template` SET `OfferRewardText`='I''m in your debt, mon. Take this as payment.' WHERE `entry`=12176;
UPDATE `quest_template` SET `OfferRewardText`='Just who do you take me for? These hides smell of flour!$B$BThis is a complete insult to the Horde!' WHERE `entry`=12178;
UPDATE `quest_template` SET `OfferRewardText`='So you managed to stop the Dark Irons... While drunk too? That, $c, is truly the spirit of Brewfest! I guess in keeping with the spirit of Brewfest you want your prize tokens.$B$BThanks for your help, $N. Enjoy the rest of Brewfest.' WHERE `entry`=12192;
UPDATE `quest_template` SET `OfferRewardText`='This slime is foul with a darkness far more ancient than their worldly forms would indicate. The land itself has a memory of this evil for as long as it has existed.$B$BWe must find out more, $N.' WHERE `entry`=12207;
UPDATE `quest_template` SET `OfferRewardText`='This orb... it has been tainted by... a purely evil force.$B$BWhatever else I might learn from studying this energy, one thing is certain. I must destroy this orb as soon as possible. Its corrupting force is just too strong.' WHERE `entry`=12213;
UPDATE `quest_template` SET `OfferRewardText`='Ah, nothing makes me happier than a job well done.$B$BYou''ve done Venomspite a great service in acquiring these horses, $c.' WHERE `entry`=12214;
UPDATE `quest_template` SET `OfferRewardText`='<Doctor Malefious looks through the contents of the package.>$B$BGlorious! Exactly to specifications!$B$BHere is your payment, $N. Keep what you''ve seen and done to yourself. This work is all classified - information is given out on a need to know basis.' WHERE `entry`=12221;
UPDATE `quest_template` SET `OfferRewardText`='<The deathguard rubs his hands together in anticipation.>$B$BExcellent. Their loss is my... our gain!$B$BYou didn''t have trouble with any of these along the way? Some of them look rather unstable. I may be $r, but I value my existence!' WHERE `entry`=12230;
UPDATE `quest_template` SET `OfferRewardText`='Ursoc''s children are wise. Their words explain much of what we''ve seen so far.' WHERE `entry`=12231;
UPDATE `quest_template` SET `OfferRewardText`='<Urik points to a gryphon.>$B$BHave you ever ridden one of those? It''s simple, friend. Just hop on and tell it where to go.\
' WHERE `entry`=12235;
UPDATE `quest_template` SET `OfferRewardText`='<The druid looks pale and her eyes stare blankly past you. She has left a package in anticipation of your return.>' WHERE `entry`=12236;
UPDATE `quest_template` SET `OfferRewardText`='I can''t make any promises, $N. But I will try my best to purify these.' WHERE `entry`=12241;
UPDATE `quest_template` SET `OfferRewardText`='Thank you, $n. I''ll take those from you.$b$bThe corruptive power of these seeds is dangerous. I must destroy them right away.' WHERE `entry`=12242;
UPDATE `quest_template` SET `OfferRewardText`='The corruption present in this blood is identical to that of the slime. I don''t have a good feeling about this.' WHERE `entry`=12246;
UPDATE `quest_template` SET `OfferRewardText`='Ursoc''s children are wise. Their words explain much of what we''ve seen so far.' WHERE `entry`=12247;
UPDATE `quest_template` SET `OfferRewardText`='Yes! Vordrassil''s magic is still present in these ashes. There might be hope for Ursoc yet.' WHERE `entry`=12248;
UPDATE `quest_template` SET `OfferRewardText`='<The druid looks pale and her eyes stare blankly past you. She has left a package in anticipation of your return.>' WHERE `entry`=12249;
UPDATE `quest_template` SET `OfferRewardText`='Thank you, $N. I''ll take those from you.$B$BThe corruptive power of these seeds is dangerous. I must destroy them right away.' WHERE `entry`=12250;
UPDATE `quest_template` SET `OfferRewardText`='<Halford salutes.>$B$BThe townsfolk are all back to work? Already? Outstanding, soldier! We''ll get this town built back up and fortified in no time. Before long, reinforcements will be ready to join the fight with Lord Fordragon at the Wrathgate.$B$BI''m getting ahead of myself, of course, as there is much left to do here before we can even think about sending you to the aid of Bolvar.\
' WHERE `entry`=12251;
UPDATE `quest_template` SET `OfferRewardText`='<Halford says a prayer for the deceased.>$B$BYou do the Light''s work, $N.$B$BI fear that our work has only just begun.$B$B<Halford holds up a document.>' WHERE `entry`=12253;
UPDATE `quest_template` SET `OfferRewardText`='Hearing their screams... watching the last life fade from their wretched bodies... it''s invigorating, is it not?$B$BI relish it.' WHERE `entry`=12264;
UPDATE `quest_template` SET `OfferRewardText`='I feel terrible about this, friend. I fear that in my haste to recover the strange ore from Wintergarde Mine I may have doomed agent Slinkin.\
' WHERE `entry`=12275;
UPDATE `quest_template` SET `OfferRewardText`='Your paperwork looks to be in order. Welcome to the club, $N!$B$BYou can expect to get our mail at the start of every month. If you like what you got, stop by and we can sell you some more. This is the club that keeps on giving.' WHERE `entry`=12278;
UPDATE `quest_template` SET `OfferRewardText`='<Halford opens the package and reads the analysis.>$B$BI am by no means a scientist, $N, so you''ll have to forgive my plebian understanding of what has been written. Now, according to this analysis - assuming I have the brain power of at least an adolescent school boy - we still don''t know jack squat about the Scourge war machine. The only thing we do know is that the Scourge uses this foul metal to craft its siege engines, armor and weaponry.$B$B<Halford lets loose a long sigh.>' WHERE `entry`=12281;
UPDATE `quest_template` SET `OfferRewardText`='Let''s see them bring her back to life without her head!$B$B<The high executor''s laugh draws a number of furtive glances.>$B$BI''m a little concerned that you let this grand admiral get away, but you''re still the hero of the day, $N!$B$BTake your pick... you''ve earned it!' WHERE `entry`=12285;
UPDATE `quest_template` SET `OfferRewardText`='Zelig sent word, friend. We have been expecting you.$B$BI am Orik Trueheart, paladin of the Argent Crusade. The priestess standing across the campfire from me is Tilda Darathan. We are here on behalf of the Argent Crusade - sent to quell the unfortunate damned souls attempting to escape Wintergarde.' WHERE `entry`=12287;
UPDATE `quest_template` SET `OfferRewardText`='It''s locked, isn''t it? It looks pretty ordinary.$B$B<Lieutenant Dumont Shakes the chest, producing a rattling wooden sound.>$B$BNo matter, I suppose. If this gets us the edge we need against the Horde, then I could care less if the cure for the Plague was in there.' WHERE `entry`=12292;
UPDATE `quest_template` SET `OfferRewardText`='<Greer lifts his glasses onto the top of his head and reads the note, looking back up at you curiously when he''s done.>$B$BYou will have my fastest gryphon! This information must be delivered to High Commander Wyrmbane at once!\
' WHERE `entry`=12297;
UPDATE `quest_template` SET `OfferRewardText`='<The High Commander reads the missive and then crumples it up.>$B$BDo you know where the people on this list are now? Take a look outside, near the front gate. They''re the ones hanging from the arches.$B$BGhoul bait...\
' WHERE `entry`=12298;
UPDATE `quest_template` SET `OfferRewardText`='So you be joinin'' our ranks, $N? We treat ya nice here. You only get the best when you part of dis club!$B$BWe be sendin'' out brew to you at da start of every month. If you like what you got, and you be wantin'' more, head back over here. We make sure you get more of da brew you like.' WHERE `entry`=12306;
UPDATE `quest_template` SET `OfferRewardText`='Whatever information is held in this book must be of great importance! I could hear the howls and wails echoing through the crypt as you made your escape!$B$BThe High Commander must be notified!' WHERE `entry`=12312;
UPDATE `quest_template` SET `OfferRewardText`='Ah, the distinguished hero arrives. Welcome to ground zero, $N. Allow me to bring you up to speed!$B$BThel''zan''s most powerful forces have made their way into the Wintergarde Mausoleum. They plumb its depths in search of corpses and souls to send against Wintergarde while Naxxramas rains down terrible Scourge plague machines, set to hold us at bay!$B$BWe must strike now and hope that Lord Fordragon is able to hold out at the Wrathgate for just a little longer.\
' WHERE `entry`=12325;
UPDATE `quest_template` SET `OfferRewardText`='Why I''m not wearing any pants isn''t important. Let''s just say I took some Scourge shrapnel in the wrong place and leave it at that, ok?$B$BSo you wiped out those plague wagons up in the fields and got my soldiers here in one piece. Impressive. You''re one of the first to make it this far, friend. Too bad you gotta go right back out into the Carrion Fields. Yep, we''ve had a bit of a setback.\
' WHERE `entry`=12326;
UPDATE `quest_template` SET `OfferRewardText`='You''re back. And you''re alive.$b$bNow what''s this nonsense about worgen?' WHERE `entry`=12412;
UPDATE `quest_template` SET `OfferRewardText`='Not bad, $n. You might be slightly more useful than I initially thought.' WHERE `entry`=12413;
UPDATE `quest_template` SET `OfferRewardText`='You''re going to let me go... just like that? Listen, I don''t want any trouble with you... these monsters killed my father and took my sister. I have other things on my mind right now.' WHERE `entry`=12422;
UPDATE `quest_template` SET `OfferRewardText`='Hah! Is this some sort of joke?$B$BI barely have any use for books I can actually understand.' WHERE `entry`=12423;
UPDATE `quest_template` SET `OfferRewardText`='Could it be? The man who wrote this journal feared for his daughters'' lives so he sent them away from Silverbrook.$B$BWe just captured an outcast in the outskirts of town about the same age as the eldest daughter.$B$BListen, $N. There''s more happening here than meets the eye... we can''t just burn this diary.' WHERE `entry`=12424;
UPDATE `quest_template` SET `OfferRewardText`='You seek knowledge beyond your reach so you''ve come to me. I must warn you, stranger, the answers I provide might not be to your liking.' WHERE `entry`=12425;
UPDATE `quest_template` SET `OfferRewardText`='Nice work, mon! Here''s your cut.' WHERE `entry`=12427;
UPDATE `quest_template` SET `OfferRewardText`='Those were some sharp moves, friend! Lots of bets against you, which is good news cash-wise!' WHERE `entry`=12428;
UPDATE `quest_template` SET `OfferRewardText`='My heart nearly skipped a beat there! Thought that mound of metal was gonna get ya, mon!' WHERE `entry`=12429;
UPDATE `quest_template` SET `OfferRewardText`='Fancy footwork, fancy footwork. You really made quick work of that crazy orc, friend.$B$BOdds were against you seven-to-one; made some nice coin on that one!' WHERE `entry`=12430;
UPDATE `quest_template` SET `OfferRewardText`='What happened today... had to happen. It doesn''t mean I have to be happy about it.$B$BI''ve freed my people from a tyrant, but I''ve also lost a sister. I thank you for your help, $N. I wish to be alone now.' WHERE `entry`=12431;
UPDATE `quest_template` SET `OfferRewardText`='Nice job, $N. These will feed two or three grunts each. Not bad.' WHERE `entry`=12436;
UPDATE `quest_template` SET `OfferRewardText`='At least for now the Scarlet Onslaught suffers a setback in their nefarious plans. You have done Wintergarde a great service, $N.\
' WHERE `entry`=12442;
UPDATE `quest_template` SET `OfferRewardText`='Dahlia... they turned her?$B$BDahlia has been loyal to us for a very long time... if they can corrupt a being of her devotion, it does not bode well for the rest of the young races. Thank you for freeing her. I hope she has found some peace.$B$BYou have honored us with your selfless assistance today, $r. Perhaps not all of the Horde bear the black hearts of their ancestors. I will send word to the council of what your kind have accomplished here.' WHERE `entry`=12450;
UPDATE `quest_template` SET `OfferRewardText`='I thank you, $N. Your help is appreciated.' WHERE `entry`=12453;
UPDATE `quest_template` SET `OfferRewardText`='$N, I haven''t seen heroics like that since Silithus!$B$BI''ll be sure that each and every one of those soldiers puts in a recommendation to Lord Fordragon that you be promoted!$B$BNow, on to more pressing matters. We''ve gotten reports back from our scouts that Thel''zan is close.\
' WHERE `entry`=12457;
UPDATE `quest_template` SET `OfferRewardText`='So Krenna sent you to me? She must''ve not liked you very much, but then again who does she like?$B$BCracking this vrykul outpost is going to be a tough, tough job.' WHERE `entry`=12468;
UPDATE `quest_template` SET `OfferRewardText`='You saw Nozdormu? That doesn''t make any sense.$B$B<Chromie thinks a moment about what you''ve said.>$B$BActually, that''s great news! We had no idea of where or when the Lord of Time had gone to. We just knew that he had disappeared to deal with very important matters.$B$BSo, even though the leader of the Infinite Dragonflight wasn''t revealed, you''ve discovered that Nozdormu is alive and well, and fighting back against them!$B$BThank you, $N. I''ll be seeing you soon!' WHERE `entry`=12470;
UPDATE `quest_template` SET `OfferRewardText`='Wintergarde is saved because of you, $N. To think that one woman could so swiftly turn the tides of battle is hard for most to comprehend; yet here we are - victorious! You have managed to restore the faith of these people and earned the respect of your commanding officers.$B$B<Halford salutes.>$B$BLord Fordragon has returned to Angrathar to prepare our forces for the destruction of the Wrathgate and has requested that you join him! I couldn''t recommend a better soldier for the job, $N.' WHERE `entry`=12473;
UPDATE `quest_template` SET `OfferRewardText`='Hopefully the message is now clear to the Onslaught. I hope it was enough of a beating to make them doubt their affiliations.\
' WHERE `entry`=12476;
UPDATE `quest_template` SET `OfferRewardText`='Muradin lives? Could it be? I must nofity King Bronzebeard at once!$B$BI need to consult the orb. There must be more information - somewhere!\
' WHERE `entry`=12478;
UPDATE `quest_template` SET `OfferRewardText`='Nice work. That poor sap never saw it coming.' WHERE `entry`=12481;
UPDATE `quest_template` SET `OfferRewardText`='Excellent work, $N. When our forces from Vengeance Landing arrive, we''ll be able to take care of any vrykul that are left.' WHERE `entry`=12482;
UPDATE `quest_template` SET `OfferRewardText`='<The dwarf sergeant warily eyes the orders in your hand.>$B$BAre those new orders for me, $Gmister:lady;?' WHERE `entry`=12505;
UPDATE `quest_template` SET `OfferRewardText`='Your skill with the quill is already starting to manifest, young scribe. The tarot cards are of great interest to the Darkmoon Faire, so do not hesitate to call upon us if you manage to create more. We are not without our own skilled tradesmen, so please allow us to offer something in trade for the cards.' WHERE `entry`=12517;
UPDATE `quest_template` SET `OfferRewardText`='Your skill is most impressive! The tarot cards are of great interest to the Darkmoon Faire, so do not hesitate to call upon us if you manage to create more. We are not without our own skilled tradesmen, so please allow us to offer something in trade for the cards.' WHERE `entry`=12518;
UPDATE `quest_template` SET `OfferRewardText`='Well, now!$B$BYa saved me a fair bit o'' work there $Glad:lass;. I''m grateful. I''ll be sure ta make mention of ya in me report.$B$BOff with yeh now. Finklestein''ll likely be waitin fer ya a bit west o'' here.' WHERE `entry`=12519;
UPDATE `quest_template` SET `OfferRewardText`='Aye, Hemet''s here. He''s at the camp, just go northwest toward the river and you''ll soon see it. And for the love of the Light, $g lad:lass;, have him send someone to cut me down!' WHERE `entry`=12521;
UPDATE `quest_template` SET `OfferRewardText`='What a relief to hear that the Venture Company will trouble us no more. You have my thanks, and that of Hemet for dealing with this problem. A game hunter cannot, in good conscience, lift $Ghis:her; weapon against another person.' WHERE `entry`=12525;
UPDATE `quest_template` SET `OfferRewardText`='You''ve done it!$B$BThe intelligence gathered from that $r will undoubtedly be of great value. I''ll be certain to make mention of your efforts in my report to the commander.$B$BThank you, $N.' WHERE `entry`=12541;
UPDATE `quest_template` SET `OfferRewardText`='<Hemet listens as you describe what you learned.>$B$BWay to go, $Glad:lass;. No dead rhino tells Hemet Nesingwary where and what he can hunt. We''ll show that heap o'' bones.' WHERE `entry`=12544;
UPDATE `quest_template` SET `OfferRewardText`='As you can see, the Scourge war machine presses onward, yet the armies of the Horde and the Alliance remain divided, making for easy prey. It is for this reason that we must remain united.$B$B<Valus is lost in contemplation for a moment.>$B$BThe Argent Crusade has use for a $g man:woman; like you. Perhaps you would be interested in joining our cause? To battle and die at the side of the Ashbringer?' WHERE `entry`=12545;
UPDATE `quest_template` SET `OfferRewardText`='I am grateful for your help, $N. It is my duty to watch over these lands and all life that dwells on them.$B$BThanks to you, that life will continue to thrive while the forces of death wage in the bordering regions.$B$BYour actions will not be forgotten.' WHERE `entry`=12546;
UPDATE `quest_template` SET `OfferRewardText`='<As you read the engravings on this stone colossus, you realize that this is the weapon that Freya spoke of. This is the Etymidian.>' WHERE `entry`=12548;
UPDATE `quest_template` SET `OfferRewardText`='I think you may have found the proof we need for this Shango. And I think I have an idea as to where we can find him.' WHERE `entry`=12550;
UPDATE `quest_template` SET `OfferRewardText`='You''re the hero of the hour, $N.$B$B<Moonshard kicks the head away from him.>$B$BYou deserve our deepest respect, and something more I think.' WHERE `entry`=12554;
UPDATE `quest_template` SET `OfferRewardText`='We''re halfway there, $N. One more switch needs to be activated before we can retrieve the Etymidian.' WHERE `entry`=12559;
UPDATE `quest_template` SET `OfferRewardText`='Very well, $r. I am satisfied that you''re not one of the Lich King''s minions... perhaps there is something you can do for us after all.' WHERE `entry`=12561;
UPDATE `quest_template` SET `OfferRewardText`='Excellent work, $gsir:ma''am;!$B$BI''ll see to it that the commander is apprised of your mission results.' WHERE `entry`=12562;
UPDATE `quest_template` SET `OfferRewardText`='You help us? You welcome then, $N.' WHERE `entry`=12570;
UPDATE `quest_template` SET `OfferRewardText`='Well, $n, at least you''ve made it back in one piece. I suppose that''s worth something....' WHERE `entry`=12587;
UPDATE `quest_template` SET `OfferRewardText`='You have heard the call of the Lich King, death knight. Now is the time to answer your master.' WHERE `entry`=12593;
UPDATE `quest_template` SET `OfferRewardText`='Fine specimens, $n.$b$bOn behalf of my soldiers, I thank you for your efforts today.$b$bCaptain Rupert is likely the next stop on your patrol. He''s stationed at the wall just east of here.' WHERE `entry`=12597;
UPDATE `quest_template` SET `OfferRewardText`='We''re not out of the woods by any means, but your efforts have helped to slow the enemy down.$b$bCaptain Grondel up in Drak''Agal will likely have need of you.$b$bFarewell, $n.' WHERE `entry`=12598;
UPDATE `quest_template` SET `OfferRewardText`='The living... willingly serve the Lich King?$b$bAll this time I''ve been searching for the wrong enemy, $r. Let us make haste and uproot these cultists from these lands.' WHERE `entry`=12608;
UPDATE `quest_template` SET `OfferRewardText`='You continue to prove yourself, $n. Perhaps I was too quick to judge you.$b$bI had assumed you were here with the poachers who were recently stranded in my lands, but perhaps you''re ready to put that behind you.' WHERE `entry`=12611;
UPDATE `quest_template` SET `OfferRewardText`='<The corpse is badly burnt. There appear to be the remains of several powder kegs in the vicinity.>' WHERE `entry`=12612;
UPDATE `quest_template` SET `OfferRewardText`='The waygate is active, $n. It is time!' WHERE `entry`=12613;
UPDATE `quest_template` SET `OfferRewardText`='You speak the truth. The intruders at the camp were dealt with... but I''m afraid it might have been too late.' WHERE `entry`=12617;
UPDATE `quest_template` SET `OfferRewardText`='Impressive. I wasn''t expecting a mere mortal to prove as worthy an ally as you.$b$bI fear our efforts have not been sufficient, however. The Scourge shows no signs of stopping.' WHERE `entry`=12620;
UPDATE `quest_template` SET `OfferRewardText`='There is no turning back now. If you agree to help me, you will do so without hesitation.' WHERE `entry`=12621;
UPDATE `quest_template` SET `OfferRewardText`='The scalper thinkin'' that you be his kind of $r!$b$bWhat''s these candybars doin'' in here? What we do with this, mon?$b$bAhunae say that you can have them back!' WHERE `entry`=12622;
UPDATE `quest_template` SET `OfferRewardText`='You did it! You actually found it!$b$bI don''t know... I don''t know how to thank you!' WHERE `entry`=12624;
UPDATE `quest_template` SET `OfferRewardText`='The time to spill the blood of our enemies approaches. You must first learn what it is that you seek to destroy, before rushing headlong into battle. It is what separates a death knight from a mindless ghoul.$B$BI will grant you sight beyond sight, my champion. You will use the eye of Acherus to steal our enemies'' secrets. ' WHERE `entry`=12636;
UPDATE `quest_template` SET `OfferRewardText`='Two out of three drinkers agree, eh? Not bad for a first try. Not bad at all. I suppose I''ll have to whip up something else for Tamara by way of apology.$b$bNow... what should we call this creation?' WHERE `entry`=12645;
UPDATE `quest_template` SET `OfferRewardText`='Aw, me thinkin'' that too funny.$b$b$n is my kind of $r!$b$bYou still got my knife?' WHERE `entry`=12659;
UPDATE `quest_template` SET `OfferRewardText`='I thank you, $r. You''re proving to be a worthy ally.' WHERE `entry`=12660;
UPDATE `quest_template` SET `OfferRewardText`='Do you smell it?$B$B<Valanar sniffs at the air.>$B$BFresh meat... The scent of Scarlet Crusader wafts through the air.$B$B<Valanar salivates.>$B$BApologies, death knight, I''m sure you''re not interested in my choice of fine cuisine. You are here to work! To lead the charge! Yes... I know. The Lich King has told me all that I need to know about you, $N.$B$BThe time for bloodshed is now.\
' WHERE `entry`=12670;
UPDATE `quest_template` SET `OfferRewardText`='You saved my life up there, $gbuddy:lassy;. Nice flying!' WHERE `entry`=12671;
UPDATE `quest_template` SET `OfferRewardText`='Fascinating!$b$bWe''ll look into the properties of these crystals right away.$b$bNow tell me, $n, what is the latest with this Drakuru fellow?' WHERE `entry`=12677;
UPDATE `quest_template` SET `OfferRewardText`='Do you feel it, $N? That sensation is raw power coursing through your body. Such a thing cannot exist for mortals.$B$BThe front lines are now dismantled. The geist will finish the job and prepare the grounds for Razuvious. We turn our attention now to more tactical targets.\
' WHERE `entry`=12678;
UPDATE `quest_template` SET `OfferRewardText`='Well done, death knight! You feed the Scourge war machine with your deeds!$B$BAh yes, your reward - as promised.' WHERE `entry`=12679;
UPDATE `quest_template` SET `OfferRewardText`='You have succeeded where most initiates fail, $N. For that you will be rewarded handsomely.$B$B<Salanar bows.>' WHERE `entry`=12687;
UPDATE `quest_template` SET `OfferRewardText`='The professor sent you my way? All right.' WHERE `entry`=12696;
UPDATE `quest_template` SET `OfferRewardText`='You have served us well, death knight. Few of your brethren have survived our initial attack upon the Scarlet interlopers. You remain as one of the strongest.$B$B<Prince Valanar nods.>$B$BEast of us, past the Havenshire Mine, is the coast - called Light''s Point by the Scarlet Crusade. A thousand soldiers stand between us and their ships. Insurmountable? Hardly the point...\
' WHERE `entry`=12700;
UPDATE `quest_template` SET `OfferRewardText`='<Highlord Mograine reads over the report.>$B$BThe ENTIRE Scarlet fleet?$B$B<Highlord Mograine nods.>$B$BSuch power, $N... I have not seen such a display of domination in years... Since my father wielded...$B$B<Highlord Mograine shakes his head.>$B$BIt''s not important...$B$BYes, your commendation, lest I forget.' WHERE `entry`=12706;
UPDATE `quest_template` SET `OfferRewardText`='Just look at all of that!$b$bSee here, $n. This piece you recovered vividly illustrates that the Drakkari became aware of the weakening of the land that the Scourge caused by their presence.$b$bThe warlord felt compelled to take the opportunity this presented. He pushed the prophets to kill their gods in an effort to control the power and fight back against the Lich King''s forces.$b$bEither way they were doomed. They inadvertently chose to be the instrument of their own destruction!' WHERE `entry`=12709;
UPDATE `quest_template` SET `OfferRewardText`='Hail, death knight. I am the blood lord, Keleseth, ruler of the southeastern reaches of Northrend. The Lich King has sought to utilize my talents in ending this mortal affront to the Scourge. As with all things the Lich King asks of me, I am happy to oblige. Of course, a sea of endless souls to sate my thirst certainly sweetened the deal, don''t you think?\
' WHERE `entry`=12715;
UPDATE `quest_template` SET `OfferRewardText`='The plague cauldron jumps to life when the skulls are placed inside.$B$BAfter a few seconds, the plague cauldron grants you the dark and frothy splendor of Noth''s Special Brew.' WHERE `entry`=12718;
UPDATE `quest_template` SET `OfferRewardText`='The registry will tell us many things about the Scarlet insects.$B$B<Keleseth flips through the pages of the registry.>$B$BDeath rates, births, but most importantly, movement.$B$BLook here, $N, they have already sent three vessels abroad. Let me see here... Where are they headed?$B$B<Keleseth mutters something about latitude and longitude under his breath as he calculates the route.>$B$BWHAT? This is impossible. They sail to Northrend!$B$BBeside the coordinates are the words: "Crimson Dawn."' WHERE `entry`=12719;
UPDATE `quest_template` SET `OfferRewardText`='An awakening? What nonsense do you speak, $g boy:girl;! What kind of fool would deliver their people into the very heart of the frozen wastes? Perhaps, though, this courier holds the answer.' WHERE `entry`=12720;
UPDATE `quest_template` SET `OfferRewardText`='No!$b$bAnother god destroyed, its power stolen. And now the prophet of Akali has threatened us directly.$b$bWhen he comes, he will come for Har''koa. We cannot allow him to take her power too.$b$bWe must consult the gods once more, $n. They will tell us what must be done.' WHERE `entry`=12721;
UPDATE `quest_template` SET `OfferRewardText`='I thank you, $n. The great tempest will look upon us favorably thanks to you.' WHERE `entry`=12726;
UPDATE `quest_template` SET `OfferRewardText`='You did it! $n, you are the champion of Zul''Drak!$b$bWe will never be able to repay the debt that we owe to you, but the Zandalari have given into my trust a number of objects they believe you might have an interest in.$b$bPlease, I want you to have a token of our appreciation, but hurry. I sense another issue of urgency!' WHERE `entry`=12730;
UPDATE `quest_template` SET `OfferRewardText`='To the victor goes the glory, death knight! Well done! The Lich King looks favorably upon you on this day.\
' WHERE `entry`=12733;
UPDATE `quest_template` SET `OfferRewardText`='Waters... cleansed. Yes. All is well.$b$bYou understand our way, $n.' WHERE `entry`=12735;
UPDATE `quest_template` SET `OfferRewardText`='You see? I can tell you smarter already. And if not smarter... then... happier!' WHERE `entry`=12736;
UPDATE `quest_template` SET `OfferRewardText`='You learn fast, $n. You learn that song well. Maybe next time I teach you different song.' WHERE `entry`=12737;
UPDATE `quest_template` SET `OfferRewardText`='You''re a good man, $n. We''re fortunate that you happened to stop by.$b$bStick around a while. I''m sure that we have much that a capable $c such as yourself can do.' WHERE `entry`=12740;
UPDATE `quest_template` SET `OfferRewardText`='Greetings, $gbrother:sister;. You may have come on behalf of the Argent Dawn, but that is not why you are here -- you are here to help your people earn the respect we so justly deserve. As any forsaken will agree, the end justifies the means, and our research into the zombie plague''s cure is that proverb in practice...' WHERE `entry`=12752;
UPDATE `quest_template` SET `OfferRewardText`='$gBrother:Sister; $r, I am proud to stand with you during our days of need. Bless you, and may the alliance between $r and human last a thousand years.' WHERE `entry`=12753;
UPDATE `quest_template` SET `OfferRewardText`='You have become an instrument of doom, death knight! We will ravage these approaching armies and raise the dead as our own!' WHERE `entry`=12757;
UPDATE `quest_template` SET `OfferRewardText`='By my beard! This holds a power to rival a fleet of our flying machines! I''ll give it to my war priests and we''ll devise a plan to send those vile necropolises scurrying back to Northrend... and we''ll be right behind them!$b$bOh, Muradin my brother, you must live! By the honor of the Bronzebeards, I will find you!' WHERE `entry`=12771;
UPDATE `quest_template` SET `OfferRewardText`='$n, honorable $r, welcome. May the Light shine upon you, and may your ancient wisdom ward our land in its time of need.' WHERE `entry`=12772;
UPDATE `quest_template` SET `OfferRewardText`='What is this? What a boon! They have captured such Light into this artifact, it shines nigh bright as the moon! Our priests will channel this power against our foes, and the Lich King''s invasion will surely fail. Thank you, $n. Our world tree will be safe.$b$bWhat''s more, we have sensed that perhaps another world tree grows far to the north, nestled hidden near the Lich King''s own domain. Perhaps someday... we will shepherd both trees and herald a new era of peace.' WHERE `entry`=12773;
UPDATE `quest_template` SET `OfferRewardText`='So, the holy folk in Shattrath created what they promised! In hindsight, diverting so many priests and paladins there, instead of sending them against the Scourge, was the right move. With this holy weapon, we can beat back that damned Lich King and his minions!$b$bI commend you, Lord $n.' WHERE `entry`=12774;
UPDATE `quest_template` SET `OfferRewardText`='$gBrother:Sister;, we are called again to fight against the Scourge. It is good you are here; with your strength, and the power of the Light, we may yet prevail.' WHERE `entry`=12775;
UPDATE `quest_template` SET `OfferRewardText`='Ah, I can see the power of the Naaru shine through this thing, as if Light itself is housed here. Such good can be done with this implement; the necropolises sent from the frozen wastes of the north will surely fail.' WHERE `entry`=12776;
UPDATE `quest_template` SET `OfferRewardText`='My heart swells with Light to see you, a noble $r, come to our aid. Bless you, good $c!' WHERE `entry`=12777;
UPDATE `quest_template` SET `OfferRewardText`='You have served me well, $N. The mark of the Scourge has been burned into these Scarlet lands. You have reaped death and destruction for as far as the eye can see and delivered to me the last of the Scarlet armies.$B$B<The Lich King points to the ruins of Havenshire and the burning city of New Avalon.>$B$BIt is now time to finish what you started.' WHERE `entry`=12778;
UPDATE `quest_template` SET `OfferRewardText`='Kneel, champion. I place this helm upon your head to complete your terrifying visage. Any that dare look upon your dark countenance will know that death comes. Let none stand so boldly against your king so as to face your merciless wrath, $N.$B$BThere remains only one final task...$B$B<The Lich King looks west.>$B$BLight''s Hope Chapel.' WHERE `entry`=12779;
UPDATE `quest_template` SET `OfferRewardText`='What a fine specimen you are. We have many experiments to perform and our stable of volunteers is nearly bankrupt. So, elf, as your race''s self-proclaimed name implies... Do you have blood to spare? Fresh blood is welcome blood indeed...' WHERE `entry`=12782;
UPDATE `quest_template` SET `OfferRewardText`='What a fine, robust specimen you are. We have many experiments to perform and our stable of volunteers is nearly bankrupt. Fresh blood is welcome blood indeed, and the rage in your blood could fuel hours of research.' WHERE `entry`=12783;
UPDATE `quest_template` SET `OfferRewardText`='What a fine, robust specimen you are. We have many experiments to perform and our stable of volunteers is nearly bankrupt. Fresh blood is welcome blood indeed, and I''m sure someone of your stature has blood to spare...' WHERE `entry`=12784;
UPDATE `quest_template` SET `OfferRewardText`='Ah, very good. The diseases this rotted head carries are deadly, but we must not shy from danger or from what we find distasteful. Some day, $n, you will learn that damnation is the path to salvation...' WHERE `entry`=12785;
UPDATE `quest_template` SET `OfferRewardText`='Ah, very good. The diseases this rotted head carries are deadly, but we must not shy from danger or from what we find distasteful. Some day, $n, you will learn that damnation is the path to salvation...' WHERE `entry`=12786;
UPDATE `quest_template` SET `OfferRewardText`='Ah, what a fine specimen you are. The disease, -- diseases -- dancing through your brain must offer you visions so sublime. We will spend long nights in conversation, you and I, and I will pick from you your thoughts as I slowly extract the meat from your skull.$b$bDo not fear, little one. The knowledge gained from your sacrifice will be awesome. You are a gift to the forsaken; you will herald a new age of respect for us among the peoples of this world. Your place in our history is assured...' WHERE `entry`=12787;
UPDATE `quest_template` SET `OfferRewardText`='Ah, very good. The diseases this rotted head carries are deadly, but we must not shy from danger or from what we find distasteful. Some day, $n, you will learn that damnation is the path to salvation...' WHERE `entry`=12788;
UPDATE `quest_template` SET `OfferRewardText`='You''ve done well.$b$bWoe unto our enemies. Woe unto those who serve the Lich King and threaten the titans'' creations -- for the Etymidian is here.' WHERE `entry`=12797;
UPDATE `quest_template` SET `OfferRewardText`='Your inscription ability has grown, scribe. The tarot cards are of great interest to the Darkmoon Faire, so do not hesitate to call upon us if you manage to create more. We are not without our own skilled tradesmen, so please allow us to offer something in trade for the cards.' WHERE `entry`=12798;
UPDATE `quest_template` SET `OfferRewardText`='The Highlord and the other death knights are preparing to strike! We will squeeze the last remnants of life out of this place.' WHERE `entry`=12800;
UPDATE `quest_template` SET `OfferRewardText`='Impressive, mon! Fate be kind in bringin'' us together.$b$bSoon I be avengin'' me bruddas by cleansin'' Drak''Tharon, and you be awarded Drak''Tharon''s greatest treasure.' WHERE `entry`=12802;
UPDATE `quest_template` SET `OfferRewardText`='You are not of this land. But you also are not with the Scourge.$b$bWhat should I make of you?' WHERE `entry`=12803;
UPDATE `quest_template` SET `OfferRewardText`='I thank you, $n. It is a shame that the pillar has fallen, but we must salvage what we can.' WHERE `entry`=12805;
UPDATE `quest_template` SET `OfferRewardText`='$gBrother:Sister; $r, I am proud to stand with you during our days of need. Bless you, and may the clever eyes of your race help find a path to our salvation..' WHERE `entry`=12808;
UPDATE `quest_template` SET `OfferRewardText`='Inconceivably immaculate! This device stores Light energy at levels beyond those of any source yet known! Oh, the possible applications shiver my whiskers and curl my toes. Ho ho! The anti-nocturnal photo-dispersement geno-actuator I could build with this would turn dusk into dawn! The Scourge won''t know what hit them. We''ll destroy them all in one pull of a lever!' WHERE `entry`=12809;
UPDATE `quest_template` SET `OfferRewardText`='What a fine, robust specimen you are. We have many experiments to perform and our stable of volunteers is nearly bankrupt. Fresh blood is welcome blood indeed, and your primal blood could fuel hours of research.' WHERE `entry`=12811;
UPDATE `quest_template` SET `OfferRewardText`='Ah, very good. The diseases this rotted head carries are deadly, but we must not shy from danger or from what we find distasteful. Some day, $n, you will learn that damnation is the path to salvation...' WHERE `entry`=12812;
UPDATE `quest_template` SET `OfferRewardText`='Oh yeah this is gonna be good!$b$bStand back... I''m gonna call down the wrath of the blood ritual!' WHERE `entry`=12814;
UPDATE `quest_template` SET `OfferRewardText`='Hmm. From what you''ve told me, the voices within the circles... they must be used for communication of some kind. I shudder to think what unnatural minds are contacted through such magic. Regardless, you seem to have emerged whole and sane. The Argent Dawn appreciates your service.' WHERE `entry`=12816;
UPDATE `quest_template` SET `OfferRewardText`='Hmm. From what you''ve told me, the voices within the circles... they must be used for communication of some kind. I shudder to think what unnatural minds are contacted through such magic. Regardless, you seem to have emerged whole and sane. The Argent Dawn appreciates your service.' WHERE `entry`=12817;
UPDATE `quest_template` SET `OfferRewardText`='Ha ha! Good to see you''re up for some dirty work.$b$bMuch appreciated there, $gpal:lass;!' WHERE `entry`=12829;
UPDATE `quest_template` SET `OfferRewardText`='Woo! That''s a ripe stench right there! You had to get hands-on with some of those snobolds, didn''t ya?$b$bI do appreciate it though!' WHERE `entry`=12830;
UPDATE `quest_template` SET `OfferRewardText`='That should cut it... I hope Ricket can put something together for me. Ready to get out of there, then?' WHERE `entry`=12831;
UPDATE `quest_template` SET `OfferRewardText`='A note written by Westwind? Why didn''t you say so?$b$b<Arete tears the letter from your hand to read it.>$b$bThe fool! He''s actually here?!$b$b<The lord-commander laughs.>$b$bThis is new information. I wonder how he imagines that he''s going to conquer the world once he''s taken down the Lich King? Not that he could accomplish either task in his wildest imaginings.' WHERE `entry`=12839;
UPDATE `quest_template` SET `OfferRewardText`='I wasn''t sure you were coming back. I dread to think what will happen to me if I stay here for much longer.' WHERE `entry`=12841;
UPDATE `quest_template` SET `OfferRewardText`='Remember these words, death knight: The Runeforge is a Scourge instrument. It exists only in Acherus, Naxxramas and the heart of Icecrown! You may only emblazon your weaponry at a Runeforge.$B$BReturn often and emblazon all of your weapons. A death knight must be prepared for all that would dare oppose $g him:her;!' WHERE `entry`=12842;
UPDATE `quest_template` SET `OfferRewardText`='You did it! Our boys are back!' WHERE `entry`=12843;
UPDATE `quest_template` SET `OfferRewardText`='Thanks, $n! We''ll see what we can do to salvage these parts!' WHERE `entry`=12844;
UPDATE `quest_template` SET `OfferRewardText`='You''re definitely not with the Hyldnir... so what are you here for? Ah... you must be looking for the new prisoner!' WHERE `entry`=12846;
UPDATE `quest_template` SET `OfferRewardText`='The war has begun, death knight! I shall place you upon my finest gryphon and deliver you to Death''s Breach. Chaos, death, destruction! You will herald in all of this and more!\
' WHERE `entry`=12850;
UPDATE `quest_template` SET `OfferRewardText`='Your efforts appear to have been successful, $gbrother:sister;.$b$bYou have brought glory to the Brunnhildar!' WHERE `entry`=12856;
UPDATE `quest_template` SET `OfferRewardText`='<Stefan reads the missive, then crumples it up and tosses it into the fire.>$b$bOld news. The Argent Crusade is - once again - late to the party. we''ve been tracking Drakuru since Grizzly Hills. He is slated for eradication.' WHERE `entry`=12884;
UPDATE `quest_template` SET `OfferRewardText`='These will do nicely. I''ll have the harness ready for you in no time.' WHERE `entry`=12900;
UPDATE `quest_template` SET `OfferRewardText`='I was expecting a replacement for one of my overseers. It''s about time you showed up.$b$bLet''s put you to work.' WHERE `entry`=12905;
UPDATE `quest_template` SET `OfferRewardText`='Not bad for a new overseer. I''ve another task for you if you''re feeling brave today.' WHERE `entry`=12906;
UPDATE `quest_template` SET `OfferRewardText`='If I had any reservations regarding your commitment when you first arrived, I no longer have any. With just a little more effort you could be a permanent member of my operation.' WHERE `entry`=12907;
UPDATE `quest_template` SET `OfferRewardText`='I knew you''d be back! Get me out of these shackles and I''ll help you find the goblin.' WHERE `entry`=12908;
UPDATE `quest_template` SET `OfferRewardText`='A... A storm giant? I don''t know about this, $n. That sounds risky. On the other hand, I don''t think we have too many other options.$b$bIf I do this you have to promise me that you will get your giant friend to help us deal with Navarius and his cronies.' WHERE `entry`=12912;
UPDATE `quest_template` SET `OfferRewardText`='Unbelievable! This will be a story for the ages, $n! One man rode upon the head of the king of storm giants and decimated an entire Scourge army!$b$bAnd I was there to see it all happen...' WHERE `entry`=12919;
UPDATE `quest_template` SET `OfferRewardText`='You''re here -- good. I think I know where your goblin is.' WHERE `entry`=12921;
UPDATE `quest_template` SET `OfferRewardText`='You have our thanks, $gbrother:sister;. We cannot allow our valiant traditions to be corrupted.' WHERE `entry`=12925;
UPDATE `quest_template` SET `OfferRewardText`='Already I''m hearing reports of the prowess you displayed on the Savage Ledge. Excellent, $n... excellent!$b$b$b$bAnd now I think it''s time to issue a decree to the thane of those vrykul that you so easily defeated.' WHERE `entry`=12939;
UPDATE `quest_template` SET `OfferRewardText`='The Val''kyr are nothing but the Lich King''s lapdogs. They will be put down like the scum they are. They''ve made their choice, now they have to live with the consequences.' WHERE `entry`=12942;
UPDATE `quest_template` SET `OfferRewardText`='These will have to do. I can teach you the art of gemcutting perfection, and give you proof of my skills as well.' WHERE `entry`=12952;
UPDATE `quest_template` SET `OfferRewardText`='Now that is what I call dedication! Those traitors might have a new master now, but they''ll never forget their sisters'' parting gift.' WHERE `entry`=12953;
UPDATE `quest_template` SET `OfferRewardText`='Here is your Dalaran Jewelcrafter''s Token as promised. Come back tomorrow and I am sure I will have another item I need from you!' WHERE `entry`=12958;
UPDATE `quest_template` SET `OfferRewardText`='Here is your Dalaran Jewelcrafter''s Token as promised. Come back tomorrow and I am sure I will have another item I need from you!' WHERE `entry`=12959;
UPDATE `quest_template` SET `OfferRewardText`='Here is your Dalaran Jewelcrafter''s Token as promised. Come back tomorrow and I am sure I will have another item I need from you!' WHERE `entry`=12960;
UPDATE `quest_template` SET `OfferRewardText`='Here is your Dalaran Jewelcrafter''s Token as promised. Come back tomorrow and I am sure I will have another item I need from you!' WHERE `entry`=12961;
UPDATE `quest_template` SET `OfferRewardText`='Here is your Dalaran Jewelcrafter''s Token as promised. Come back tomorrow and I am sure I will have another item I need from you!' WHERE `entry`=12962;
UPDATE `quest_template` SET `OfferRewardText`='Here is your Dalaran Jewelcrafter''s Token as promised. Come back tomorrow and I am sure I will have another item I need from you!' WHERE `entry`=12963;
UPDATE `quest_template` SET `OfferRewardText`='Yulda had it coming. No one gets away with insulting the Hyldsmeet. Not even one of our own.' WHERE `entry`=12968;
UPDATE `quest_template` SET `OfferRewardText`='Well done, young one. It looks like our deal has been satisfied on both our ends.' WHERE `entry`=12969;
UPDATE `quest_template` SET `OfferRewardText`='It''s settled then. You will compete in the Hyldsmeet and with my help you''ll restore great Thorim to his rightful place.' WHERE `entry`=12970;
UPDATE `quest_template` SET `OfferRewardText`='You''ve done it, $n. You''ve bested some of the fiercest fighters the Hyldnir race has to offer.' WHERE `entry`=12971;
UPDATE `quest_template` SET `OfferRewardText`='Think we''ll give you your own bear just like that? You''ll have to prove yourself before you get anything from us.$b$bDo not think too highly of yourself just because you bested a few challengers in the Hyldsmeet.' WHERE `entry`=12972;
UPDATE `quest_template` SET `OfferRewardText`='<Njormeld''s eyes become noticeably moist as he pours the contents of the bag onto the anvil.>$b$bThe Horn of Hodir....$b$bThis was a sacred gift to our people from Hodir himself, $r. It is a relic of great importance to us.$b$bWhen you next return to our stronghold you shall see the fruits of your labor.$b$bFarewell.' WHERE `entry`=12976;
UPDATE `quest_template` SET `OfferRewardText`='I''m impressed. I never thought I would see an icemaw matriarch again. Especially not one this size.' WHERE `entry`=12983;
UPDATE `quest_template` SET `OfferRewardText`='The Jormungar are vile creatures. You did well in destroying them.' WHERE `entry`=12989;
UPDATE `quest_template` SET `OfferRewardText`='Not bad. I was hoping Kirgaraak would snap your neck so I could keep your bear.$b$bJust joking, $gbrother:sister;. Well... half-joking. That''s a really nice bear you''ve got.' WHERE `entry`=12996;
UPDATE `quest_template` SET `OfferRewardText`='You really did it! You made it out with your health. Wish we could say the same for your bear.$b$bIt''s going to take a while for her to recover. Fortunately you won''t need her for a while.' WHERE `entry`=12997;
UPDATE `quest_template` SET `OfferRewardText`='$n, you came.$b$bAlready I have heard of your activities on the Savage Ledge. This is good. I am glad that you seem willing to help with undermining the vrykul here at Jotunheim.$b$b$b$bYou and I are going to have a great deal of fun with them!' WHERE `entry`=12999;
UPDATE `quest_template` SET `OfferRewardText`='These furs are rather... large. I''d hate to see the worgs you had to face off with.$b$bWe''re all very thankful. The temperature is starting to drop already.' WHERE `entry`=13000;
UPDATE `quest_template` SET `OfferRewardText`='Thank you.  I shall teach you of gemcutting perfection and in addition give you a perfect gem that I have cut.' WHERE `entry`=13004;
UPDATE `quest_template` SET `OfferRewardText`='It''s a good start. But my brother''s forces will not take long to regroup. We must make our victory a decisive one.' WHERE `entry`=13005;
UPDATE `quest_template` SET `OfferRewardText`='There are still many Argent Crusade soldiers out on that field and in Scourgeholme, $n. While your help is appreciated, there is still much left to be done.' WHERE `entry`=13008;
UPDATE `quest_template` SET `OfferRewardText`='One by one, my brother''s servants have fallen. Loken''s insurrection will soon come to an end.' WHERE `entry`=13035;
UPDATE `quest_template` SET `OfferRewardText`='Here is your Dalaran Jewelcrafter''s Token as promised. I have new shipments going out all the time, check by from time to time to see what I need.' WHERE `entry`=13041;
UPDATE `quest_template` SET `OfferRewardText`='No... it cannot be...$b$bNo one can defeat Thorim in single combat. Not a giant, nor a beast... no one! Especially not that coward of a brother of his.$b$bOn my forefather''s names, this I swear...$b$bLoken will pay for this!' WHERE `entry`=13047;
UPDATE `quest_template` SET `OfferRewardText`='Yes... these will do. Let us hope my plan works, $n.$b$bVeranus is a great drake. I''d hate to have to settle for a lesser one.' WHERE `entry`=13050;
UPDATE `quest_template` SET `OfferRewardText`='It''s good to have my old friend back. It appears that my luck is finally starting to change... and it''s all thanks to you, little friend.' WHERE `entry`=13051;
UPDATE `quest_template` SET `OfferRewardText`='This hurts bad, mon. Don''t know if I''m gonna make it.' WHERE `entry`=13054;
UPDATE `quest_template` SET `OfferRewardText`='I thank you, mon. I might live another day now.' WHERE `entry`=13055;
UPDATE `quest_template` SET `OfferRewardText`='I''m already feeling much better, mon. Not sure if it''s the antidote or the news of that filthy worg getting what he deserved.' WHERE `entry`=13056;
UPDATE `quest_template` SET `OfferRewardText`='You''ve really made it this far. Never would I have thought you''d progress so quickly among the hyldnir.' WHERE `entry`=13061;
UPDATE `quest_template` SET `OfferRewardText`='Are you ready to ride, $gbrother:sister;? There is no coming back.' WHERE `entry`=13062;
UPDATE `quest_template` SET `OfferRewardText`='So, $gbrother:sister;, you think that completing a few simple chores makes you a heroine?$b$bYou shall learn....' WHERE `entry`=13063;
UPDATE `quest_template` SET `OfferRewardText`='I am glad you were able to save him from undeath. With A''dal''s blessing, he will know no evil in his afterlife.$b$bWe shall take heart in his shining example and in your selflessness. Thank you for all that you have done.' WHERE `entry`=13083;
UPDATE `quest_template` SET `OfferRewardText`='Ya gots me meat!  Here is your recipe, I gots cookin to do!' WHERE `entry`=13087;
UPDATE `quest_template` SET `OfferRewardText`='That will keep our recruits fed!  Here''s how you cook it.' WHERE `entry`=13088;
UPDATE `quest_template` SET `OfferRewardText`='This looks great!  Thanks!' WHERE `entry`=13100;
UPDATE `quest_template` SET `OfferRewardText`='This is plenty of food for everyone!  I am sure the customers will be pleased.' WHERE `entry`=13101;
UPDATE `quest_template` SET `OfferRewardText`='This will be consumed in no time!   Thanks!' WHERE `entry`=13102;
UPDATE `quest_template` SET `OfferRewardText`='Your power has grown, my faithful knight.$b$b<Highlord Darion Mograine peers at you.>$b$bVengeance is at hand, $gbrother:sister;. Koltira aids the Horde upon the gunship, Orgrim''s Hammer, while Thassarian assists the Alliance aboard the Skybreaker. The Ebon Blade will soon wash over Icecrown and leave the armies of the Lich King in ruin.' WHERE `entry`=13105;
UPDATE `quest_template` SET `OfferRewardText`='Perfect!  I Just hope the Dalaran Destroyers finally win one!' WHERE `entry`=13107;
UPDATE `quest_template` SET `OfferRewardText`='Is this food from Awilo? Can you promise me there isn''t any gnome in it?' WHERE `entry`=13112;
UPDATE `quest_template` SET `OfferRewardText`='My guests should find this acceptable. Just don''t tell them it came from Awilo.' WHERE `entry`=13113;
UPDATE `quest_template` SET `OfferRewardText`='Stew looks good. Thanks for your help.' WHERE `entry`=13114;
UPDATE `quest_template` SET `OfferRewardText`='This wine is quite amazing! I must know where it''s from.' WHERE `entry`=13115;
UPDATE `quest_template` SET `OfferRewardText`='Perfect! I Just hope the Dalaran Destroyers finally win one!' WHERE `entry`=13116;
UPDATE `quest_template` SET `OfferRewardText`='<Raelorasz listens intently to your report.>$b$b$n, this is most welcome news.$b$bNot since the onset of this conflict have we dealt a blow of this magnitude to the Lord of Magic.$b$bPlease, friend, accept the gratitude of our unified dragonflights.' WHERE `entry`=13128;
UPDATE `quest_template` SET `OfferRewardText`='Splendid! Mebbe now me mateys be able ta rest in peace.$b$bHere ya go, lad.Don''t let it be said that ol'' Brigg weren''t generous ta those who showed ''im a kindness.$b$bGood doin'' business wit yeh.' WHERE `entry`=13132;
