UPDATE `quest_template` SET `RequestItemsText`='I bid you welcome, $gbrother:sister;. I knew you would come. It was only a matter of time.$b$bWhat I said interested you, didn''t it? I hit a chord... something inside you knew what I claimed was truth. Good.$b$bKnow this though: I am no traitor to Sylvanas. If anything, she would appreciate my claims considering it was her own beliefs that has put the Forsaken in the position it is now.' WHERE `entry`=3099;
UPDATE `quest_template` SET `RequestItemsText`='You''ve arrived, and none too soon, $N. Welcome to Shadowglen.$B$BI trust my sigil found you in good spirits and health?$B$BAs I said previously, I am here to train you as a $C; to tame beasts to aid you in battle; to use a bow with unerring accuracy; to respect the lands which we call home and also the lands beyond.' WHERE `entry`=3117;
UPDATE `quest_template` SET `RequestItemsText`='Sharptusk will trouble us no more once you have brought me proof of his death.  It is his head that I seek, $N.$B$BWe tauren live for the hunt, and there is no greater hunt than against one that is cunning enough to perhaps hunt us back.  If you are successful in this task, young one, you will start to learn what I mean.' WHERE `entry`=3376;
UPDATE `quest_template` SET `RequestItemsText`='Yes $N, have you grown some morrowgrain for the Arch Druid''s important research?  The mysterious properties of Un''Goro Crater become clearer with each passing day, thanks to the help you are giving us.' WHERE `entry`=3786;
