UPDATE `quest_template` SET `RequestItemsText`='Think whatever you want of me, but they''re not going to care if the bones they get to research are from ones from ancient stegodons and diemetradons or the ones that almost devoured us wholesale when we were trying to set up our camps.  I''ll just be happy if we get out of here alive...' WHERE `entry`=3882;
